(this["webpackJsonpgita-cards"]=this["webpackJsonpgita-cards"]||[]).push([[6],{113:function(n){n.exports=JSON.parse('[{"text":"\u0905\u0930\u094d\u091c\u0941\u0928 \u0909\u0935\u093e\u091a\\n\u092e\u0926\u0928\u0941\u0917\u094d\u0930\u0939\u093e\u092f \u092a\u0930\u092e\u0902 \u0917\u0941\u0939\u094d\u092f\u092e\u0927\u094d\u092f\u093e\u0924\u094d\u092e\u0938\u0902\u091c\u094d\u091e\u093f\u0924\u092e\u094d\u0964\\n\u092f\u0924\u094d\u0924\u094d\u0935\u092f\u094b\u0915\u094d\u0924\u0902 \u0935\u091a\u0938\u094d\u0924\u0947\u0928 \u092e\u094b\u0939\u094b\u093d\u092f\u0902 \u0935\u093f\u0917\u0924\u094b \u092e\u092e\u0964\u096411.1\u0964\u0964","translation":"\u0964\u096411.1\u0964\u0964\xa0\u0905\u0930\u094d\u091c\u0941\u0928 \u092c\u094b\u0932\u0947 -- \u0915\u0947\u0935\u0932 \u092e\u0947\u0930\u0947\u092a\u0930 \u0915\u0943\u092a\u093e \u0915\u0930\u0928\u0947\u0915\u0947 \u0932\u093f\u092f\u0947 \u0939\u0940 \u0906\u092a\u0928\u0947 \u091c\u094b \u092a\u0930\u092e \u0917\u094b\u092a\u0928\u0940\u092f \u0905\u0927\u094d\u092f\u093e\u0924\u094d\u092e\u0924\u0924\u094d\u0924\u0935 \u091c\u093e\u0928\u0928\u0947\u0915\u093e \u0935\u091a\u0928 \u0915\u0939\u093e, \u0909\u0938\u0938\u0947 \u092e\u0947\u0930\u093e \u092f\u0939 \u092e\u094b\u0939 \u0928\u0937\u094d\u091f \u0939\u094b \u0917\u092f\u093e \u0939\u0948\u0964","commentary":"\u0964\u096411.1\u0964\u0964\xa0\u0935\u094d\u092f\u093e\u0916\u094d\u092f\u093e--\'\u092e\u0926\u0928\u0941\u0917\u094d\u0930\u0939\u093e\u092f\'--\u092e\u0947\u0930\u093e \u092d\u091c\u0928 \u0915\u0930\u0928\u0947\u0935\u093e\u0932\u094b\u0902\u092a\u0930 \u0915\u0943\u092a\u093e \u0915\u0930\u0915\u0947 \u092e\u0948\u0902 \u0938\u094d\u0935\u092f\u0902 \u0909\u0928\u0915\u0947 \u0905\u091c\u094d\u091e\u093e\u0928\u091c\u0928\u094d\u092f \u0905\u0928\u094d\u0927\u0915\u093e\u0930\u0915\u093e \u0928\u093e\u0936 \u0915\u0930 \u0926\u0947\u0924\u093e \u0939\u0942\u0901 (\u0917\u0940\u0924\u093e 10\u0964 11) -- \u092f\u0939 \u092c\u093e\u0924 \u092d\u0917\u0935\u093e\u0928\u094d\u0928\u0947 \u0915\u0947\u0935\u0932 \u0915\u0943\u092a\u093e-\u092a\u0930\u0935\u0936 \u0939\u094b\u0915\u0930 \u0915\u0939\u0940\u0964 \u0907\u0938 \u092c\u093e\u0924\u0915\u093e \u0905\u0930\u094d\u091c\u0941\u0928\u092a\u0930 \u092c\u0921\u093c\u093e \u092a\u094d\u0930\u092d\u093e\u0935 \u092a\u093c\u0921\u093c\u093e, \u091c\u093f\u0938\u0938\u0947 \u0905\u0930\u094d\u091c\u0941\u0928 \u092d\u0917\u0935\u093e\u0928\u094d\u0915\u0940 \u0938\u094d\u0924\u0941\u0924\u093f \u0915\u0930\u0928\u0947 \u0932\u0917\u0947 (10\u0964 12 -- 15)\u0964 \u0910\u0938\u0940 \u0938\u094d\u0924\u0941\u0924\u093f \u0909\u0928\u094d\u0939\u094b\u0902\u0928\u0947 \u092a\u0939\u0932\u0947 \u0917\u0940\u0924\u093e\u092e\u0947\u0902 \u0915\u0939\u0940\u0902 \u0928\u0939\u0940\u0902 \u0915\u0940\u0964 \u0909\u0938\u0940\u0915\u093e \u0932\u0915\u094d\u0937\u094d\u092f \u0915\u0930\u0915\u0947 \u0905\u0930\u094d\u091c\u0941\u0928 \u092f\u0939\u093e\u0901 \u0915\u0939\u0924\u0947 \u0939\u0948\u0902 \u0915\u093f \u0915\u0947\u0935\u0932 \u092e\u0947\u0930\u0947\u092a\u0930 \u0915\u0943\u092a\u093e \u0915\u0930\u0928\u0947\u0915\u0947 \u0932\u093f\u092f\u0947 \u0939\u0940 \u0906\u092a\u0928\u0947 \u0910\u0938\u0940 \u092c\u093e\u0924 \u0915\u0939\u0940 \u0939\u0948 (\u091f\u093f\u092a\u094d\u092a\u0923\u0940 \u092a0 573.2)\u0964"},{"text":"\u092d\u0935\u093e\u092a\u094d\u092f\u092f\u094c \u0939\u093f \u092d\u0942\u0924\u093e\u0928\u093e\u0902 \u0936\u094d\u0930\u0941\u0924\u094c \u0935\u093f\u0938\u094d\u0924\u0930\u0936\u094b \u092e\u092f\u093e\u0964\\n\u0924\u094d\u0935\u0924\u094d\u0924\u0903 \u0915\u092e\u0932\u092a\u0924\u094d\u0930\u093e\u0915\u094d\u0937 \u092e\u093e\u0939\u093e\u0924\u094d\u092e\u094d\u092f\u092e\u092a\u093f \u091a\u093e\u0935\u094d\u092f\u092f\u092e\u094d\u0964\u096411.2\u0964\u0964","translation":"\u0964\u096411.2\u0964\u0964\xa0 \u0939\u0947 \u0915\u092e\u0932\u0928\u092f\u0928 ! \u0938\u092e\u094d\u092a\u0942\u0930\u094d\u0923 \u092a\u094d\u0930\u093e\u0923\u093f\u092f\u094b\u0902\u0915\u0940 \u0909\u0924\u094d\u092a\u0924\u094d\u0924\u093f \u0914\u0930 \u092a\u094d\u0930\u0932\u092f \u092e\u0948\u0902\u0928\u0947 \u0935\u093f\u0938\u094d\u0924\u093e\u0930\u092a\u0942\u0930\u094d\u0935\u0915 \u0906\u092a\u0938\u0947 \u0939\u0940 \u0938\u0941\u0928\u093e \u0939\u0948 \u0914\u0930 \u0906\u092a\u0915\u093e \u0905\u0935\u093f\u0928\u093e\u0936\u0940 \u092e\u093e\u0939\u093e\u0924\u094d\u092e\u094d\u092f \u092d\u0940 \u0938\u0941\u0928\u093e \u0939\u0948\u0964","commentary":"\u0964\u096411.2\u0964\u0964\xa0\u0935\u094d\u092f\u093e\u0916\u094d\u092f\u093e --\u092d\u0935\u093e\u092a\u094d\u092f\u092f\u094c \u0939\u093f \u092d\u0942\u0924\u093e\u0928\u093e\u0902 \u0924\u094d\u0935\u0924\u094d\u0924\u0903 \u0936\u094d\u0930\u0941\u0924\u094c \u0935\u093f\u0938\u094d\u0924\u0930\u0936\u094b \u092e\u092f\u093e --  \u092d\u0917\u0935\u093e\u0928\u094d\u0928\u0947 \u092a\u0939\u0932\u0947 \u0915\u0939\u093e \u0925\u093e-- \u092e\u0948\u0902 \u0938\u092e\u094d\u092a\u0942\u0930\u094d\u0923 \u091c\u0917\u0924\u094d\u0915\u093e \u092a\u094d\u0930\u092d\u0935 \u0914\u0930 \u092a\u094d\u0930\u0932\u092f \u0939\u0942\u0901, \u092e\u0947\u0930\u0947 \u0938\u093f\u0935\u093e\u092f \u0905\u0928\u094d\u092f \u0915\u094b\u0908 \u0915\u093e\u0930\u0923 \u0928\u0939\u0940\u0902 \u0939\u0948 (7\u0964 6 7); \u0938\u093e\u0924\u094d\u0924\u094d\u0935\u093f\u0915, \u0930\u093e\u091c\u0938 \u0914\u0930 \u0924\u093e\u092e\u0938 \u092d\u093e\u0935 \u092e\u0947\u0930\u0947\u0938\u0947 \u0939\u0940 \u0939\u094b\u0924\u0947 \u0939\u0948\u0902 (7\u0964 12); \u092a\u094d\u0930\u093e\u0923\u093f\u092f\u094b\u0902\u0915\u0947 \u0905\u0932\u0917-\u0905\u0932\u0917 \u0905\u0928\u0947\u0915 \u0924\u0930\u0939\u0915\u0947 \u092d\u093e\u0935 \u092e\u0947\u0930\u0947\u0938\u0947 \u0939\u0940 \u0939\u094b\u0924\u0947 \u0939\u0948\u0902 (10\u0964 4 5); \u0938\u092e\u094d\u092a\u0942\u0930\u094d\u0923 \u092a\u094d\u0930\u093e\u0923\u0940 \u092e\u0947\u0930\u0947\u0938\u0947 \u0939\u0940 \u0939\u094b\u0924\u0947 \u0939\u0948\u0902 \u0914\u0930 \u092e\u0947\u0930\u0947\u0938\u0947 \u0939\u0940 \u0938\u092c \u091a\u0947\u0937\u094d\u091f\u093e \u0915\u0930\u0924\u0947 \u0939\u0948\u0902 (10\u0964 8); \u092a\u094d\u0930\u093e\u0923\u093f\u092f\u094b\u0902\u0915\u0947 \u0906\u0926\u093f, \u092e\u0927\u094d\u092f \u0924\u0925\u093e \u0905\u0928\u094d\u0924\u092e\u0947\u0902 \u092e\u0948\u0902 \u0939\u0940 \u0939\u0942\u0901 (10\u0964 20); \u0914\u0930 \u0938\u092e\u094d\u092a\u0942\u0930\u094d\u0923 \u0938\u0943\u0937\u094d\u091f\u093f\u092f\u094b\u0902\u0915\u0947 \u0906\u0926\u093f, \u092e\u0927\u094d\u092f \u0924\u0925\u093e \u0905\u0928\u094d\u0924\u092e\u0947\u0902 \u092e\u0948\u0902 \u0939\u0940 \u0939\u0942\u0901 (10\u0964 32)\u0964 \u0907\u0938\u0940\u0915\u094b \u0932\u0947\u0915\u0930 \u0905\u0930\u094d\u091c\u0941\u0928 \u092f\u0939\u093e\u0901 \u0915\u0939\u0924\u0947 \u0939\u0948\u0902 \u0915\u093f \u092e\u0948\u0902\u0928\u0947 \u0906\u092a\u0938\u0947 \u092a\u094d\u0930\u093e\u0923\u093f\u092f\u094b\u0902\u0915\u0940 \u0909\u0924\u094d\u092a\u0924\u094d\u0924\u093f \u0914\u0930 \u092a\u094d\u0930\u0932\u092f\u0915\u093e \u0935\u0930\u094d\u0923\u0928 \u0935\u093f\u0938\u094d\u0924\u093e\u0930\u0938\u0947 \u0938\u0941\u0928\u093e \u0939\u0948\u0964 \u0907\u0938\u0915\u093e \u0924\u093e\u0924\u094d\u092a\u0930\u094d\u092f \u092a\u094d\u0930\u093e\u0923\u093f\u092f\u094b\u0902\u0915\u0940 \u0909\u0924\u094d\u092a\u0924\u094d\u0924\u093f \u0914\u0930 \u0935\u093f\u0928\u093e\u0936 \u0938\u0941\u0928\u0928\u0947\u0938\u0947 \u0928\u0939\u0940\u0902 \u0939\u0948, \u092a\u094d\u0930\u0924\u094d\u092f\u0941\u0924 \u0907\u0938\u0915\u093e \u0924\u093e\u0924\u094d\u092a\u0930\u094d\u092f \u092f\u0939 \u0938\u0941\u0928\u0928\u0947\u0938\u0947 \u0939\u0948 \u0915\u093f \u0938\u092d\u0940 \u092a\u094d\u0930\u093e\u0923\u0940 \u0906\u092a\u0938\u0947 \u0939\u0940 \u0909\u0924\u094d\u092a\u0928\u094d\u0928 \u0939\u094b\u0924\u0947 \u0939\u0948\u0902, \u0906\u092a\u092e\u0947\u0902 \u0939\u0940 \u0930\u0939\u0924\u0947 \u0939\u0948\u0902 \u0914\u0930 \u0906\u092a\u092e\u0947\u0902 \u0939\u0940 \u0932\u0940\u0928 \u0939\u094b \u091c\u093e\u0924\u0947 \u0939\u0948\u0902 \u0905\u0930\u094d\u0925\u093e\u0924\u094d \u0938\u092c \u0915\u0941\u091b \u0906\u092a \u0939\u0940 \u0939\u0948\u0902\u0964"},{"text":"\u090f\u0935\u092e\u0947\u0924\u0926\u094d\u092f\u0925\u093e\u0924\u094d\u0925 \u0924\u094d\u0935\u092e\u093e\u0924\u094d\u092e\u093e\u0928\u0902 \u092a\u0930\u092e\u0947\u0936\u094d\u0935\u0930\u0964\\n\u0926\u094d\u0930\u0937\u094d\u091f\u0941\u092e\u093f\u091a\u094d\u091b\u093e\u092e\u093f \u0924\u0947 \u0930\u0942\u092a\u092e\u0948\u0936\u094d\u0935\u0930\u0902 \u092a\u0941\u0930\u0941\u0937\u094b\u0924\u094d\u0924\u092e\u0964\u096411.3\u0964\u0964","translation":"\u0964\u096411.3\u0964\u0964 \u0939\u0947 \u092a\u0941\u0930\u0941\u0937\u094b\u0924\u094d\u0924\u092e ! \u0906\u092a \u0905\u092a\u0928\u0947-\u0906\u092a\u0915\u094b \u091c\u0948\u0938\u093e \u0915\u0939\u0924\u0947 \u0939\u0948\u0902, \u092f\u0939 \u0935\u093e\u0938\u094d\u0924\u0935\u092e\u0947\u0902 \u0910\u0938\u093e \u0939\u0940 \u0939\u0948\u0964 \u0939\u0947 \u092a\u0930\u092e\u0947\u0936\u094d\u0935\u0930 ! \u0906\u092a\u0915\u0947 \u0908\u0936\u094d\u0935\u0930-\u0938\u092e\u094d\u092c\u0928\u094d\u0927\u0940 \u0930\u0942\u092a\u0915\u094b \u092e\u0948\u0902 \u0926\u0947\u0916\u0928\u093e \u091a\u093e\u0939\u0924\u093e \u0939\u0942\u0901\u0964","commentary":"\u0964\u096411.3\u0964\u0964\xa0\u0935\u094d\u092f\u093e\u0916\u094d\u092f\u093e --\'\u092a\u0941\u0930\u0941\u0937\u094b\u0924\u094d\u0924\u092e\'--\u092f\u0939 \u0938\u092e\u094d\u092c\u094b\u0927\u0928 \u0926\u0947\u0928\u0947\u0915\u093e \u0924\u093e\u0924\u094d\u092a\u0930\u094d\u092f \u0939\u0948 \u0915\u093f \u0939\u0947 \u092d\u0917\u0935\u0928\u094d !\u092e\u0947\u0930\u0940 \u0926\u0943\u0937\u094d\u091f\u093f\u092e\u0947\u0902 \u0907\u0938 \u0938\u0902\u0938\u093e\u0930\u092e\u0947\u0902 \u0906\u092a\u0915\u0947 \u0938\u092e\u093e\u0928 \u0915\u094b\u0908 \u0909\u0924\u094d\u0924\u092e, \u0936\u094d\u0930\u0947\u0937\u094d\u0920 \u0928\u0939\u0940\u0902 \u0939\u0948 \u0905\u0930\u094d\u0925\u093e\u0924\u094d \u0906\u092a \u0939\u0940 \u0938\u092c\u0938\u0947 \u0909\u0924\u094d\u0924\u092e, \u0936\u094d\u0930\u0947\u0937\u094d\u0920 \u0939\u0948\u0902\u0964 \u0907\u0938 \u092c\u093e\u0924\u0915\u094b \u0906\u0917\u0947 \u092a\u0928\u094d\u0926\u094d\u0930\u0939\u0935\u0947\u0902 \u0905\u0927\u094d\u092f\u093e\u092f\u092e\u0947\u0902 \u092d\u0917\u0935\u093e\u0928\u094d\u0928\u0947 \u092d\u0940 \u0915\u0939\u093e \u0939\u0948 \u0915\u093f \u092e\u0948\u0902 \u0915\u094d\u0937\u0930\u0938\u0947 \u0905\u0924\u0940\u0924 \u0914\u0930 \u0905\u0915\u094d\u0937\u0930\u0938\u0947 \u0909\u0924\u094d\u0924\u092e \u0939\u0942\u0901; \u0905\u0924\u0903 \u092e\u0948\u0902 \u0936\u093e\u0938\u094d\u0924\u094d\u0930 \u0914\u0930 \u0935\u0947\u0926\u092e\u0947\u0902 \u092a\u0941\u0930\u0941\u0937\u094b\u0924\u094d\u0924\u092e \u0928\u093e\u092e\u0938\u0947 \u092a\u094d\u0930\u0938\u093f\u0926\u094d\u0927 \u0939\u0942\u0901 (15\u0964 18)\u0964"},{"text":"\u092e\u0928\u094d\u092f\u0938\u0947 \u092f\u0926\u093f \u0924\u091a\u094d\u091b\u0915\u094d\u092f\u0902 \u092e\u092f\u093e \u0926\u094d\u0930\u0937\u094d\u091f\u0941\u092e\u093f\u0924\u093f \u092a\u094d\u0930\u092d\u094b\u0964\\n\u092f\u094b\u0917\u0947\u0936\u094d\u0935\u0930 \u0924\u0924\u094b \u092e\u0947 \u0924\u094d\u0935\u0902 \u0926\u0930\u094d\u0936\u092f\u093e\u093d\u0924\u094d\u092e\u093e\u0928\u092e\u0935\u094d\u092f\u092f\u092e\u094d\u0964\u096411.4\u0964\u0964","translation":"\u0964\u096411.4\u0964\u0964 \u0939\u0947 \u092a\u094d\u0930\u092d\u094b ! \u092e\u0947\u0930\u0947 \u0926\u094d\u0935\u093e\u0930\u093e \u0906\u092a\u0915\u093e \u0935\u0939 \u092a\u0930\u092e \u0910\u0936\u094d\u0935\u0930 \u0930\u0942\u092a \u0926\u0947\u0916\u093e \u091c\u093e \u0938\u0915\u0924\u093e \u0939\u0948 -- \u0910\u0938\u093e \u0905\u0917\u0930 \u0906\u092a \u092e\u093e\u0928\u0924\u0947 \u0939\u0948\u0902, \u0924\u094b \u0939\u0947 \u092f\u094b\u0917\u0947\u0936\u094d\u0935\u0930 ! \u0906\u092a \u0905\u092a\u0928\u0947 \u0909\u0938 \u0905\u0935\u093f\u0928\u093e\u0936\u0940 \u0938\u094d\u0935\u0930\u0942\u092a\u0915\u094b \u092e\u0941\u091d\u0947 \u0926\u093f\u0916\u093e \u0926\u0940\u091c\u093f\u092f\u0947\u0964","commentary":"\u0964\u096411.4\u0964\u0964\xa0\u0935\u094d\u092f\u093e\u0916\u094d\u092f\u093e--\'\u092a\u094d\u0930\u092d\u094b\'-- \'\u092a\u094d\u0930\u092d\u0941\' \u0928\u093e\u092e \u0938\u0930\u094d\u0935\u0938\u092e\u0930\u094d\u0925\u0915\u093e \u0939\u0948, \u0907\u0938\u0932\u093f\u092f\u0947 \u0907\u0938 \u0938\u092e\u094d\u092c\u094b\u0927\u0928\u0915\u093e \u092d\u093e\u0935 \u092f\u0939 \u092e\u093e\u0932\u0942\u092e \u0926\u0947\u0924\u093e \u0939\u0948 \u0915\u093f \u092f\u0926\u093f \u0906\u092a \u092e\u0947\u0930\u0947\u092e\u0947\u0902 \u0935\u093f\u0930\u093e\u091f\u094d\u0930\u0942\u092a \u0926\u0947\u0916\u0928\u0947\u0915\u0940 \u0938\u093e\u092e\u0930\u094d\u0925\u094d\u092f \u092e\u093e\u0928\u0924\u0947 \u0939\u0948\u0902, \u0924\u092c \u0924\u094b \u0920\u0940\u0915 \u0939\u0948; \u0928\u0939\u0940\u0902 \u0924\u094b \u0906\u092a \u092e\u0947\u0930\u0947\u0915\u094b \u0910\u0938\u0940 \u0938\u093e\u092e\u0930\u094d\u0925\u094d\u092f \u0926\u0940\u091c\u093f\u092f\u0947, \u091c\u093f\u0938\u0938\u0947 \u092e\u0948\u0902 \u0906\u092a\u0915\u093e \u0935\u0939 \u0910\u0936\u094d\u0935\u0930 (\u0908\u0936\u094d\u0935\u0930\u0938\u092e\u094d\u092c\u0928\u094d\u0927\u0940) \u0930\u0942\u092a \u0926\u0947\u0916 \u0938\u0915\u0942\u0901\u0964"},{"text":"\u0936\u094d\u0930\u0940 \u092d\u0917\u0935\u093e\u0928\u0941\u0935\u093e\u091a\\n\u092a\u0936\u094d\u092f \u092e\u0947 \u092a\u093e\u0930\u094d\u0925 \u0930\u0942\u092a\u093e\u0923\u093f \u0936\u0924\u0936\u094b\u093d\u0925 \u0938\u0939\u0938\u094d\u0930\u0936\u0903\u0964\\n\u0928\u093e\u0928\u093e\u0935\u093f\u0927\u093e\u0928\u093f \u0926\u093f\u0935\u094d\u092f\u093e\u0928\u093f \u0928\u093e\u0928\u093e\u0935\u0930\u094d\u0923\u093e\u0915\u0943\u0924\u0940\u0928\u093f \u091a\u0964\u096411.5\u0964\u0964","translation":"\u0964\u096411.5\u0964\u0964 \u0936\u094d\u0930\u0940\u092d\u0917\u0935\u093e\u0928\u094d \u092c\u094b\u0932\u0947 -- \u0939\u0947 \u092a\u0943\u0925\u093e\u0928\u0928\u094d\u0926\u0928 ! \u0905\u092c \u092e\u0947\u0930\u0947 \u0905\u0928\u0947\u0915 \u0924\u0930\u0939\u0915\u0947, \u0905\u0928\u0947\u0915 \u0905\u0928\u0947\u0915 \u0935\u0930\u094d\u0923\u094b\u0902 \u0914\u0930 \u0906\u0915\u0943\u0924\u093f\u092f\u094b\u0902\u0935\u093e\u0932\u0947 \u0938\u0948\u0915\u0921\u093c\u094b\u0902-\u0939\u091c\u093e\u0930\u094b\u0902 \u0926\u093f\u0935\u094d\u092f\u0930\u0942\u092a\u094b\u0902\u0915\u094b \u0924\u0942 \u0926\u0947\u0916\u0964","commentary":"\u0964\u096411.5\u0964\u0964\xa0\u0935\u094d\u092f\u093e\u0916\u094d\u092f\u093e--\'\u092a\u0936\u094d\u092f \u092e\u0947 \u092a\u093e\u0930\u094d\u0925 \u0930\u0942\u092a\u093e\u0923\u093f \u0936\u0924\u0936\u094b\u093d\u0925 \u0938\u0939\u0938\u094d\u0930\u0936\u0903\'--\u0905\u0930\u094d\u091c\u0941\u0928\u0915\u0940 \u0938\u0902\u0915\u094b\u091a\u092a\u0942\u0930\u094d\u0935\u0915 \u092a\u094d\u0930\u093e\u0930\u094d\u0925\u0928\u093e\u0915\u094b \u0938\u0941\u0928\u0915\u0930 \u092d\u0917\u0935\u093e\u0928\u094d \u0905\u0924\u094d\u092f\u0927\u093f\u0915 \u092a\u094d\u0930\u0938\u0928\u094d\u0928 \u0939\u0941\u090f; \u0905\u0924\u0903 \u0905\u0930\u094d\u091c\u0941\u0928\u0915\u0947 \u0932\u093f\u092f\u0947 \'\u092a\u093e\u0930\u094d\u0925\' \u0938\u092e\u094d\u092c\u094b\u0927\u0928\u0915\u093e \u092a\u094d\u0930\u092f\u094b\u0917 \u0915\u0930\u0924\u0947 \u0939\u0941\u090f \u0915\u0939\u0924\u0947 \u0939\u0948\u0902 \u0915\u093f \u0924\u0942 \u092e\u0947\u0930\u0947 \u0930\u0942\u092a\u094b\u0902\u0915\u094b \u0926\u0947\u0916\u0964 \u0930\u0942\u092a\u094b\u0902\u092e\u0947\u0902 \u092d\u0940 \u0924\u0940\u0928-\u091a\u093e\u0930 \u0928\u0939\u0940\u0902, \u092a\u094d\u0930\u0924\u094d\u092f\u0941\u0924 \u0938\u0948\u0915\u0921\u093c\u094b\u0902-\u0939\u091c\u093e\u0930\u094b\u0902 \u0930\u0942\u092a\u094b\u0902\u0915\u094b \u0926\u0947\u0916 \u0905\u0930\u094d\u0925\u093e\u0924\u094d \u0905\u0928\u0917\u093f\u0928\u0924 \u0930\u0942\u092a\u094b\u0902\u0915\u094b \u0926\u0947\u0916\u0964 \u092d\u0917\u0935\u093e\u0928\u094d\u0928\u0947 \u091c\u0948\u0938\u0947 \u0935\u093f\u092d\u0942\u0924\u093f\u092f\u094b\u0902\u0915\u0947 \u0935\u093f\u0937\u092f \u0915\u0939\u093e \u0939\u0948 \u0915\u093f \u092e\u0947\u0930\u0940 \u0935\u093f\u092d\u0942\u0924\u093f\u092f\u094b\u0902\u0915\u093e \u0905\u0928\u094d\u0924 \u0928\u0939\u0940\u0902 \u0906 \u0938\u0915\u0924\u093e, \u0910\u0938\u0947 \u0939\u0940 \u092f\u0939\u093e\u0901 \u092d\u0917\u0935\u093e\u0928\u094d\u0928\u0947,\u0905\u092a\u0928\u0947 \u0930\u0942\u092a\u094b\u0902\u0915\u0940 \u0905\u0928\u0928\u094d\u0924\u0924\u093e \u092c\u0924\u093e\u092f\u0940 \u0939\u0948\u0964\xa0"},{"text":"\u092a\u0936\u094d\u092f\u093e\u0926\u093f\u0924\u094d\u092f\u093e\u0928\u094d\u0935\u0938\u0942\u0928\u094d\u0930\u0941\u0926\u094d\u0930\u093e\u0928\u0936\u094d\u093f\u0935\u0928\u094c \u092e\u0930\u0941\u0924\u0938\u094d\u0924\u0925\u093e\u0964\\n\u092c\u0939\u0942\u0928\u094d\u092f\u0926\u0943\u0937\u094d\u091f\u092a\u0942\u0930\u094d\u0935\u093e\u0923\u093f \u092a\u0936\u094d\u092f\u093e\u093d\u0936\u094d\u091a\u0930\u094d\u092f\u093e\u0923\u093f \u092d\u093e\u0930\u0924\u0964\u096411.6\u0964\u0964","translation":"\u0964\u096411.6\u0964\u0964 \u0939\u0947 \u092d\u0930\u0924\u0935\u0902\u0936\u094b\u0926\u094d\u092d\u0935 \u0905\u0930\u094d\u091c\u0941\u0928! \u0924\u0942 \u092c\u093e\u0930\u0939 \u0906\u0926\u093f\u0924\u094d\u092f\u094b\u0902\u0915\u094b, \u0906\u0920 \u0935\u0938\u0941\u0913\u0902\u0915\u094b, \u0917\u094d\u092f\u093e\u0930\u0939 \u0930\u0941\u0926\u094d\u0930\u094b\u0902\u0915\u094b \u0914\u0930 \u0926\u094b \u0905\u0936\u094d\u0935\u093f\u0928\u0940\u0915\u0941\u092e\u093e\u0930\u094b\u0902\u0915\u094b \u0924\u0925\u093e \u0909\u0928\u091a\u093e\u0938 \u092e\u0930\u0941\u0926\u094d\u0917\u0923\u094b\u0902\u0915\u094b \u0926\u0947\u0916\u0964 \u091c\u093f\u0928\u0915\u094b \u0924\u0942\u0928\u0947 \u092a\u0939\u0932\u0947 \u0915\u092d\u0940 \u0926\u0947\u0916\u093e \u0928\u0939\u0940\u0902, \u0910\u0938\u0947 \u092c\u0939\u0941\u0924-\u0938\u0947 \u0906\u0936\u094d\u091a\u0930\u094d\u092f\u091c\u0928\u0915 \u0930\u0942\u092a\u094b\u0902\u0915\u094b \u092d\u0940 \u0924\u0942 \u0926\u0947\u0916\u0964","commentary":"\u0964\u096411.6\u0964\u0964\xa0\u0935\u094d\u092f\u093e\u0916\u094d\u092f\u093e--\'\u092a\u0936\u094d\u092f\u093e\u0926\u093f\u0924\u094d\u092f\u093e\u0928\u094d\u0935\u0938\u0942\u0928\u094d\u0930\u0941\u0926\u094d\u0930\u093e\u0928\u0936\u094d\u0935\u093f\u0928\u094c \u092e\u0930\u0941\u0924\u0938\u094d\u0924\u0925\u093e\'-- \u0905\u0926\u093f\u0924\u093f\u0915\u0947 \u092a\u0941\u0924\u094d\u0930 \u0927\u093e\u0924\u093e, \u092e\u093f\u0924\u094d\u0930, \u0905\u0930\u094d\u092f\u092e\u093e, \u0936\u0941\u0915\u094d\u0930, \u0935\u0930\u0941\u0923, \u0905\u0902\u0936, \u092d\u0917, \u0935\u093f\u0935\u0938\u094d\u0935\u093e\u0928\u094d, \u092a\u0942\u0937\u093e, \u0938\u0935\u093f\u0924\u093e, \u0924\u094d\u0935\u0937\u094d\u091f\u093e \u0914\u0930 \u0935\u093f\u0937\u094d\u0923\u0941 -- \u092f\u0947 \u092c\u093e\u0930\u0939 \'\u0906\u0926\u093f\u0924\u094d\u092f\' \u0939\u0948\u0902 (\u092e\u0939\u093e0 \u0906\u0926\u093f0 65\u0964 15 16)\u0964\\n\u0927\u0930, \u0927\u094d\u0930\u0941\u0935, \u0938\u094b\u092e, \u0905\u0939\u0903, \u0905\u0928\u093f\u0932, \u0905\u0928\u0932, \u092a\u094d\u0930\u0924\u094d\u092f\u0942\u0937 \u0914\u0930 \u092a\u094d\u0930\u092d\u093e\u0938 --\u092f\u0947 \u0906\u0920 \u0935\u0938\u0941 \u0939\u0948\u0902 (\u092e\u0939\u093e0 \u0906\u0926\u093f0 66\u0964 18)\u0964\u0939\u0930, \u092c\u0939\u0941\u0930\u0942\u092a, \u0924\u094d\u0930\u092f\u092e\u094d\u092c\u0915, \u0905\u092a\u0930\u093e\u091c\u093f\u0924, \u0935\u0943\u0937\u093e\u0915\u092a\u093f, \u0936\u092e\u094d\u092d\u0941, \u0915\u092a\u0930\u094d\u0926\u0940, \u0930\u0948\u0935\u0924\u092e\u0943\u0917\u0935\u094d\u092f\u093e\u0927, \u0936\u0930\u094d\u0935 \u0914\u0930 \u0915\u092a\u093e\u0932\u0940 -- \u092f\u0947 \u0917\u094d\u092f\u093e\u0930\u0939 \'\u0930\u0941\u0926\u094d\u0930\' \u0939\u0948\u0902 (\u0939\u0930\u093f\u0935\u0902\u09360 1\u0964 3\u0964 51 52)\u0964\'\u0905\u0936\u094d\u0935\u093f\u0928\u0940\u0915\u0941\u092e\u093e\u0930\' \u0926\u094b \u0939\u0948\u0902\u0964 \u092f\u0947 \u0926\u094b\u0928\u094b\u0902 \u092d\u093e\u0908 \u0926\u0947\u0935\u0924\u093e\u0913\u0902\u0915\u0947 \u0935\u0948\u0926\u094d\u092f \u0939\u0948\u0902\u0964\u0938\u0924\u094d\u0924\u094d\u0935\u091c\u094d\u092f\u094b\u0924\u093f, \u0906\u0926\u093f\u0924\u094d\u092f, \u0938\u0924\u094d\u092f\u091c\u094d\u092f\u094b\u0924\u093f, \u0924\u093f\u0930\u094d\u092f\u0917\u094d\u091c\u094d\u092f\u094b\u0924\u093f, \u0938\u091c\u094d\u092f\u094b\u0924\u093f, \u091c\u094d\u092f\u094b\u0924\u093f\u0937\u094d\u092e\u093e\u0928\u094d, \u0939\u0930\u093f\u0924, \u090b\u0924\u091c\u093f\u0924\u094d, \u0938\u0924\u094d\u092f\u091c\u093f\u0924\u094d, \u0938\u0941\u0937\u0947\u0923, \u0938\u0947\u0928\u091c\u093f\u0924\u094d, \u0938\u0924\u094d\u092f\u092e\u093f\u0924\u094d\u0930, \u0905\u092d\u093f\u092e\u093f\u0924\u094d\u0930, \u0939\u0930\u093f\u092e\u093f\u0924\u094d\u0930, \u0915\u0943\u0924, \u0938\u0924\u094d\u092f, \u0927\u094d\u0930\u0941\u0935, \u0927\u0930\u094d\u0924\u093e, \u0935\u093f\u0927\u0930\u094d\u0924\u093e, \u0935\u093f\u0927\u093e\u0930\u092f, \u0927\u094d\u0935\u093e\u0928\u094d\u0924, \u0927\u0941\u0928\u093f, \u0909\u0917\u094d\u0930, \u092d\u0940\u092e, \u0905\u092d\u093f\u092f\u0941, \u0938\u093e\u0915\u094d\u0937\u093f\u092a, \u0908\u0926\u0943\u0915\u094d, \u0905\u0928\u094d\u092f\u093e\u0926\u0943\u0915\u094d, \u092f\u093e\u0926\u0943\u0915\u094d, \u092a\u094d\u0930\u0924\u093f\u0915\u0943\u0924\u094d, \u090b\u0915\u094d, \u0938\u092e\u093f\u0924\u093f, \u0938\u0902\u0930\u092e\u094d\u092d, \u0908\u0926\u0943\u0915\u094d\u0937, \u092a\u0941\u0930\u0941\u0937, \u0905\u0928\u094d\u092f\u093e\u0926\u0943\u0915\u094d\u0937, \u091a\u0947\u0924\u0938, \u0938\u092e\u093f\u0924\u093e, \u0938\u092e\u093f\u0926\u0943\u0915\u094d\u0937\u092a\u094d\u0930\u0924\u093f\u0926\u0943\u0915\u094d\u0937, \u092e\u0930\u0941\u0924\u093f, \u0938\u0930\u0924, \u0926\u0947\u0935, \u0926\u093f\u0936, \u092f\u091c\u0941\u0903, \u0905\u0928\u0941\u0926\u0943\u0915\u094d, \u0938\u093e\u092e, \u092e\u093e\u0928\u0941\u0937 \u0914\u0930 \u0935\u093f\u0936\u094d -- \u092f\u0947 \u0909\u0928\u091a\u093e\u0938 \'\u092e\u0930\u0941\u0924\' \u0939\u0948\u0902 (\u0935\u093e\u092f\u0941\u092a\u0941\u0930\u093e\u0923 67\u0964 123 -- 130) -- \u0907\u0928 \u0938\u092c\u0915\u094b \u0924\u0942 \u092e\u0947\u0930\u0947 \u0935\u093f\u0930\u093e\u091f\u094d\u0930\u0942\u092a\u092e\u0947\u0902 \u0926\u0947\u0916\u0964\u092c\u093e\u0930\u0939 \u0906\u0926\u093f\u0924\u094d\u092f, \u0906\u0920 \u0935\u0938\u0941, \u0917\u094d\u092f\u093e\u0930\u0939 \u0930\u0941\u0926\u094d\u0930 \u0914\u0930 \u0926\u094b \u0905\u0936\u094d\u0935\u093f\u0928\u0940\u0915\u0941\u092e\u093e\u0930 -- \u092f\u0947 \u0924\u0948\u0902\u0924\u0940\u0938 \u0915\u094b\u091f\u093f (\u0924\u0948\u0902\u0924\u0940\u0938 \u092a\u094d\u0930\u0915\u093e\u0930\u0915\u0947) \u0926\u0947\u0935\u0924\u093e \u0938\u092e\u094d\u092a\u0942\u0930\u094d\u0923 \u0926\u0947\u0935\u0924\u093e\u0913\u0902\u092e\u0947\u0902 \u092e\u0941\u0916\u094d\u092f \u0939\u0948\u0902\u0964 \u0926\u0947\u0935\u0924\u093e\u0913\u0902\u092e\u0947\u0902 \u092e\u0930\u0941\u0926\u094d\u0917\u0923\u094b\u0902\u0915\u093e \u0928\u093e\u092e \u092d\u0940 \u0906\u0924\u093e \u0939\u0948, \u092a\u0930 \u0935\u0947 \u0909\u0928\u091a\u093e\u0938 \u092e\u0930\u0941\u0926\u094d\u0917\u0923 \u0907\u0928 \u0924\u0948\u0902\u0924\u0940\u0938 \u092a\u094d\u0930\u0915\u093e\u0930\u0915\u0947 \u0926\u0947\u0935\u0924\u093e\u0913\u0902\u0938\u0947 \u0905\u0932\u0917 \u092e\u093e\u0928\u0947 \u091c\u093e\u0924\u0947 \u0939\u0948\u0902; \u0915\u094d\u092f\u094b\u0902\u0915\u093f \u0935\u0947 \u0938\u092d\u0940 \u0926\u0948\u0924\u094d\u092f\u094b\u0902\u0938\u0947 \u0926\u0947\u0935\u0924\u093e \u092c\u0928\u0947 \u0939\u0948\u0902\u0964 \u0907\u0938\u0932\u093f\u092f\u0947 \u092d\u0917\u0935\u093e\u0928\u094d\u0928\u0947 \u092d\u0940 \'\u0924\u0925\u093e\' \u092a\u0926 \u0926\u0947\u0915\u0930 \u092e\u0930\u0941\u0926\u094d\u0917\u0923\u094b\u0902\u0915\u094b \u0905\u0932\u0917 \u092c\u0924\u093e\u092f\u093e \u0939\u0948\u0964"},{"text":"\u0907\u0939\u0948\u0915\u0938\u094d\u0925\u0902 \u091c\u0917\u0924\u094d\u0915\u0943\u0924\u094d\u0938\u094d\u0928\u0902 \u092a\u0936\u094d\u092f\u093e\u0926\u094d\u092f \u0938\u091a\u0930\u093e\u091a\u0930\u092e\u094d\u0964\\n\u092e\u092e \u0926\u0947\u0939\u0947 \u0917\u0941\u0921\u093e\u0915\u0947\u0936 \u092f\u091a\u094d\u091a\u093e\u0928\u094d\u092f\u0926\u094d\u0926\u094d\u0930\u0937\u094d\u091f\u0941\u092e\u093f\u091a\u094d\u091b\u0938\u093f\u0964\u096411.7\u0964\u0964","translation":"\u0964\u096411.7\u0964\u0964 \u0939\u0947 \u0928\u0940\u0902\u0926\u0915\u094b \u091c\u0940\u0924\u0928\u0947\u0935\u093e\u0932\u0947 \u0905\u0930\u094d\u091c\u0941\u0928! \u092e\u0947\u0930\u0947 \u0907\u0938 \u0936\u0930\u0940\u0930\u0915\u0947 \u090f\u0915 \u0926\u0947\u0936\u092e\u0947\u0902 \u091a\u0930\u093e\u091a\u0930\u0938\u0939\u093f\u0924 \u0938\u092e\u094d\u092a\u0942\u0930\u094d\u0923 \u091c\u0917\u0924\u094d \u0915\u094b \u0905\u092d\u0940 \u0926\u0947\u0916 \u0932\u0947\u0964 \u0907\u0938\u0915\u0947 \u0938\u093f\u0935\u093e\u092f \u0924\u0942 \u0914\u0930 \u092d\u0940 \u091c\u094b \u0915\u0941\u091b \u0926\u0947\u0916\u0928\u093e \u091a\u093e\u0939\u0924\u093e \u0939\u0948, \u0935\u0939 \u092d\u0940 \u0926\u0947\u0916 \u0932\u0947\u0964","commentary":"\u0964\u096411.7\u0964\u0964\xa0\u0935\u094d\u092f\u093e\u0916\u094d\u092f\u093e--\u0917\u0941\u0921\u093e\u0915\u0947\u0936\'--\u0928\u093f\u0926\u094d\u0930\u093e\u092a\u0930 \u0905\u0927\u093f\u0915\u093e\u0930 \u092a\u094d\u0930\u093e\u092a\u094d\u0924 \u0915\u0930\u0928\u0947\u0938\u0947 \u0905\u0930\u094d\u091c\u0941\u0928\u0915\u094b \'\u0917\u0941\u0921\u093e\u0915\u0947\u0936\' \u0915\u0939\u0924\u0947 \u0939\u0948\u0902\u0964 \u092f\u0939\u093e\u0901 \u092f\u0939 \u0938\u092e\u094d\u092c\u094b\u0927\u0928 \u0926\u0947\u0928\u0947\u0915\u093e \u0924\u093e\u0924\u094d\u092a\u0930\u094d\u092f \u0939\u0948 \u0915\u093f \u0924\u0942 \u0928\u093f\u0930\u093e\u0932\u0938\u094d\u092f \u0939\u094b\u0915\u0930 \u0938\u093e\u0935\u0927\u093e\u0928\u0940\u0938\u0947 \u092e\u0947\u0930\u0947 \u0935\u093f\u0936\u094d\u0935-\u0930\u0942\u092a\u0915\u094b \u0926\u0947\u0916\u0964\xa0"},{"text":"\u0928 \u0924\u0941 \u092e\u093e\u0902 \u0936\u0915\u094d\u092f\u0938\u0947 \u0926\u094d\u0930\u0937\u094d\u091f\u0941\u092e\u0928\u0947\u0928\u0948\u0935 \u0938\u094d\u0935\u091a\u0915\u094d\u0937\u0941\u0937\u093e\u0964\\n\u0926\u093f\u0935\u094d\u092f\u0902 \u0926\u0926\u093e\u092e\u093f \u0924\u0947 \u091a\u0915\u094d\u0937\u0941\u0903 \u092a\u0936\u094d\u092f \u092e\u0947 \u092f\u094b\u0917\u092e\u0948\u0936\u094d\u0935\u0930\u092e\u094d\u0964\u096411.8\u0964\u0964","translation":"\u0964\u096411.8\u0964\u0964 \u092a\u0930\u0928\u094d\u0924\u0941 \u0924\u0942 \u0905\u092a\u0928\u0940 \u0907\u0938 \u0906\u0901\u0916\u0938\u0947 \u0905\u0930\u094d\u0925\u093e\u0924\u094d \u091a\u0930\u094d\u092e\u091a\u0915\u094d\u0937\u0941\u0938\u0947 \u092e\u0947\u0930\u0947\u0915\u094b \u0926\u0947\u0916 \u0939\u0940 \u0928\u0939\u0940\u0902 \u0938\u0915\u0924\u093e, \u0907\u0938\u0932\u093f\u092f\u0947 \u092e\u0948\u0902 \u0924\u0941\u091d\u0947 \u0926\u093f\u0935\u094d\u092f \u091a\u0915\u094d\u0937\u0941 \u0926\u0947\u0924\u093e \u0939\u0942\u0901, \u091c\u093f\u0938\u0938\u0947 \u0924\u0942 \u092e\u0947\u0930\u0940 \u0908\u0936\u094d\u0935\u0930-\u0938\u092e\u094d\u092c\u0928\u094d\u0927\u0940 \u0938\u093e\u092e\u0930\u094d\u0925\u094d\u092f\u0915\u094b \u0926\u0947\u0916\u0964","commentary":"\u0964\u096411.8\u0964\u0964\xa0\u0935\u094d\u092f\u093e\u0916\u094d\u092f\u093e--\'\u0928 \u0924\u0941 \u092e\u093e\u0902 \u0936\u0915\u094d\u092f\u0938\u0947 \u0926\u094d\u0930\u0937\u094d\u091f\u0941\u092e\u0928\u0947\u0928\u0948\u0935 \u0938\u094d\u0935\u091a\u0915\u094d\u0937\u0941\u0937\u093e\'--\u0924\u0941\u092e\u094d\u0939\u093e\u0930\u0947 \u091c\u094b \u091a\u0930\u094d\u092e\u091a\u0915\u094d\u0937\u0941 \u0939\u0948\u0902, \u0907\u0928\u0915\u0940 \u0936\u0915\u094d\u0924\u093f \u092c\u0939\u0941\u0924 \u0905\u0932\u094d\u092a \u0914\u0930 \u0938\u0940\u092e\u093f\u0924 \u0939\u0948\u0964 \u092a\u094d\u0930\u093e\u0915\u0943\u0924 \u0939\u094b\u0928\u0947\u0915\u0947 \u0915\u093e\u0930\u0923 \u092f\u0947 \u091a\u0930\u094d\u092e\u091a\u0915\u094d\u0937\u0941 \u0915\u0947\u0935\u0932 \u092a\u094d\u0930\u0915\u0943\u0924\u093f\u0915\u0947 \u0924\u0941\u091a\u094d\u091b \u0915\u093e\u0930\u094d\u092f\u0915\u094b \u0939\u0940 \u0926\u0947\u0916 \u0938\u0915\u0924\u0947 \u0939\u0948\u0902 \u0905\u0930\u094d\u0925\u093e\u0924\u094d \u092a\u094d\u0930\u093e\u0915\u0943\u0924 \u092e\u0928\u0941\u0937\u094d\u092f, \u092a\u0936\u0941, \u092a\u0915\u094d\u0937\u0940 \u0906\u0926\u093f\u0915\u0947 \u0930\u0942\u092a\u094b\u0902\u0915\u094b, \u0909\u0928\u0915\u0947 \u092d\u0947\u0926\u094b\u0902\u0915\u094b \u0924\u0925\u093e \u0927\u0942\u092a-\u091b\u093e\u092f\u093e \u0906\u0926\u093f\u0915\u0947 \u0930\u0942\u092a\u094b\u0902\u0915\u094b \u0939\u0940 \u0926\u0947\u0916 \u0938\u0915\u0924\u0947 \u0939\u0948\u0902\u0964 \u092a\u0930\u0928\u094d\u0924\u0941 \u0935\u0947 \u092e\u0928-\u092c\u0941\u0926\u094d\u0927\u093f-\u0907\u0928\u094d\u0926\u094d\u0930\u093f\u092f\u094b\u0902\u0938\u0947 \u0905\u0924\u0940\u0924 \u092e\u0947\u0930\u0947 \u0930\u0942\u092a\u0915\u094b \u0928\u0939\u0940\u0902 \u0926\u0947\u0916 \u0938\u0915\u0924\u0947\u0964"},{"text":"\u0938\u091e\u094d\u091c\u092f \u0909\u0935\u093e\u091a\\n\u090f\u0935\u092e\u0941\u0915\u094d\u0924\u094d\u0935\u093e \u0924\u0924\u094b \u0930\u093e\u091c\u0928\u094d\u092e\u0939\u093e\u092f\u094b\u0917\u0947\u0936\u094d\u0935\u0930\u094b \u0939\u0930\u093f\u0903\u0964\\n\u0926\u0930\u094d\u0936\u092f\u093e\u092e\u093e\u0938 \u092a\u093e\u0930\u094d\u0925\u093e\u092f \u092a\u0930\u092e\u0902 \u0930\u0942\u092a\u092e\u0948\u0936\u094d\u0935\u0930\u092e\u094d\u0964\u096411.9\u0964\u0964","translation":"\u0964\u096411.9\u0964\u0964 \u0938\u091e\u094d\u091c\u092f \u092c\u094b\u0932\u0947 -- \u0939\u0947 \u0930\u093e\u091c\u0928\u094d ! \u0910\u0938\u093e \u0915\u0939\u0915\u0930 \u092b\u093f\u0930 \u092e\u0939\u093e\u092f\u094b\u0917\u0947\u0936\u094d\u0935\u0930 \u092d\u0917\u0935\u093e\u0928\u094d \u0936\u094d\u0930\u0940\u0915\u0943\u0937\u094d\u0923\u0928\u0947 \u0905\u0930\u094d\u091c\u0941\u0928\u0915\u094b \u092a\u0930\u092e \u0910\u0936\u094d\u0935\u0930-\u0930\u0942\u092a \u0926\u093f\u0916\u093e\u092f\u093e\u0964","commentary":"\u0964\u096411.9\u0964\u0964\xa0\u0935\u094d\u092f\u093e\u0916\u094d\u092f\u093e--\'\u090f\u0935\u092e\u0941\u0915\u094d\u0924\u094d\u0935\u093e \u0924\u0924\u094b \u09f7\u09f7. \u092a\u0930\u092e\u0902 \u0930\u0942\u092a\u092e\u0948\u0936\u094d\u0935\u0930\u092e\u094d\'--\u092a\u0942\u0930\u094d\u0935\u0936\u094d\u0932\u094b\u0915\u092e\u0947\u0902 \u092d\u0917\u0935\u093e\u0928\u094d\u0928\u0947 \u091c\u094b \u092f\u0939 \u0915\u0939\u093e \u0925\u093e \u0915\u093f \'\u0924\u0942 \u0905\u092a\u0928\u0947 \u091a\u0930\u094d\u092e\u091a\u0915\u094d\u0937\u0941\u0913\u0902\u0938\u0947 \u092e\u0941\u091d\u0947 \u0928\u0939\u0940\u0902 \u0926\u0947\u0916 \u0938\u0915\u0924\u093e, \u0907\u0938\u0932\u093f\u092f\u0947 \u092e\u0948\u0902 \u0924\u0947\u0930\u0947\u0915\u094b \u0926\u093f\u0935\u094d\u092f\u091a\u0915\u094d\u0937\u0941 \u0926\u0947\u0924\u093e \u0939\u0942\u0901, \u091c\u093f\u0938\u0938\u0947 \u0924\u0942 \u092e\u0947\u0930\u0947 \u0908\u0936\u094d\u0935\u0930-\u0938\u092e\u094d\u092c\u0928\u094d\u0927\u0940 \u092f\u094b\u0917\u0915\u094b \u0926\u0947\u0916\' \u0909\u0938\u0940\u0915\u093e \u0938\u0902\u0915\u0947\u0924 \u092f\u0939\u093e\u0901 \u0938\u091e\u094d\u091c\u092f\u0928\u0947 \'\u090f\u0935\u092e\u0941\u0915\u094d\u0924\u094d\u0935\u093e\' \u092a\u0926\u0938\u0947 \u0915\u093f\u092f\u093e \u0939\u0948\u0964\u091a\u094c\u0925\u0947 \u0936\u094d\u0932\u094b\u0915\u092e\u0947\u0902 \u0905\u0930\u094d\u091c\u0941\u0928\u0928\u0947 \u092d\u0917\u0935\u093e\u0928\u094d\u0915\u094b \'\u092f\u094b\u0917\u0947\u0936\u094d\u0935\u0930\' \u0915\u0939\u093e \u0914\u0930 \u092f\u0939\u093e\u0901 \u0938\u091e\u094d\u091c\u092f \u092d\u0917\u0935\u093e\u0928\u094d\u0915\u094b \'\u092e\u0939\u093e\u092f\u094b\u0917\u0947\u0936\u094d\u0935\u0930\' \u0915\u0939\u0924\u0947 \u0939\u0948\u0902\u0964 \u0907\u0938\u0915\u093e \u0924\u093e\u0924\u094d\u092a\u0930\u094d\u092f \u0939\u0948 \u0915\u093f \u092d\u0917\u0935\u093e\u0928\u094d\u0928\u0947 \u0905\u0930\u094d\u091c\u0941\u0928\u0915\u0940 \u092a\u094d\u0930\u093e\u0930\u094d\u0925\u0928\u093e\u0938\u0947 \u092c\u0939\u0941\u0924 \u0905\u0927\u093f\u0915 \u0905\u092a\u0928\u093e \u0935\u093f\u0936\u094d\u0935\u0930\u0942\u092a \u0926\u093f\u0916\u093e\u092f\u093e\u0964 \u092d\u0915\u094d\u0924\u0915\u0940 \u0925\u094b\u0921\u093c\u0940-\u0938\u0940 \u092d\u0940 \u0935\u093e\u0938\u094d\u0924\u0935\u093f\u0915 \u0930\u0941\u091a\u093f \u092d\u0917\u0935\u093e\u0928\u094d\u0915\u0940 \u0924\u0930\u092b \u0939\u094b\u0928\u0947\u092a\u0930 \u092d\u0917\u0935\u093e\u0928\u094d \u0905\u092a\u0928\u0940 \u0905\u092a\u093e\u0930 \u0936\u0915\u094d\u0924\u093f\u0938\u0947 \u0909\u0938\u0915\u0940 \u092a\u0942\u0930\u094d\u0924\u093f \u0915\u0930 \u0926\u0947\u0924\u0947 \u0939\u0948\u0902\u0964\\n\u0924\u0940\u0938\u0930\u0947 \u0936\u094d\u0932\u094b\u0915\u092e\u0947\u0902 \u0905\u0930\u094d\u091c\u0941\u0928\u0928\u0947 \u091c\u093f\u0938 \u0930\u0942\u092a\u0915\u0947 \u0932\u093f\u092f\u0947 \'\u0930\u0942\u092a\u092e\u0948\u0936\u094d\u0935\u0930\u092e\u094d\' \u0915\u0939\u093e, \u0909\u0938\u0940 \u0930\u0942\u092a\u0915\u0947 \u0932\u093f\u092f\u0947 \u092f\u0939\u093e\u0901 \u0938\u091e\u094d\u091c\u092f \'\u092a\u0930\u092e\u0902 \u0930\u0942\u092a\u092e\u0948\u0936\u094d\u0935\u0930\u092e\u094d\' \u0915\u0939\u0924\u0947 \u0939\u0948\u0902\u0964 \u0907\u0938\u0915\u093e \u0924\u093e\u0924\u094d\u092a\u0930\u094d\u092f \u0939\u0948 \u0915\u093f \u092d\u0917\u0935\u093e\u0928\u094d\u0915\u093e \u0935\u093f\u0936\u094d\u0935\u0930\u0942\u092a \u092c\u0939\u0941\u0924 \u0939\u0940 \u0935\u093f\u0932\u0915\u094d\u0937\u0923 \u0939\u0948\u0964 \u0938\u092e\u094d\u092a\u0942\u0930\u094d\u0923 \u092f\u094b\u0917\u094b\u0902\u0915\u0947 \u092e\u0939\u093e\u0928\u094d \u0908\u0936\u094d\u0935\u0930 \u092d\u0917\u0935\u093e\u0928\u094d \u0936\u094d\u0930\u0940\u0915\u0943\u0937\u094d\u0923\u0928\u0947 \u0910\u0938\u093e \u0935\u093f\u0932\u0915\u094d\u0937\u0923, \u0905\u0932\u094c\u0915\u093f\u0915, \u0905\u0926\u094d\u092d\u0941\u0924 \u0935\u093f\u0936\u094d\u0935\u0930\u0942\u092a \u0926\u093f\u0916\u093e\u092f\u093e, \u091c\u093f\u0938\u0915\u094b \u0927\u0948\u0930\u094d\u092f\u0936\u093e\u0932\u0940, \u091c\u093f\u0924\u0947\u0928\u094d\u0926\u094d\u0930\u093f\u092f, \u0936\u0942\u0930\u0935\u0940\u0930 \u0914\u0930 \u092d\u0917\u0935\u093e\u0928\u094d\u0938\u0947 \u092a\u094d\u0930\u093e\u092a\u094d\u0924 \u0926\u093f\u0935\u094d\u092f\u0926\u0943\u0937\u094d\u091f\u093f\u0935\u093e\u0932\u0947 \u0905\u0930\u094d\u091c\u0941\u0928\u0915\u094b \u092d\u0940 \u0926\u0941\u0930\u094d\u0928\u093f\u0930\u0940\u0915\u094d\u0937\u094d\u092f \u0915\u0939\u0928\u093e \u092a\u093c\u0921\u093c\u093e (11\u0964 17) \u0914\u0930 \u092d\u092f\u092d\u0940\u0924 \u0939\u094b\u0928\u093e \u092a\u0921\u093c\u093e (11\u0964 45), \u0924\u0925\u093e \u092d\u0917\u0935\u093e\u0928\u094d\u0915\u094b \u092d\u0940 \'\u0935\u094d\u092f\u092a\u0947\u0924\u092d\u0940\u0903\' \u0915\u0939\u0915\u0930 \u0905\u0930\u094d\u091c\u0941\u0928\u0915\u094b \u0906\u0936\u094d\u0935\u093e\u0938\u0928 \u0926\u0947\u0928\u093e \u092a\u0921\u093c\u093e (11\u0964 49)\u0964\\n\xa0\u0938\u092e\u094d\u092c\u0928\u094d\u0927--\u0905\u092c \u0938\u091e\u094d\u091c\u092f \u092d\u0917\u0935\u093e\u0928\u094d\u0915\u0947 \u0909\u0938 \u092a\u0930\u092e \u0910\u0936\u094d\u0935\u0930-\u0930\u0942\u092a\u0915\u093e \u0935\u0930\u094d\u0923\u0928 \u0906\u0917\u0947\u0915\u0947 \u0926\u094b \u0936\u094d\u0932\u094b\u0915\u094b\u0902\u092e\u0947\u0902 \u0915\u0930\u0924\u0947 \u0939\u0948\u0902\u0964"},{"text":"\u0905\u0928\u0947\u0915\u0935\u0915\u094d\u0924\u094d\u0930\u0928\u092f\u0928\u092e\u0928\u0947\u0915\u093e\u0926\u094d\u092d\u0941\u0924\u0926\u0930\u094d\u0936\u0928\u092e\u094d\u0964\\n\u0905\u0928\u0947\u0915\u0926\u093f\u0935\u094d\u092f\u093e\u092d\u0930\u0923\u0902 \u0926\u093f\u0935\u094d\u092f\u093e\u0928\u0947\u0915\u094b\u0926\u094d\u092f\u0924\u093e\u092f\u0941\u0927\u092e\u094d\u0964\u096411.10\u0964\u0964","translation":"\u0964\u096411.10 -- 11.11\u0964\u0964 \u091c\u093f\u0938\u0915\u0947 \u0905\u0928\u0947\u0915 \u092e\u0941\u0916 \u0914\u0930 \u0928\u0947\u0924\u094d\u0930 \u0939\u0948\u0902, \u0905\u0928\u0947\u0915 \u0924\u0939\u0930\u0915\u0947 \u0905\u0926\u094d\u092d\u0941\u0924 \u0926\u0930\u094d\u0936\u0928 \u0939\u0948\u0902, \u0905\u0928\u0947\u0915 \u0926\u093f\u0935\u094d\u092f \u0906\u092d\u0942\u0937\u0923 \u0939\u0948\u0902, \u0939\u093e\u0925\u094b\u0902\u092e\u0947\u0902 \u0909\u0920\u093e\u092f\u0947 \u0939\u0941\u090f \u0905\u0928\u0947\u0915 \u0926\u093f\u0935\u094d\u092f \u0906\u092f\u0941\u0927 \u0939\u0948\u0902 \u0924\u0925\u093e \u091c\u093f\u0928\u0915\u0947 \u0917\u0932\u0947\u092e\u0947\u0902 \u0926\u093f\u0935\u094d\u092f \u092e\u093e\u0932\u093e\u090f\u0901 \u0939\u0948\u0902, \u091c\u094b \u0926\u093f\u0935\u094d\u092f \u0935\u0938\u094d\u0924\u094d\u0930 \u092a\u0939\u0928\u0947 \u0939\u0941\u090f \u0939\u0948\u0902, \u091c\u093f\u0928\u0915\u0947 \u0932\u0932\u093e\u091f \u0924\u0925\u093e \u0936\u0930\u0940\u0930\u092a\u0930 \u0926\u093f\u0935\u094d\u092f \u091a\u0928\u094d\u0926\u0928, \u0915\u0941\u0902\u0915\u0941\u092e \u0906\u0926\u093f \u0932\u0917\u093e \u0939\u0941\u0906 \u0939\u0948, \u0910\u0938\u0947 \u0938\u092e\u094d\u092a\u0942\u0930\u094d\u0923 \u0906\u0936\u094d\u091a\u0930\u094d\u092f\u092e\u092f, \u0905\u0928\u0928\u094d\u0924\u0930\u0942\u092a\u0935\u093e\u0932\u0947 \u0924\u0925\u093e \u091a\u093e\u0930\u094b\u0902 \u0924\u0930\u092b \u092e\u0941\u0916\u0935\u093e\u0932\u0947 \u0926\u0947\u0935-(\u0905\u092a\u0928\u0947 \u0926\u093f\u0935\u094d\u092f \u0938\u094d\u0935\u0930\u0942\u092a-) \u0915\u094b \u092d\u0917\u0935\u093e\u0928\u094d \u0928\u0947 \u0926\u093f\u0916\u093e\u092f\u093e\u0964","commentary":"\u0964\u096411.10\u0964\u0964\xa0\u0935\u094d\u092f\u093e\u0916\u094d\u092f\u093e--\'\u0905\u0928\u0947\u0915\u0935\u0915\u094d\u0924\u094d\u0930\u0928\u092f\u0928\u092e\u094d\'--\u0935\u093f\u0930\u093e\u091f\u094d\u0930\u0942\u092a\u0938\u0947 \u092a\u094d\u0930\u0915\u091f \u0939\u0941\u090f \u092d\u0917\u0935\u093e\u0928\u094d\u0915\u0947 \u091c\u093f\u0924\u0928\u0947 \u092e\u0941\u0916 \u0914\u0930 \u0928\u0947\u0924\u094d\u0930 \u0926\u0940\u0916 \u0930\u0939\u0947 \u0939\u0948\u0902, \u0935\u0947 \u0938\u092c-\u0915\u0947-\u0938\u092c \u0926\u093f\u0935\u094d\u092f \u0939\u0948\u0902\u0964 \u0935\u093f\u0930\u093e\u091f\u094d\u0930\u0942\u092a\u092e\u0947\u0902 \u091c\u093f\u0924\u0928\u0947 \u092a\u094d\u0930\u093e\u0923\u0940 \u0926\u0940\u0916 \u0930\u0939\u0947 \u0939\u0948\u0902, \u0909\u0928\u0915\u0947 \u092e\u0941\u0916, \u0928\u0947\u0924\u094d\u0930, \u0939\u093e\u0925, \u092a\u0948\u0930 \u0906\u0926\u093f \u0938\u092c\u0915\u0947\u0938\u092c \u0905\u0919\u094d\u0917 \u0935\u093f\u0930\u093e\u091f\u094d\u0930\u0942\u092a \u092d\u0917\u0935\u093e\u0928\u094d\u0915\u0947 \u0939\u0948\u0902\u0964 \u0915\u093e\u0930\u0923 \u0915\u093f \u092d\u0917\u0935\u093e\u0928\u094d \u0938\u094d\u0935\u092f\u0902 \u0939\u0940 \u0935\u093f\u0930\u093e\u091f\u094d\u0930\u0942\u092a\u0938\u0947 \u092a\u094d\u0930\u0915\u091f \u0939\u0941\u090f \u0939\u0948\u0902\u0964"},{"text":"\u0926\u093f\u0935\u094d\u092f\u092e\u093e\u0932\u094d\u092f\u093e\u092e\u094d\u092c\u0930\u0927\u0930\u0902 \u0926\u093f\u0935\u094d\u092f\u0917\u0928\u094d\u0927\u093e\u0928\u0941\u0932\u0947\u092a\u0928\u092e\u094d\u0964\\n\u0938\u0930\u094d\u0935\u093e\u0936\u094d\u091a\u0930\u094d\u092f\u092e\u092f\u0902 \u0926\u0947\u0935\u092e\u0928\u0928\u094d\u0924\u0902 \u0935\u093f\u0936\u094d\u0935\u0924\u094b\u092e\u0941\u0916\u092e\u094d\u0964\u096411.11\u0964\u0964","translation":"\u0964\u096411.10 -- 11.11\u0964\u0964 \u091c\u093f\u0938\u0915\u0947 \u0905\u0928\u0947\u0915 \u092e\u0941\u0916 \u0914\u0930 \u0928\u0947\u0924\u094d\u0930 \u0939\u0948\u0902, \u0905\u0928\u0947\u0915 \u0924\u0939\u0930\u0915\u0947 \u0905\u0926\u094d\u092d\u0941\u0924 \u0926\u0930\u094d\u0936\u0928 \u0939\u0948\u0902, \u0905\u0928\u0947\u0915 \u0926\u093f\u0935\u094d\u092f \u0906\u092d\u0942\u0937\u0923 \u0939\u0948\u0902, \u0939\u093e\u0925\u094b\u0902\u092e\u0947\u0902 \u0909\u0920\u093e\u092f\u0947 \u0939\u0941\u090f \u0905\u0928\u0947\u0915 \u0926\u093f\u0935\u094d\u092f \u0906\u092f\u0941\u0927 \u0939\u0948\u0902 \u0924\u0925\u093e \u091c\u093f\u0928\u0915\u0947 \u0917\u0932\u0947\u092e\u0947\u0902 \u0926\u093f\u0935\u094d\u092f \u092e\u093e\u0932\u093e\u090f\u0901 \u0939\u0948\u0902, \u091c\u094b \u0926\u093f\u0935\u094d\u092f \u0935\u0938\u094d\u0924\u094d\u0930 \u092a\u0939\u0928\u0947 \u0939\u0941\u090f \u0939\u0948\u0902, \u091c\u093f\u0928\u0915\u0947 \u0932\u0932\u093e\u091f \u0924\u0925\u093e \u0936\u0930\u0940\u0930\u092a\u0930 \u0926\u093f\u0935\u094d\u092f \u091a\u0928\u094d\u0926\u0928, \u0915\u0941\u0902\u0915\u0941\u092e \u0906\u0926\u093f \u0932\u0917\u093e \u0939\u0941\u0906 \u0939\u0948, \u0910\u0938\u0947 \u0938\u092e\u094d\u092a\u0942\u0930\u094d\u0923 \u0906\u0936\u094d\u091a\u0930\u094d\u092f\u092e\u092f, \u0905\u0928\u0928\u094d\u0924 \u0930\u0942\u092a\u094b\u0902\u0935\u093e\u0932\u0947 \u0924\u0925\u093e \u091a\u093e\u0930\u094b\u0902 \u0924\u0930\u092b \u092e\u0941\u0916\u0935\u093e\u0932\u0947 \u0926\u0947\u0935-(\u0905\u092a\u0928\u0947 \u0926\u093f\u0935\u094d\u092f \u0938\u094d\u0935\u0930\u0942\u092a-) \u0915\u094b \u092d\u0917\u0935\u093e\u0928\u094d \u0928\u0947 \u0926\u093f\u0916\u093e\u092f\u093e\u0964","commentary":"\u0964\u096411.11\u0964\u0964\xa0\u0935\u094d\u092f\u093e\u0916\u094d\u092f\u093e--\'\u0905\u0928\u0947\u0915\u0935\u0915\u094d\u0924\u094d\u0930\u0928\u092f\u0928\u092e\u094d\'--\u0935\u093f\u0930\u093e\u091f\u094d\u0930\u0942\u092a\u0938\u0947 \u092a\u094d\u0930\u0915\u091f \u0939\u0941\u090f \u092d\u0917\u0935\u093e\u0928\u094d\u0915\u0947 \u091c\u093f\u0924\u0928\u0947 \u092e\u0941\u0916 \u0914\u0930 \u0928\u0947\u0924\u094d\u0930 \u0926\u0940\u0916 \u0930\u0939\u0947 \u0939\u0948\u0902, \u0935\u0947 \u0938\u092c-\u0915\u0947-\u0938\u092c \u0926\u093f\u0935\u094d\u092f \u0939\u0948\u0902\u0964 \u0935\u093f\u0930\u093e\u091f\u094d\u0930\u0942\u092a\u092e\u0947\u0902 \u091c\u093f\u0924\u0928\u0947 \u092a\u094d\u0930\u093e\u0923\u0940 \u0926\u0940\u0916 \u0930\u0939\u0947 \u0939\u0948\u0902, \u0909\u0928\u0915\u0947 \u092e\u0941\u0916, \u0928\u0947\u0924\u094d\u0930, \u0939\u093e\u0925, \u092a\u0948\u0930 \u0906\u0926\u093f \u0938\u092c-\u0915\u0947-\u0938\u092c \u0905\u0919\u094d\u0917 \u0935\u093f\u0930\u093e\u091f\u094d\u0930\u0942\u092a \u092d\u0917\u0935\u093e\u0928\u094d\u0915\u0947 \u0939\u0948\u0902\u0964 \u0915\u093e\u0930\u0923 \u0915\u093f \u092d\u0917\u0935\u093e\u0928\u094d \u0938\u094d\u0935\u092f\u0902 \u0939\u0940 \u0935\u093f\u0930\u093e\u091f\u094d\u0930\u0942\u092a\u0938\u0947 \u092a\u094d\u0930\u0915\u091f \u0939\u0941\u090f \u0939\u0948\u0902\u0964"},{"text":"\u0926\u093f\u0935\u093f \u0938\u0942\u0930\u094d\u092f\u0938\u0939\u0938\u094d\u0930\u0938\u094d\u092f \u092d\u0935\u0947\u0926\u094d\u092f\u0941\u0917\u092a\u0926\u0941\u0924\u094d\u0925\u093f\u0924\u093e\u0964\\n\u092f\u0926\u093f \u092d\u093e\u0903 \u0938\u0926\u0943\u0936\u0940 \u0938\u093e \u0938\u094d\u092f\u093e\u0926\u094d\u092d\u093e\u0938\u0938\u094d\u0924\u0938\u094d\u092f \u092e\u0939\u093e\u0924\u094d\u092e\u0928\u0903\u0964\u096411.12\u0964\u0964","translation":"\u0964\u096411.12\u0964\u0964 \u0905\u0917\u0930 \u0906\u0915\u093e\u0936\u092e\u0947\u0902 \u090f\u0915 \u0938\u093e\u0925 \u0939\u091c\u093e\u0930\u094b\u0902 \u0938\u0942\u0930\u094d\u092f \u0909\u0926\u093f\u0924 \u0939\u094b \u091c\u093e\u092f\u0901, \u0924\u094b \u092d\u0940 \u0909\u0928 \u0938\u092c\u0915\u093e \u092a\u094d\u0930\u0915\u093e\u0936 \u092e\u093f\u0932\u0915\u0930 \u0909\u0938 \u092e\u0939\u093e\u0924\u094d\u092e\u093e-(\u0935\u093f\u0930\u093e\u091f\u094d \u0930\u0942\u092a \u092a\u0930\u092e\u093e\u0924\u094d\u092e\u093e-) \u0915\u0947 \u092a\u094d\u0930\u0915\u093e\u0936\u0915\u0947 \u0938\u092e\u093e\u0928 \u0936\u093e\u092f\u0926 \u0939\u0940 \u0939\u094b\u0964","commentary":"\u0964\u096411.12\u0964\u0964\xa0\u0935\u094d\u092f\u093e\u0916\u094d\u092f\u093e--\'\u0926\u093f\u0935\u093f \u0938\u0942\u0930\u094d\u092f\u0938\u0939\u0938\u094d\u0930\u0938\u094d\u092f \u09f7\u09f7. \u0924\u0938\u094d\u092f \u092e\u0939\u093e\u0924\u094d\u092e\u0928\u0903\'--\u091c\u0948\u0938\u0947 \u0906\u0915\u093e\u0936\u092e\u0947\u0902 \u0939\u091c\u093e\u0930\u094b\u0902 \u0924\u093e\u0930\u0947 \u090f\u0915 \u0938\u093e\u0925 \u0909\u0926\u093f\u0924 \u0939\u094b\u0928\u0947\u092a\u0930 \u092d\u0940 \u0909\u0928 \u0938\u092c\u0915\u093e \u092e\u093f\u0932\u093e \u0939\u0941\u0906 \u092a\u094d\u0930\u0915\u093e\u0936 \u090f\u0915 \u091a\u0928\u094d\u0926\u094d\u0930\u092e\u093e\u0915\u0947 \u092a\u094d\u0930\u0915\u093e\u0936\u0915\u0947 \u0938\u0926\u0943\u0936 \u0928\u0939\u0940\u0902 \u0939\u094b \u0938\u0915\u0924\u093e \u0914\u0930 \u0939\u091c\u093e\u0930\u094b\u0902 \u091a\u0928\u094d\u0926\u094d\u0930\u092e\u093e\u0913\u0902\u0915\u093e \u092e\u093f\u0932\u093e \u0939\u0941\u0906 \u092a\u094d\u0930\u0915\u093e\u0936 \u090f\u0915 \u0938\u0942\u0930\u094d\u092f\u0915\u0947 \u092a\u094d\u0930\u0915\u093e\u0936\u0915\u0947 \u0938\u0926\u0943\u0936 \u0928\u0939\u0940\u0902 \u0939\u094b \u0938\u0915\u0924\u093e, \u0910\u0938\u0947 \u0939\u0940 \u0906\u0915\u093e\u0936\u092e\u0947\u0902 \u0939\u091c\u093e\u0930\u094b\u0902 \u0938\u0942\u0930\u094d\u092f \u090f\u0915 \u0938\u093e\u0925 \u0909\u0926\u093f\u0924 \u0939\u094b\u0928\u0947\u092a\u0930 \u092d\u0940 \u0909\u0928 \u0938\u092c\u0915\u093e \u092e\u093f\u0932\u093e \u0939\u0941\u0906 \u092a\u094d\u0930\u0915\u093e\u0936 \u0935\u093f\u0930\u093e\u091f\u094d \u092d\u0917\u0935\u093e\u0928\u094d\u0915\u0947 \u092a\u094d\u0930\u0915\u093e\u0936\u0915\u0947 \u0938\u0926\u0943\u0936 \u0928\u0939\u0940\u0902 \u0939\u094b \u0938\u0915\u0924\u093e\u0964 \u0924\u093e\u0924\u094d\u092a\u0930\u094d\u092f \u092f\u0939 \u0939\u0941\u0906 \u0915\u093f \u0939\u091c\u093e\u0930\u094b\u0902 \u0938\u0942\u0930\u094d\u092f\u094b\u0902\u0915\u093e \u092a\u094d\u0930\u0915\u093e\u0936 \u092d\u0940 \u0935\u093f\u0930\u093e\u091f\u094d \u092d\u0917\u0935\u093e\u0928\u094d\u0915\u0947 \u092a\u094d\u0930\u0915\u093e\u0936\u0915\u093e \u0909\u092a\u092e\u0947\u092f \u0928\u0939\u0940\u0902 \u0939\u094b \u0938\u0915\u0924\u093e\u0964 \u0907\u0938 \u092a\u094d\u0930\u0915\u0930 \u091c\u092c \u0939\u091c\u093e\u0930\u094b\u0902 \u0938\u0942\u0930\u094d\u092f\u094b\u0902\u0915\u0947 \u092a\u094d\u0930\u0915\u093e\u0936\u0915\u094b \u0909\u092a\u092e\u0947\u092f \u092c\u0928\u093e\u0928\u0947\u092e\u0947\u0902 \u092d\u0940 \u0926\u093f\u0935\u094d\u092f\u0926\u0943\u0937\u094d\u091f\u093f\u0935\u093e\u0932\u0947 \u0938\u091e\u094d\u091c\u092f\u0915\u094b \u0938\u0902\u0915\u094b\u091a \u0939\u094b\u0924\u093e \u0939\u0948, \u0924\u092c \u0935\u0939 \u092a\u094d\u0930\u0915\u093e\u0936 \u0935\u093f\u0930\u093e\u091f\u094d\u0930\u0942\u092a \u092d\u0917\u0935\u093e\u0928\u094d\u0915\u0947 \u092a\u094d\u0930\u0915\u093e\u0936\u0915\u093e \u0909\u092a\u092e\u093e\u0928 \u0939\u094b \u0939\u0940 \u0915\u0948\u0938\u0947 \u0938\u0915\u0924\u093e \u0939\u0948! \u0915\u093e\u0930\u0923 \u0915\u093f \u0938\u0942\u0930\u094d\u092f\u0915\u093e \u092a\u094d\u0930\u0915\u093e\u0936 \u092d\u094c\u0924\u093f\u0915 \u0939\u0948, \u091c\u092c \u0915\u093f \u0935\u093f\u0930\u093e\u091f\u094d \u092d\u0917\u0935\u093e\u0928\u094d\u0915\u093e \u092a\u094d\u0930\u0915\u093e\u0936 \u0926\u093f\u0935\u094d\u092f \u0939\u0948\u0964 \u092d\u094c\u0924\u093f\u0915 \u092a\u094d\u0930\u0915\u093e\u0936 \u0915\u093f\u0924\u0928\u093e \u0939\u0940 \u092c\u0921\u093c\u093e \u0915\u094d\u092f\u094b\u0902 \u0928 \u0939\u094b,,\u0926\u093f\u0935\u094d\u092f \u092a\u094d\u0930\u0915\u093e\u0936\u0915\u0947 \u0938\u093e\u092e\u0928\u0947 \u0935\u0939 \u0924\u0941\u091a\u094d\u091b \u0939\u0940 \u0939\u0948\u0964 \u092d\u094c\u0924\u093f\u0915 \u092a\u094d\u0930\u0915\u093e\u0936 \u0914\u0930 \u0926\u093f\u0935\u094d\u092f \u092a\u094d\u0930\u0915\u093e\u0936\u0915\u0940 \u091c\u093e\u0924\u093f \u0905\u0932\u0917-\u0905\u0932\u0917 \u0939\u094b\u0928\u0947\u0938\u0947 \u0909\u0928\u0915\u0940 \u0906\u092a\u0938\u092e\u0947\u0902 \u0924\u0941\u0932\u0928\u093e \u0928\u0939\u0940\u0902 \u0915\u0940 \u091c\u093e \u0938\u0915\u0924\u0940\u0964 \u0939\u093e\u0901, \u0905\u0919\u094d\u0917\u0941\u0932\u093f\u0928\u093f\u0930\u094d\u0926\u0947\u0936\u0915\u0940 \u0924\u0930\u0939 \u092d\u094c\u0924\u093f\u0915 \u092a\u094d\u0930\u0915\u093e\u0936\u0938\u0947 \u0926\u093f\u0935\u094d\u092f \u092a\u094d\u0930\u0915\u093e\u0936\u0915\u093e \u0938\u0902\u0915\u0947\u0924 \u0915\u093f\u092f\u093e \u091c\u093e \u0938\u0915\u0924\u093e \u0939\u0948\u0964 \u092f\u0939\u093e\u0901 \u0938\u091e\u094d\u091c\u092f \u092d\u0940 \u0939\u091c\u093e\u0930\u094b\u0902 \u0938\u0942\u0930\u094d\u092f\u094b\u0902\u0915\u0947 \u092d\u094c\u0924\u093f\u0915 \u092a\u094d\u0930\u0915\u093e\u0936\u0915\u0940 \u0915\u0932\u094d\u092a\u0928\u093e \u0915\u0930\u0915\u0947 \u0935\u093f\u0930\u093e\u091f\u094d\u0930\u0942\u092a \u092d\u0917\u0935\u093e\u0928\u094d\u0915\u0947 \u092a\u094d\u0930\u0915\u093e\u0936-(\u0924\u0947\u091c-) \u0915\u093e \u0932\u0915\u094d\u0937\u094d\u092f \u0915\u0930\u093e\u0924\u0947 \u0939\u0948\u0902\u0964\xa0"},{"text":"\u0924\u0924\u094d\u0930\u0948\u0915\u0938\u094d\u0925\u0902 \u091c\u0917\u0924\u094d\u0915\u0943\u0924\u094d\u0938\u094d\u0928\u0902 \u092a\u094d\u0930\u0935\u093f\u092d\u0915\u094d\u0924\u092e\u0928\u0947\u0915\u0927\u093e\u0964\\n\u0905\u092a\u0936\u094d\u092f\u0926\u094d\u0926\u0947\u0935\u0926\u0947\u0935\u0938\u094d\u092f \u0936\u0930\u0940\u0930\u0947 \u092a\u093e\u0923\u094d\u0921\u0935\u0938\u094d\u0924\u0926\u093e\u0964\u096411.13\u0964\u0964","translation":"\u0964\u096411.13\u0964\u0964 \u0909\u0938 \u0938\u092e\u092f \u0905\u0930\u094d\u091c\u0941\u0928\u0928\u0947 \u0926\u0947\u0935\u094b\u0902\u0915\u0947 \u0926\u0947\u0935 \u092d\u0917\u0935\u093e\u0928\u094d \u0915\u0947 \u0909\u0938 \u0936\u0930\u0940\u0930\u092e\u0947\u0902 \u090f\u0915 \u091c\u0917\u0939 \u0938\u094d\u0925\u093f\u0924 \u0905\u0928\u0947\u0915 \u092a\u094d\u0930\u0915\u093e\u0930\u0915\u0947 \u0935\u093f\u092d\u093e\u0917\u094b\u0902\u092e\u0947\u0902 \u0935\u093f\u092d\u0915\u094d\u0924 \u0938\u092e\u094d\u092a\u0942\u0930\u094d\u0923 \u091c\u0917\u0924\u094d \u0915\u094b \u0926\u0947\u0916\u093e\u0964","commentary":"\u0964\u096411.13\u0964\u0964\xa0\u0935\u094d\u092f\u093e\u0916\u094d\u092f\u093e--\'\u0924\u0924\u094d\u0930\u0948\u0915\u0938\u094d\u0925\u0902 \u091c\u0917\u0924\u094d\u0915\u0943\u0924\u094d\u0938\u094d\u0928\u0902 \u092a\u094d\u0930\u0935\u093f\u092d\u0915\u094d\u0924\u092e\u0928\u0947\u0915\u0927\u093e\'--\u0905\u0928\u0947\u0915 \u092a\u094d\u0930\u0915\u093e\u0930\u0915\u0947 \u0935\u093f\u092d\u093e\u0917\u094b\u0902\u092e\u0947\u0902 \u0935\u093f\u092d\u0915\u094d\u0924 \u0905\u0930\u094d\u0925\u093e\u0924\u094d \u092f\u0947 \u0926\u0947\u0935\u0924\u093e \u0939\u0948\u0902, \u092f\u0947 \u092e\u0928\u0941\u0937\u094d\u092f \u0939\u0948\u0902, \u092f\u0947 \u092a\u0936\u0941-\u092a\u0915\u094d\u0937\u0940 \u0939\u0948\u0902, \u092f\u0939 \u092a\u0943\u0925\u094d\u0935\u0940 \u0939\u0948, \u092f\u0947 \u0938\u092e\u0941\u0926\u094d\u0930 \u0939\u0948\u0902, \u092f\u0939 \u0906\u0915\u093e\u0936 \u0939\u0948, \u092f\u0947 \u0928\u0915\u094d\u0937\u0924\u094d\u0930 \u0939\u0948\u0902, \u0906\u0926\u093f-\u0906\u0926\u093f \u0935\u093f\u092d\u093e\u0917\u094b\u0902\u0915\u0947 \u0938\u0939\u093f\u0924 (\u0938\u0902\u0915\u0941\u091a\u093f\u0924 \u0928\u0939\u0940\u0902, \u092a\u094d\u0930\u0924\u094d\u092f\u0941\u0924 \u0935\u093f\u0938\u094d\u0924\u093e\u0930\u0938\u0939\u093f\u0924) \u0938\u092e\u094d\u092a\u0942\u0930\u094d\u0923 \u091a\u0930\u093e\u091a\u0930 \u091c\u0917\u0924\u094d\u0915\u094b \u092d\u0917\u0935\u093e\u0928\u094d\u0915\u0947 \u0936\u0930\u0940\u0930\u0915\u0947 \u092d\u0940 \u090f\u0915 \u0926\u0947\u0936\u092e\u0947\u0902 \u0905\u0930\u094d\u091c\u0941\u0928\u0928\u0947 \u092d\u0917\u0935\u093e\u0928\u094d\u0915\u0947 \u0926\u093f\u092f\u0947 \u0939\u0941\u090f \u0926\u093f\u0935\u094d\u092f\u091a\u0915\u094d\u0937\u0941\u0913\u0902\u0938\u0947 \u092a\u094d\u0930\u0924\u094d\u092f\u0915\u094d\u0937 \u0926\u0947\u0916\u093e\u0964 \u0924\u093e\u0924\u094d\u092a\u0930\u094d\u092f \u092f\u0939 \u0939\u0941\u0906 \u0915\u093f \u092d\u0917\u0935\u093e\u0928\u094d \u0936\u094d\u0930\u0940\u0915\u0943\u0937\u094d\u0923\u0915\u0947 \u091b\u094b\u091f\u0947-\u0938\u0947 \u0936\u0930\u0940\u0930\u0915\u0947 \u092d\u0940 \u090f\u0915 \u0905\u0902\u0936\u092e\u0947\u0902 \u091a\u0930-\u0905\u091a\u0930, \u0938\u094d\u0925\u093e\u0935\u0930-\u091c\u0919\u094d\u0917\u092e\u0938\u0939\u093f\u0924 \u0938\u092e\u094d\u092a\u0942\u0930\u094d\u0923 \u0938\u0902\u0938\u093e\u0930 \u0939\u0948\u0964 \u0935\u0939 \u0938\u0902\u0938\u093e\u0930 \u092d\u0940 \u0905\u0928\u0947\u0915 \u092c\u094d\u0930\u0939\u094d\u092e\u093e\u0923\u094d\u0921\u094b\u0902\u0915\u0947 \u0930\u0942\u092a\u092e\u0947\u0902, \u0905\u0928\u0947\u0915 \u0926\u0947\u0935\u0924\u093e\u0913\u0902\u0915\u0947 \u0932\u094b\u0915\u094b\u0902\u0915\u0947 \u0930\u0942\u092a\u092e\u0947\u0902, \u0905\u0928\u0947\u0915 \u0935\u094d\u092f\u0915\u094d\u0924\u093f\u092f\u094b\u0902 \u0914\u0930 \u092a\u0926\u093e\u0930\u094d\u0925\u094b\u0902\u0915\u0947 \u0930\u0942\u092a\u092e\u0947\u0902 \u0935\u093f\u092d\u0915\u094d\u0924 \u0914\u0930 \u0935\u093f\u0938\u094d\u0924\u0943\u0924 \u0939\u0948 -- \u0907\u0938 \u092a\u094d\u0930\u0915\u093e\u0930 \u0905\u0930\u094d\u091c\u0941\u0928\u0928\u0947 \u0938\u094d\u092a\u0937\u094d\u091f \u0930\u0942\u092a\u0938\u0947 \u0926\u0947\u0916\u093e (\u091f\u093f\u092a\u094d\u092a\u0923\u0940 \u092a0 582)\u0964\xa0"},{"text":"\u0924\u0924\u0903 \u0938 \u0935\u093f\u0938\u094d\u092e\u092f\u093e\u0935\u093f\u0937\u094d\u091f\u094b \u0939\u0943\u0937\u094d\u091f\u0930\u094b\u092e\u093e \u0927\u0928\u091e\u094d\u091c\u092f\u0903\u0964\\n\u092a\u094d\u0930\u0923\u092e\u094d\u092f \u0936\u093f\u0930\u0938\u093e \u0926\u0947\u0935\u0902 \u0915\u0943\u0924\u093e\u091e\u094d\u091c\u0932\u093f\u0930\u092d\u093e\u0937\u0924\u0964\u096411.14\u0964\u0964","translation":"\u0964\u096411.14\u0964\u0964 \u092d\u0917\u0935\u093e\u0928\u094d \u0915\u0947 \u0935\u093f\u0936\u094d\u0935\u0930\u0942\u092a\u0915\u094b \u0926\u0947\u0916\u0915\u0930 \u0905\u0930\u094d\u091c\u0941\u0928 \u092c\u0939\u0941\u0924 \u091a\u0915\u093f\u0924 \u0939\u0941\u090f \u0914\u0930 \u0906\u0936\u094d\u091a\u0930\u094d\u092f\u0915\u0947 \u0915\u093e\u0930\u0923 \u0909\u0928\u0915\u093e \u0936\u0930\u0940\u0930 \u0930\u094b\u092e\u093e\u091e\u094d\u091a\u093f\u0924 \u0939\u094b \u0917\u092f\u093e\u0964 \u0935\u0947 \u0939\u093e\u0925 \u091c\u094b\u0921\u093c\u0915\u0930 \u0935\u093f\u0936\u094d\u0935\u0930\u0942\u092a \u0926\u0947\u0935\u0915\u094b \u092e\u0938\u094d\u0924\u0915\u0938\u0947 \u092a\u094d\u0930\u0923\u093e\u092e \u0915\u0930\u0915\u0947 \u092c\u094b\u0932\u0947\u0964","commentary":"\u0964\u096411.14\u0964\u0964\xa0\u0935\u094d\u092f\u093e\u0916\u094d\u092f\u093e--\u0924\u0924\u0903 \u0938 \u0935\u093f\u0938\u094d\u092e\u092f\u093e\u0935\u093f\u0937\u094d\u091f\u094b \u0939\u0943\u0937\u094d\u091f\u0930\u094b\u092e\u093e \u0927\u0928\u091e\u094d\u091c\u092f\u0903--\u0905\u0930\u094d\u091c\u0941\u0928\u0928\u0947 \u092d\u0917\u0935\u093e\u0928\u094d\u0915\u0947 \u0930\u0942\u092a\u0915\u0947 \u0935\u093f\u0937\u092f\u092e\u0947\u0902 \u091c\u0948\u0938\u0940 \u0915\u0932\u094d\u092a\u0928\u093e \u092d\u0940 \u0928\u0939\u0940\u0902 \u0915\u0940 \u0925\u0940, \u0935\u0948\u0938\u093e \u0930\u0942\u092a \u0926\u0947\u0916\u0915\u0930 \u0909\u0928\u0915\u094b \u092c\u0921\u093c\u093e \u0906\u0936\u094d\u091a\u0930\u094d\u092f \u0939\u0941\u0906\u0964 \u092d\u0917\u0935\u093e\u0928\u094d\u0928\u0947 \u092e\u0947\u0930\u0947\u092a\u0930 \u0915\u0943\u092a\u093e \u0915\u0930\u0915\u0947 \u0935\u093f\u0932\u0915\u094d\u0937\u0923 \u0906\u0927\u094d\u092f\u093e\u0924\u094d\u092e\u093f\u0915 \u092c\u093e\u0924\u0947\u0902 \u0905\u092a\u0928\u0940 \u0913\u0930\u0938\u0947 \u092c\u0924\u093e\u092f\u0940\u0902 \u0914\u0930 \u0905\u092c \u0915\u0943\u092a\u093e \u0915\u0930\u0915\u0947 \u092e\u0947\u0930\u0947\u0915\u094b \u0905\u092a\u0928\u093e \u0935\u093f\u0932\u0915\u094d\u0937\u0923 \u0930\u0942\u092a \u0926\u093f\u0916\u093e \u0930\u0939\u0947 \u0939\u0948\u0902-- \u0907\u0938 \u092c\u093e\u0924\u0915\u094b \u0932\u0947\u0915\u0930 \u0905\u0930\u094d\u091c\u0941\u0928 \u092a\u094d\u0930\u0938\u0928\u094d\u0928\u0924\u093e\u0915\u0947 \u0915\u093e\u0930\u0923 \u0930\u094b\u092e\u093e\u091e\u094d\u091a\u093f\u0924 \u0939\u094b \u0909\u0920\u0947\u0964"},{"text":"\u0905\u0930\u094d\u091c\u0941\u0928 \u0909\u0935\u093e\u091a\\n\u092a\u0936\u094d\u092f\u093e\u092e\u093f \u0926\u0947\u0935\u093e\u0902\u0938\u094d\u0924\u0935 \u0926\u0947\u0935 \u0926\u0947\u0939\u0947\\n\u0938\u0930\u094d\u0935\u093e\u0902\u0938\u094d\u0924\u0925\u093e \u092d\u0942\u0924\u0935\u093f\u0936\u0947\u0937\u0938\u0919\u094d\u0918\u093e\u0928\u094d\u0964\\n\u092c\u094d\u0930\u0939\u094d\u092e\u093e\u0923\u092e\u0940\u0936\u0902 \u0915\u092e\u0932\u093e\u0938\u0928\u0938\u094d\u0925\\n\u092e\u0943\u0937\u0940\u0902\u0936\u094d\u091a \u0938\u0930\u094d\u0935\u093e\u0928\u0941\u0930\u0917\u093e\u0902\u0936\u094d\u091a \u0926\u093f\u0935\u094d\u092f\u093e\u0928\u094d\u0964\u096411.15\u0964\u0964","translation":"\u0964\u096411.15\u0964\u0964 \u0905\u0930\u094d\u091c\u0941\u0928 \u092c\u094b\u0932\u0947 -- \u0939\u0947 \u0926\u0947\u0935 ! \u092e\u0948\u0902 \u0906\u092a\u0915\u0947 \u0936\u0930\u0940\u0930\u092e\u0947\u0902 \u0938\u092e\u094d\u092a\u0942\u0930\u094d\u0923 \u0926\u0947\u0935\u0924\u093e\u0913\u0902\u0915\u094b, \u092a\u094d\u0930\u093e\u0923\u093f\u092f\u094b\u0902\u0915\u0947 \u0935\u093f\u0936\u0947\u0937-\u0935\u093f\u0936\u0947\u0937 \u0938\u092e\u0941\u0926\u093e\u092f\u094b\u0902\u0915\u094b \u0915\u092e\u0932\u093e\u0938\u0928\u092a\u0930 \u092c\u0948\u0920\u0947 \u0939\u0941\u090f \u092c\u094d\u0930\u0939\u094d\u092e\u093e\u091c\u0940\u0915\u094b, \u0936\u0919\u094d\u0915\u0930\u091c\u0940\u0915\u094b, \u0938\u092e\u094d\u092a\u0942\u0930\u094d\u0923 \u090b\u0937\u093f\u092f\u094b\u0902\u0915\u094b \u0914\u0930 \u0938\u092e\u094d\u092a\u0942\u0930\u094d\u0923 \u0926\u093f\u0935\u094d\u092f \u0938\u0930\u094d\u092a\u094b\u0902\u0915\u094b \u0926\u0947\u0916 \u0930\u0939\u093e \u0939\u0942\u0901\u0964","commentary":"\u0964\u096411.15\u0964\u0964\xa0\u0935\u094d\u092f\u093e\u0916\u094d\u092f\u093e--\u092a\u0936\u094d\u092f\u093e\u092e\u093f \u0926\u0947\u0935\u093e\u0902\u0938\u094d\u0924\u0935 \u0926\u0947\u0935 \u0926\u0947\u0939\u0947 \u0938\u0930\u094d\u0935\u093e\u0902\u0938\u094d\u0924\u0925\u093e \u092d\u0942\u0924\u0935\u093f\u0936\u0947\u0937\u0938\u0919\u094d\u0918\u093e\u0928\u094d--\u0905\u0930\u094d\u091c\u0941\u0928\u0915\u0940 \u092d\u0917\u0935\u0924\u094d\u092a\u094d\u0930\u0926\u0924\u094d\u0924 \u0926\u093f\u0935\u094d\u092f \u0926\u0943\u0937\u094d\u091f\u093f \u0907\u0924\u0928\u0940 \u0935\u093f\u0932\u0915\u094d\u0937\u0923 \u0939\u0948 \u0915\u093f \u0909\u0928\u0915\u094b \u0926\u0947\u0935\u0932\u094b\u0915 \u092d\u0940 \u0905\u092a\u0928\u0947 \u0938\u093e\u092e\u0928\u0947 \u0926\u0940\u0916 \u0930\u0939\u0947 \u0939\u0948\u0902\u0964 \u0907\u0924\u0928\u093e \u0939\u0940 \u0928\u0939\u0940\u0902, \u0909\u0928\u0915\u094b \u0938\u092c-\u0915\u0940-\u0938\u092c \u0924\u094d\u0930\u093f\u0932\u094b\u0915\u0940 \u0926\u093f\u0916 \u0930\u0939\u0940 \u0939\u0948\u0964 \u0915\u0947\u0935\u0932 \u0924\u094d\u0930\u093f\u0932\u094b\u0915\u0940 \u0939\u0940 \u0928\u0939\u0940\u0902, \u092a\u094d\u0930\u0924\u094d\u092f\u0941\u0924 \u0924\u094d\u0930\u093f\u0932\u094b\u0915\u0940\u0915\u0947 \u0909\u0924\u094d\u092a\u093e\u0926\u0915 (\u092c\u094d\u0930\u0939\u094d\u092e\u093e), \u092a\u093e\u0932\u0915 (\u0935\u093f\u0937\u094d\u0923\u0941) \u0914\u0930 \u0938\u0902\u0939\u093e\u0930\u0915 (\u092e\u0939\u0947\u0936) \u092d\u0940 \u092a\u094d\u0930\u0924\u094d\u092f\u0915\u094d\u0937 \u0926\u0940\u0916 \u0930\u0939\u0947 \u0939\u0948\u0902\u0964 \u0905\u0924\u0903 \u0905\u0930\u094d\u091c\u0941\u0928 \u0935\u0930\u094d\u0923\u0928 \u0915\u0930\u0924\u0947 \u0939\u0948\u0902 \u0915\u093f \u092e\u0948\u0902 \u0938\u092e\u094d\u092a\u0942\u0930\u094d\u0923 \u0926\u0947\u0935\u094b\u0902\u0915\u094b, \u092a\u094d\u0930\u093e\u0923\u093f\u092f\u094b\u0902\u0915\u0947 \u0938\u092e\u0941\u0926\u093e\u092f\u094b\u0902\u0915\u094b \u0914\u0930 \u092c\u094d\u0930\u0939\u094d\u092e\u093e \u0924\u0925\u093e \u0936\u0919\u094d\u0915\u0930\u0915\u094b \u0926\u0947\u0916 \u0930\u0939\u093e \u0939\u0942\u0901\u0964"},{"text":"\u0905\u0928\u0947\u0915\u092c\u093e\u0939\u0942\u0926\u0930\u0935\u0915\u094d\u0924\u094d\u0930\u0928\u0947\u0924\u094d\u0930\u0902\\n\u092a\u0936\u094d\u092f\u093e\u092e\u093f \u0924\u094d\u0935\u093e\u0902 \u0938\u0930\u094d\u0935\u0924\u094b\u093d\u0928\u0928\u094d\u0924\u0930\u0942\u092a\u092e\u094d\u0964\\n\u0928\u093e\u0928\u094d\u0924\u0902 \u0928 \u092e\u0927\u094d\u092f\u0902 \u0928 \u092a\u0941\u0928\u0938\u094d\u0924\u0935\u093e\u0926\u093f\u0902\\n\u092a\u0936\u094d\u092f\u093e\u092e\u093f \u0935\u093f\u0936\u094d\u0935\u0947\u0936\u094d\u0935\u0930 \u0935\u093f\u0936\u094d\u0935\u0930\u0942\u092a\u0964\u096411.16\u0964\u0964","translation":"\u0964\u096411.16\u0964\u0964 \u0939\u0947 \u0935\u093f\u0936\u094d\u0935\u0930\u0942\u092a ! \u0939\u0947 \u0935\u093f\u0936\u094d\u0935\u0947\u0936\u094d\u0935\u0930\u0935 ! \u0906\u092a\u0915\u094b \u092e\u0948\u0902 \u0905\u0928\u0947\u0915 \u0939\u093e\u0925\u094b\u0902, \u092a\u0947\u091f\u094b\u0902, \u092e\u0941\u0916\u094b\u0902 \u0914\u0930 \u0928\u0947\u0924\u094d\u0930\u094b\u0902\u0935\u093e\u0932\u093e \u0924\u0925\u093e \u0938\u092c \u0913\u0930\u0938\u0947 \u0905\u0928\u0928\u094d\u0924 \u0930\u0942\u092a\u094b\u0902\u0935\u093e\u0932\u093e \u0926\u0947\u0916 \u0930\u0939\u093e \u0939\u0942\u0901\u0964 \u092e\u0948\u0902 \u0906\u092a\u0915\u0947 \u0928 \u0906\u0926\u093f\u0915\u094b, \u0928 \u092e\u0927\u094d\u092f\u0915\u094b \u0914\u0930 \u0928 \u0905\u0928\u094d\u0924\u0915\u094b \u0939\u0940 \u0926\u0947\u0916 \u0930\u0939\u093e \u0939\u0942\u0901\u0964","commentary":"\u0964\u096411.16\u0964\u0964\xa0\u0935\u094d\u092f\u093e\u0916\u094d\u092f\u093e--\'\u0935\u093f\u0936\u094d\u0935\u0930\u0942\u092a\',\u0935\u093f\u0936\u094d\u0935\u0947\u0936\u094d\u0935\u0930\'--\u0907\u0928 \u0926\u094b \u0938\u092e\u094d\u092c\u094b\u0927\u0928\u094b\u0902\u0915\u093e \u0924\u093e\u0924\u094d\u092a\u0930\u094d\u092f \u0939\u0948 \u0915\u093f \u092e\u0947\u0930\u0947\u0915\u094b \u091c\u094b \u0915\u0941\u091b \u092d\u0940 \u0926\u0940\u0916 \u0930\u0939\u093e \u0939\u0948, \u0935\u0939 \u0938\u092c \u0906\u092a \u0939\u0940 \u0939\u0948\u0902 \u0914\u0930 \u0907\u0938 \u0935\u093f\u0936\u094d\u0935\u0915\u0947 \u092e\u093e\u0932\u093f\u0915 \u092d\u0940 \u0906\u092a \u0939\u0940 \u0939\u0948\u0902\u0964 \u0938\u093e\u0902\u0938\u093e\u0930\u093f\u0915 \u092e\u0928\u0941\u0937\u094d\u092f\u094b\u0902\u0915\u0947 \u0936\u0930\u0940\u0930 \u0924\u094b \u091c\u0921 \u0939\u094b\u0924\u0947 \u0939\u0948\u0902 \u0914\u0930 \u0909\u0928\u092e\u0947\u0902 \u0936\u0930\u0940\u0930\u0940 \u091a\u0947\u0924\u0928 \u0939\u094b\u0924\u093e \u0939\u0948; \u092a\u0930\u0928\u094d\u0924\u0941 \u0906\u092a\u0915\u0947 \u0935\u093f\u0930\u093e\u091f\u094d\u0930\u0942\u092a\u092e\u0947\u0902 \u0936\u0930\u0940\u0930 \u0914\u0930 \u0936\u0930\u0940\u0930\u0940-- \u092f\u0947 \u0926\u094b \u0935\u093f\u092d\u093e\u0917 \u0928\u0939\u0940\u0902 \u0939\u0948\u0902\u0964 \u0935\u093f\u0930\u093e\u091f\u094d\u0930\u0942\u092a\u092e\u0947\u0902 \u0936\u0930\u0940\u0930 \u0914\u0930 \u0936\u0930\u0940\u0930\u0940\u0930\u0942\u092a\u0938\u0947 \u090f\u0915 \u0906\u092a \u0939\u0940 \u0939\u0948\u0902\u0964 \u0907\u0938\u0932\u093f\u092f\u0947 \u0935\u093f\u0930\u093e\u091f\u094d\u0930\u0942\u092a\u092e\u0947\u0902 \u0938\u092c \u0915\u0941\u091b \u091a\u093f\u0928\u094d\u092e\u092f-\u0939\u0940-\u091a\u093f\u0928\u094d\u092e\u092f \u0939\u0948\u0964 \u0924\u093e\u0924\u094d\u092a\u0930\u094d\u092f \u092f\u0939 \u0939\u0941\u0906 \u0915\u093f \u0905\u0930\u094d\u091c\u0941\u0928 \u0935\u093f\u0936\u094d\u0935\u0930\u0942\u092a \u0938\u092e\u094d\u092c\u094b\u0927\u0928 \u0926\u0947\u0915\u0930 \u092f\u0939 \u0915\u0939 \u0930\u0939\u0947 \u0939\u0948\u0902 \u0915\u093f \u0906\u092a \u0939\u0940 \u0936\u0930\u0940\u0930 \u0939\u0948\u0902 \u0914\u0930 \'\u0935\u093f\u0936\u094d\u0935\u0947\u0936\u094d\u0935\u0930\' \u0938\u092e\u094d\u092c\u094b\u0927\u0928 \u0926\u0947\u0915\u0930 \u092f\u0939 \u0915\u0939 \u0930\u0939\u0947 \u0939\u0948\u0902 \u0915\u093f \u0906\u092a \u0939\u0940 \u0936\u0930\u0940\u0930\u0940 (\u0936\u0930\u0940\u0930\u0915\u0947 \u092e\u093e\u0932\u093f\u0915) \u0939\u0948\u0902\u0964"},{"text":"\u0915\u093f\u0930\u0940\u091f\u093f\u0928\u0902 \u0917\u0926\u093f\u0928\u0902 \u091a\u0915\u094d\u0930\u093f\u0923\u0902 \u091a\\n\u0924\u0947\u091c\u094b\u0930\u093e\u0936\u093f\u0902 \u0938\u0930\u094d\u0935\u0924\u094b\u0926\u0940\u092a\u094d\u0924\u093f\u092e\u0928\u094d\u0924\u092e\u094d\u0964\\n\u092a\u0936\u094d\u092f\u093e\u092e\u093f \u0924\u094d\u0935\u093e\u0902 \u0926\u0941\u0930\u094d\u0928\u093f\u0930\u0940\u0915\u094d\u0937\u094d\u092f\u0902 \u0938\u092e\u0928\u094d\u0924\u093e\\n\u0926\u094d\u0926\u0940\u092a\u094d\u0924\u093e\u0928\u0932\u093e\u0930\u094d\u0915\u0926\u094d\u092f\u0941\u0924\u093f\u092e\u092a\u094d\u0930\u092e\u0947\u092f\u092e\u094d\u0964\u096411.17\u0964\u0964","translation":"\u0964\u096411.17\u0964\u0964 \u092e\u0948\u0902 \u0906\u092a\u0915\u094b \u0915\u093f\u0930\u0940\u091f, \u0917\u0926\u093e, \u091a\u0915\u094d\u0930 (\u0924\u0925\u093e \u0936\u0919\u094d\u0916 \u0914\u0930 \u092a\u0926\u094d\u092e) \u0927\u093e\u0930\u0923 \u0915\u093f\u092f\u0947 \u0939\u0941\u090f \u0926\u0947\u0916 \u0930\u0939\u093e \u0939\u0942\u0901\u0964 \u0906\u092a\u0915\u094b \u0924\u0947\u091c\u0915\u0940 \u0930\u093e\u0936\u093f, \u0938\u092c \u0913\u0930 \u092a\u094d\u0930\u0915\u093e\u0936 \u0915\u0930\u0928\u0947\u0935\u093e\u0932\u0947, \u0926\u0947\u0926\u0940\u092a\u094d\u092f\u092e\u093e\u0928 \u0905\u0917\u094d\u0928\u093f \u0924\u0925\u093e \u0938\u0942\u0930\u094d\u092f\u0915\u0947 \u0938\u092e\u093e\u0928 \u0915\u093e\u0928\u094d\u0924\u093f\u0935\u093e\u0932\u0947, \u0928\u0947\u0924\u094d\u0930\u094b\u0902\u0915\u0947 \u0926\u094d\u0935\u093e\u0930\u093e \u0915\u0920\u093f\u0928\u0924\u093e\u0938\u0947 \u0926\u0947\u0916\u0947 \u091c\u093e\u0928\u0947\u092f\u094b\u0917\u094d\u092f \u0914\u0930 \u0938\u092c \u0924\u0930\u092b\u0938\u0947 \u0905\u092a\u094d\u0930\u092e\u0947\u092f\u0938\u094d\u0935\u0930\u0942\u092a \u0926\u0947\u0916 \u0930\u0939\u093e \u0939\u0942\u0901\u0964","commentary":"\u0964\u096411.17\u0964\u0964\xa0\u0935\u094d\u092f\u093e\u0916\u094d\u092f\u093e--\'\u0915\u093f\u0930\u0940\u091f\u093f\u0928\u0902 \u0917\u0926\u093f\u0928\u0902 \u091a\u0915\u094d\u0930\u093f\u0923\u0902 \u091a\'--\u0906\u092a\u0915\u094b \u092e\u0948\u0902 \u0915\u093f\u0930\u0940\u091f, \u0917\u0926\u093e \u0914\u0930 \u091a\u0915\u094d\u0930 \u0927\u093e\u0930\u0923 \u0915\u093f\u092f\u0947 \u0939\u0941\u090f \u0926\u0947\u0916 \u0930\u0939\u093e \u0939\u0942\u0901\u0964 \u092f\u0939\u093e\u0901 \'\u091a\' \u092a\u0926\u0938\u0947 \u0936\u0919\u094d\u0915 \u0914\u0930 \u092a\u0926\u094d\u092e\u0915\u094b \u092d\u0940 \u0932\u0947 \u0932\u0947\u0928\u093e \u091a\u093e\u0939\u093f\u092f\u0947\u0964 \u0907\u0938\u0915\u093e \u0924\u093e\u0924\u094d\u092a\u0930\u094d\u092f \u0910\u0938\u093e \u092e\u093e\u0932\u0942\u092e \u0926\u0947\u0924\u093e \u0939\u0948 \u0915\u093f \u0905\u0930\u094d\u091c\u0941\u0928\u0915\u094b \u0935\u093f\u0936\u094d\u0935\u0930\u0942\u092a\u092e\u0947\u0902 \u092d\u0917\u0935\u093e\u0928\u094d \u0935\u093f\u0937\u094d\u0923\u0941\u0915\u093e \u091a\u0924\u0941\u0930\u094d\u092d\u0941\u091c\u0930\u0942\u092a \u092d\u0940 \u0926\u0940\u0916 \u0930\u0939\u093e \u0939\u0948\u0964\\n\'\u0924\u0947\u091c\u094b\u0930\u093e\u0936\u093f\u092e\u094d\'--\u0906\u092a \u0924\u0947\u091c\u0915\u0940 \u0930\u093e\u0936\u093f \u0939\u0948\u0902, \u092e\u093e\u0928\u094b \u0924\u0947\u091c\u0915\u093e \u0938\u092e\u0942\u0939-\u0915\u093e-\u0938\u092e\u0942\u0939 (\u0905\u0928\u0928\u094d\u0924 \u0924\u0947\u091c) \u0907\u0915\u091f\u094d\u0920\u093e \u0939\u094b \u0917\u092f\u093e \u0939\u094b\u0964 \u0907\u0938\u0915\u093e \u092a\u0939\u0932\u0947 \u0938\u091e\u094d\u091c\u092f\u0928\u0947 \u0935\u0930\u094d\u0923\u0928 \u0915\u093f\u092f\u093e \u0939\u0948 \u0915\u093f \u0906\u0915\u093e\u0936\u092e\u0947\u0902 \u0939\u091c\u093e\u0930\u094b\u0902 \u0938\u0942\u0930\u094d\u092f \u090f\u0915 \u0938\u093e\u0926 \u0909\u0926\u093f\u0924 \u0939\u094b\u0928\u0947\u092a\u0930 \u092d\u0940 \u092d\u0917\u0935\u093e\u0928\u094d\u0915\u0947 \u0924\u0947\u091c\u0915\u0940 \u092c\u0930\u093e\u092c\u0930\u0940 \u0928\u0939\u0940\u0902 \u0915\u0930 \u0938\u0915\u0924\u0947 (11\u0964 12)\u0964 \u0910\u0938\u0947 \u0906\u092a \u092a\u094d\u0930\u0915\u093e\u0936\u0938\u094d\u0935\u0930\u0942\u092a \u0939\u0948\u0902\u0964"},{"text":"\u0924\u094d\u0935\u092e\u0915\u094d\u0937\u0930\u0902 \u092a\u0930\u092e\u0902 \u0935\u0947\u0926\u093f\u0924\u0935\u094d\u092f\u0902\\n\u0924\u094d\u0935\u092e\u0938\u094d\u092f \u0935\u093f\u0936\u094d\u0935\u0938\u094d\u092f \u092a\u0930\u0902 \u0928\u093f\u0927\u093e\u0928\u092e\u094d\u0964\\n\u0924\u094d\u0935\u092e\u0935\u094d\u092f\u092f\u0903 \u0936\u093e\u0936\u094d\u0935\u0924\u0927\u0930\u094d\u092e\u0917\u094b\u092a\u094d\u0924\u093e\\n\u0938\u0928\u093e\u0924\u0928\u0938\u094d\u0924\u094d\u0935\u0902 \u092a\u0941\u0930\u0941\u0937\u094b \u092e\u0924\u094b \u092e\u0947\u0964\u096411.18\u0964\u0964","translation":"\u0964\u096411.18\u0964\u0964 \u0906\u092a \u0939\u0940 \u091c\u093e\u0928\u0928\u0947\u092f\u094b\u0917\u094d\u092f \u092a\u0930\u092e \u0905\u0915\u094d\u0937\u0930 (\u0905\u0915\u094d\u0937\u0930\u092c\u094d\u0930\u0939\u094d\u092e) \u0939\u0948\u0902, \u0906\u092a \u0939\u0940 \u0907\u0938 \u0938\u092e\u094d\u092a\u0942\u0930\u094d\u0923 \u0935\u093f\u0936\u094d\u0935\u0915\u0947 \u092a\u0930\u092e \u0906\u0936\u094d\u0930\u092f \u0939\u0948\u0902, \u0906\u092a \u0939\u0940 \u0938\u0928\u093e\u0924\u0928\u0927\u0930\u094d\u092e\u0915\u0947 \u0930\u0915\u094d\u0937\u0915 \u0939\u0948\u0902 \u0914\u0930 \u0906\u092a \u0939\u0940 \u0905\u0935\u093f\u0928\u093e\u0936\u0940 \u0938\u0928\u093e\u0924\u0928 \u092a\u0941\u0930\u0941\u0937 \u0939\u0948\u0902 -- \u0910\u0938\u093e \u092e\u0948\u0902 \u092e\u093e\u0928\u0924\u093e \u0939\u0942\u0901\u0964","commentary":"\u0964\u096411.18\u0964\u0964\xa0\u0935\u094d\u092f\u093e\u0916\u094d\u092f\u093e--\'\u0924\u094d\u0935\u092e\u0915\u094d\u0937\u0930\u0902 \u092a\u0930\u092e\u0902 \u0935\u0947\u0926\u093f\u0924\u0935\u094d\u092f\u092e\u094d\'--  \u0935\u0947\u0926\u094b\u0902, \u0936\u093e\u0938\u094d\u0924\u094d\u0930\u094b\u0902, \u092a\u0941\u0930\u093e\u0923\u094b\u0902, \u0938\u094d\u092e\u0943\u0924\u093f\u092f\u094b\u0902, \u0938\u0928\u094d\u0924\u094b\u0902\u0915\u0940 \u0935\u093e\u0923\u093f\u092f\u094b\u0902 \u0914\u0930 \u0924\u0924\u094d\u0924\u094d\u0935\u091c\u094d\u091e \u091c\u0940\u0935\u0928\u094d\u092e\u0941\u0915\u094d\u0924 \u092e\u0939\u093e\u092a\u0941\u0930\u0941\u0937\u094b\u0902\u0926\u094d\u0935\u093e\u0930\u093e \u091c\u093e\u0928\u0928\u0947\u092f\u094b\u0917\u094d\u092f \u091c\u094b \u092a\u0930\u092e\u093e\u0928\u0928\u094d\u0926\u0938\u094d\u0935\u0930\u0942\u092a \u0905\u0915\u094d\u0937\u0930\u092c\u094d\u0930\u0939\u094d\u092e \u0939\u0948, \u091c\u093f\u0938\u0915\u094b \u0928\u093f\u0930\u094d\u0917\u0941\u0923-\u0928\u093f\u0930\u093e\u0915\u093e\u0930 \u0915\u0939\u0924\u0947 \u0939\u0948\u0902, \u0935\u0947 \u0906\u092a \u0939\u0940 \u0939\u0948\u0902\u0964"},{"text":"\u0905\u0928\u093e\u0926\u093f\u092e\u0927\u094d\u092f\u093e\u0928\u094d\u0924\u092e\u0928\u0928\u094d\u0924\u0935\u0940\u0930\u094d\u092f\\n\u092e\u0928\u0928\u094d\u0924\u092c\u093e\u0939\u0941\u0902 \u0936\u0936\u093f\u0938\u0942\u0930\u094d\u092f\u0928\u0947\u0924\u094d\u0930\u092e\u094d\u0964\\n\u092a\u0936\u094d\u092f\u093e\u092e\u093f \u0924\u094d\u0935\u093e\u0902 \u0926\u0940\u092a\u094d\u0924\u0939\u0941\u0924\u093e\u0936\u0935\u0915\u094d\u0924\u094d\u0930\u092e\u094d\\n\u0938\u094d\u0935\u0924\u0947\u091c\u0938\u093e \u0935\u093f\u0936\u094d\u0935\u092e\u093f\u0926\u0902 \u0924\u092a\u0928\u094d\u0924\u092e\u094d\u0964\u096411.19\u0964\u0964","translation":"\u0964\u096411.19\u0964\u0964 \u0906\u092a\u0915\u094b \u092e\u0948\u0902 \u0906\u0926\u093f, \u092e\u0927\u094d\u092f \u0914\u0930 \u0905\u0928\u094d\u0924\u0938\u0947 \u0930\u0939\u093f\u0924, \u0905\u0928\u0928\u094d\u0924 \u092a\u094d\u0930\u092d\u093e\u0935\u0936\u093e\u0932\u0940, \u0905\u0928\u0928\u094d\u0924 \u092d\u0941\u091c\u093e\u0913\u0902\u0935\u093e\u0932\u0947, \u091a\u0928\u094d\u0926\u094d\u0930 \u0914\u0930 \u0938\u0942\u0930\u094d\u092f\u0930\u0942\u092a \u0928\u0947\u0924\u094d\u0930\u094b\u0935\u093e\u0932\u0947, \u092a\u094d\u0930\u091c\u094d\u0935\u0932\u093f\u0924 \u0905\u0917\u094d\u0928\u093f\u0915\u0947 \u0938\u092e\u093e\u0928 \u092e\u0941\u0916\u094b\u0902\u0935\u093e\u0932\u0947 \u0914\u0930 \u0905\u092a\u0928\u0947 \u0924\u0947\u091c\u0938\u0947 \u0938\u0902\u0938\u093e\u0930\u0915\u094b \u0938\u0902\u0924\u092a\u094d\u0924 \u0915\u0930\u0924\u0947 \u0939\u0941\u090f \u0926\u0947\u0916 \u0930\u0939\u093e \u0939\u0942\u0901\u0964","commentary":"\u0964\u096411.19\u0964\u0964\xa0\u0935\u094d\u092f\u093e\u0916\u094d\u092f\u093e--\'\u0905\u0928\u093e\u0926\u093f\u092e\u0927\u094d\u092f\u093e\u0928\u094d\u0924\u092e\u094d\'--\u0906\u092a \u0906\u0926\u093f, \u092e\u0927\u094d\u092f \u0914\u0930 \u0905\u0928\u094d\u0924\u0938\u0947 \u0930\u0939\u093f\u0924 \u0939\u0948\u0902 \u0905\u0930\u094d\u0925\u093e\u0924\u094d \u0906\u092a\u0915\u0940 \u0915\u094b\u0908 \u0938\u0940\u092e\u093e \u0928\u0939\u0940\u0902 \u0939\u0948\u0964\u0938\u094b\u0932\u0939\u0935\u0947\u0902 \u0936\u094d\u0932\u094b\u0915\u092e\u0947\u0902 \u092d\u0940 \u0905\u0930\u094d\u091c\u0941\u0928\u0928\u0947 \u0915\u0939\u093e \u0939\u0948 \u0915\u093f \u092e\u0948\u0902 \u0906\u092a\u0915\u0947 \u0906\u0926\u093f, \u092e\u0927\u094d\u092f \u0914\u0930 \u0905\u0928\u094d\u0924\u0915\u094b \u0928\u0939\u0940\u0902 \u0926\u0947\u0916\u0924\u093e \u0939\u0942\u0901\u0964 \u0935\u0939\u093e\u0901 \u0924\u094b,\u0926\u0947\u0936\u0915\u0943\u0924 \u0905\u0928\u0928\u094d\u0924\u0924\u093e\u0915\u093e \u0935\u0930\u094d\u0923\u0928 \u0939\u0941\u0906 \u0939\u0948 \u0914\u0930 \u092f\u0939\u093e\u0901 \u0915\u093e\u0932\u0915\u0943\u0924 \u0905\u0928\u0928\u094d\u0924\u0924\u093e\u0915\u093e \u0935\u0930\u094d\u0923\u0928 \u0939\u0941\u0906 \u0939\u0948\u0964 \u0924\u093e\u0924\u094d\u092a\u0930\u094d\u092f \u0939\u0948 \u0915\u093f \'\u0926\u0947\u0936\u0915\u0943\u0924\' \'\u0915\u093e\u0932\u0915\u0943\u0924\' \u0935\u0938\u094d\u0924\u0941\u0915\u0943\u0924 \u0906\u0926\u093f \u0915\u093f\u0938\u0940 \u0924\u0930\u0939\u0938\u0947 \u092d\u0940 \u0906\u092a\u0915\u0940 \u0938\u0940\u092e\u093e \u0928\u0939\u0940\u0902 \u0939\u0948\u0964 \u0938\u092e\u094d\u092a\u0942\u0930\u094d\u0923 \u0926\u0947\u0936, \u0915\u093e\u0932 \u0906\u0926\u093f \u0906\u092a\u0915\u0947 \u0905\u0928\u094d\u0924\u0930\u094d\u0917\u0924 \u0939\u0948\u0902, \u092b\u093f\u0930 \u0906\u092a \u0926\u0947\u0936, \u0915\u093e\u0932 \u0906\u0926\u093f\u0915\u0947 \u0905\u0928\u094d\u0924\u0930\u094d\u0917\u0924 \u0915\u0948\u0938\u0947 \u0906 \u0938\u0915\u0924\u0947 \u0939\u0948\u0902? \u0905\u0930\u094d\u0925\u093e\u0924\u094d \u0926\u0947\u0936, \u0915\u093e\u0932 \u0906\u0926\u093f \u0915\u093f\u0938\u0940\u0915\u0947 \u092d\u0940 \u0906\u0927\u093e\u0930\u092a\u0930 \u0906\u092a\u0915\u094b \u092e\u093e\u092a\u093e \u0928\u0939\u0940\u0902 \u091c\u093e \u0938\u0915\u0924\u093e\u0964"},{"text":"\u0926\u094d\u092f\u093e\u0935\u093e\u092a\u0943\u0925\u093f\u0935\u094d\u092f\u094b\u0930\u093f\u0926\u092e\u0928\u094d\u0924\u0930\u0902 \u0939\u093f\\n\u0935\u094d\u092f\u093e\u092a\u094d\u0924\u0902 \u0924\u094d\u0935\u092f\u0948\u0915\u0947\u0928 \u0926\u093f\u0936\u0936\u094d\u091a \u0938\u0930\u094d\u0935\u093e\u0903\u0964\\n\u0926\u0943\u0937\u094d\u091f\u094d\u0935\u093e\u093d\u0926\u094d\u092d\u0941\u0924\u0902 \u0930\u0942\u092a\u092e\u0941\u0917\u094d\u0930\u0902 \u0924\u0935\u0947\u0926\u0902\\n\u0932\u094b\u0915\u0924\u094d\u0930\u092f\u0902 \u092a\u094d\u0930\u0935\u094d\u092f\u0925\u093f\u0924\u0902 \u092e\u0939\u093e\u0924\u094d\u092e\u0928\u094d\u0964\u096411.20\u0964\u0964","translation":"\u0964\u096411.20\u0964\u0964 \u0939\u0947 \u092e\u0939\u093e\u0924\u094d\u092e\u0928\u094d ! \u092f\u0939 \u0938\u094d\u0935\u0930\u094d\u0917 \u0914\u0930 \u092a\u0943\u0925\u094d\u0935\u0940\u0915\u0947 \u092c\u0940\u091a\u0915\u093e \u0905\u0928\u094d\u0924\u0930\u093e\u0932 \u0914\u0930 \u0938\u092e\u094d\u092a\u0942\u0930\u094d\u0923 \u0926\u093f\u0936\u093e\u090f\u0901 \u090f\u0915 \u0906\u092a\u0938\u0947 \u0939\u0940 \u092a\u0930\u093f\u092a\u0942\u0930\u094d\u0923 \u0939\u0948\u0902\u0964 \u0906\u092a\u0915\u0947 \u0907\u0938 \u0905\u0926\u094d\u092d\u0941\u0924 \u0914\u0930 \u0909\u0917\u094d\u0930\u0930\u0942\u092a\u0915\u094b \u0926\u0947\u0916\u0915\u0930 \u0924\u0940\u0928\u094b\u0902 \u0932\u094b\u0915 \u0935\u094d\u092f\u0925\u093f\u0924 (\u0935\u094d\u092f\u093e\u0915\u0941\u0932) \u0939\u094b \u0930\u0939\u0947 \u0939\u0948\u0902\u0964","commentary":"\u0964\u096411.20\u0964\u0964\xa0\u0935\u094d\u092f\u093e\u0916\u094d\u092f\u093e--\'\u092e\u0939\u093e\u0924\u094d\u092e\u0928\u094d\'--  \u0907\u0938 \u0938\u092e\u094d\u092c\u094b\u0927\u0928\u0915\u093e \u0924\u093e\u0924\u094d\u092a\u0930\u094d\u092f \u0939\u0948 \u0915\u093f \u0906\u092a\u0915\u0947 \u0938\u094d\u0935\u0930\u0942\u092a\u0915\u0947 \u0938\u092e\u093e\u0928 \u0915\u093f\u0938\u0940\u0915\u093e \u0938\u094d\u0935\u0930\u0942\u092a \u0939\u0941\u0906 \u0928\u0939\u0940\u0902, \u0939\u0948 \u0928\u0939\u0940\u0902, \u0939\u094b\u0917\u093e \u0928\u0939\u0940\u0902 \u0914\u0930 \u0939\u094b \u0938\u0915\u0924\u093e \u092d\u0940 \u0928\u0939\u0940\u0902\u0964 \u0907\u0938\u0932\u093f\u092f\u0947 \u0906\u092a \u092e\u0939\u093e\u0924\u094d\u092e\u093e \u0905\u0930\u094d\u0925\u093e\u0924\u094d \u092e\u0939\u093e\u0928\u094d \u0938\u094d\u0935\u0930\u0942\u092a\u0935\u093e\u0932\u0947 \u0939\u0948\u0902\u0964"},{"text":"\u0905\u092e\u0940 \u0939\u093f \u0924\u094d\u0935\u093e\u0902 \u0938\u0941\u0930\u0938\u0919\u094d\u0918\u093e\u0903 \u0935\u093f\u0936\u0928\u094d\u0924\u093f\\n\u0915\u0947\u091a\u093f\u0926\u094d\u092d\u0940\u0924\u093e\u0903 \u092a\u094d\u0930\u093e\u091e\u094d\u091c\u0932\u092f\u094b \u0917\u0943\u0923\u0928\u094d\u0924\u093f\u0964\\n\u0938\u094d\u0935\u0938\u094d\u0924\u0940\u0924\u094d\u092f\u0941\u0915\u094d\u0924\u094d\u0935\u093e \u092e\u0939\u0930\u094d\u0937\u093f\u0938\u093f\u0926\u094d\u0927\u0938\u0919\u094d\u0918\u093e\u0903\\n\u0938\u094d\u0924\u0941\u0935\u0928\u094d\u0924\u093f \u0924\u094d\u0935\u093e\u0902 \u0938\u094d\u0924\u0941\u0924\u093f\u092d\u093f\u0903 \u092a\u0941\u0937\u094d\u0915\u0932\u093e\u092d\u093f\u0903\u0964\u096411.21\u0964\u0964","translation":"\u0964\u096411.21\u0964\u0964 \u0935\u0947 \u0939\u0940 \u0926\u0947\u0935\u0924\u093e\u0913\u0902\u0915\u0947 \u0938\u092e\u0941\u0926\u093e\u092f \u0906\u092a\u092e\u0947\u0902 \u092a\u094d\u0930\u0935\u093f\u0937\u094d\u091f \u0939\u094b \u0930\u0939\u0947 \u0939\u0948\u0902\u0964 \u0909\u0928\u092e\u0947\u0902\u0938\u0947 \u0915\u0908 \u0924\u094b \u092d\u092f\u092d\u0940\u0924 \u0939\u094b\u0915\u0930 \u0939\u093e\u0925 \u091c\u094b\u0921\u093c\u0947 \u0939\u0941\u090f \u0906\u092a\u0915\u0947 \u0928\u093e\u092e\u094b\u0902 \u0914\u0930 \u0917\u0941\u0923\u094b\u0902\u0915\u093e \u0915\u0940\u0930\u094d\u0924\u0928 \u0915\u0930 \u0930\u0939\u0947 \u0939\u0948\u0902\u0964 \u092e\u0939\u0930\u094d\u0937\u093f\u092f\u094b\u0902 \u0914\u0930 \u0938\u093f\u0926\u094d\u0927\u094b\u0902\u0915\u0947 \u0938\u092e\u0941\u0926\u093e\u092f \'\u0915\u0932\u094d\u092f\u093e\u0923 \u0939\u094b ! \u092e\u0919\u094d\u0917\u0932 \u0939\u094b !\' \u0910\u0938\u093e \u0915\u0939\u0915\u0930 \u0909\u0924\u094d\u0924\u092e-\u0909\u0924\u094d\u0924\u092e \u0938\u094d\u0924\u094b\u0924\u094d\u0930\u094b\u0902\u0915\u0947 \u0926\u094d\u0935\u093e\u0930\u093e \u0906\u092a\u0915\u0940 \u0938\u094d\u0924\u0941\u0924\u093f \u0915\u0930 \u0930\u0939\u0947 \u0939\u0948\u0902\u0964","commentary":"\u0964\u096411.21\u0964\u0964\xa0\u0935\u094d\u092f\u093e\u0916\u094d\u092f\u093e--\'\u0905\u092e\u0940 \u0939\u093f \u0924\u094d\u0935\u093e\u0902 \u0938\u0941\u0930\u0938\u0919\u094d\u0918\u093e \u0935\u093f\u0936\u0928\u094d\u0924\u093f\'--\u091c\u092c \u0905\u0930\u094d\u091c\u0941\u0928 \u0938\u094d\u0935\u0930\u094d\u0917\u092e\u0947\u0902 \u0917\u092f\u0947 \u0925\u0947, \u0909\u0938 \u0938\u092e\u092f \u0909\u0928\u0915\u093e \u091c\u093f\u0928 \u0926\u0947\u0935\u0924\u093e\u0913\u0902\u0938\u0947 \u092a\u0930\u093f\u091a\u092f \u0939\u0941\u0906 \u0925\u093e, \u0909\u0928\u094d\u0939\u0940\u0902 \u0926\u0947\u0935\u0924\u093e\u0913\u0902\u0915\u0947 \u0932\u093f\u092f\u0947 \u092f\u0939\u093e\u0901 \u0905\u0930\u094d\u091c\u0941\u0928 \u0915\u0939 \u0930\u0939\u0947 \u0939\u0948\u0902 \u0915\u093f \u0935\u0947 \u0939\u0940 \u0926\u0947\u0935\u0924\u093e\u0932\u094b\u0917 \u0906\u092a\u0915\u0947 \u0938\u094d\u0935\u0930\u0942\u092a\u092e\u0947\u0902 \u092a\u094d\u0930\u0935\u093f\u0937\u094d\u091f \u0939\u094b\u0924\u0947 \u0939\u0941\u090f \u0926\u0940\u0916 \u0930\u0939\u0947 \u0939\u0948\u0902\u0964 \u092f\u0947 \u0938\u092d\u0940 \u0926\u0947\u0935\u0924\u093e \u0906\u092a\u0938\u0947 \u0939\u0940 \u0909\u0924\u094d\u092a\u0928\u094d\u0928 \u0939\u094b\u0924\u0947 \u0939\u0948\u0902, \u0906\u092a\u092e\u0947\u0902 \u0939\u0940 \u0938\u094d\u0925\u093f\u0924 \u0930\u0939\u0924\u0947 \u0939\u0948\u0902 \u0914\u0930 \u0906\u092a\u092e\u0947\u0902 \u0939\u0940 \u092a\u094d\u0930\u0935\u093f\u0937\u094d\u091f \u0939\u094b\u0924\u0947 \u0939\u0948\u0902\u0964"},{"text":"\u0930\u0941\u0926\u094d\u0930\u093e\u0926\u093f\u0924\u094d\u092f\u093e \u0935\u0938\u0935\u094b \u092f\u0947 \u091a \u0938\u093e\u0927\u094d\u092f\u093e\\n\u0935\u093f\u0936\u094d\u0935\u0947\u093d\u0936\u094d\u093f\u0935\u0928\u094c \u092e\u0930\u0941\u0924\u0936\u094d\u091a\u094b\u0937\u094d\u092e\u092a\u093e\u0936\u094d\u091a\u0964\\n\u0917\u0928\u094d\u0927\u0930\u094d\u0935\u092f\u0915\u094d\u0937\u093e\u0938\u0941\u0930\u0938\u093f\u0926\u094d\u0927\u0938\u0919\u094d\u0918\u093e\\n\u0935\u0940\u0915\u094d\u0937\u0928\u094d\u0924\u0947 \u0924\u094d\u0935\u093e\u0902 \u0935\u093f\u0938\u094d\u092e\u093f\u0924\u093e\u0936\u094d\u091a\u0948\u0935 \u0938\u0930\u094d\u0935\u0947\u0964\u096411.22\u0964\u0964","translation":"\u0964\u096411.22\u0964\u0964 \u091c\u094b \u0917\u094d\u092f\u093e\u0930\u0939 \u0930\u0941\u0926\u094d\u0930, \u092c\u093e\u0930\u0939 \u0906\u0926\u093f\u0924\u094d\u092f, \u0906\u0920 \u0935\u0938\u0941, \u092c\u093e\u0930\u0939 \u0938\u093e\u0927\u094d\u092f\u0917\u0923, \u0926\u0938 \u0935\u093f\u0936\u094d\u0935\u0947\u0926\u0947\u0935 \u0914\u0930 \u0926\u094b \u0905\u0936\u094d\u0935\u093f\u0928\u0940\u0915\u0941\u092e\u093e\u0930, \u0909\u0928\u091a\u093e\u0938 \u092e\u0930\u0941\u0926\u094d\u0917\u0923, \u0938\u093e\u0924 \u092a\u093f\u0924\u0943\u0917\u0923 \u0924\u0925\u093e \u0917\u0928\u094d\u0927\u0930\u094d\u0935, \u092f\u0915\u094d\u0937, \u0905\u0938\u0941\u0930 \u0914\u0930 \u0938\u093f\u0926\u094d\u0927\u094b\u0902\u0915\u0947 \u0938\u092e\u0941\u0926\u093e\u092f \u0939\u0948\u0902, \u0935\u0947 \u0938\u092d\u0940 \u091a\u0915\u093f\u0924 \u0939\u094b\u0915\u0930 \u0906\u092a\u0915\u094b \u0926\u0947\u0916 \u0930\u0939\u0947 \u0939\u0948\u0902\u0964","commentary":"\u0964\u096411.22\u0964\u0964\xa0\u0935\u094d\u092f\u093e\u0916\u094d\u092f\u093e--\'\u0930\u0941\u0926\u094d\u0930\u093e\u0926\u093f\u0924\u094d\u092f\u093e \u0935\u0938\u0935\u094b \u092f\u0947 \u091a \u0938\u093e\u0927\u094d\u092f\u093e \u0935\u093f\u0936\u094d\u0935\u0947\u093d\u0936\u094d\u0935\u093f\u0928\u094c \u092e\u0930\u0941\u0924\u0936\u094d\u091a\u094b\u0937\u094d\u092e\u092a\u093e\u0936\u094d\u091a\'--\u0917\u094d\u092f\u093e\u0930\u0939 \u0930\u0941\u0926\u094d\u0930, \u092c\u093e\u0930\u0939 \u0906\u0926\u093f\u0924\u094d\u092f, \u0906\u0920 \u0935\u0938\u0941, \u0926\u094b \u0905\u0936\u094d\u0935\u093f\u0928\u0940\u0915\u0941\u092e\u093e\u0930 \u0914\u0930 \u0909\u0928\u091a\u093e\u0938 \u092e\u0930\u0941\u0926\u094d\u0917\u0923 -- \u0907\u0928 \u0938\u092c\u0915\u0947 \u0928\u093e\u092e \u0907\u0938\u0940 \u0905\u0927\u094d\u092f\u093e\u092f\u0915\u0947 \u091b\u0920\u0947 \u0936\u094d\u0932\u094b\u0915\u0915\u0940 \u0935\u094d\u092f\u093e\u0916\u094d\u092f\u093e\u092e\u0947\u0902 \u0926\u093f\u092f\u0947 \u0917\u092f\u0947 \u0939\u0948\u0902, \u0907\u0938\u0932\u093f\u092f\u0947 \u0935\u0939\u093e\u0901 \u0926\u0947\u0916 \u0932\u0947\u0928\u093e \u091a\u093e\u0939\u093f\u092f\u0947\u0964\\n\u092e\u0928, \u0905\u0928\u0941\u092e\u0928\u094d\u0924\u093e, \u092a\u094d\u0930\u093e\u0923, \u0928\u0930, \u092f\u093e\u0928, \u091a\u093f\u0924\u094d\u0924\u093f, \u0939\u092f, \u0928\u092f, \u0939\u0902\u0938, \u0928\u093e\u0930\u093e\u092f\u0923, \u092a\u094d\u0930\u092d\u0935 \u0914\u0930 \u0935\u093f\u092d\u0941 -- \u092f\u0947 \u092c\u093e\u0930\u0939 \'\u0938\u093e\u0927\u094d\u092f\' \u0939\u0948\u0902 (\u0935\u093e\u092f\u0941\u092a\u0941\u0930\u093e\u0923 66\u0964 15 16)\u0964\\n\u0915\u094d\u0930\u0924\u0941, \u0926\u0915\u094d\u0937, \u0936\u094d\u0930\u0935, \u0938\u0924\u094d\u092f, \u0915\u093e\u0932, \u0915\u093e\u092e, \u0927\u0941\u0928\u093f, \u0915\u0941\u0930\u0941\u0935\u093e\u0928\u094d, \u092a\u094d\u0930\u092d\u0935\u093e\u0928\u094d \u0914\u0930 \u0930\u094b\u091a\u092e\u093e\u0928 -- \u092f\u0947 \u0926\u0938 \'\u0935\u093f\u0936\u094d\u0935\u0947\u0926\u0947\u0935\' \u0939\u0948\u0902 (\u0935\u093e\u092f\u0941\u092a\u0941\u0930\u093e\u0923 66\u0964 31 32)\u0964\\n\u0915\u0935\u094d\u092f\u0935\u093e\u0939 \u0905\u0928\u0932, \u0938\u094b\u092e, \u092f\u092e, \u0905\u0930\u094d\u092f\u092e\u093e, \u0905\u0917\u094d\u0928\u093f\u0937\u094d\u0935\u093e\u0924\u094d\u0924 \u0914\u0930 \u092c\u0930\u094d\u0939\u093f\u0937\u0924\u094d -- \u092f\u0947 \u0938\u093e\u0924 \'\u092a\u093f\u0924\u0930\' \u0939\u0948\u0902 (\u0936\u093f\u0935\u092a\u0941\u0930\u093e\u0923, \u0927\u0930\u094d\u092e0 63\u0964 2)\u0964 \u090a\u0937\u094d\u092e \u0905\u0930\u094d\u0925\u093e\u0924\u094d \u0917\u0930\u092e \u0905\u0928\u094d\u0928 \u0916\u093e\u0928\u0947\u0915\u0947 \u0915\u093e\u0930\u0923 \u092a\u093f\u0924\u0930\u094b\u0902\u0915\u093e \u0928\u093e\u092e \'\u090a\u0937\u094d\u092e\u092a\u093e\' \u0939\u0948\u0964"},{"text":"\u0930\u0942\u092a\u0902 \u092e\u0939\u0924\u094d\u0924\u0947 \u092c\u0939\u0941\u0935\u0915\u094d\u0924\u094d\u0930\u0928\u0947\u0924\u094d\u0930\u0902\\n\u092e\u0939\u093e\u092c\u093e\u0939\u094b \u092c\u0939\u0941\u092c\u093e\u0939\u0942\u0930\u0941\u092a\u093e\u0926\u092e\u094d\u0964\\n\u092c\u0939\u0942\u0926\u0930\u0902 \u092c\u0939\u0941\u0926\u0902\u0937\u094d\u091f\u094d\u0930\u093e\u0915\u0930\u093e\u0932\u0902\\n\u0926\u0943\u0937\u094d\u091f\u094d\u0935\u093e \u0932\u094b\u0915\u093e\u0903 \u092a\u094d\u0930\u0935\u094d\u092f\u0925\u093f\u0924\u093e\u0938\u094d\u0924\u0925\u093e\u093d\u0939\u092e\u094d\u0964\u096411.23\u0964\u0964","translation":"\u0964\u096411.23\u0964\u0964 \u0939\u0947 \u092e\u0939\u093e\u092c\u093e\u0939\u094b! \u0906\u092a\u0915\u0947 \u092c\u0939\u0941\u0924 \u092e\u0941\u0916\u094b\u0902 \u0914\u0930 \u0928\u0947\u0924\u094d\u0930\u094b\u0902\u0935\u093e\u0932\u0947, \u092c\u0939\u0941\u0924 \u092d\u0941\u091c\u093e\u0913\u0902, \u091c\u0902\u0918\u093e\u0913\u0902 \u0914\u0930 \u091a\u0930\u0923\u094b\u0902\u0935\u093e\u0932\u0947, \u092c\u0939\u0941\u0924 \u0909\u0926\u0930\u094b\u0902\u0935\u093e\u0932\u0947, \u092c\u0939\u0941\u0924 \u0935\u093f\u0915\u0930\u093e\u0932 \u0926\u093e\u0922\u093c\u094b\u0902\u0935\u093e\u0932\u0947 \u092e\u0939\u093e\u0928\u094d \u0930\u0942\u092a\u0915\u094b \u0926\u0947\u0916\u0915\u0930 \u0938\u092c \u092a\u094d\u0930\u093e\u0923\u0940 \u0935\u094d\u092f\u0925\u093f\u0924 \u0939\u094b \u0930\u0939\u0947 \u0939\u0948\u0902 \u0924\u0925\u093e \u092e\u0948\u0902 \u092d\u0940 \u0935\u094d\u092f\u0925\u093f\u0924 \u0939\u094b \u0930\u0939\u093e \u0939\u0942\u0901\u0964","commentary":"\u0964\u096411.23\u0964\u0964\xa0\u0935\u094d\u092f\u093e\u0916\u094d\u092f\u093e--[\u092a\u0928\u094d\u0926\u094d\u0930\u0939\u0935\u0947\u0902\u0938\u0947 \u0905\u0920\u093e\u0930\u0939\u0935\u0947\u0902 \u0936\u094d\u0932\u094b\u0915\u0924\u0915 \u0935\u093f\u0936\u094d\u0935\u0930\u0942\u092a\u092e\u0947\u0902 \'\u0926\u0947\u0935\'-\u0930\u0942\u092a\u0915\u093e, \u0909\u0928\u094d\u0928\u0940\u0938\u0935\u0947\u0902\u0938\u0947 \u092c\u093e\u0908\u0938\u0935\u0947\u0902 \u0936\u094d\u0932\u094b\u0915\u0924\u0915 \'\u0909\u0917\u094d\u0930\'-\u0930\u0942\u092a\u0915\u093e \u0914\u0930 \u0924\u0947\u0908\u0938\u0935\u0947\u0902\u0938\u0947 \u0924\u0940\u0938\u0935\u0947\u0902 \u0936\u094d\u0932\u094b\u0915\u0924\u0915 \'\u0905\u0924\u094d\u092f\u0928\u094d\u0924 \u0909\u0917\u094d\u0930\'-\u0930\u0942\u092a\u0915\u093e \u0935\u0930\u094d\u0923\u0928 \u0939\u0941\u0906 \u0939\u0948\u0964]"},{"text":"\u0928\u092d\u0903\u0938\u094d\u092a\u0943\u0936\u0902 \u0926\u0940\u092a\u094d\u0924\u092e\u0928\u0947\u0915\u0935\u0930\u094d\u0923\u0902\\n\u0935\u094d\u092f\u093e\u0924\u094d\u0924\u093e\u0928\u0928\u0902 \u0926\u0940\u092a\u094d\u0924\u0935\u093f\u0936\u093e\u0932\u0928\u0947\u0924\u094d\u0930\u092e\u094d\u0964\\n\u0926\u0943\u0937\u094d\u091f\u094d\u0935\u093e \u0939\u093f \u0924\u094d\u0935\u093e\u0902 \u092a\u094d\u0930\u0935\u094d\u092f\u0925\u093f\u0924\u093e\u0928\u094d\u0924\u0930\u093e\u0924\u094d\u092e\u093e\\n\u0927\u0943\u0924\u093f\u0902 \u0928 \u0935\u093f\u0928\u094d\u0926\u093e\u092e\u093f \u0936\u092e\u0902 \u091a \u0935\u093f\u0937\u094d\u0923\u094b\u0964\u096411.24\u0964\u0964","translation":"\u0964\u096411.24\u0964\u0964 \u0939\u0947 \u0935\u093f\u0937\u094d\u0923\u094b ! \u0906\u092a\u0915\u0947 \u0905\u0928\u0947\u0915 \u0926\u0947\u0926\u0940\u092a\u094d\u092f\u092e\u093e\u0928 \u0935\u0930\u094d\u0923 \u0939\u0948\u0902, \u0906\u092a \u0906\u0915\u093e\u0936\u0915\u094b \u0938\u094d\u092a\u0930\u094d\u0936 \u0915\u0930 \u0930\u0939\u0947 \u0939\u0948\u0902, \u0906\u092a\u0915\u093e \u092e\u0941\u0916 \u092b\u0948\u0932\u093e \u0939\u0941\u0906 \u0939\u0948 \u0906\u092a\u0915\u0947 \u0928\u0947\u0924\u094d\u0930 \u092a\u094d\u0930\u0926\u0940\u092a\u094d\u0924 \u0914\u0930 \u0935\u093f\u0936\u093e\u0932 \u0939\u0948\u0902\u0964 \u0910\u0938\u0947 \u0906\u092a\u0915\u094b \u0926\u0947\u0916\u0915\u0930 \u092d\u092f\u092d\u0940\u0924 \u0905\u0928\u094d\u0924\u0903\u0915\u0930\u0923\u0935\u093e\u0932\u093e \u092e\u0948\u0902 \u0927\u0948\u0930\u094d\u092f \u0914\u0930 \u0936\u093e\u0928\u094d\u0924\u093f\u0915\u094b \u092a\u094d\u0930\u093e\u092a\u094d\u0924 \u0928\u0939\u0940\u0902 \u0939\u094b \u0930\u0939\u093e \u0939\u0942\u0901\u0964","commentary":"\u0964\u096411.24\u0964\u0964\xa0\u0935\u094d\u092f\u093e\u0916\u094d\u092f\u093e--[\u092c\u0940\u0938\u0935\u0947\u0902 \u0936\u094d\u0932\u094b\u0915\u092e\u0947\u0902 \u0924\u094b \u0905\u0930\u094d\u091c\u0941\u0928\u0928\u0947 \u0935\u093f\u0930\u093e\u091f\u094d\u0930\u0942\u092a\u0915\u0940 \u0932\u092e\u094d\u092c\u093e\u0908-\u091a\u094c\u0921\u093c\u093e\u0908\u0915\u093e \u0935\u0930\u094d\u0923\u0928 \u0915\u093f\u092f\u093e, \u0905\u092c \u092f\u0939\u093e\u0901 \u0915\u0947\u0935\u0932 \u0932\u092e\u094d\u092c\u093e\u0908\u0915\u093e \u0935\u0930\u094d\u0923\u0928 \u0915\u0930\u0924\u0947 \u0939\u0948\u0902\u0964]"},{"text":"\u0926\u0902\u0937\u094d\u091f\u094d\u0930\u093e\u0915\u0930\u093e\u0932\u093e\u0928\u093f \u091a \u0924\u0947 \u092e\u0941\u0916\u093e\u0928\u093f\\n\u0926\u0943\u0937\u094d\u091f\u094d\u0935\u0948\u0935 \u0915\u093e\u0932\u093e\u0928\u0932\u0938\u0928\u094d\u0928\u093f\u092d\u093e\u0928\u093f\u0964\\n\u0926\u093f\u0936\u094b \u0928 \u091c\u093e\u0928\u0947 \u0928 \u0932\u092d\u0947 \u091a \u0936\u0930\u094d\u092e\\n\u092a\u094d\u0930\u0938\u0940\u0926 \u0926\u0947\u0935\u0947\u0936 \u091c\u0917\u0928\u094d\u0928\u093f\u0935\u093e\u0938\u0964\u096411.25\u0964\u0964","translation":"\u0964\u096411.25\u0964\u0964 \u0906\u092a\u0915\u0947 \u092a\u094d\u0930\u0932\u092f\u0915\u093e\u0932\u0915\u0940 \u0905\u0917\u094d\u0928\u093f\u0915\u0947 \u0938\u092e\u093e\u0928 \u092a\u094d\u0930\u091c\u094d\u0935\u0932\u093f\u0924 \u0914\u0930 \u0926\u093e\u0922\u093c\u094b\u0902\u0915\u0947 \u0915\u093e\u0930\u0923 \u0935\u093f\u0915\u0930\u093e\u0932 (\u092d\u092f\u093e\u0928\u0915) \u092e\u0941\u0916\u094b\u0902\u0915\u094b \u0926\u0947\u0916\u0915\u0930 \u092e\u0941\u091d\u0947 \u0928 \u0924\u094b \u0926\u093f\u0936\u093e\u0913\u0902\u0915\u093e \u091c\u094d\u091e\u093e\u0928 \u0939\u094b \u0930\u0939\u093e \u0939\u0948 \u0914\u0930 \u0928 \u0936\u093e\u0928\u094d\u0924\u093f \u0939\u0940 \u092e\u093f\u0932 \u0930\u0939\u0940 \u0939\u0948\u0964 \u0907\u0938\u0932\u093f\u092f\u0947 \u0939\u0947 \u0926\u0947\u0935\u0947\u0936 ! \u0939\u0947 \u091c\u0917\u0928\u094d\u0928\u093f\u0935\u093e\u0938 ! \u0906\u092a \u092a\u094d\u0930\u0938\u0928\u094d\u0928 \u0939\u094b\u0907\u092f\u0947\u0964","commentary":"\u0964\u096411.25\u0964\u0964\xa0\u0935\u094d\u092f\u093e\u0916\u094d\u092f\u093e--\'\u0926\u0902\u0937\u094d\u091f\u094d\u0930\u093e\u0915\u0930\u093e\u0932\u093e\u0928\u093f \u091a \u0924\u0947 \u092e\u0941\u0916\u093e\u0928\u093f \u0926\u0943\u0937\u094d\u091f\u094d\u0935\u0948\u0935 \u0915\u093e\u0932\u093e\u0928\u0932\u0938\u0928\u094d\u0928\u093f\u092d\u093e\u0928\u093f\'--  \u092e\u0939\u093e\u092a\u094d\u0930\u0932\u092f\u0915\u0947 \u0938\u092e\u092f \u0938\u092e\u094d\u092a\u0942\u0930\u094d\u0923 \u0924\u094d\u0930\u093f\u0932\u094b\u0915\u0940\u0915\u094b \u092d\u0938\u094d\u092e \u0915\u0930\u0928\u0947\u0935\u093e\u0932\u0940 \u091c\u094b \u0905\u0917\u094d\u0928\u093f \u092a\u094d\u0930\u0915\u091f \u0939\u094b\u0924\u0940 \u0939\u0948? \u0909\u0938\u0947 \u0938\u0902\u0935\u0930\u094d\u0924\u0915 \u0905\u0925\u0935\u093e \u0915\u093e\u0932\u093e\u0917\u094d\u0928\u093f \u0915\u0939\u0924\u0947 \u0939\u0948\u0902\u0964 \u0909\u0938 \u0915\u093e\u0932\u093e\u0917\u094d\u0928\u093f\u0915\u0947 \u0938\u092e\u093e\u0928 \u0906\u092a\u0915\u0947 \u092e\u0941\u0916 \u0939\u0948, \u091c\u094b \u092d\u092f\u0902\u0915\u0930-\u092d\u092f\u0902\u0915\u0930 \u0926\u093e\u0922\u093c\u094b\u0902\u0915\u0947 \u0915\u093e\u0930\u0923 \u092c\u0939\u0941\u0924 \u0935\u093f\u0915\u0930\u093e\u0932 \u0939\u094b \u0930\u0939\u0947 \u0939\u0948\u0902\u0964 \u0909\u0928\u0915\u094b \u0926\u0947\u0916\u0928\u0947\u092e\u093e\u0924\u094d\u0930\u0938\u0947 \u0939\u0940 \u092c\u0921\u093c\u093e \u092d\u092f \u0932\u0917 \u0930\u0939\u093e \u0939\u0948\u0964 \u0905\u0917\u0930 \u0909\u0928\u0915\u093e \u0915\u093e\u0930\u094d\u092f \u0926\u0947\u0916\u093e \u091c\u093e\u092f \u0924\u094b \u0909\u0938\u0915\u0947 \u0938\u093e\u092e\u0928\u0947 \u0915\u093f\u0938\u0940\u0915\u093e \u091f\u093f\u0915\u0928\u093e \u0939\u0940 \u092e\u0941\u0936\u094d\u0915\u093f\u0932 \u0939\u0948\u0964\\n\'\u0926\u093f\u0936\u094b \u0928 \u091c\u093e\u0928\u0947 \u0928 \u0932\u092d\u0947 \u091a \u0936\u0930\u094d\u092e\'--  \u0910\u0938\u0947 \u0935\u093f\u0915\u0930\u093e\u0932 \u092e\u0941\u0916\u094b\u0902\u0915\u094b \u0926\u0947\u0916\u0915\u0930 \u092e\u0941\u091d\u0947 \u0926\u093f\u0936\u093e\u0913\u0902\u0915\u093e \u092d\u0940 \u091c\u094d\u091e\u093e\u0928 \u0928\u0939\u0940\u0902 \u0939\u094b \u0930\u0939\u093e \u0939\u0948\u0964 \u0907\u0938\u0915\u093e \u0924\u093e\u0924\u094d\u092a\u0930\u094d\u092f \u0939\u0948 \u0915\u093f \u0926\u093f\u0936\u093e\u0913\u0902\u0915\u093e \u091c\u094d\u091e\u093e\u0928 \u0939\u094b\u0924\u093e \u0939\u0948 \u0938\u0942\u0930\u094d\u092f\u0915\u0947 \u0909\u0926\u092f \u0914\u0930 \u0905\u0938\u094d\u0924 \u0939\u094b\u0928\u0947\u0938\u0947\u0964 \u092a\u0930 \u0935\u0939 \u0938\u0942\u0930\u094d\u092f \u0924\u094b \u0906\u092a\u0915\u0947 \u0928\u0947\u0924\u094d\u0930\u094b\u0902\u0915\u0940 \u091c\u0917\u0939 \u0939\u0948 \u0905\u0930\u094d\u0925\u093e\u0924\u094d \u0935\u0939 \u0924\u094b \u0906\u092a\u0915\u0947 \u0935\u093f\u0930\u093e\u091f\u094d\u0930\u0942\u092a\u0915\u0947 \u0905\u0928\u094d\u0924\u0930\u094d\u0917\u0924 \u0906 \u0917\u092f\u093e \u0939\u0948\u0964 \u0907\u0938\u0915\u0947 \u0938\u093f\u0935\u093e\u092f \u0906\u092a\u0915\u0947 \u091a\u093e\u0930\u094b\u0902 \u0913\u0930 \u092e\u0939\u093e\u0928\u094d \u092a\u094d\u0930\u091c\u094d\u0935\u0932\u093f\u0924 \u092a\u094d\u0930\u0915\u093e\u0936-\u0939\u0940-\u092a\u094d\u0930\u0915\u093e\u0936 \u0926\u0940\u0916 \u0930\u0939\u093e \u0939\u0948 (11\u0964 12), \u091c\u093f\u0938\u0915\u093e \u0928 \u0909\u0926\u092f \u0914\u0930 \u0928 \u0905\u0938\u094d\u0924 \u0939\u094b \u0930\u0939\u093e \u0939\u0948\u0964 \u0907\u0938\u0932\u093f\u092f\u0947 \u092e\u0947\u0930\u0947\u0915\u094b \u0926\u093f\u0936\u093e\u0913\u0902\u0915\u093e \u091c\u094d\u091e\u093e\u0928 \u0928\u0939\u0940\u0902 \u0939\u094b \u0930\u0939\u093e \u0939\u0948 \u0914\u0930 \u0935\u093f\u0915\u0930\u093e\u0932 \u092e\u0941\u0916\u094b\u0902\u0915\u094b \u0926\u0947\u0916\u0915\u0930 \u092d\u092f\u0915\u0947 \u0915\u093e\u0930\u0923 \u092e\u0948\u0902 \u0915\u093f\u0938\u0940 \u0924\u0930\u0939\u0915\u093e \u0938\u0941\u0916 \u0914\u0930 \u0936\u093e\u0928\u094d\u0924\u093f \u092d\u0940 \u092a\u094d\u0930\u093e\u092a\u094d\u0924 \u0928\u0939\u0940\u0902 \u0915\u0930 \u0930\u0939\u093e \u0939\u0942\u0901\u0964\'\u092a\u094d\u0930\u0938\u0940\u0926 \u0926\u0947\u0935\u0947\u0936 \u091c\u0917\u0928\u094d\u0928\u093f\u0935\u093e\u0938\'--\u0906\u092a \u0938\u092c \u0926\u0947\u0935\u0924\u093e\u0913\u0902\u0915\u0947 \u092e\u093e\u0932\u093f\u0915 \u0939\u0948\u0902 \u0914\u0930 \u0938\u092e\u094d\u092a\u0942\u0930\u094d\u0923 \u0938\u0902\u0938\u093e\u0930 \u0906\u092a\u092e\u0947\u0902 \u0939\u0940 \u0928\u093f\u0935\u093e\u0938 \u0915\u0930 \u0930\u0939\u093e \u0939\u0948\u0964 \u0905\u0924\u0903 \u0915\u094b\u0908 \u092d\u0940 \u0926\u0947\u0935\u0924\u093e, \u092e\u0928\u0941\u0937\u094d\u092f \u092d\u092f\u092d\u0940\u0924 \u0939\u094b\u0928\u0947\u092a\u0930 \u0906\u092a\u0915\u094b \u0939\u0940 \u0924\u094b \u092a\u0941\u0915\u093e\u0930\u0947\u0917\u093e! \u0906\u092a\u0915\u0947 \u0938\u093f\u0935\u093e\u092f \u0914\u0930 \u0915\u093f\u0938\u0915\u094b \u092a\u0941\u0915\u093e\u0930\u0947\u0917\u093e? \u0924\u0925\u093e \u0914\u0930 \u0915\u094c\u0928 \u0938\u0941\u0928\u0947\u0917\u093e? \u0907\u0938\u0932\u093f\u092f\u0947 \u092e\u0948\u0902 \u092d\u0940 \u0906\u092a\u0915\u094b \u092a\u0941\u0915\u093e\u0930\u0915\u0930 \u0915\u0939 \u0930\u0939\u093e \u0939\u0942\u0901 \u0915\u093f \u0939\u0947 \u0926\u0947\u0935\u0947\u0936 ! \u0939\u0947 \u091c\u0917\u0928\u094d\u0928\u093f\u0935\u093e\u0938 ! \u0906\u092a \u092a\u094d\u0930\u0938\u0928\u094d\u0928 \u0939\u094b\u0907\u092f\u0947\u0964\u092d\u0917\u0935\u093e\u0928\u094d\u0915\u0947 \u0935\u093f\u0915\u0930\u093e\u0932 \u0930\u0942\u092a\u0915\u094b \u0926\u0947\u0916\u0915\u0930 \u0905\u0930\u094d\u091c\u0941\u0928\u0915\u094b \u0910\u0938\u093e \u0932\u0917\u093e \u0915\u093f \u092d\u0917\u0935\u093e\u0928\u094d \u092e\u093e\u0928\u094b \u092c\u0921\u093c\u0947 \u0915\u094d\u0930\u094b\u0927\u092e\u0947\u0902 \u0906\u092f\u0947 \u0939\u0941\u090f \u0939\u0948\u0902\u0964 \u0907\u0938 \u092d\u093e\u0935\u0928\u093e\u0915\u094b \u0932\u0947\u0915\u0930 \u0939\u0940 \u092d\u092f\u092d\u0940\u0924 \u0905\u0930\u094d\u091c\u0941\u0928 \u092d\u0917\u0935\u093e\u0928\u094d\u0938\u0947 \u092a\u094d\u0930\u0938\u0928\u094d\u0928 \u0939\u094b\u0928\u0947\u0915\u0947 \u0932\u093f\u092f\u0947 \u092a\u094d\u0930\u093e\u0930\u094d\u0925\u0928\u093e \u0915\u0930 \u0930\u0939\u0947 \u0939\u0948\u0902\u0964\\n\xa0\u0938\u092e\u094d\u092c\u0928\u094d\u0927 --\u0905\u092c \u0905\u0930\u094d\u091c\u0941\u0928 \u0906\u0917\u0947\u0915\u0947 \u0926\u094b \u0936\u094d\u0932\u094b\u0915\u094b\u0902\u092e\u0947\u0902 \u092e\u0941\u0916\u094d\u092f-\u092e\u0941\u0916\u094d\u092f \u092f\u094b\u0926\u094d\u0927\u093e\u0913\u0902\u0915\u093e \u0935\u093f\u0930\u093e\u091f\u094d\u0930\u0942\u092a\u092e\u0947\u0902 \u092a\u094d\u0930\u0935\u0947\u0936 \u0939\u094b\u0928\u0947\u0915\u093e \u0935\u0930\u094d\u0923\u0928 \u0915\u0930\u0924\u0947 \u0939\u0948\u0902\u0964 "},{"text":"\u0905\u092e\u0940 \u091a \u0924\u094d\u0935\u093e\u0902 \u0927\u0943\u0924\u0930\u093e\u0937\u094d\u091f\u094d\u0930\u0938\u094d\u092f \u092a\u0941\u0924\u094d\u0930\u093e\u0903\\n\u0938\u0930\u094d\u0935\u0947 \u0938\u0939\u0948\u0935\u093e\u0935\u0928\u093f\u092a\u093e\u0932\u0938\u0919\u094d\u0918\u0948\u0903\u0964\\n\u092d\u0940\u0937\u094d\u092e\u094b \u0926\u094d\u0930\u094b\u0923\u0903 \u0938\u0942\u0924\u092a\u0941\u0924\u094d\u0930\u0938\u094d\u0924\u0925\u093e\u093d\u0938\u094c\\n\u0938\u0939\u093e\u0938\u094d\u092e\u0926\u0940\u092f\u0948\u0930\u092a\u093f \u092f\u094b\u0927\u092e\u0941\u0916\u094d\u092f\u0948\u0903\u0964\u096411.26\u0964\u0964","translation":"\u0964\u096411.26 -- 11.27\u0964\u0964 \u0939\u092e\u093e\u0930\u0947 \u092e\u0941\u0916\u094d\u092f \u092f\u094b\u0926\u094d\u0927\u093e\u0913\u0902\u0915\u0947 \u0938\u0939\u093f\u0924 \u092d\u0940\u0937\u094d\u092e, \u0926\u094d\u0930\u094b\u0923 \u0914\u0930 \u0935\u0939 \u0915\u0930\u094d\u0923 \u092d\u0940 \u0906\u092a\u092e\u0947\u0902 \u092a\u094d\u0930\u0935\u093f\u0937\u094d\u091f \u0939\u094b \u0930\u0939\u0947 \u0939\u0948\u0902\u0964 \u0930\u093e\u091c\u093e\u0913\u0902\u0915\u0947 \u0938\u092e\u0941\u0926\u093e\u092f\u094b\u0902\u0915\u0947 \u0938\u0939\u093f\u0924 \u0927\u0943\u0924\u0930\u093e\u0937\u094d\u091f\u094d\u0930\u0915\u0947 \u0935\u0947 \u0939\u0940 \u0938\u092c-\u0915\u0947-\u0938\u092c \u092a\u0941\u0924\u094d\u0930 \u0906\u092a\u0915\u0947 \u0935\u093f\u0915\u0930\u093e\u0932 \u0926\u093e\u0922\u093c\u094b\u0902\u0915\u0947 \u0915\u093e\u0930\u0923 \u092d\u092f\u0902\u0915\u0930 \u092e\u0941\u0916\u094b\u0902\u092e\u0947\u0902 \u092c\u0921\u093c\u0940 \u0924\u0947\u091c\u0940\u0938\u0947 \u092a\u094d\u0930\u0935\u093f\u0937\u094d\u091f \u0939\u094b \u0930\u0939\u0947 \u0939\u0948\u0902\u0964 \u0909\u0928\u092e\u0947\u0902\u0938\u0947 \u0915\u0908-\u090f\u0915 \u0924\u094b \u091a\u0942\u0930\u094d\u0923 \u0939\u0941\u090f \u0938\u093f\u0930\u094b\u0902\u0938\u0939\u093f\u0924 \u0906\u092a\u0915\u0947 \u0926\u093e\u0901\u0924\u094b\u0902\u0915\u0947 \u092c\u0940\u091a\u092e\u0947\u0902 \u092b\u0901\u0938\u0947 \u0939\u0941\u090f \u0926\u0940\u0916 \u0930\u0939\u0947 \u0939\u0948\u0902\u0964","commentary":"\u0964\u096411.26\u0964\u0964\xa0\u0935\u094d\u092f\u093e\u0916\u094d\u092f\u093e--\'\u092d\u0940\u0937\u094d\u092e\u094b \u0926\u094d\u0930\u094b\u0923\u0903 \u0938\u0942\u0924\u092a\u0941\u0924\u094d\u0930\u0938\u094d\u0924\u0925\u093e\u0938\u094c \u0938\u0939\u093e\u0938\u094d\u092e\u0926\u0940\u092f\u0948\u0930\u092a\u093f \u092f\u094b\u0927\u092e\u0941\u0916\u094d\u092f\u0948\u0903\'--\u0939\u092e\u093e\u0930\u0947 \u092a\u0915\u094d\u0937\u0915\u0947 \u0927\u0943\u0937\u094d\u091f\u0926\u094d\u092f\u0941\u092e\u094d\u0928, \u0935\u093f\u0930\u093e\u091f\u094d, \u0926\u094d\u0930\u0941\u092a\u0926 \u0906\u0926\u093f \u091c\u094b \u092e\u0941\u0916\u094d\u092f-\u092e\u0941\u0916\u094d\u092f \u092f\u094b\u0926\u094d\u0927\u093e\u0932\u094b\u0917 \u0939\u0948\u0902, \u0935\u0947 \u0938\u092c-\u0915\u0947-\u0938\u092c \u0927\u0930\u094d\u092e\u0915\u0947 \u092a\u0915\u094d\u0937\u092e\u0947\u0902 \u0939\u0948\u0902 \u0914\u0930 \u0915\u0947\u0935\u0932 \u0905\u092a\u0928\u093e \u0915\u0930\u094d\u0924\u0935\u094d\u092f \u0938\u092e\u091d\u0915\u0930 \u092f\u0941\u0926\u094d\u0927 \u0915\u0930\u0928\u0947\u0915\u0947 \u0932\u093f\u092f\u0947 \u0906\u092f\u0947 \u0939\u0948\u0902\u0964 \u0939\u092e\u093e\u0930\u0947 \u0907\u0928 \u0938\u0947\u0928\u093e\u092a\u0924\u093f\u092f\u094b\u0902\u0915\u0947 \u0938\u093e\u0925 \u092a\u093f\u0924\u093e\u092e\u0939 \u092d\u0940\u0937\u094d\u092e, \u0906\u091a\u093e\u0930\u094d\u092f \u0926\u094d\u0930\u094b\u0923 \u0914\u0930 \u0935\u0939 \u092a\u094d\u0930\u0938\u093f\u0926\u094d\u0927 \u0938\u0942\u0924\u092a\u0941\u0924\u094d\u0930 \u0915\u0930\u094d\u0923 \u0906\u092a\u092e\u0947\u0902 \u092a\u094d\u0930\u0935\u093f\u0937\u094d\u091f \u0939\u094b \u0930\u0939\u0947 \u0939\u0948\u0902\u0964\\n\u092f\u0939\u093e\u0901 \u092d\u0940\u0937\u094d\u092e, \u0926\u094d\u0930\u094b\u0923 \u0914\u0930 \u0915\u0930\u094d\u0923\u0915\u093e \u0928\u093e\u092e \u0932\u0947\u0928\u0947\u0915\u093e \u0924\u093e\u0924\u094d\u092a\u0930\u094d\u092f \u0939\u0948 \u0915\u093f \u092f\u0947 \u0924\u0940\u0928\u094b\u0902 \u0939\u0940 \u0905\u092a\u0928\u0947 \u0915\u0930\u094d\u0924\u0935\u094d\u092f\u0915\u093e \u092a\u093e\u0932\u0928 \u0915\u0930\u0928\u0947\u0915\u0947 \u0932\u093f\u092f\u0947 \u092f\u0941\u0926\u094d\u0927\u092e\u0947\u0902 \u0906\u092f\u0947 \u0925\u0947 (\u091f\u093f\u092a\u094d\u092a\u0923\u0940 \u092a0 591)\u0964\\n\'\u0905\u092e\u0940 \u091a \u0924\u094d\u0935\u093e\u0902 \u0927\u0943\u0924\u0930\u093e\u0937\u094d\u091f\u094d\u0930\u0938\u094d\u092f \u092a\u0941\u0924\u094d\u0930\u093e\u0903 \u0938\u0930\u094d\u0935\u0947 \u0938\u0939\u0948\u0935\u093e\u0935\u0928\u093f\u092a\u093e\u0932\u0938\u0919\u094d\u0918\u0948\u0903\'--\u0926\u0941\u0930\u094d\u092f\u094b\u0927\u0928\u0915\u0947 \u092a\u0915\u094d\u0937\u092e\u0947\u0902 \u091c\u093f\u0924\u0928\u0947 \u0930\u093e\u091c\u093e\u0932\u094b\u0917 \u0939\u0948\u0902, \u091c\u094b \u092f\u0941\u0926\u094d\u0927\u092e\u0947\u0902 \u0926\u0941\u0930\u094d\u092f\u094b\u0927\u0928\u0915\u093e \u092a\u094d\u0930\u093f\u092f \u0915\u0930\u0928\u093e \u091a\u093e\u0939\u0924\u0947 \u0939\u0948\u0902 (\u0917\u0940\u0924\u093e 1\u0964 23) \u0905\u0930\u094d\u0925\u093e\u0924\u094d \u0926\u0941\u0930\u094d\u092f\u094b\u0927\u0928\u0915\u094b \u0939\u093f\u0924\u0915\u0940 \u0938\u0932\u093e\u0939 \u0928\u0939\u0940\u0902 \u0926\u0947 \u0930\u0939\u0947 \u0939\u0948\u0902, \u0909\u0928 \u0938\u092d\u0940,\u0930\u093e\u091c\u093e\u0913\u0902\u0915\u0947 \u0938\u092e\u0942\u0939\u094b\u0902\u0915\u0947 \u0938\u093e\u0925 \u0927\u0943\u0924\u0930\u093e\u0937\u094d\u091f\u094d\u0930\u0915\u0947 \u0926\u0941\u0930\u094d\u092f\u094b\u0927\u0928, \u0926\u0941\u0903\u0936\u093e\u0938\u0928 \u0906\u0926\u093f \u0938\u094c \u092a\u0941\u0924\u094d\u0930 \u0935\u093f\u0915\u0930\u093e\u0932 \u0926\u093e\u0922\u093c\u094b\u0902\u0915\u0947 \u0915\u093e\u0930\u0923 \u0905\u0924\u094d\u092f\u0928\u094d\u0924 \u092d\u092f\u093e\u0928\u0915 \u0906\u092a\u0915\u0947 \u092e\u0941\u0916\u094b\u0902\u092e\u0947\u0902 \u092c\u0921\u093c\u0940 \u0924\u0947\u091c\u0940\u0938\u0947 \u092a\u094d\u0930\u0935\u0947\u0936 \u0915\u0930 \u0930\u0939\u0947 \u0939\u0948\u0902--\'\u0935\u0915\u094d\u0924\u094d\u0930\u093e\u0923\u093f \u0924\u0947 \u0924\u094d\u0935\u0930\u092e\u093e\u0923\u093e \u0935\u093f\u0936\u0928\u094d\u0924\u093f \u0926\u0902\u0937\u094d\u091f\u094d\u0930\u093e\u0915\u0930\u093e\u0932\u093e\u0928\u093f \u092d\u092f\u093e\u0928\u0915\u093e\u0928\u093f\'\u0964\u0935\u093f\u0930\u093e\u091f\u094d\u0930\u0942\u092a\u092e\u0947\u0902 \u0935\u0947 \u091a\u093e\u0939\u0947 \u092d\u0917\u0935\u093e\u0928\u094d\u092e\u0947\u0902 \u092a\u094d\u0930\u0935\u0947\u0936 \u0915\u0930\u0947\u0902, \u091a\u093e\u0939\u0947 \u092d\u0917\u0935\u093e\u0928\u094d\u0915\u0947 \u092e\u0941\u0916\u094b\u0902\u092e\u0947\u0902 \u091c\u093e\u092f\u0901, \u0935\u0939 \u090f\u0915 \u0939\u0940 \u0932\u0940\u0932\u093e \u0939\u0948\u0964 \u092a\u0930\u0928\u094d\u0924\u0941 \u092d\u093e\u0935\u094b\u0902\u0915\u0947 \u0905\u0928\u0941\u0938\u093e\u0930 \u0909\u0928\u0915\u0940 \u0917\u0924\u093f\u092f\u093e\u0901 \u0905\u0932\u0917-\u0905\u0932\u0917 \u092a\u094d\u0930\u0924\u0940\u0924 \u0939\u094b \u0930\u0939\u0940 \u0939\u0948\u0902\u0964 \u0907\u0938\u0932\u093f\u092f\u0947 \u092d\u0917\u0935\u093e\u0928\u094d\u092e\u0947\u0902 \u091c\u093e\u092f\u0901 \u0905\u0925\u0935\u093e \u092e\u0941\u0916\u094b\u0902\u092e\u0947\u0902 \u091c\u093e\u092f\u0901, \u0935\u0947 \u0939\u0948\u0902 \u0924\u094b \u0935\u093f\u0930\u093e\u091f\u094d\u0930\u0942\u092a\u092e\u0947\u0902 \u0939\u0940\u0964"},{"text":"\u0935\u0915\u094d\u0924\u094d\u0930\u093e\u0923\u093f \u0924\u0947 \u0924\u094d\u0935\u0930\u092e\u093e\u0923\u093e \u0935\u093f\u0936\u0928\u094d\u0924\u093f\\n\u0926\u0902\u0937\u094d\u091f\u094d\u0930\u093e\u0915\u0930\u093e\u0932\u093e\u0928\u093f \u092d\u092f\u093e\u0928\u0915\u093e\u0928\u093f\u0964\\n\u0915\u0947\u091a\u093f\u0926\u094d\u0935\u093f\u0932\u0917\u094d\u0928\u093e \u0926\u0936\u0928\u093e\u0928\u094d\u0924\u0930\u0947\u0937\u0941\\n\u0938\u0902\u0926\u0943\u0936\u094d\u092f\u0928\u094d\u0924\u0947 \u091a\u0942\u0930\u094d\u0923\u093f\u0924\u0948\u0930\u0941\u0924\u094d\u0924\u092e\u093e\u0919\u094d\u0917\u0948\u0903\u0964\u096411.27\u0964\u0964","translation":"\u0964\u096411.26 -- 11.27\u0964\u0964 \u0939\u092e\u093e\u0930\u0947 \u092e\u0941\u0916\u094d\u092f\xa0 \u092f\u094b\u0926\u094d\u0927\u093e\u0913\u0902\u0915\u0947 \u0938\u0939\u093f\u0924 \u092d\u0940\u0937\u094d\u092e, \u0926\u094d\u0930\u094b\u0923 \u0914\u0930 \u0935\u0939 \u0915\u0930\u094d\u0923 \u092d\u0940 \u0906\u092a\u092e\u0947\u0902 \u092a\u094d\u0930\u0935\u093f\u0937\u094d\u091f \u0939\u094b \u0930\u0939\u0947 \u0939\u0948\u0902\u0964 \u0930\u093e\u091c\u093e\u0913\u0902\u0915\u0947 \u0938\u092e\u0941\u0926\u093e\u092f\u094b\u0902\u0915\u0947 \u0938\u0939\u093f\u0924 \u0927\u0943\u0924\u0930\u093e\u0937\u094d\u091f\u094d\u0930\u0915\u0947 \u0935\u0947 \u0939\u0940 \u0938\u092c-\u0915\u0947-\u0938\u092c \u092a\u0941\u0924\u094d\u0930 \u0906\u092a\u0915\u0947 \u0935\u093f\u0915\u0930\u093e\u0932 \u0926\u093e\u0922\u093c\u094b\u0902\u0915\u0947 \u0915\u093e\u0930\u0923 \u092d\u092f\u0902\u0915\u0930 \u092e\u0941\u0916\u094b\u0902\u092e\u0947\u0902 \u092c\u0921\u093c\u0940 \u0924\u0947\u091c\u0940\u0938\u0947 \u092a\u094d\u0930\u0935\u093f\u0937\u094d\u091f \u0939\u094b \u0930\u0939\u0947 \u0939\u0948\u0902\u0964 \u0909\u0928\u092e\u0947\u0902\u0938\u0947 \u0915\u0908\u090f\u0915 \u0924\u094b \u091a\u0942\u0930\u094d\u0923 \u0939\u0941\u090f \u0938\u093f\u0930\u094b\u0902\u0938\u0939\u093f\u0924 \u0906\u092a\u0915\u0947 \u0926\u093e\u0901\u0924\u094b\u0902\u0915\u0947 \u092c\u0940\u091a\u092e\u0947\u0902 \u092b\u0901\u0938\u0947 \u0939\u0941\u090f \u0926\u0940\u0916 \u0930\u0939\u0947 \u0939\u0948\u0902\u0964","commentary":"\u0964\u096411.27\u0964\u0964\xa0\u0935\u094d\u092f\u093e\u0916\u094d\u092f\u093e--\'\u092d\u0940\u0937\u094d\u092e\u094b \u0926\u094d\u0930\u094b\u0923\u0903 \u0938\u0942\u0924\u092a\u0941\u0924\u094d\u0930\u0938\u094d\u0924\u0925\u093e\u0938\u094c \u0938\u0939\u093e\u0938\u094d\u092e\u0926\u0940\u092f\u0948\u0930\u092a\u093f \u092f\u094b\u0927\u092e\u0941\u0916\u094d\u092f\u0948\u0903\'--\u0939\u092e\u093e\u0930\u0947 \u092a\u0915\u094d\u0937\u0915\u0947 \u0927\u0943\u0937\u094d\u091f\u0926\u094d\u092f\u0941\u092e\u094d\u0928, \u0935\u093f\u0930\u093e\u091f\u094d, \u0926\u094d\u0930\u0941\u092a\u0926 \u0906\u0926\u093f \u091c\u094b \u092e\u0941\u0916\u094d\u092f-\u092e\u0941\u0916\u094d\u092f \u092f\u094b\u0926\u094d\u0927\u093e\u0932\u094b\u0917 \u0939\u0948\u0902, \u0935\u0947 \u0938\u092c-\u0915\u0947-\u0938\u092c \u0927\u0930\u094d\u092e\u0915\u0947 \u092a\u0915\u094d\u0937\u092e\u0947\u0902 \u0939\u0948\u0902 \u0914\u0930 \u0915\u0947\u0935\u0932 \u0905\u092a\u0928\u093e \u0915\u0930\u094d\u0924\u0935\u094d\u092f \u0938\u092e\u091d\u0915\u0930 \u092f\u0941\u0926\u094d\u0927 \u0915\u0930\u0928\u0947\u0915\u0947 \u0932\u093f\u092f\u0947 \u0906\u092f\u0947 \u0939\u0948\u0902\u0964 \u0939\u092e\u093e\u0930\u0947 \u0907\u0928 \u0938\u0947\u0928\u093e\u092a\u0924\u093f\u092f\u094b\u0902\u0915\u0947 \u0938\u093e\u0925 \u092a\u093f\u0924\u093e\u092e\u0939 \u092d\u0940\u0937\u094d\u092e, \u0906\u091a\u093e\u0930\u094d\u092f \u0926\u094d\u0930\u094b\u0923 \u0914\u0930 \u0935\u0939 \u092a\u094d\u0930\u0938\u093f\u0926\u094d\u0927 \u0938\u0942\u0924\u092a\u0941\u0924\u094d\u0930 \u0915\u0930\u094d\u0923 \u0906\u092a\u092e\u0947\u0902 \u092a\u094d\u0930\u0935\u093f\u0937\u094d\u091f \u0939\u094b \u0930\u0939\u0947 \u0939\u0948\u0902\u0964\\n\u092f\u0939\u093e\u0901 \u092d\u0940\u0937\u094d\u092e, \u0926\u094d\u0930\u094b\u0923 \u0914\u0930 \u0915\u0930\u094d\u0923\u0915\u093e \u0928\u093e\u092e \u0932\u0947\u0928\u0947\u0915\u093e \u0924\u093e\u0924\u094d\u092a\u0930\u094d\u092f \u0939\u0948 \u0915\u093f \u092f\u0947 \u0924\u0940\u0928\u094b\u0902 \u0939\u0940 \u0905\u092a\u0928\u0947 \u0915\u0930\u094d\u0924\u0935\u094d\u092f\u0915\u093e \u092a\u093e\u0932\u0928 \u0915\u0930\u0928\u0947\u0915\u0947 \u0932\u093f\u092f\u0947 \u092f\u0941\u0926\u094d\u0927\u092e\u0947\u0902 \u0906\u092f\u0947 \u0925\u0947 (\u091f\u093f\u092a\u094d\u092a\u0923\u0940 \u092a0 591)\u0964\\n\'\u0905\u092e\u0940 \u091a \u0924\u094d\u0935\u093e\u0902 \u0927\u0943\u0924\u0930\u093e\u0937\u094d\u091f\u094d\u0930\u0938\u094d\u092f \u092a\u0941\u0924\u094d\u0930\u093e\u0903 \u0938\u0930\u094d\u0935\u0947 \u0938\u0939\u0948\u0935\u093e\u0935\u0928\u093f\u092a\u093e\u0932\u0938\u0919\u094d\u0918\u0948\u0903\'--  \u0926\u0941\u0930\u094d\u092f\u094b\u0927\u0928\u0915\u0947 \u092a\u0915\u094d\u0937\u092e\u0947\u0902 \u091c\u093f\u0924\u0928\u0947 \u0930\u093e\u091c\u093e\u0932\u094b\u0917 \u0939\u0948\u0902, \u091c\u094b \u092f\u0941\u0926\u094d\u0927\u092e\u0947\u0902 \u0926\u0941\u0930\u094d\u092f\u094b\u0927\u0928\u0915\u093e \u092a\u094d\u0930\u093f\u092f \u0915\u0930\u0928\u093e \u091a\u093e\u0939\u0924\u0947 \u0939\u0948\u0902 (\u0917\u0940\u0924\u093e 1\u0964 23) \u0905\u0930\u094d\u0925\u093e\u0924\u094d \u0926\u0941\u0930\u094d\u092f\u094b\u0927\u0928\u0915\u094b \u0939\u093f\u0924\u0915\u0940 \u0938\u0932\u093e\u0939 \u0928\u0939\u0940\u0902 \u0926\u0947 \u0930\u0939\u0947 \u0939\u0948\u0902, \u0909\u0928 \u0938\u092d\u0940,\u0930\u093e\u091c\u093e\u0913\u0902\u0915\u0947 \u0938\u092e\u0942\u0939\u094b\u0902\u0915\u0947 \u0938\u093e\u0925 \u0927\u0943\u0924\u0930\u093e\u0937\u094d\u091f\u094d\u0930\u0915\u0947 \u0926\u0941\u0930\u094d\u092f\u094b\u0927\u0928, \u0926\u0941\u0903\u0936\u093e\u0938\u0928 \u0906\u0926\u093f \u0938\u094c \u092a\u0941\u0924\u094d\u0930 \u0935\u093f\u0915\u0930\u093e\u0932 \u0926\u093e\u0922\u093c\u094b\u0902\u0915\u0947 \u0915\u093e\u0930\u0923 \u0905\u0924\u094d\u092f\u0928\u094d\u0924 \u092d\u092f\u093e\u0928\u0915 \u0906\u092a\u0915\u0947 \u092e\u0941\u0916\u094b\u0902\u092e\u0947\u0902 \u092c\u0921\u093c\u0940 \u0924\u0947\u091c\u0940\u0938\u0947 \u092a\u094d\u0930\u0935\u0947\u0936 \u0915\u0930 \u0930\u0939\u0947 \u0939\u0948\u0902 --\xa0"},{"text":"\u092f\u0925\u093e \u0928\u0926\u0940\u0928\u093e\u0902 \u092c\u0939\u0935\u094b\u093d\u092e\u094d\u092c\u0941\u0935\u0947\u0917\u093e\u0903\\n\u0938\u092e\u0941\u0926\u094d\u0930\u092e\u0947\u0935\u093e\u092d\u093f\u092e\u0941\u0916\u093e\u0903 \u0926\u094d\u0930\u0935\u0928\u094d\u0924\u093f\u0964\\n\u0924\u0925\u093e \u0924\u0935\u093e\u092e\u0940 \u0928\u0930\u0932\u094b\u0915\u0935\u0940\u0930\u093e\\n\u0935\u093f\u0936\u0928\u094d\u0924\u093f \u0935\u0915\u094d\u0924\u094d\u0930\u093e\u0923\u094d\u092f\u092d\u093f\u0935\u093f\u091c\u094d\u0935\u0932\u0928\u094d\u0924\u093f\u0964\u096411.28\u0964\u0964","translation":"\u0964\u096411.28\u0964\u0964 \u091c\u0948\u0938\u0947 \u0928\u0926\u093f\u092f\u094b\u0902\u0915\u0947 \u092c\u0939\u0941\u0924-\u0938\u0947 \u091c\u0932\u0915\u0947 \u092a\u094d\u0930\u0935\u093e\u0939 \u0938\u094d\u0935\u093e\u092d\u093e\u0935\u093f\u0915 \u0939\u0940 \u0938\u092e\u0941\u0926\u094d\u0930\u0915\u0947 \u0938\u092e\u094d\u092e\u0941\u0916 \u0926\u094c\u0921\u093c\u0924\u0947 \u0939\u0948\u0902, \u0910\u0938\u0947 \u0939\u0940 \u0935\u0947 \u0938\u0902\u0938\u093e\u0930\u0915\u0947 \u092e\u0939\u093e\u0928\u094d \u0936\u0942\u0930\u0935\u0940\u0930 \u0906\u092a\u0915\u0947 \u092a\u094d\u0930\u091c\u094d\u0935\u0932\u093f\u0924 \u092e\u0941\u0916\u094b\u0902\u092e\u0947\u0902 \u092a\u094d\u0930\u0935\u0947\u0936 \u0915\u0930 \u0930\u0939\u0947 \u0939\u0948\u0902\u0964","commentary":"\u0964\u096411.28\u0964\u0964\xa0\u0935\u094d\u092f\u093e\u0916\u094d\u092f\u093e--\'\u092f\u0925\u093e \u0928\u0926\u0940\u0928\u093e\u0902 \u092c\u0939\u0935\u094b\u093d\u092e\u094d\u092c\u0941\u0935\u0947\u0917\u093e\u0903 \u0938\u092e\u0941\u0926\u094d\u0930\u092e\u0947\u0935\u093e\u092d\u093f\u092e\u0941\u0916\u093e \u0926\u094d\u0930\u0935\u0928\u094d\u0924\u093f\'--\u092e\u0942\u0932\u092e\u0947\u0902 \u091c\u0932\u092e\u093e\u0924\u094d\u0930 \u0938\u092e\u0941\u0926\u094d\u0930\u0915\u093e \u0939\u0948\u0964 \u0935\u0939\u0940 \u091c\u0932 \u092c\u093e\u0926\u0932\u094b\u0902\u0915\u0947 \u0926\u094d\u0935\u093e\u0930\u093e \u0935\u0930\u094d\u0937\u093e\u0930\u0942\u092a\u092e\u0947\u0902 \u092a\u0943\u0925\u094d\u0935\u0940\u092a\u0930 \u092c\u0930\u0938\u0915\u0930 \u091d\u0930\u0928\u0947, \u0928\u093e\u0932\u0947 \u0906\u0926\u093f\u0915\u094b \u0932\u0947\u0915\u0930 \u0928\u0926\u093f\u092f\u094b\u0902\u0915\u093e \u0930\u0942\u092a \u0927\u093e\u0930\u0923 \u0915\u0930\u0924\u093e \u0939\u0948\u0964 \u0909\u0928 \u0928\u0926\u093f\u092f\u094b\u0902\u0915\u0947 \u091c\u093f\u0924\u0928\u0947 \u0935\u0947\u0917 \u0939\u0948\u0902, \u092a\u094d\u0930\u0935\u093e\u0939 \u0939\u0948\u0902, \u0935\u0947 \u0938\u092d\u0940 \u0938\u094d\u0935\u093e\u092d\u093e\u0935\u093f\u0915 \u0939\u0940 \u0938\u092e\u0941\u0926\u094d\u0930\u0915\u0940 \u0924\u0930\u092b \u0926\u094c\u0921\u093c\u0924\u0947 \u0939\u0948\u0902\u0964 \u0915\u093e\u0930\u0923 \u0915\u093f \u091c\u0932\u0915\u093e \u0909\u0926\u094d\u0917\u092e \u0938\u094d\u0925\u093e\u0928 \u0938\u092e\u0941\u0926\u094d\u0930 \u0939\u0940 \u0939\u0948\u0964 \u0935\u0947 \u0938\u092d\u0940 \u091c\u0932-\u092a\u094d\u0930\u0935\u093e\u0939 \u0938\u092e\u0941\u0926\u094d\u0930\u092e\u0947\u0902 \u091c\u093e\u0915\u0930 \u0905\u092a\u0928\u0947 \u0928\u093e\u092e \u0914\u0930 \u0930\u0942\u092a\u0915\u094b \u091b\u094b\u0921\u093c\u0915\u0930 \u0905\u0930\u094d\u0925\u093e\u0924\u094d \u0917\u0919\u094d\u0917\u093e, \u092f\u092e\u0941\u0928\u093e, \u0938\u0930\u0938\u094d\u0935\u0924\u0940 \u0906\u0926\u093f \u0928\u093e\u092e\u094b\u0902\u0915\u094b \u0914\u0930 \u092a\u094d\u0930\u0935\u093e\u0939\u0915\u0947 \u0930\u0942\u092a\u0915\u094b \u091b\u094b\u0921\u093c\u0915\u0930 \u0938\u092e\u0941\u0926\u094d\u0930\u0930\u0942\u092a \u0939\u0940 \u0939\u094b \u091c\u093e\u0924\u0947 \u0939\u0948\u0902\u0964 \u092b\u093f\u0930 \u0935\u0947 \u091c\u0932-\u092a\u094d\u0930\u0935\u093e\u0939 \u0938\u092e\u0941\u0926\u094d\u0930\u0915\u0947 \u0938\u093f\u0935\u093e\u092f \u0905\u092a\u0928\u093e \u0915\u094b\u0908 \u0905\u0932\u0917, \u0938\u094d\u0935\u0924\u0928\u094d\u0924\u094d\u0930 \u0905\u0938\u094d\u0924\u093f\u0924\u094d\u0935 \u0928\u0939\u0940\u0902 \u0930\u0916\u0924\u0947\u0964 \u0935\u093e\u0938\u094d\u0924\u0935\u092e\u0947\u0902 \u0924\u094b \u0909\u0928\u0915\u093e \u0938\u094d\u0935\u0924\u0928\u094d\u0924\u094d\u0930 \u0905\u0938\u094d\u0924\u093f\u0924\u094d\u0935 \u092a\u0939\u0932\u0947 \u092d\u0940 \u0928\u0939\u0940\u0902 \u0925\u093e? \u0915\u0947\u0935\u0932 \u0928\u0926\u093f\u092f\u094b\u0902\u0915\u0947 \u092a\u094d\u0930\u0935\u093e\u0939\u0930\u0942\u092a\u092e\u0947\u0902 \u0939\u094b\u0928\u0947\u0915\u0947 \u0915\u093e\u0930\u0923 \u0935\u0947 \u0905\u0932\u0917 \u0926\u0940\u0916\u0924\u0947 \u0925\u0947\u0964\xa0"},{"text":"\u092f\u0925\u093e \u092a\u094d\u0930\u0926\u0940\u092a\u094d\u0924\u0902 \u091c\u094d\u0935\u0932\u0928\u0902 \u092a\u0924\u0919\u094d\u0917\u093e\\n\u0935\u093f\u0936\u0928\u094d\u0924\u093f \u0928\u093e\u0936\u093e\u092f \u0938\u092e\u0943\u0926\u094d\u0927\u0935\u0947\u0917\u093e\u0903\u0964\\n\u0924\u0925\u0948\u0935 \u0928\u093e\u0936\u093e\u092f \u0935\u093f\u0936\u0928\u094d\u0924\u093f \u0932\u094b\u0915\u093e\\n\u0938\u094d\u0924\u0935\u093e\u092a\u093f \u0935\u0915\u094d\u0924\u094d\u0930\u093e\u0923\u093f \u0938\u092e\u0943\u0926\u094d\u0927\u0935\u0947\u0917\u093e\u0903\u0964\u096411.29\u0964\u0964","translation":"\u0964\u096411.29\u0964\u0964 \u091c\u0948\u0938\u0947 \u092a\u0924\u0902\u0917\u0947 \u092e\u094b\u0939\u0935\u0936 \u0905\u092a\u0928\u093e \u0928\u093e\u0936 \u0915\u0930\u0928\u0947\u0915\u0947 \u0932\u093f\u092f\u0947 \u092c\u0921\u093c\u0947 \u0935\u0947\u0917\u0938\u0947 \u0926\u094c\u0921\u093c\u0924\u0947 \u0939\u0941\u090f \u092a\u094d\u0930\u091c\u094d\u0935\u0932\u093f\u0924 \u0905\u0917\u094d\u0928\u093f\u092e\u0947\u0902 \u092a\u094d\u0930\u0935\u093f\u0937\u094d\u091f \u0939\u094b\u0924\u0947 \u0939\u0948\u0902, \u0910\u0938\u0947 \u0939\u0940 \u092f\u0947 \u0938\u092c \u0932\u094b\u0917 \u092d\u0940 \u092e\u094b\u0939\u0935\u0936 \u0905\u092a\u0928\u093e \u0928\u093e\u0936 \u0915\u0930\u0928\u0947\u0915\u0947 \u0932\u093f\u092f\u0947 \u092c\u0921\u093c\u0947 \u0935\u0947\u0917\u0938\u0947 \u0926\u094c\u0921\u093c\u0924\u0947 \u0939\u0941\u090f \u0906\u092a\u0915\u0947 \u092e\u0941\u0916\u094b\u0902\u092e\u0947\u0902 \u092a\u094d\u0930\u0935\u093f\u0937\u094d\u091f \u0939\u094b \u0930\u0939\u0947 \u0939\u0948\u0902\u0964","commentary":"\u0964\u096411.29\u0964\u0964\xa0\u0935\u094d\u092f\u093e\u0916\u094d\u092f\u093e--\u092f\u0925\u093e \u092a\u094d\u0930\u0926\u0940\u092a\u094d\u0924\u0902 \u091c\u094d\u0935\u0932\u0928\u0902 \u092a\u0924\u0919\u094d\u0917\u093e \u0935\u093f\u0936\u0928\u094d\u0924\u093f \u0928\u093e\u0936\u093e\u092f \u0938\u092e\u0943\u0926\u094d\u0927\u0935\u0947\u0917\u093e\u0903--\u091c\u0948\u0938\u0947 \u0939\u0930\u0940-\u0939\u0930\u0940 \u0918\u093e\u0938\u092e\u0947\u0902 \u0930\u0939\u0928\u0947\u0935\u093e\u0932\u0947 \u092a\u0924\u0902\u0917\u0947 \u091a\u093e\u0924\u0941\u0930\u094d\u092e\u093e\u0938\u0915\u0940 \u0905\u0901\u0927\u0947\u0930\u0940 \u0930\u093e\u0924\u094d\u0930\u093f\u092e\u0947\u0902 \u0915\u0939\u0940\u0902\u092a\u0930 \u092a\u094d\u0930\u091c\u094d\u0935\u0932\u093f\u0924 \u0905\u0917\u094d\u0928\u093f \u0926\u0947\u0916\u0924\u0947 \u0939\u0948\u0902, \u0924\u094b \u0909\u0938\u092a\u0930 \u092e\u0941\u0917\u094d\u0927 \u0939\u094b\u0915\u0930 (\u0915\u093f \u092c\u0939\u0941\u0924 \u0938\u0941\u0928\u094d\u0926\u0930 \u092a\u094d\u0930\u0915\u093e\u0936 \u092e\u093f\u0932 \u0917\u092f\u093e, \u0939\u092e \u0907\u0938\u0938\u0947 \u0932\u093e\u092d \u0932\u0947 \u0932\u0947\u0902\u0917\u0947, \u0939\u092e\u093e\u0930\u093e \u0905\u0901\u0927\u0947\u0930\u093e \u092e\u093f\u091f \u091c\u093e\u092f\u0917\u093e) \u0909\u0938\u0915\u0940 \u0924\u0930\u092b \u092c\u0921\u093c\u0940 \u0924\u0947\u091c\u0940\u0938\u0947 \u0926\u094c\u0921\u093c\u0924\u0947 \u0939\u0948\u0902\u0964 \u0909\u0928\u092e\u0947\u0902\u0938\u0947 \u0915\u0941\u091b \u0924\u094b \u092a\u094d\u0930\u091c\u094d\u0935\u0932\u093f\u0924 \u0905\u0917\u094d\u0928\u093f\u092e\u0947\u0902 \u0938\u094d\u0935\u093e\u0939\u093e \u0939\u094b \u091c\u093e\u0924\u0947 \u0939\u0948\u0902; \u0915\u0941\u091b\u0915\u094b \u0905\u0917\u094d\u0928\u093f\u0915\u0940 \u0925\u094b\u0921\u093c\u0940-\u0938\u0940 \u0932\u092a\u091f \u0932\u0917 \u091c\u093e\u0924\u0940 \u0939\u0948 \u0924\u094b \u0909\u0928\u0915\u093e \u0909\u0921\u093c\u0928\u093e \u092c\u0902\u0926 \u0939\u094b \u091c\u093e\u0924\u093e \u0939\u0948 \u0914\u0930 \u0935\u0947 \u0924\u0921\u093c\u092a\u0924\u0947 \u0930\u0939\u0924\u0947 \u0939\u0948\u0902\u0964 \u092b\u093f\u0930 \u092d\u0940 \u0909\u0928\u0915\u0940 \u0932\u093e\u0932\u0938\u093e \u0909\u0938 \u0905\u0917\u094d\u0928\u093f\u0915\u0940 \u0924\u0930\u092b \u0939\u0940 \u0930\u0939\u0924\u0940 \u0939\u0948! \u092f\u0926\u093f \u0915\u094b\u0908 \u092a\u0941\u0930\u0941\u0937 \u0926\u092f\u093e \u0915\u0930\u0915\u0947 \u0909\u0938 \u0905\u0917\u094d\u0928\u093f\u0915\u094b \u092c\u0941\u091d\u093e \u0926\u0947\u0924\u093e \u0939\u0948 \u0924\u094b \u0935\u0947 \u092a\u0902\u0924\u0917\u0947 \u092c\u0921\u093c\u0947 \u0926\u0941\u0903\u0916\u0940 \u0939\u094b \u091c\u093e\u0924\u0947 \u0939\u0948\u0902 \u0915\u093f \u0909\u0938\u0928\u0947 \u0939\u092e\u093e\u0930\u0947\u0915\u094b \u092c\u0921\u093c\u0947 \u0932\u093e\u092d\u0938\u0947 \u0935\u091e\u094d\u091a\u093f\u0924 \u0915\u0930 \u0926\u093f\u092f\u093e!\xa0\u0924\u0925\u0948\u0935 \u0928\u093e\u0936\u093e\u092f \u0935\u093f\u0936\u0928\u094d\u0924\u093f \u0932\u094b\u0915\u093e\u0938\u094d\u0924\u0935\u093e\u092a\u093f \u0935\u0915\u094d\u0924\u094d\u0930\u093e\u0923\u093f \u0938\u092e\u0941\u0926\u094d\u0927\u0935\u0947\u0917\u093e\u0903 --\u092d\u094b\u0917 \u092d\u094b\u0917\u0928\u0947 \u0914\u0930 \u0938\u0902\u0917\u094d\u0930\u0939 \u0915\u0930\u0928\u0947\u092e\u0947\u0902 \u0939\u0940 \u0924\u0924\u094d\u092a\u0930\u0924\u093e\u092a\u0942\u0930\u094d\u0935\u0915 \u0932\u0917\u0947 \u0930\u0939\u0928\u093e \u0914\u0930 \u092e\u0928\u092e\u0947\u0902 \u092d\u094b\u0917\u094b\u0902 \u0914\u0930 \u0938\u0902\u0917\u094d\u0930\u0939\u0915\u093e \u0939\u0940 \u091a\u093f\u0928\u094d\u0924\u0928 \u0939\u094b\u0924\u0947 \u0930\u0939\u0928\u093e -- \u092f\u0939 \u092c\u0922\u093c\u093e \u0939\u0941\u0906 \u0938\u093e\u0902\u0938\u093e\u0930\u093f\u0915 \u0935\u0947\u0917 \u0939\u0948\u0964 \u0910\u0938\u0947 \u0935\u0947\u0917\u0935\u093e\u0932\u0947 \u0926\u0941\u0930\u094d\u092f\u094b\u0927\u0928\u093e\u0926\u093f \u0930\u093e\u091c\u093e\u0932\u094b\u0917 \u092a\u0902\u0924\u0917\u094b\u0902\u0915\u0940 \u0924\u0930\u0939 \u092c\u0921\u093c\u0940 \u0924\u0947\u091c\u0940\u0938\u0947 \u0915\u093e\u0932\u091a\u0915\u094d\u0930\u0930\u0942\u092a \u0906\u092a\u0915\u0947 \u092e\u0941\u0916\u094b\u0902\u092e\u0947\u0902 \u091c\u093e \u0930\u0939\u0947 \u0939\u0948\u0902 \u0905\u0930\u094d\u0925\u093e\u0924\u094d \u092a\u0924\u0928\u0915\u0940 \u0924\u0930\u092b \u091c\u093e \u0930\u0939\u0947 \u0939\u0948\u0902--\u091a\u094c\u0930\u093e\u0938\u0940 \u0932\u093e\u0916 \u092f\u094b\u0928\u093f\u092f\u094b\u0902 \u0914\u0930 \u0928\u0930\u0915\u094b\u0902\u0915\u0940 \u0924\u0930\u092b \u091c\u093e \u0930\u0939\u0947 \u0939\u0948\u0902\u0964 \u0924\u093e\u0924\u094d\u092a\u0930\u094d\u092f \u092f\u0939 \u0939\u0941\u0906 \u0915\u093f \u092a\u094d\u0930\u093e\u092f\u0903 \u092e\u0928\u0941\u0937\u094d\u092f \u0938\u093e\u0902\u0938\u093e\u0930\u093f\u0915 \u092d\u094b\u0917, \u0938\u0941\u0916, \u0906\u0930\u093e\u092e, \u092e\u093e\u0928, \u0906\u0926\u0930 \u0906\u0926\u093f\u0915\u094b \u092a\u094d\u0930\u093e\u092a\u094d\u0924 \u0915\u0930\u0928\u0947\u0915\u0947 \u0932\u093f\u092f\u0947 \u0930\u093e\u0924-\u0926\u093f\u0928 \u0926\u094c\u0921\u093c\u0924\u0947 \u0939\u0948\u0902\u0964 \u0909\u0928\u0915\u094b \u092a\u094d\u0930\u093e\u092a\u094d\u0924 \u0915\u0930\u0928\u0947\u092e\u0947\u0902 \u0909\u0928\u0915\u093e \u0905\u092a\u092e\u093e\u0928 \u0939\u094b\u0924\u093e \u0939\u0948, \u0928\u093f\u0928\u094d\u0926\u093e \u0939\u094b\u0924\u0940 \u0939\u0948, \u0918\u093e\u091f\u093e \u0932\u0917\u0924\u093e \u0939\u0948, \u091a\u093f\u0928\u094d\u0924\u093e \u0939\u094b\u0924\u0940 \u0939\u0948, \u0905\u0928\u094d\u0924\u0903\u0915\u0930\u0923\u092e\u0947\u0902 \u091c\u0932\u0928 \u0939\u094b\u0924\u0940 \u0939\u0948 \u0914\u0930 \u091c\u093f\u0938 \u0906\u092f\u0941\u0915\u0947 \u092c\u0932\u092a\u0930 \u0935\u0947 \u091c\u0940 \u0930\u0939\u0947 \u0939\u0948\u0902, \u0935\u0939 \u0906\u092f\u0941 \u092d\u0940 \u0938\u092e\u093e\u092a\u094d\u0924 \u0939\u094b\u0924\u0940 \u091c\u093e\u0924\u0940 \u0939\u0948, \u092b\u093f\u0930 \u092d\u0940 \u0935\u0947 \u0928\u093e\u0936\u0935\u093e\u0928\u094d \u092d\u094b\u0917 \u0914\u0930 \u0938\u0902\u0917\u094d\u0930\u0939\u0915\u0940 \u092a\u094d\u0930\u093e\u092a\u094d\u0924\u093f\u0915\u0947 \u0932\u093f\u092f\u0947 \u092d\u0940\u0924\u0930\u0938\u0947 \u0932\u093e\u0932\u093e\u092f\u093f\u0924 \u0930\u0939\u0924\u0947 \u0939\u0948\u0902 (\u091f\u093f\u092a\u094d\u092a\u0923\u0940 \u092a0 593)\u0964\\n\xa0\u0938\u092e\u094d\u092c\u0928\u094d\u0927--\u092a\u0940\u091b\u0947\u0915\u0947 \u0926\u094b \u0936\u094d\u0932\u094b\u0915\u094b\u0902\u092e\u0947\u0902 \u0926\u094b \u0926\u0943\u0937\u094d\u091f\u093e\u0928\u094d\u0924\u094b\u0902\u0938\u0947 \u0926\u094b\u0928\u094b\u0902 \u0938\u092e\u0941\u0926\u093e\u092f\u094b\u0902\u0915\u093e \u0935\u0930\u094d\u0923\u0928 \u0915\u0930\u0915\u0947 \u0905\u092c \u0938\u092e\u094d\u092a\u0942\u0930\u094d\u0923 \u0932\u094b\u0915\u094b\u0902\u0915\u093e \u0917\u094d\u0930\u0938\u0928 \u0915\u0930\u0924\u0947 \u0939\u0941\u090f \u0935\u093f\u0936\u094d\u0935\u0930\u0942\u092a \u092d\u0917\u0935\u093e\u0928\u094d\u0915\u0947 \u092d\u092f\u093e\u0928\u0915 \u0930\u0942\u092a\u0915\u093e \u0935\u0930\u094d\u0923\u0928 \u0915\u0930\u0924\u0947 \u0939\u0948\u0902\u0964"},{"text":"\u0932\u0947\u0932\u093f\u0939\u094d\u092f\u0938\u0947 \u0917\u094d\u0930\u0938\u092e\u093e\u0928\u0903 \u0938\u092e\u0928\u094d\u0924\u093e\\n\u0932\u094d\u0932\u094b\u0915\u093e\u0928\u094d\u0938\u092e\u0917\u094d\u0930\u093e\u0928\u094d\u0935\u0926\u0928\u0948\u0930\u094d\u091c\u094d\u0935\u0932\u0926\u094d\u092d\u093f\u0903\u0964\\n\u0924\u0947\u091c\u094b\u092d\u093f\u0930\u093e\u092a\u0942\u0930\u094d\u092f \u091c\u0917\u0924\u094d\u0938\u092e\u0917\u094d\u0930\u0902\\n\u092d\u093e\u0938\u0938\u094d\u0924\u0935\u094b\u0917\u094d\u0930\u093e\u0903 \u092a\u094d\u0930\u0924\u092a\u0928\u094d\u0924\u093f \u0935\u093f\u0937\u094d\u0923\u094b\u0964\u096411.30\u0964\u0964","translation":"\u0964\u096411.30\u0964\u0964 \u0906\u092a \u0905\u092a\u0928\u0947 \u092a\u094d\u0930\u091c\u094d\u0935\u0932\u093f\u0924 \u092e\u0941\u0916\u094b\u0902\u0926\u094d\u0935\u093e\u0930\u093e \u0938\u092e\u094d\u092a\u0942\u0930\u094d\u0923 \u0932\u094b\u0915\u094b\u0902\u0915\u093e \u0917\u094d\u0930\u0938\u0928 \u0915\u0930\u0924\u0947 \u0939\u0941\u090f \u0909\u0928\u094d\u0939\u0947\u0902 \u091a\u093e\u0930\u094b\u0902 \u0913\u0930\u0938\u0947 \u092c\u093e\u0930-\u092c\u093e\u0930 \u091a\u093e\u091f \u0930\u0939\u0947 \u0939\u0948\u0902 \u0914\u0930 \u0939\u0947 \u0935\u093f\u0937\u094d\u0923\u094b ! \u0906\u092a\u0915\u093e \u0909\u0917\u094d\u0930 \u092a\u094d\u0930\u0915\u093e\u0936 \u0905\u092a\u0928\u0947 \u0924\u0947\u091c\u0938\u0947 \u0938\u092e\u094d\u092a\u0942\u0930\u094d\u0923 \u091c\u0917\u0924\u094d \u0915\u094b \u092a\u0930\u093f\u092a\u0942\u0930\u094d\u0923 \u0915\u0930\u0915\u0947 \u0938\u092c\u0915\u094b \u0924\u092a\u093e \u0930\u0939\u093e \u0939\u0948\u0964","commentary":"\u0964\u096411.30\u0964\u0964\xa0\u0935\u094d\u092f\u093e\u0916\u094d\u092f\u093e--\'\u0932\u0947\u0932\u093f\u0939\u094d\u092f\u0938\u0947 \u0917\u094d\u0930\u0938\u092e\u093e\u0928\u0903 \u0938\u092e\u0928\u094d\u0924\u093e\u0932\u094d\u0932\u094b\u0915\u093e\u0928\u094d \u0938\u092e\u0917\u094d\u0930\u093e\u0928\u094d\u0935\u0926\u0928\u0948\u0930\u094d\u091c\u094d\u0935\u0932\u0926\u094d\u092d\u093f\u0903\'--\u0906\u092a \u0938\u092e\u094d\u092a\u0942\u0930\u094d\u0923 \u092a\u094d\u0930\u093e\u0923\u093f\u092f\u094b\u0902\u0915\u093e \u0938\u0902\u0939\u093e\u0930 \u0915\u0930 \u0930\u0939\u0947 \u0939\u0948\u0902 \u0914\u0930 \u0915\u094b\u0908 \u0907\u0927\u0930-\u0909\u0927\u0930 \u0928 \u091a\u0932\u093e \u091c\u093e\u092f, \u0907\u0938\u0932\u093f\u092f\u0947 \u092c\u093e\u0930-\u092c\u093e\u0930 \u091c\u0940\u092d\u0915\u0947 \u0932\u092a\u0947\u091f\u0947\u0938\u0947 \u0905\u092a\u0928\u0947 \u092a\u094d\u0930\u091c\u094d\u0935\u0932\u093f\u0924 \u092e\u0941\u0916\u094b\u0902\u092e\u0947\u0902 \u0932\u0947\u0924\u0947 \u0939\u0941\u090f \u0909\u0928\u0915\u093e \u0917\u094d\u0930\u0938\u0928 \u0915\u0930 \u0930\u0939\u0947 \u0939\u0948\u0902\u0964 \u0924\u093e\u0924\u094d\u092a\u0930\u094d\u092f \u0939\u0948 \u0915\u093f \u0915\u093e\u0932\u0930\u0942\u092a \u092d\u0917\u0935\u093e\u0928\u094d\u0915\u0940 \u091c\u0940\u092d\u0915\u0947 \u0932\u092a\u0947\u091f\u0938\u0947 \u0915\u094b\u0908 \u092d\u0940 \u092a\u094d\u0930\u093e\u0923\u0940 \u092c\u091a \u0928\u0939\u0940\u0902 \u0938\u0915\u0924\u093e\u0964\'\u0924\u0947\u091c\u094b\u092d\u093f\u0930\u093e\u092a\u0942\u0930\u094d\u092f \u091c\u0917\u0924\u094d\u0938\u092e\u0917\u094d\u0930\u0902 \u092d\u093e\u0938\u0938\u094d\u0924\u0935\u094b\u0917\u094d\u0930\u093e\u0903 \u092a\u094d\u0930\u0924\u092a\u0928\u094d\u0924\u093f \u0935\u093f\u0937\u094d\u0923\u094b\'--\u0935\u093f\u0930\u093e\u091f\u094d\u0930\u0942\u092a \u092d\u0917\u0935\u093e\u0928\u094d\u0915\u093e \u0924\u0947\u091c \u092c\u0921\u093c\u093e \u0909\u0917\u094d\u0930 \u0939\u0948\u0964 \u0935\u0939 \u0909\u0917\u094d\u0930 \u0924\u0947\u091c \u0938\u092e\u094d\u092a\u0942\u0930\u094d\u0923 \u091c\u0917\u0924\u094d\u092e\u0947\u0902 \u092a\u0930\u093f\u092a\u0942\u0930\u094d\u0923 \u0939\u094b\u0915\u0930 \u0938\u092c\u0915\u094b \u0938\u0902\u0924\u092a\u094d\u0924 \u0915\u0930 \u0930\u0939\u093e \u0939\u0948, \u0935\u094d\u092f\u0925\u093f\u0924 \u0915\u0930 \u0930\u0939\u093e \u0939\u0948\u0964\\n\xa0\u0938\u092e\u094d\u092c\u0928\u094d\u0927--\u0935\u093f\u0930\u093e\u091f\u094d\u0930\u0942\u092a \u092d\u0917\u0935\u093e\u0928\u094d \u0905\u092a\u0928\u0947 \u0935\u093f\u0932\u0915\u094d\u0937\u0923\u0935\u093f\u0932\u0915\u094d\u0937\u0923 \u0930\u0942\u092a\u094b\u0902\u0915\u093e \u0926\u0930\u094d\u0936\u0928 \u0915\u0930\u093e\u0924\u0947 \u0939\u0940 \u091a\u0932\u0947 \u0917\u092f\u0947\u0964 \u0909\u0928\u0915\u0947 \u092d\u092f\u0902\u0915\u0930 \u0914\u0930 \u0905\u0924\u094d\u092f\u0928\u094d\u0924 \u0909\u0917\u094d\u0930\u0930\u0942\u092a\u0915\u0947 \u092e\u0941\u0916\u094b\u0902\u092e\u0947\u0902 \u0938\u092e\u094d\u092a\u0942\u0930\u094d\u0923 \u092a\u094d\u0930\u093e\u0923\u0940 \u0914\u0930 \u0926\u094b\u0928\u094b\u0902 \u092a\u0915\u094d\u0937\u094b\u0902\u0915\u0947 \u092f\u094b\u0926\u094d\u0927\u093e \u091c\u093e\u0924\u0947 \u0926\u0947\u0916\u0915\u0930 \u0905\u0930\u094d\u091c\u0941\u0928 \u092c\u0939\u0941\u0924 \u0918\u092c\u0930\u093e \u0917\u092f\u0947\u0964 \u0905\u0924\u0903 \u0905\u0924\u094d\u092f\u0928\u094d\u0924 \u0909\u0917\u094d\u0930\u0930\u0942\u092a\u0927\u093e\u0930\u0940 \u092d\u0917\u0935\u093e\u0928\u094d\u0915\u093e \u0935\u093e\u0938\u094d\u0924\u0935\u093f\u0915 \u092a\u0930\u093f\u091a\u092f \u091c\u093e\u0928\u0928\u0947\u0915\u0947 \u0932\u093f\u092f\u0947 \u0905\u0930\u094d\u091c\u0941\u0928 \u092a\u094d\u0930\u0936\u094d\u0928 \u0915\u0930\u0924\u0947 \u0939\u0948\u0902\u0964"},{"text":"\u0906\u0916\u094d\u092f\u093e\u0939\u093f \u092e\u0947 \u0915\u094b \u092d\u0935\u093e\u0928\u0941\u0917\u094d\u0930\u0930\u0942\u092a\u094b\\n\u0928\u092e\u094b\u093d\u0938\u094d\u0924\u0941 \u0924\u0947 \u0926\u0947\u0935\u0935\u0930 \u092a\u094d\u0930\u0938\u0940\u0926\u0964\\n\u0935\u093f\u091c\u094d\u091e\u093e\u0924\u0941\u092e\u093f\u091a\u094d\u091b\u093e\u092e\u093f \u092d\u0935\u0928\u094d\u0924\u092e\u093e\u0926\u094d\u092f\u0902\\n\u0928 \u0939\u093f \u092a\u094d\u0930\u091c\u093e\u0928\u093e\u092e\u093f \u0924\u0935 \u092a\u094d\u0930\u0935\u0943\u0924\u094d\u0924\u093f\u092e\u094d\u0964\u096411.31\u0964\u0964","translation":"\u0964\u096411.31\u0964\u0964 \u092e\u0941\u091d\u0947 \u092f\u0939 \u092c\u0924\u093e\u0907\u092f\u0947 \u0915\u093f \u0909\u0917\u094d\u0930\u0930\u0942\u092a\u0935\u093e\u0932\u0947 \u0906\u092a \u0915\u094c\u0928 \u0939\u0948\u0902? \u0939\u0947 \u0926\u0947\u0935\u0924\u093e\u0913\u0902\u092e\u0947\u0902 \u0936\u094d\u0930\u0947\u0937\u094d\u0920 ! \u0906\u092a\u0915\u094b \u0928\u092e\u0938\u094d\u0915\u093e\u0930 \u0939\u094b\u0964 \u0906\u092a \u092a\u094d\u0930\u0938\u0928\u094d\u0928 \u0939\u094b\u0907\u092f\u0947\u0964 \u0906\u0926\u093f\u0930\u0942\u092a \u0906\u092a\u0915\u094b \u092e\u0948\u0902 \u0924\u0924\u094d\u0924\u094d\u0935\u0938\u0947 \u091c\u093e\u0928\u0928\u093e \u091a\u093e\u0939\u0924\u093e \u0939\u0942\u0901; \u0915\u094d\u092f\u094b\u0902\u0915\u093f \u092e\u0948\u0902 \u0906\u092a\u0915\u0940 \u092a\u094d\u0930\u0935\u0943\u0924\u094d\u0924\u093f\u0915\u094b \u0928\u0939\u0940\u0902 \u091c\u093e\u0928\u0924\u093e\u0964","commentary":"\u0964\u096411.31\u0964\u0964\xa0\u0935\u094d\u092f\u093e\u0916\u094d\u092f\u093e--\'\u0906\u0916\u094d\u092f\u093e\u0939\u093f \u092e\u0947 \u0915\u094b \u092d\u0935\u093e\u0928\u0941\u0917\u094d\u0930\u0930\u0942\u092a\u094b \u0928\u092e\u094b\u093d\u0938\u094d\u0924\u0941 \u0924\u0947 \u0926\u0947\u0935\u0935\u0930 \u092a\u094d\u0930\u0938\u0940\u0926\'--\u0906\u092a \u0926\u0947\u0935\u0930\u0942\u092a\u0938\u0947 \u092d\u0940 \u0926\u0940\u0916 \u0930\u0939\u0947 \u0939\u0948\u0902 \u0914\u0930 \u0909\u0917\u094d\u0930\u0930\u0942\u092a\u0938\u0947 \u092d\u0940 \u0926\u0940\u0916 \u0930\u0939\u0947 \u0939\u0948\u0902; \u0924\u094b \u0935\u093e\u0938\u094d\u0924\u0935\u092e\u0947\u0902 \u0910\u0938\u0947 \u0930\u0942\u092a\u094b\u0902\u0915\u094b \u0927\u093e\u0930\u0923 \u0915\u0930\u0928\u0947\u0935\u093e\u0932\u0947 \u0906\u092a \u0915\u094c\u0928 \u0939\u0948\u0902?\xa0"},{"text":"\u0936\u094d\u0930\u0940 \u092d\u0917\u0935\u093e\u0928\u0941\u0935\u093e\u091a\\n\u0915\u093e\u0932\u094b\u093d\u0938\u094d\u092e\u093f \u0932\u094b\u0915\u0915\u094d\u0937\u092f\u0915\u0943\u0924\u094d\u092a\u094d\u0930\u0935\u0943\u0926\u094d\u0927\u094b\\n\u0932\u094b\u0915\u093e\u0928\u094d\u0938\u092e\u093e\u0939\u0930\u094d\u0924\u0941\u092e\u093f\u0939 \u092a\u094d\u0930\u0935\u0943\u0924\u094d\u0924\u0903\u0964\\n\u090b\u0924\u0947\u093d\u092a\u093f \u0924\u094d\u0935\u093e\u0902 \u0928 \u092d\u0935\u093f\u0937\u094d\u092f\u0928\u094d\u0924\u093f \u0938\u0930\u094d\u0935\u0947\\n\u092f\u0947\u093d\u0935\u0938\u094d\u0925\u093f\u0924\u093e\u0903 \u092a\u094d\u0930\u0924\u094d\u092f\u0928\u0940\u0915\u0947\u0937\u0941 \u092f\u094b\u0927\u093e\u0903\u0964\u096411.32\u0964\u0964","translation":"\u0964\u096411.32\u0964\u0964 \u0936\u094d\u0930\u0940\u092d\u0917\u0935\u093e\u0928\u094d \u092c\u094b\u0932\u0947 -- \u092e\u0948\u0902 \u0938\u092e\u094d\u092a\u0942\u0930\u094d\u0923 \u0932\u094b\u0915\u094b\u0902\u0915\u093e \u0915\u094d\u0937\u092f \u0915\u0930\u0928\u0947\u0935\u093e\u0932\u093e \u092c\u0922\u093c\u093e \u0939\u0941\u0906 \u0915\u093e\u0932 \u0939\u0942\u0901 \u0914\u0930 \u0907\u0938 \u0938\u092e\u092f \u092e\u0948\u0902 \u0907\u0928 \u0938\u092c \u0932\u094b\u0917\u094b\u0902\u0915\u093e \u0938\u0902\u0939\u093e\u0930 \u0915\u0930\u0928\u0947\u0915\u0947 \u0932\u093f\u092f\u0947 \u092f\u0939\u093e\u0901 \u0906\u092f\u093e \u0939\u0942\u0901\u0964 \u0924\u0941\u092e\u094d\u0939\u093e\u0930\u0947 \u092a\u094d\u0930\u0924\u093f\u092a\u0915\u094d\u0937\u092e\u0947\u0902 \u091c\u094b \u092f\u094b\u0926\u094d\u0927\u093e\u0932\u094b\u0917 \u0916\u0921\u093c\u0947 \u0939\u0948\u0902, \u0935\u0947 \u0938\u092c \u0924\u0941\u092e\u094d\u0939\u093e\u0930\u0947 \u092f\u0941\u0926\u094d\u0927 \u0915\u093f\u092f\u0947 \u092c\u093f\u0928\u093e \u092d\u0940 \u0928\u0939\u0940\u0902 \u0930\u0939\u0947\u0902\u0917\u0947\u0964","commentary":"\u0964\u096411.32\u0964\u0964\xa0\u0935\u094d\u092f\u093e\u0916\u094d\u092f\u093e --[\u092d\u0917\u0935\u093e\u0928\u094d\u0915\u093e \u0935\u093f\u0936\u094d\u0935\u0930\u0942\u092a \u0935\u093f\u091a\u093e\u0930 \u0915\u0930\u0928\u0947\u092a\u0930 \u092c\u0939\u0941\u0924 \u0935\u093f\u0932\u0915\u094d\u0937\u0923 \u092e\u093e\u0932\u0942\u092e \u0926\u0947\u0924\u093e \u0939\u0948; \u0915\u094d\u092f\u094b\u0902\u0915\u093f \u0909\u0938\u0915\u094b \u0926\u0947\u0916\u0928\u0947\u092e\u0947\u0902 \u0905\u0930\u094d\u091c\u0941\u0928\u0915\u0940 \u0926\u093f\u0935\u094d\u092f\u0926\u0943\u0937\u094d\u091f\u093f \u092d\u0940 \u092a\u0942\u0930\u0940 \u0924\u0930\u0939\u0938\u0947 \u0915\u093e\u092e \u0928\u0939\u0940\u0902 \u0915\u0930 \u0930\u0939\u0940 \u0939\u0948 \u0914\u0930 \u0935\u0947 \u0935\u093f\u0936\u094d\u0935\u0930\u0942\u092a\u0915\u094b \u0915\u0920\u093f\u0928\u0924\u093e\u0938\u0947 \u0926\u0947\u0916\u0947 \u091c\u093e\u0928\u0947\u092f\u094b\u0917\u094d\u092f \u092c\u0924\u093e\u0924\u0947 \u0939\u0948\u0902 --\'\u0926\u0941\u0930\u094d\u0928\u093f\u0930\u0940\u0915\u094d\u0937\u094d\u092f\u0902 \u0938\u092e\u0928\u094d\u0924\u093e\u0924\u094d\' (11\u0964 17)\u0964 \u092f\u0939\u093e\u0901 \u092d\u0940 \u0935\u0947 \u092d\u0917\u0935\u093e\u0928\u094d\u0938\u0947 \u092a\u0942\u091b \u092c\u0948\u0920\u0924\u0947 \u0939\u0948\u0902 \u0915\u093f \u0909\u0917\u094d\u0930 \u0930\u0942\u092a\u0935\u093e\u0932\u0947 \u0906\u092a \u0915\u094c\u0928 \u0939\u0948\u0902? \u0910\u0938\u093e \u092e\u093e\u0932\u0942\u092e \u0926\u0947\u0924\u093e \u0939\u0948 \u0915\u093f \u0905\u0917\u0930 \u0905\u0930\u094d\u091c\u0941\u0928 \u092d\u092f\u092d\u0940\u0924 \u0939\u094b\u0915\u0930 \u0910\u0938\u093e \u0928\u0939\u0940\u0902 \u092a\u0942\u091b\u0924\u0947 \u0924\u094b \u092d\u0917\u0935\u093e\u0928\u094d \u0914\u0930 \u092d\u0940 \u0905\u0927\u093f\u0915 \u0935\u093f\u0932\u0915\u094d\u0937\u0923\u0930\u0942\u092a\u0938\u0947 \u092a\u094d\u0930\u0915\u091f \u0939\u094b\u0924\u0947 \u091a\u0932\u0947 \u091c\u093e\u0924\u0947\u0964 \u092a\u0930\u0928\u094d\u0924\u0941 \u0905\u0930\u094d\u091c\u0941\u0928\u0915\u0947 \u092c\u0940\u091a\u092e\u0947\u0902 \u0939\u0940 \u092a\u0942\u091b\u0928\u0947\u0938\u0947 \u092d\u0917\u0935\u093e\u0928\u094d\u0928\u0947 \u0914\u0930 \u0906\u0917\u0947\u0915\u093e \u0930\u0942\u092a \u0926\u093f\u0916\u093e\u0928\u093e \u092c\u0928\u094d\u0926 \u0915\u0930 \u0926\u093f\u092f\u093e \u0914\u0930 \u0905\u0930\u094d\u091c\u0941\u0928\u0915\u0947 \u092a\u094d\u0930\u0936\u094d\u0928\u0915\u093e \u0909\u0924\u094d\u0924\u0930 \u0926\u0947\u0928\u0947 \u0932\u0917\u0947\u0964]\xa0"},{"text":"\u0924\u0938\u094d\u092e\u093e\u0924\u094d\u0924\u094d\u0935\u092e\u0941\u0924\u094d\u0924\u093f\u0937\u094d\u0920 \u092f\u0936\u094b \u0932\u092d\u0938\u094d\u0935\\n\u091c\u093f\u0924\u094d\u0935\u093e \u0936\u0924\u094d\u0930\u0942\u0928\u094d \u092d\u0941\u0919\u094d\u0915\u094d\u0937\u094d\u0935 \u0930\u093e\u091c\u094d\u092f\u0902 \u0938\u092e\u0943\u0926\u094d\u0927\u092e\u094d\u0964\\n\u092e\u092f\u0948\u0935\u0948\u0924\u0947 \u0928\u093f\u0939\u0924\u093e\u0903 \u092a\u0942\u0930\u094d\u0935\u092e\u0947\u0935\\n\u0928\u093f\u092e\u093f\u0924\u094d\u0924\u092e\u093e\u0924\u094d\u0930\u0902 \u092d\u0935 \u0938\u0935\u094d\u092f\u0938\u093e\u091a\u093f\u0928\u094d\u0964\u096411.33\u0964\u0964","translation":"\u0964\u096411.33\u0964\u0964 \u0907\u0938\u0932\u093f\u092f\u0947 \u0924\u0941\u092e \u092f\u0941\u0926\u094d\u0927\u0915\u0947 \u0932\u093f\u092f\u0947 \u0916\u0921\u093c\u0947 \u0939\u094b \u091c\u093e\u0913 \u0914\u0930 \u092f\u0936\u0915\u094b \u092a\u094d\u0930\u093e\u092a\u094d\u0924 \u0915\u0930\u094b \u0924\u0925\u093e \u0936\u0924\u094d\u0930\u0941\u0913\u0902\u0915\u094b \u091c\u0940\u0924\u0915\u0930 \u0927\u0928-\u0927\u093e\u0928\u094d\u092f\u0938\u0947 \u0938\u092e\u094d\u092a\u0928\u094d\u0928 \u0930\u093e\u091c\u094d\u092f\u0915\u094b \u092d\u094b\u0917\u094b\u0964 \u092f\u0947 \u0938\u092d\u0940 \u092e\u0947\u0930\u0947 \u0926\u094d\u0935\u093e\u0930\u093e \u092a\u0939\u0932\u0947\u0938\u0947 \u0939\u0940 \u092e\u093e\u0930\u0947 \u0939\u0941\u090f \u0939\u0948\u0902\u0964 \u0939\u0947 \u0938\u0935\u094d\u092f\u0938\u093e\u091a\u093f\u0928\u094d !\xa0 \u0924\u0941\u092e \u0928\u093f\u092e\u093f\u0924\u094d\u0924\u092e\u093e\u0924\u094d\u0930 \u092c\u0928 \u091c\u093e\u0913\u0964","commentary":"\u0964\u096411.33\u0964\u0964\xa0\u0935\u094d\u092f\u093e\u0916\u094d\u092f\u093e--\'\u0924\u0938\u094d\u092e\u093e\u0924\u094d\u0924\u094d\u0935\u092e\u0941\u0924\u094d\u0924\u093f\u0937\u094d\u0920 \u092f\u0936\u094b \u0932\u092d\u0938\u094d\u0935\'--\u0939\u0947 \u0905\u0930\u094d\u091c\u0941\u0928 ! \u091c\u092c \u0924\u0941\u092e\u0928\u0947 \u092f\u0939 \u0926\u0947\u0916 \u0939\u0940 \u0932\u093f\u092f\u093e \u0915\u093f \u0924\u0941\u092e\u094d\u0939\u093e\u0930\u0947 \u092e\u093e\u0930\u0947 \u092c\u093f\u0928\u093e \u092d\u0940 \u092f\u0947 \u092a\u094d\u0930\u0924\u093f\u092a\u0915\u094d\u0937\u0940 \u092c\u091a\u0947\u0902\u0917\u0947 \u0928\u0939\u0940\u0902, \u0924\u094b \u0924\u0941\u092e \u0915\u092e\u0930 \u0915\u0938\u0915\u0930 \u092f\u0941\u0926\u094d\u0927\u0915\u0947 \u0932\u093f\u092f\u0947 \u0916\u0921\u093c\u0947 \u0939\u094b \u091c\u093e\u0913 \u0914\u0930 \u092e\u0941\u092b\u094d\u0924\u092e\u0947\u0902 \u0939\u0940 \u092f\u0936\u0915\u094b \u092a\u094d\u0930\u093e\u092a\u094d\u0924 \u0915\u0930 \u0932\u094b\u0964 \u0907\u0938\u0915\u093e \u0924\u093e\u0924\u094d\u092a\u0930\u094d\u092f \u0939\u0948 \u0915\u093f \u092f\u0939 \u0938\u092c \u0939\u094b\u0928\u0939\u093e\u0930 \u0939\u0948, \u091c\u094b \u0939\u094b\u0915\u0930 \u0939\u0940 \u0930\u0939\u0947\u0917\u0940 \u0914\u0930 \u0907\u0938\u0915\u094b \u092e\u0948\u0902\u0928\u0947 \u0924\u0941\u092e\u094d\u0939\u0947\u0902 \u092a\u094d\u0930\u0924\u094d\u092f\u0915\u094d\u0937 \u0926\u093f\u0916\u093e \u092d\u0940 \u0926\u093f\u092f\u093e \u0939\u0948\u0964 \u0905\u0924\u0903 \u0924\u0941\u092e \u092f\u0941\u0926\u094d\u0927 \u0915\u0930\u094b\u0917\u0947 \u0924\u094b \u0924\u0941\u092e\u094d\u0939\u0947\u0902 \u092e\u0941\u092b\u094d\u0924\u092e\u0947\u0902 \u0939\u0940 \u092f\u0936 \u092e\u093f\u0932\u0947\u0917\u093e \u0914\u0930 \u0932\u094b\u0917 \u092d\u0940 \u0915\u0939\u0947\u0902\u0917\u0947 \u0915\u093f \u0905\u0930\u094d\u091c\u0941\u0928\u0928\u0947 \u0935\u093f\u091c\u092f \u0915\u0930 \u0932\u0940?\\n\'\u092f\u0936\u094b \u0932\u092d\u0938\u094d\u0935\' \u0915\u0939\u0928\u0947\u0915\u093e \u092f\u0939 \u0905\u0930\u094d\u0925 \u0928\u0939\u0940\u0902 \u0939\u0948 \u0915\u093f \u092f\u0936\u0915\u0940 \u092a\u094d\u0930\u093e\u092a\u094d\u0924\u093f \u0939\u094b\u0928\u0947\u092a\u0930 \u0924\u0941\u092e \u092b\u0942\u0932 \u091c\u093e\u0913 \u0915\u093f \'\u0935\u093e\u0939\' ! \u092e\u0948\u0902\u0928\u0947 \u0935\u093f\u091c\u092f \u092a\u094d\u0930\u093e\u092a\u094d\u0924 \u0915\u0930 \u0932\u0940\', \u092a\u094d\u0930\u0924\u094d\u092f\u0941\u0924 \u0924\u0941\u092e \u0910\u0938\u093e \u0938\u092e\u091d\u094b \u0915\u093f \u091c\u0948\u0938\u0947 \u092f\u0947 \u092a\u094d\u0930\u0924\u093f\u092a\u0915\u094d\u0937\u0940 \u092e\u0947\u0930\u0947 \u0926\u094d\u0935\u093e\u0930\u093e \u092e\u093e\u0930\u0947 \u0939\u0941\u090f \u0939\u0940 \u092e\u0930\u0947\u0902\u0917\u0947, \u0910\u0938\u0947 \u0939\u0940 \u092f\u0936 \u092d\u0940 \u091c\u094b \u0939\u094b\u0928\u0947\u0935\u093e\u0932\u093e \u0939\u0948, \u0935\u0939\u0940 \u0939\u094b\u0917\u093e\u0964 \u0905\u0917\u0930 \u0924\u0941\u092e \u092f\u0936\u0915\u094b \u0905\u092a\u0928\u0947 \u092a\u0941\u0930\u0941\u0937\u093e\u0930\u094d\u0925\u0938\u0947 \u092a\u094d\u0930\u093e\u092a\u094d\u0924 \u092e\u093e\u0928\u0915\u0930 \u0930\u093e\u091c\u0940 \u0939\u094b\u0913\u0917\u0947, \u0924\u094b \u0924\u0941\u092e \u092b\u0932\u092e\u0947\u0902 \u092c\u0901\u0927 \u091c\u093e\u0913\u0917\u0947 -- \'\u092b\u0932\u0947 \u0938\u0915\u094d\u0924\u094b \u0928\u093f\u092c\u0927\u094d\u092f\u0924\u0947\' (\u0917\u0940\u0924\u093e 5\u0964 12)\u0964 \u0924\u093e\u0924\u094d\u092a\u0930\u094d\u092f \u092f\u0939 \u0939\u0941\u0906 \u0915\u093f \u0932\u093e\u092d-\u0939\u093e\u0928\u093f, \u092f\u0936-\u0905\u092a\u092f\u0936 \u0938\u092c \u092a\u094d\u0930\u092d\u0941\u0915\u0947 \u0939\u093e\u0925\u092e\u0947\u0902 \u0939\u0948\u0964 \u0905\u0924\u0903 \u092e\u0928\u0941\u0937\u094d\u092f \u0907\u0928\u0915\u0947 \u0938\u093e\u0925 \u0905\u092a\u0928\u093e \u0938\u092e\u094d\u092c\u0928\u094d\u0927 \u0928 \u091c\u094b\u093c\u0921\u093c\u0947; \u0915\u094d\u092f\u094b\u0902\u0915\u093f \u092f\u0947 \u0924\u094b \u0939\u094b\u0928\u0939\u093e\u0930 \u0939\u0948\u0902\u0964\\n\xa0 \xa0 \'\u091c\u093f\u0924\u094d\u0935\u093e \u0936\u0924\u094d\u0930\u0942\u0928\u094d \u092d\u0941\u0919\u094d\u0915\u094d\u0937\u094d\u0935 \u0930\u093e\u091c\u094d\u092f\u0902 \u0938\u092e\u0943\u0926\u094d\u0927\u092e\u094d\'--\u0938\u092e\u0943\u0926\u094d\u0927 \u0930\u093e\u091c\u094d\u092f\u092e\u0947\u0902 \u0926\u094b \u092c\u093e\u0924\u0947\u0902 \u0939\u094b\u0924\u0940 \u0939\u0948\u0902 -- (1) \u0930\u093e\u091c\u094d\u092f \u0928\u093f\u0937\u094d\u0915\u0923\u094d\u091f\u0915 \u0939\u094b \u0905\u0930\u094d\u0925\u093e\u0924\u094d \u0909\u0938\u092e\u0947\u0902 \u092c\u093e\u0927\u093e \u0926\u0947\u0928\u0947\u0935\u093e\u0932\u093e \u0915\u094b\u0908 \u092d\u0940 \u0936\u0924\u094d\u0930\u0941 \u092f\u093e \u092a\u094d\u0930\u0924\u093f\u092a\u0915\u094d\u0937\u0940 \u0928 \u0930\u0939\u0947 \u0914\u0930 (2) \u0930\u093e\u091c\u094d\u092f \u0927\u0928-\u0927\u093e\u0928\u094d\u092f\u0938\u0947 \u0938\u092e\u094d\u092a\u0928\u094d\u0928 \u0939\u094b \u0905\u0930\u094d\u0925\u093e\u0924\u094d \u092a\u094d\u0930\u091c\u093e\u0915\u0947 \u092a\u093e\u0938 \u0916\u0942\u092c \u0927\u0928-\u0938\u092e\u094d\u092a\u0924\u094d\u0924\u093f \u0939\u094b; \u0939\u093e\u0925\u0940, \u0918\u094b\u0921\u093c\u0947, \u0917\u093e\u092f, \u091c\u092e\u0940\u0928, \u092e\u0915\u093e\u0928, \u091c\u0932\u093e\u0936\u092f \u0906\u0926\u093f \u0906\u0935\u0936\u094d\u092f\u0915 \u0935\u0938\u094d\u0924\u0941\u090f\u0901 \u092d\u0930\u092a\u0942\u0930 \u0939\u094b\u0902 \u092a\u094d\u0930\u091c\u093e\u0915\u0947 \u0916\u093e\u0928\u0947 \u0915\u0947 \u0932\u093f\u092f\u0947 \u092d\u0930\u092a\u0942\u0930 \u0905\u0928\u094d\u0928 \u0939\u094b\u0964 \u0907\u0928 \u0926\u094b\u0928\u094b\u0902 \u092c\u093e\u0924\u094b\u0902\u0938\u0947 \u0939\u0940 \u0930\u093e\u091c\u094d\u092f\u0915\u0940 \u0938\u092e\u0943\u0926\u094d\u0927\u0924\u093e, \u092a\u0942\u0930\u094d\u0923\u0924\u093e \u0939\u094b\u0924\u0940 \u0939\u0948\u0964 \u092d\u0917\u0935\u093e\u0928\u094d \u0905\u0930\u094d\u091c\u0941\u0928\u0938\u0947 \u0915\u0939\u0924\u0947 \u0939\u0948\u0902 \u0915\u093f \u0936\u0924\u094d\u0930\u0941\u0913\u0902\u0915\u094b \u091c\u0940\u0924\u0915\u0930 \u0924\u0941\u092e \u0910\u0938\u0947 \u0928\u093f\u0937\u094d\u0915\u0923\u094d\u091f\u0915 \u0914\u0930 \u0927\u0928-\u0927\u093e\u0928\u094d\u092f\u0938\u0947 \u0938\u092e\u094d\u092a\u0928\u094d\u0928 \u0930\u093e\u091c\u094d\u092f\u0915\u094b \u092d\u094b\u0917\u094b\u0964\u092f\u0939\u093e\u0901 \u0930\u093e\u091c\u094d\u092f\u0915\u094b \u092d\u094b\u0917\u0928\u0947\u0915\u093e \u0905\u0930\u094d\u0925 \u0905\u0928\u0941\u0915\u0942\u0932\u0924\u093e\u0915\u093e \u0938\u0941\u0916 \u092d\u094b\u0917\u0928\u0947\u092e\u0947\u0902 \u0928\u0939\u0940\u0902 \u0939\u0948, \u092a\u094d\u0930\u0924\u094d\u092f\u0941\u0924 \u092f\u0939 \u0905\u0930\u094d\u0925 \u0939\u0948 \u0915\u093f \u0938\u093e\u0927\u093e\u0930\u0923 \u0932\u094b\u0917 \u091c\u093f\u0938\u0947 \u092d\u094b\u0917 \u092e\u093e\u0928\u0924\u0947 \u0939\u0948\u0902, \u0909\u0938 \u0930\u093e\u091c\u094d\u092f\u0915\u094b \u092d\u0940 \u0924\u0941\u092e \u0905\u0928\u093e\u092f\u093e\u0938 \u092a\u094d\u0930\u093e\u092a\u094d\u0924 \u0915\u0930 \u0932\u094b\u0964"},{"text":"\u0926\u094d\u0930\u094b\u0923\u0902 \u091a \u092d\u0940\u0937\u094d\u092e\u0902 \u091a \u091c\u092f\u0926\u094d\u0930\u0925\u0902 \u091a\\n\u0915\u0930\u094d\u0923\u0902 \u0924\u0925\u093e\u093d\u0928\u094d\u092f\u093e\u0928\u092a\u093f \u092f\u094b\u0927\u0935\u0940\u0930\u093e\u0928\u094d\u0964\\n\u092e\u092f\u093e \u0939\u0924\u093e\u0902\u0938\u094d\u0924\u094d\u0935\u0902 \u091c\u0939\u093f \u092e\u093e \u0935\u094d\u092f\u0925\u093f\u0937\u094d\u0920\u093e\\n\u092f\u0941\u0927\u094d\u092f\u0938\u094d\u0935 \u091c\u0947\u0924\u093e\u0938\u093f \u0930\u0923\u0947 \u0938\u092a\u0924\u094d\u0928\u093e\u0928\u094d\u0964\u096411.34\u0964\u0964","translation":"\u0964\u096411.34\u0964\u0964 \u0926\u094d\u0930\u094b\u0923, \u092d\u0940\u0937\u094d\u092e, \u091c\u092f\u0926\u094d\u0930\u0925 \u0914\u0930 \u0915\u0930\u094d\u0923 \u0924\u0925\u093e \u0905\u0928\u094d\u092f \u0938\u092d\u0940 \u092e\u0947\u0930\u0947 \u0926\u094d\u0935\u093e\u0930\u093e \u092e\u093e\u0930\u0947 \u0939\u0941\u090f \u0936\u0942\u0930\u0935\u0940\u0930\u094b\u0902\u0915\u094b \u0924\u0941\u092e \u092e\u093e\u0930\u094b\u0964 \u0924\u0941\u092e \u0935\u094d\u092f\u0925\u093e \u092e\u0924 \u0915\u0930\u094b \u0914\u0930 \u092f\u0941\u0926\u094d\u0927 \u0915\u0930\u094b\u0964 \u092f\u0941\u0926\u094d\u0927\u092e\u0947\u0902 \u0924\u0941\u092e \u0928\u093f\u0903\u0938\u0928\u094d\u0926\u0947\u0939 \u0935\u0948\u0930\u093f\u092f\u094b\u0902\u0915\u094b \u091c\u0940\u0924\u094b\u0917\u0947\u0964","commentary":"\u0964\u096411.34\u0964\u0964\xa0\u0935\u094d\u092f\u093e\u0916\u094d\u092f\u093e--\'\u0926\u094d\u0930\u094b\u0923\u0902 \u091a \u092d\u0940\u0937\u094d\u092e\u0902 \u091a \u091c\u092f\u0926\u094d\u0930\u0925\u0902 \u091a \u0915\u0930\u094d\u0923\u0902 \u0924\u0925\u093e\u0928\u094d\u092f\u093e\u0928\u092a\u093f \u092f\u094b\u0927\u0935\u0940\u0930\u093e\u0928\u094d \u092e\u092f\u093e \u0939\u0924\u093e\u0902\u0938\u094d\u0924\u094d\u0935\u0902 \u091c\u0939\u093f\'--\u0924\u0941\u092e\u094d\u0939\u093e\u0930\u0940 \u0926\u0943\u0937\u094d\u091f\u093f\u092e\u0947\u0902 \u0917\u0941\u0930\u0941 \u0926\u094d\u0930\u094b\u0923\u093e\u091a\u093e\u0930\u094d\u092f, \u092a\u093f\u0924\u093e\u092e\u0939 \u092d\u0940\u0937\u094d\u092e, \u091c\u092f\u0926\u094d\u0930\u0925 \u0914\u0930 \u0915\u0930\u094d\u0923 \u0924\u0925\u093e \u0905\u0928\u094d\u092f \u091c\u093f\u0924\u0928\u0947 \u092a\u094d\u0930\u0924\u093f\u092a\u0915\u094d\u0937\u0915\u0947 \u0928\u093e\u092e\u0940 \u0936\u0942\u0930\u0935\u0940\u0930 \u0939\u0948\u0902, \u091c\u093f\u0928\u092a\u0930 \u0935\u093f\u091c\u092f \u0915\u0930\u0928\u093e \u092c\u0921\u093c\u093e \u0915\u0920\u093f\u0928 \u0915\u093e\u092e \u0939\u0948 (\u091f\u093f\u092a\u094d\u092a\u0923\u0940 \u092a0 597),\xa0\u0909\u0928 \u0938\u092c\u0915\u0940 \u0906\u092f\u0941 \u0938\u092e\u093e\u092a\u094d\u0924 \u0939\u094b \u091a\u0941\u0915\u0940 \u0939\u0948 \u0905\u0930\u094d\u0925\u093e\u0924\u094d \u0935\u0947 \u0938\u092c \u0915\u093e\u0932\u0930\u0942\u092a \u092e\u0947\u0930\u0947 \u0926\u094d\u0935\u093e\u0930\u093e \u092e\u093e\u0930\u0947 \u091c\u093e \u091a\u0941\u0915\u0947 \u0939\u0948\u0902\u0964 \u0907\u0938\u0932\u093f\u092f\u0947 \u0939\u0947 \u0905\u0930\u094d\u091c\u0941\u0928 ! \u092e\u0947\u0930\u0947 \u0926\u094d\u0935\u093e\u0930\u093e \u092e\u093e\u0930\u0947 \u0939\u0941\u090f \u0936\u0942\u0930\u0935\u0940\u0930\u094b\u0902\u0915\u094b \u0924\u0941\u092e \u092e\u093e\u0930 \u0926\u094b\u0964 \u092d\u0917\u0935\u093e\u0928\u094d\u0915\u0947 \u0926\u094d\u0935\u093e\u0930\u093e \u092a\u0942\u0930\u094d\u0935\u0936\u094d\u0932\u094b\u0915\u092e\u0947\u0902 \'\u092e\u092f\u0948\u0935\u0948\u0924\u0947 \u0928\u093f\u0939\u0924\u093e\u0903 \u092a\u0942\u0930\u094d\u0935\u092e\u0947\u0935\' \u0914\u0930 \u092f\u0939\u093e\u0901 \'\u092e\u092f\u093e \u0939\u0924\u093e\u0902\u0938\u094d\u0924\u094d\u0935\u0902 \u091c\u0939\u093f\' \u0915\u0939\u0928\u0947\u0915\u093e \u0924\u093e\u0924\u094d\u092a\u0930\u094d\u092f \u092f\u0939 \u0939\u0948 \u0915\u093f \u0924\u0941\u092e \u0907\u0928\u092a\u0930 \u0935\u093f\u091c\u092f \u0915\u0930\u094b, \u092a\u0930 \u0935\u093f\u091c\u092f\u0915\u093e \u0905\u092d\u093f\u092e\u093e\u0928 \u092e\u0924 \u0915\u0930\u094b; \u0915\u094d\u092f\u094b\u0902\u0915\u093f \u092f\u0947 \u0938\u092c-\u0915\u0947-\u0938\u092c \u092e\u0947\u0930\u0947 \u0926\u094d\u0935\u093e\u0930\u093e \u092a\u0939\u0932\u0947\u0938\u0947 \u0939\u0940 \u092e\u093e\u0930\u0947 \u0939\u0941\u090f \u0939\u0948\u0902\u0964\'\u092e\u093e \u0935\u094d\u092f\u0925\u093f\u0937\u094d\u0920\u093e \u092f\u0941\u0927\u094d\u092f\u0938\u094d\u0935\'--\u0905\u0930\u094d\u091c\u0941\u0928 \u092a\u093f\u0924\u093e\u092e\u0939 \u092d\u0940\u0937\u094d\u092e \u0914\u0930 \u0917\u0941\u0930\u0941 \u0926\u094d\u0930\u094b\u0923\u093e\u091a\u093e\u0930\u094d\u092f\u0915\u094b \u092e\u093e\u0930\u0928\u0947\u092e\u0947\u0902 \u092a\u093e\u092a \u0938\u092e\u091d\u0924\u0947 \u0925\u0947, \u092f\u0939\u0940 \u0905\u0930\u094d\u091c\u0941\u0928\u0915\u0947 \u092e\u0928\u092e\u0947\u0902 \u0935\u094d\u092f\u0925\u093e \u0925\u0940\u0964 \u0905\u0924\u0903 \u092d\u0917\u0935\u093e\u0928\u094d \u0915\u0939 \u0930\u0939\u0947 \u0939\u0948\u0902 \u0915\u093f \u0935\u0939 \u0935\u094d\u092f\u0925\u093e \u092d\u0940 \u0924\u0941\u092e \u092e\u0924 \u0915\u0930\u094b \u0905\u0930\u094d\u0925\u093e\u0924\u094d \u092d\u0940\u0937\u094d\u092e \u0914\u0930 \u0926\u094d\u0930\u094b\u0923 \u0906\u0926\u093f\u0915\u094b \u092e\u093e\u0930\u0928\u0947\u0938\u0947 \u0939\u093f\u0902\u0938\u093e \u0906\u0926\u093f \u0926\u094b\u0937\u094b\u0902\u0915\u093e \u0935\u093f\u091a\u093e\u0930 \u0915\u0930\u0928\u0947\u0915\u0940 \u0924\u0941\u092e\u094d\u0939\u0947\u0902 \u0915\u093f\u091e\u094d\u091a\u093f\u0928\u094d\u092e\u093e\u0924\u094d\u0930 \u092d\u0940 \u0906\u0935\u0936\u094d\u092f\u0915\u0924\u093e \u0928\u0939\u0940\u0902 \u0939\u0948\u0964 \u0924\u0941\u092e \u0905\u092a\u0928\u0947 \u0915\u094d\u0937\u093e\u0924\u094d\u0930\u0927\u0930\u094d\u092e\u0915\u093e \u0905\u0928\u0941\u0937\u094d\u0920\u093e\u0928 \u0915\u0930\u094b \u0905\u0930\u094d\u0925\u093e\u0924\u094d \u092f\u0941\u0926\u094d\u0927 \u0915\u0930\u094b\u0964 \u0907\u0938\u0915\u093e \u0924\u094d\u092f\u093e\u0917 \u092e\u0924 \u0915\u0930\u094b\u0964\\n\'\u091c\u0947\u0924\u093e\u0938\u093f \u0930\u0923\u0947 \u0938\u092a\u0924\u094d\u0928\u093e\u0928\u094d\'--\u0907\u0938 \u092f\u0941\u0926\u094d\u0927\u092e\u0947\u0902 \u0924\u0941\u092e \u0935\u0948\u0930\u093f\u092f\u094b\u0902\u0915\u094b \u091c\u0940\u0924\u094b\u0917\u0947\u0964 \u0910\u0938\u093e \u0915\u0939\u0928\u0947\u0915\u093e \u0924\u093e\u0924\u094d\u092a\u0930\u094d\u092f \u0939\u0948 \u0915\u093f \u092a\u0939\u0932\u0947 (\u0917\u0940\u0924\u093e 2\u0964 6 \u092e\u0947\u0902) \u0905\u0930\u094d\u091c\u0941\u0928\u0928\u0947 \u0915\u0939\u093e \u0925\u093e \u0915\u093f \u0939\u092e \u0909\u0928\u0915\u094b \u091c\u0940\u0924\u0947\u0902\u0917\u0947 \u092f\u093e \u0935\u0947 \u0939\u092e\u0947\u0902 \u091c\u0940\u0924\u0947\u0902\u0917\u0947 -- \u0907\u0938\u0915\u093e \u0939\u092e\u0947\u0902 \u092a\u0924\u093e \u0928\u0939\u0940\u0902\u0964 \u0907\u0938 \u092a\u094d\u0930\u0915\u093e\u0930 \u0905\u0930\u094d\u091c\u0941\u0928\u0915\u0947 \u092e\u0928\u092e\u0947\u0902 \u0938\u0928\u094d\u0926\u0947\u0939 \u0925\u093e\u0964 \u092f\u0939\u093e\u0901 \u0917\u094d\u092f\u093e\u0930\u0939\u0935\u0947\u0902 \u0905\u0927\u094d\u092f\u093e\u092f\u0915\u0947 \u0906\u0930\u092e\u094d\u092d\u092e\u0947\u0902 \u092d\u0917\u0935\u093e\u0928\u094d\u0928\u0947 \u0905\u0930\u094d\u091c\u0941\u0928\u0915\u094b \u0935\u093f\u0936\u094d\u0935\u0930\u0942\u092a \u0926\u0947\u0916\u0928\u0947\u0915\u0940 \u0906\u091c\u094d\u091e\u093e \u0926\u0940, \u0924\u094b \u0909\u0938\u092e\u0947\u0902 \u092d\u0917\u0935\u093e\u0928\u094d\u0928\u0947 \u0915\u0939\u093e \u0915\u093f \u0924\u0941\u092e \u0914\u0930 \u092d\u0940 \u091c\u094b \u0915\u0941\u091b \u0926\u0947\u0916\u0928\u093e \u091a\u093e\u0939\u094b, \u0935\u0939 \u0926\u0947\u0916 \u0932\u094b (11\u0964 7) \u0905\u0930\u094d\u0925\u093e\u0924\u094d \u0915\u093f\u0938\u0915\u0940 \u091c\u092f \u0939\u094b\u0917\u0940 \u0914\u0930 \u0915\u093f\u0938\u0915\u0940 \u092a\u0930\u093e\u091c\u092f \u0939\u094b\u0917\u0940 -- \u092f\u0939 \u092d\u0940 \u0924\u0941\u092e \u0926\u0947\u0916 \u0932\u094b\u0964 \u092b\u093f\u0930 \u092d\u0917\u0935\u093e\u0928\u094d\u0928\u0947 \u0935\u093f\u0930\u093e\u091f\u094d\u0930\u0942\u092a\u0915\u0947 \u0905\u0928\u094d\u0924\u0930\u094d\u0917\u0924 \u092d\u0940\u0937\u094d\u092e, \u0926\u094d\u0930\u094b\u0923 \u0914\u0930 \u0915\u0930\u094d\u0923\u0915\u0947 \u0928\u093e\u0936\u0915\u0940 \u092c\u093e\u0924 \u0926\u093f\u0916\u093e \u0926\u0940 \u0914\u0930 \u0907\u0938 \u0936\u094d\u0932\u094b\u0915\u092e\u0947\u0902 \u0935\u0939 \u092c\u093e\u0924 \u0938\u094d\u092a\u0937\u094d\u091f\u0930\u0942\u092a\u0938\u0947 \u0915\u0939 \u0926\u0940 \u0915\u093f \u092f\u0941\u0926\u094d\u0927\u092e\u0947\u0902 \u0928\u093f\u0903\u0938\u0928\u094d\u0926\u0947\u0939 \u0924\u0941\u092e\u094d\u0939\u093e\u0930\u0940 \u0935\u093f\u091c\u092f \u0939\u094b\u0917\u0940\u0964\\n\u0935\u093f\u0936\u0947\u0937 \u092c\u093e\u0924\\n\u0938\u093e\u0927\u0915\u0915\u094b \u0905\u092a\u0928\u0947 \u0938\u093e\u0927\u0928\u092e\u0947\u0902 \u092c\u093e\u0927\u0915\u0930\u0942\u092a\u0938\u0947 \u0928\u093e\u0936\u0935\u093e\u0928\u094d \u092a\u0926\u093e\u0930\u094d\u0925\u094b\u0902\u0915\u093e, \u0935\u094d\u092f\u0915\u094d\u0924\u093f\u092f\u094b\u0902\u0915\u093e \u091c\u094b \u0906\u0915\u0930\u094d\u0937\u0923 \u0926\u0940\u0916\u0924\u093e \u0939\u0948, \u0909\u0938\u0938\u0947 \u0935\u0939 \u0918\u092c\u0930\u093e \u091c\u093e\u0924\u093e \u0939\u0948 \u0915\u093f \u092e\u0947\u0930\u093e \u0909\u0926\u094d\u092f\u094b\u0917 \u0915\u0941\u091b \u092d\u0940 \u0915\u093e\u092e \u0928\u0939\u0940\u0902 \u0915\u0930 \u0930\u0939\u093e \u0939\u0948; \u0905\u0924\u0903 \u092f\u0939 \u0906\u0915\u0930\u094d\u0937\u0923 \u0915\u0948\u0938\u0947 \u092e\u093f\u091f\u0947 ! \u092d\u0917\u0935\u093e\u0928\u094d,\'\u092e\u092f\u0948\u0935\u0948\u0924\u0947 \u0928\u093f\u0939\u0924\u093e\u0903 \u092a\u0942\u0930\u094d\u0935\u092e\u0947\u0935\' \u0914\u0930 \'\u092e\u092f\u093e \u0939\u0924\u093e\u0902\u0938\u094d\u0924\u094d\u0935\u0902 \u091c\u0939\u093f\' \u092a\u0926\u094b\u0902\u0938\u0947 \u0922\u093e\u0922\u093c\u0938 \u092c\u0901\u0927\u093e\u0924\u0947 \u0939\u0941\u090f \u092e\u093e\u0928\u094b \u092f\u0939 \u0906\u0936\u094d\u0935\u093e\u0938\u0928 \u0926\u0947\u0924\u0947 \u0939\u0948\u0902 \u0915\u093f \u0924\u0941\u092e\u094d\u0939\u093e\u0930\u0947\u0915\u094b \u0905\u092a\u0928\u0947 \u0938\u093e\u0927\u0928\u092e\u0947\u0902 \u091c\u094b \u0935\u0938\u094d\u0924\u0941\u0913\u0901 \u0906\u0926\u093f\u0915\u093e \u0906\u0915\u0930\u094d\u0937\u0923 \u0926\u093f\u0916\u093e\u092f\u0940 \u0926\u0947\u0924\u093e \u0939\u0948 \u0914\u0930 \u0935\u0943\u0924\u094d\u0924\u093f\u092f\u093e\u0901 \u0916\u0930\u093e\u092c \u0939\u094b\u0924\u0940 \u0939\u0941\u0908 \u0926\u0940\u0916\u0924\u0940 \u0939\u0948\u0902, \u092f\u0947 \u0938\u092c-\u0915\u0947-\u0938\u092c \u0935\u093f\u0918\u094d\u0928 \u0928\u093e\u0936\u0935\u093e\u0928\u094d \u0939\u0948\u0902 \u0914\u0930 \u092e\u0947\u0930\u0947 \u0926\u094d\u0935\u093e\u0930\u093e \u0928\u0937\u094d\u091f \u0915\u093f\u092f\u0947 \u0939\u0941\u090f \u0939\u0948\u0902\u0964 \u0907\u0938\u0932\u093f\u092f\u0947 \u0938\u093e\u0927\u0915 \u0907\u0928\u0915\u094b \u092e\u0939\u0924\u094d\u0924\u094d\u0935 \u0928 \u0926\u0947\u0964"},{"text":"\u0938\u091e\u094d\u091c\u092f \u0909\u0935\u093e\u091a\\n\u090f\u0924\u091a\u094d\u091b\u094d\u0930\u0941\u0924\u094d\u0935\u093e \u0935\u091a\u0928\u0902 \u0915\u0947\u0936\u0935\u0938\u094d\u092f\\n\u0915\u0943\u0924\u093e\u091e\u094d\u091c\u0932\u093f\u0930\u094d\u0935\u0947\u092a\u092e\u093e\u0928\u0903 \u0915\u093f\u0930\u0940\u091f\u0940\u0964\\n\u0928\u092e\u0938\u094d\u0915\u0943\u0924\u094d\u0935\u093e \u092d\u0942\u092f \u090f\u0935\u093e\u0939 \u0915\u0943\u0937\u094d\u0923\u0902\\n\u0938\u0917\u0926\u094d\u0917\u0926\u0902 \u092d\u0940\u0924\u092d\u0940\u0924\u0903 \u092a\u094d\u0930\u0923\u092e\u094d\u092f\u0964\u096411.35\u0964\u0964","translation":"\u0964\u096411.35\u0964\u0964 \u0938\u091e\u094d\u091c\u092f \u092c\u094b\u0932\u0947 -- \u092d\u0917\u0935\u093e\u0928\u094d \u0915\u0947\u0936\u0935\u0915\u093e \u092f\u0939 \u0935\u091a\u0928 \u0938\u0941\u0928\u0915\u0930 \u092d\u092f\u0938\u0947 \u0915\u092e\u094d\u092a\u093f\u0924 \u0939\u0941\u090f \u0915\u093f\u0930\u0940\u091f\u0940 \u0905\u0930\u094d\u091c\u0941\u0928 \u0939\u093e\u0925 \u091c\u094b\u0921\u093c\u0915\u0930 \u0928\u092e\u0938\u094d\u0915\u093e\u0930 \u0915\u0930\u0915\u0947 \u0914\u0930 \u0905\u0924\u094d\u092f\u0928\u094d\u0924 \u092d\u092f\u092d\u0940\u0924 \u0939\u094b\u0915\u0930 \u092b\u093f\u0930 \u092a\u094d\u0930\u0923\u093e\u092e \u0915\u0930\u0915\u0947 \u0917\u0926\u094d\u0917\u0926\u0902 \u0935\u093e\u0923\u0940\u0938\u0947 \u092d\u0917\u0935\u093e\u0928\u094d \u0915\u0943\u0937\u094d\u0923\u0938\u0947 \u092c\u094b\u0932\u0947\u0964","commentary":"\u0964\u096411.35\u0964\u0964\xa0\u0935\u094d\u092f\u093e\u0916\u094d\u092f\u093e--\'\u090f\u0924\u091a\u094d\u091b\u094d\u0930\u0941\u0924\u094d\u0935\u093e \u0935\u091a\u0928\u0902 \u0915\u0947\u0936\u0935\u0938\u094d\u092f \u0915\u0943\u0924\u093e\u091e\u094d\u091c\u0932\u093f\u0930\u094d\u0935\u0947\u092a\u092e\u093e\u0928\u0903 \u0915\u093f\u0930\u0940\u091f\u0940\'--  \u0905\u0930\u094d\u091c\u0941\u0928 \u0924\u094b \u092a\u0939\u0932\u0947\u0938\u0947 \u092d\u092f\u092d\u0940\u0924 \u0925\u0947 \u0939\u0940, \u092b\u093f\u0930 \u092d\u0917\u0935\u093e\u0928\u094d\u0928\u0947 \u092e\u0948\u0902 \u0915\u093e\u0932 \u0939\u0942\u0901, \u0938\u092c\u0915\u094b \u0916\u093e \u091c\u093e\u090a\u0901\u0917\u093e -- \u0910\u0938\u093e \u0915\u0939\u0915\u0930 \u092e\u093e\u0928\u094b \u0921\u0930\u0947 \u0939\u0941\u090f\u0915\u094b \u0914\u0930 \u0921\u0930\u093e \u0926\u093f\u092f\u093e\u0964 \u0924\u093e\u0924\u094d\u092a\u0930\u094d\u092f \u0939\u0948 \u0915\u093f \'\u0915\u093e\u0932\u094b\u093d\u0938\u094d\u092e\u093f\'--\u092f\u0939\u093e\u0901\u0938\u0947 \u0932\u0947\u0915\u0930 \'\u092e\u092f\u093e \u0939\u0924\u093e\u0902\u0938\u094d\u0924\u094d\u0935\u0902 \u091c\u0939\u093f\'--\u092f\u0939\u093e\u0901\u0924\u0915 \u092d\u0917\u0935\u093e\u0928\u094d\u0928\u0947 \u0928\u093e\u0936-\u0939\u0940-\u0928\u093e\u0936\u0915\u0940 \u092c\u093e\u0924 \u092c\u0924\u093e\u092f\u0940\u0964 \u0907\u0938\u0947 \u0938\u0941\u0928\u0915\u0930 \u0905\u0930\u094d\u091c\u0941\u0928 \u0921\u0930\u0915\u0947 \u092e\u093e\u0930\u0947 \u0915\u093e\u0901\u092a\u0928\u0947 \u0932\u0917\u0947 \u0914\u0930 \u0939\u093e\u0925 \u091c\u094b\u0921\u093c\u0915\u0930 \u092c\u093e\u0930-\u092c\u093e\u0930 \u0928\u092e\u0938\u094d\u0915\u093e\u0930 \u0915\u0930\u0928\u0947 \u0932\u0917\u0947\u0964\\n\u0905\u0930\u094d\u091c\u0941\u0928\u0928\u0947 \u0907\u0928\u094d\u0926\u094d\u0930\u0915\u0940 \u0938\u0939\u093e\u092f\u0924\u093e\u0915\u0947 \u0932\u093f\u092f\u0947 \u091c\u092c \u0915\u093e\u0932, \u0916\u091e\u094d\u091c \u0906\u0926\u093f \u0930\u093e\u0915\u094d\u0937\u0938\u094b\u0902\u0915\u094b \u092e\u093e\u0930\u093e \u0925\u093e, \u0924\u092c \u0907\u0928\u094d\u0926\u094d\u0930\u0928\u0947 \u092a\u094d\u0930\u0938\u0928\u094d\u0928 \u0939\u094b\u0915\u0930 \u0905\u0930\u094d\u091c\u0941\u0928\u0915\u094b \u0938\u0942\u0930\u094d\u092f\u0915\u0947 \u0938\u092e\u093e\u0928 \u092a\u094d\u0930\u0915\u093e\u0936\u0935\u093e\u0932\u093e \u090f\u0915 \u0926\u093f\u0935\u094d\u092f \'\u0915\u093f\u0930\u0940\u091f\' (\u092e\u0941\u0915\u0941\u091f) \u0926\u093f\u092f\u093e \u0925\u093e\u0964 \u0907\u0938\u0940\u0938\u0947 \u0905\u0930\u094d\u091c\u0941\u0928\u0915\u093e \u0928\u093e\u092e \u0915\u093f\u0930\u0940\u091f\u0940 \u092a\u0921\u093c \u0917\u092f\u093e (\u091f\u093f\u092a\u094d\u092a\u0923\u0940 \u092a0 598)\u0964 \u092f\u0939\u093e\u0901 \'\u0915\u093f\u0930\u0940\u091f\u0940\' \u0915\u0939\u0928\u0947\u0915\u093e \u0924\u093e\u0924\u094d\u092a\u0930\u094d\u092f \u0939\u0948 \u0915\u093f \u091c\u093f\u0928\u094d\u0939\u094b\u0902\u0928\u0947 \u092c\u0921\u093c\u0947-\u092c\u0921\u093c\u0947 \u0930\u093e\u0915\u094d\u0937\u0938\u094b\u0902\u0915\u094b \u092e\u093e\u0930\u0915\u0930 \u0907\u0928\u094d\u0926\u094d\u0930\u0915\u0940 \u0938\u0939\u093e\u092f\u0924\u093e \u0915\u0940 \u0925\u0940,\u0935\u0947 \u0905\u0930\u094d\u091c\u0941\u0928 \u092d\u0940 \u092d\u0917\u0935\u093e\u0928\u094d\u0915\u0947 \u0935\u093f\u0930\u093e\u091f\u094d\u0930\u0942\u092a\u0915\u094b \u0926\u0947\u0916\u0915\u0930 \u0915\u092e\u094d\u092a\u093f\u0924 \u0939\u094b \u0930\u0939\u0947 \u0939\u0948\u0902\u0964\'\u0928\u092e\u0938\u094d\u0915\u0943\u0924\u094d\u0935\u093e \u092d\u0942\u092f \u090f\u0935\u093e\u0939 \u0915\u0943\u0937\u094d\u0923\u0902 \u0917\u0926\u094d\u0917\u0926 \u092d\u0940\u0924\u092d\u0940\u0924\u0903 \u092a\u094d\u0930\u0923\u092e\u094d\u092f\'--  \u0915\u093e\u0932 \u0938\u092c\u0915\u093e \u092d\u0915\u094d\u0937\u0923 \u0915\u0930\u0924\u093e \u0939\u0948 \u0915\u093f\u0938\u0940\u0915\u094b \u092d\u0940 \u091b\u094b\u0921\u093c\u0924\u093e \u0928\u0939\u0940\u0902\u0964 \u0915\u093e\u0930\u0923 \u0915\u093f \u092f\u0939 \u092d\u0917\u0935\u093e\u0928\u094d\u0915\u0940 \u0938\u0902\u0939\u093e\u0930\u0936\u0915\u094d\u0924\u093f \u0939\u0948, \u091c\u094b \u0939\u0930\u0926\u092e \u0938\u0902\u0939\u093e\u0930 \u0915\u0930\u0924\u0940 \u0939\u0940 \u0930\u0939\u0924\u0940 \u0939\u0948\u0964 \u0907\u0927\u0930 \u0905\u0930\u094d\u091c\u0941\u0928\u0928\u0947 \u091c\u092c \u092d\u0917\u0935\u093e\u0928\u094d\u0915\u0947 \u0905\u0924\u094d\u092f\u0941\u0917\u094d\u0930 \u0935\u093f\u0930\u093e\u091f\u094d\u0930\u0942\u092a\u0915\u094b \u0926\u0947\u0916\u093e \u0924\u094b \u0909\u0928\u0915\u094b \u0932\u0917\u093e \u0915\u093f \u092d\u0917\u0935\u093e\u0928\u094d \u0915\u093e\u0932\u0915\u0947 \u092d\u0940 \u0915\u093e\u0932-- \u092e\u0939\u093e\u0915\u093e\u0932 \u0939\u0948\u0902\u0964 \u0909\u0928\u0915\u0947 \u0938\u093f\u0935\u093e\u092f \u0926\u0942\u0938\u0930\u093e \u0915\u094b\u0908 \u092d\u0940 \u0915\u093e\u0932\u0938\u0947 \u092c\u091a\u093e\u0928\u0947\u0935\u093e\u0932\u093e \u0928\u0939\u0940\u0902 \u0939\u0948\u0964 \u0907\u0938\u0932\u093f\u092f\u0947 \u0905\u0930\u094d\u091c\u0941\u0928 \u092d\u092f\u092d\u0940\u0924 \u0939\u094b\u0915\u0930 \u092d\u0917\u0935\u093e\u0928\u094d\u0915\u094b \u092c\u093e\u0930\u092c\u093e\u0930 \u092a\u094d\u0930\u0923\u093e\u092e \u0915\u0930\u0924\u0947 \u0939\u0948\u0902\u0964\'\u092d\u0942\u092f\u0903\' \u0915\u0939\u0928\u0947\u0915\u093e \u0924\u093e\u0924\u094d\u092a\u0930\u094d\u092f \u0939\u0948; \u0915\u093f \u092a\u0939\u0932\u0947 \u092a\u0902\u0926\u094d\u0930\u0939\u0935\u0947\u0902\u0938\u0947 \u0907\u0915\u0924\u0940\u0938\u0935\u0947\u0902 \u0936\u094d\u0932\u094b\u0915\u0924\u0915 \u0905\u0930\u094d\u091c\u0941\u0928\u0928\u0947 \u092d\u0917\u0935\u093e\u0928\u094d\u0915\u0940 \u0938\u094d\u0924\u0941\u0924\u093f \u0914\u0930 \u0928\u092e\u0938\u094d\u0915\u093e\u0930 \u0915\u093f\u092f\u093e, \u0905\u092c \u092b\u093f\u0930 \u092d\u0917\u0935\u093e\u0928\u094d\u0915\u0940 \u0938\u094d\u0924\u0941\u0924\u093f \u0914\u0930 \u0928\u092e\u0938\u094d\u0915\u093e\u0930 \u0915\u0930\u0924\u0947 \u0939\u0948\u0902\u0964\u0939\u0930\u094d\u0937\u0938\u0947 \u092d\u0940 \u0935\u093e\u0923\u0940 \u0917\u0926\u094d\u0917\u0926 \u0939\u094b\u0924\u0940 \u0939\u0948 \u0914\u0930 \u092d\u092f\u0938\u0947 \u092d\u0940\u0964 \u092f\u0939\u093e\u0901 \u092d\u092f\u0915\u093e \u0935\u093f\u0937\u092f \u0939\u0948\u0964 \u0905\u0917\u0930 \u0905\u0930\u094d\u091c\u0941\u0928 \u092c\u0939\u0941\u0924 \u091c\u094d\u092f\u093e\u0926\u093e \u092d\u092f\u092d\u0940\u0924 \u0939\u094b\u0924\u0947 \u0924\u094b \u0935\u0947 \u092c\u094b\u0932 \u0939\u0940 \u0928 \u0938\u0915\u0924\u0947\u0964 \u092a\u0930\u0928\u094d\u0924\u0941 \u0905\u0930\u094d\u091c\u0941\u0928 \u0917\u0926\u094d\u0917\u0926 \u0935\u093e\u0923\u0940\u0938\u0947 \u092c\u094b\u0932\u0924\u0947 \u0939\u0948\u0902\u0964 \u0907\u0938\u0938\u0947 \u0938\u093f\u0926\u094d\u0927 \u0939\u094b\u0924\u093e \u0939\u0948 \u0915\u093f \u0935\u0947 \u0907\u0924\u0928\u0947 \u092d\u092f\u092d\u0940\u0924 \u0928\u0939\u0940\u0902 \u0939\u0948\u0902\u0964\\n\xa0\u0938\u092e\u094d\u092c\u0928\u094d\u0927--\u0905\u092c \u0906\u0917\u0947\u0915\u0947 \u0936\u094d\u0932\u094b\u0915\u0938\u0947 \u0905\u0930\u094d\u091c\u0941\u0928 \u092d\u0917\u0935\u093e\u0928\u094d\u0915\u0940 \u0938\u094d\u0924\u0941\u0924\u093f \u0915\u0930\u0928\u093e \u0906\u0930\u092e\u094d\u092d \u0915\u0930\u0924\u0947 \u0939\u0948\u0902\u0964"},{"text":"\u0905\u0930\u094d\u091c\u0941\u0928 \u0909\u0935\u093e\u091a\\n\u0938\u094d\u0925\u093e\u0928\u0947 \u0939\u0943\u0937\u0940\u0915\u0947\u0936 \u0924\u0935 \u092a\u094d\u0930\u0915\u0940\u0930\u094d\u0924\u094d\u092f\u093e\\n\u091c\u0917\u0924\u094d \u092a\u094d\u0930\u0939\u0943\u0937\u094d\u092f\u0924\u094d\u092f\u0928\u0941\u0930\u091c\u094d\u092f\u0924\u0947 \u091a\u0964\\n\u0930\u0915\u094d\u0937\u093e\u0902\u0938\u093f \u092d\u0940\u0924\u093e\u0928\u093f \u0926\u093f\u0936\u094b \u0926\u094d\u0930\u0935\u0928\u094d\u0924\u093f\\n\u0938\u0930\u094d\u0935\u0947 \u0928\u092e\u0938\u094d\u092f\u0928\u094d\u0924\u093f \u091a \u0938\u093f\u0926\u094d\u0927\u0938\u0919\u094d\u0918\u093e\u0903\u0964\u096411.36\u0964\u0964","translation":"\u0964\u096411.36\u0964\u0964 \u0905\u0930\u094d\u091c\u0941\u0928 \u092c\u094b\u0932\u0947 -- \u0939\u0947 \u0905\u0928\u094d\u0924\u0930\u094d\u092f\u093e\u092e\u0940 \u092d\u0917\u0935\u0928\u094d ! \u0906\u092a\u0915\u0947 \u0928\u093e\u092e, \u0917\u0941\u0923, \u0932\u0940\u0932\u093e\u0915\u093e \u0915\u0940\u0930\u094d\u0924\u0928 \u0915\u0930\u0928\u0947\u0938\u0947 \u092f\u0939 \u0938\u092e\u094d\u092a\u0942\u0930\u094d\u0923 \u091c\u0917\u0924\u094d \u0939\u0930\u094d\u0937\u093f\u0924 \u0939\u094b \u0930\u0939\u093e \u0939\u0948 \u0914\u0930 \u0905\u0928\u0941\u0930\u093e\u0917(-\u092a\u094d\u0930\u0947\u092e-) \u0915\u094b \u092a\u094d\u0930\u093e\u092a\u094d\u0924 \u0939\u094b \u0930\u0939\u093e \u0939\u0948\u0964 \u0906\u092a\u0915\u0947 \u0928\u093e\u092e, \u0917\u0941\u0923 \u0906\u0926\u093f\u0915\u0947 \u0915\u0940\u0930\u094d\u0924\u0928\u0938\u0947 \u092d\u092f\u092d\u0940\u0924 \u0939\u094b\u0915\u0930 \u0930\u093e\u0915\u094d\u0937\u0938\u0932\u094b\u0917 \u0926\u0938\u094b\u0902 \u0926\u093f\u0936\u093e\u0913\u0902\u092e\u0947\u0902 \u092d\u093e\u0917\u0924\u0947 \u0939\u0941\u090f \u091c\u093e \u0930\u0939\u0947 \u0939\u0948\u0902 \u0914\u0930 \u0938\u092e\u094d\u092a\u0942\u0930\u094d\u0923 \u0938\u093f\u0926\u094d\u0927\u0917\u0923 \u0906\u092a\u0915\u094b \u0928\u092e\u0938\u094d\u0915\u093e\u0930 \u0915\u0930 \u0930\u0939\u0947 \u0939\u0948\u0902\u0964 \u092f\u0939 \u0938\u092c \u0939\u094b\u0928\u093e \u0909\u091a\u093f\u0924 \u0939\u0940 \u0939\u0948\u0964","commentary":"\u0964\u096411.36\u0964\u0964\xa0\u0935\u094d\u092f\u093e\u0916\u094d\u092f\u093e--[\u0938\u0902\u0938\u093e\u0930\u092e\u0947\u0902 \u092f\u0939 \u0926\u0947\u0916\u093e \u091c\u093e\u0924\u093e \u0939\u0948 \u0915\u093f \u091c\u094b \u0935\u094d\u092f\u0915\u094d\u0924\u093f \u0905\u0924\u094d\u092f\u0928\u094d\u0924 \u092d\u092f\u092d\u0940\u0924 \u0939\u094b \u091c\u093e\u0924\u093e \u0939\u0948, \u0909\u0938\u0938\u0947 \u092c\u094b\u0932\u093e \u0928\u0939\u0940\u0902 \u091c\u093e\u0924\u093e\u0964 \u0905\u0930\u094d\u091c\u0941\u0928 \u092d\u0917\u0935\u093e\u0928\u094d\u0915\u093e \u0905\u0924\u094d\u092f\u0941\u0917\u094d\u0930 \u0930\u0942\u092a \u0926\u0947\u0916\u0915\u0930 \u0905\u0924\u094d\u092f\u0928\u094d\u0924 \u092d\u092f\u092d\u0940\u0924 \u0939\u094b \u0917\u092f\u0947 \u0925\u0947\u0964 \u092b\u093f\u0930 \u0909\u0928\u094d\u0939\u094b\u0902\u0928\u0947 \u0907\u0938 (\u091b\u0924\u094d\u0924\u0940\u0938\u0935\u0947\u0902) \u0936\u094d\u0932\u094b\u0915\u0938\u0947 \u0932\u0947\u0915\u0930 \u091b\u093f\u092f\u093e\u0932\u0940\u0938\u0935\u0947\u0902 \u0936\u094d\u0932\u094b\u0915\u0924\u0915 \u092d\u0917\u0935\u093e\u0928\u094d\u0915\u0940 \u0938\u094d\u0924\u0941\u0924\u093f \u0915\u0948\u0938\u0947 \u0915\u0940? \u0907\u0938\u0915\u093e \u0938\u092e\u093e\u0927\u093e\u0928 \u092f\u0939 \u0939\u0948 \u0915\u093f \u092f\u0926\u094d\u092f\u092a\u093f \u0905\u0930\u094d\u091c\u0941\u0928 \u092d\u0917\u0935\u093e\u0928\u094d\u0915\u0947 \u0905\u0924\u094d\u092f\u0928\u094d\u0924 \u0909\u0917\u094d\u0930 (\u092d\u092f\u093e\u0928\u0915) \u0935\u093f\u0936\u094d\u0935\u0930\u0942\u092a\u0915\u094b \u0926\u0947\u0916\u0915\u0930 \u092d\u092f\u092d\u0940\u0924 \u0939\u094b \u0930\u0939\u0947 \u0925\u0947, \u0924\u0925\u093e\u092a\u093f \u0935\u0947 \u092d\u092f\u092d\u0940\u0924 \u0939\u094b\u0928\u0947\u0915\u0947 \u0938\u093e\u0925-\u0938\u093e\u0925 \u0939\u0930\u094d\u0937\u093f\u0924 \u092d\u0940 \u0939\u094b \u0930\u0939\u0947 \u0925\u0947, \u091c\u0948\u0938\u093e \u0915\u093f \u0905\u0930\u094d\u091c\u0941\u0928\u0928\u0947 \u0906\u0917\u0947 \u0915\u0939\u093e \u0939\u0948 -- \'\u0905\u0926\u0943\u0937\u094d\u091f\u092a\u0942\u0930\u094d\u0935\u0902 \u0939\u0943\u0937\u093f\u0924\u094b\u093d\u0938\u094d\u092e\u093f \u0926\u0943\u0937\u094d\u091f\u094d\u0935\u093e \u092d\u092f\u0947\u0928 \u091a \u092a\u094d\u0930\u0935\u094d\u092f\u0925\u093f\u0924\u0902 \u092e\u0928\u094b \u092e\u0947\' (11\u0964 45)\u0964 \u0907\u0938\u0938\u0947 \u0938\u093f\u0926\u094d\u0927 \u0939\u094b\u0924\u093e \u0939\u0948 \u0915\u093f \u0905\u0930\u094d\u091c\u0941\u0928 \u0907\u0924\u0928\u0947 \u092d\u092f\u092d\u0940\u0924 \u0928\u0939\u0940\u0902 \u0939\u0941\u090f \u0925\u0947, \u091c\u093f\u0938\u0938\u0947 \u0915\u093f \u0935\u0947 \u092d\u0917\u0935\u093e\u0928\u094d\u0915\u0940 \u0938\u094d\u0924\u0941\u0924\u093f \u092d\u0940 \u0928 \u0915\u0930 \u0938\u0915\u0947\u0902\u0964]"},{"text":"\u0915\u0938\u094d\u092e\u093e\u091a\u094d\u091a \u0924\u0947 \u0928 \u0928\u092e\u0947\u0930\u0928\u094d\u092e\u0939\u093e\u0924\u094d\u092e\u0928\u094d\\n\u0917\u0930\u0940\u092f\u0938\u0947 \u092c\u094d\u0930\u0939\u094d\u092e\u0923\u094b\u093d\u092a\u094d\u092f\u093e\u0926\u093f\u0915\u0930\u094d\u0924\u094d\u0930\u0947\u0964\\n\u0905\u0928\u0928\u094d\u0924 \u0926\u0947\u0935\u0947\u0936 \u091c\u0917\u0928\u094d\u0928\u093f\u0935\u093e\u0938\\n\u0924\u094d\u0935\u092e\u0915\u094d\u0937\u0930\u0902 \u0938\u0926\u0938\u0924\u094d\u0924\u0924\u094d\u092a\u0930\u0902 \u092f\u0924\u094d\u0964\u096411.37\u0964\u0964","translation":"\u0964\u096411.37\u0964\u0964 \u0939\u0947 \u092e\u0939\u093e\u0924\u094d\u092e\u0928\u094d ! \u0917\u0941\u0930\u0941\u0913\u0902\u0915\u0947 \u092d\u0940 \u0917\u0941\u0930\u0941 \u0914\u0930 \u092c\u094d\u0930\u0939\u094d\u092e\u093e\u0915\u0947 \u092d\u0940 \u0906\u0926\u093f\u0915\u0930\u094d\u0924\u093e \u0906\u092a\u0915\u0947 \u0932\u093f\u092f\u0947 (\u0935\u0947 \u0938\u093f\u0926\u094d\u0927\u0917\u0923) \u0928\u092e\u0938\u094d\u0915\u093e\u0930 \u0915\u094d\u092f\u094b\u0902 \u0928\u0939\u0940\u0902 \u0915\u0930\u0947\u0902? \u0915\u094d\u092f\u094b\u0902\u0915\u093f \u0939\u0947 \u0905\u0928\u0928\u094d\u0924 ! \u0939\u0947 \u0926\u0947\u0935\u0947\u0936 ! \u0939\u0947 \u091c\u0917\u0928\u094d\u0928\u093f\u0935\u093e\u0938 ! \u0906\u092a \u0905\u0915\u094d\u0937\u0930\u0938\u094d\u0935\u0930\u0942\u092a \u0939\u0948\u0902; \u0906\u092a \u0938\u0924\u094d \u092d\u0940 \u0939\u0948\u0902, \u0905\u0938\u0924\u094d \u092d\u0940 \u0939\u0948\u0902, \u0914\u0930 \u0938\u0924\u094d-\u0905\u0938\u0924\u094d \u0938\u0947 \u092a\u0930 \u092d\u0940 \u091c\u094b \u0915\u0941\u091b \u0939\u0948, \u0935\u0939 \u092d\u0940 \u0906\u092a \u0939\u0940 \u0939\u0948\u0902\u0964","commentary":"\u0964\u096411.37\u0964\u0964\xa0\u0935\u094d\u092f\u093e\u0916\u094d\u092f\u093e--\'\u0915\u0938\u094d\u092e\u093e\u091a\u094d\u091a \u0924\u0947 \u0928 \u0928\u092e\u0947\u0930\u0928\u094d\u092e\u0939\u093e\u0924\u094d\u092e\u0928\u094d \u0917\u0930\u0940\u092f\u0938\u0947 \u092c\u094d\u0930\u0939\u094d\u092e\u0923\u094b\u093d\u092a\u094d\u092f\u093e\u0926\u093f\u0915\u0930\u094d\u0924\u094d\u0930\u0947\'--\u0906\u0926\u093f\u0930\u0942\u092a\u0938\u0947 \u092a\u094d\u0930\u0915\u091f \u0939\u094b\u0928\u0947\u0935\u093e\u0932\u0947 \u092e\u0939\u093e\u0928\u094d \u0938\u094d\u0935\u0930\u0942\u092a \u0906\u092a\u0915\u094b (\u092a\u0942\u0930\u094d\u0935\u094b\u0915\u094d\u0924 \u0938\u093f\u0926\u094d\u0927\u0917\u0923) \u0928\u092e\u0938\u094d\u0915\u093e\u0930 \u0915\u094d\u092f\u094b\u0902 \u0928 \u0915\u0930\u0947\u0902? \u0928\u092e\u0938\u094d\u0915\u093e\u0930 \u0926\u094b\u0915\u094b \u0915\u093f\u092f\u093e \u091c\u093e\u0924\u093e \u0939\u0948 -- (1) \u091c\u093f\u0928\u0938\u0947 \u092e\u0928\u0941\u0937\u094d\u092f\u0915\u094b \u0936\u093f\u0915\u094d\u0937\u093e \u092e\u093f\u0932\u0924\u0940 \u0939\u0948, \u092a\u094d\u0930\u0915\u093e\u0936 \u092e\u093f\u0932\u0924\u093e \u0939\u0948; \u0910\u0938\u0947 \u0906\u091a\u093e\u0930\u094d\u092f, \u0917\u0941\u0930\u0941\u091c\u0928 \u0906\u0926\u093f\u0915\u094b \u0928\u092e\u0938\u094d\u0915\u093e\u0930 \u0915\u093f\u092f\u093e \u091c\u093e\u0924\u093e \u0939\u0948 \u0914\u0930 (2) \u091c\u093f\u0928\u0938\u0947 \u0939\u092e\u093e\u0930\u093e \u091c\u0928\u094d\u092e \u0939\u0941\u0906 \u0939\u0948, \u0909\u0928 \u092e\u093e\u0924\u093e-\u092a\u093f\u0924\u093e\u0915\u094b \u0924\u0925\u093e \u0906\u092f\u0941, \u0935\u093f\u0926\u094d\u092f\u093e \u0906\u0926\u093f\u092e\u0947\u0902 \u0905\u092a\u0928\u0947\u0938\u0947 \u092c\u0921\u093c\u0947 \u092a\u0941\u0930\u0941\u0937\u094b\u0902\u0915\u094b \u0928\u092e\u0938\u094d\u0915\u093e\u0930 \u0915\u093f\u092f\u093e \u091c\u093e\u0924\u093e \u0939\u0948\u0964 \u0905\u0930\u094d\u091c\u0941\u0928 \u0915\u0939\u0924\u0947 \u0939\u0948\u0902 \u0915\u093f \u0906\u092a \u0917\u0941\u0930\u0941\u0913\u0902\u0915\u0947 \u092d\u0940 \u0917\u0941\u0930\u0941 \u0939\u0948\u0902--\'\u0917\u0930\u0940\u092f\u0938\u0947\' (\u091f\u093f\u092a\u094d\u092a\u0923\u0940 \u092a0 600.1) \u0914\u0930 \u0906\u092a \u0938\u0943\u0937\u094d\u091f\u093f\u0915\u0940 \u0930\u091a\u0928\u093e \u0915\u0930\u0928\u0947\u0935\u093e\u0932\u0947 \u092a\u093f\u0924\u093e\u092e\u0939 \u092c\u094d\u0930\u0939\u094d\u092e\u093e\u091c\u0940\u0915\u094b \u092d\u0940 \u0909\u0924\u094d\u092a\u0928\u094d\u0928 \u0915\u0930\u0928\u0947\u0935\u093e\u0932\u0947 \u0939\u0948\u0902 -- \'\u092c\u094d\u0930\u0939\u094d\u092e\u0923\u094b\u093d\u092a\u094d\u092f\u093e\u0926\u093f\u0915\u0930\u094d\u0924\u094d\u0930\u0947\u0964\' \u0905\u0924\u0903 \u0938\u093f\u0926\u094d\u0927 \u092e\u0939\u093e\u092a\u0941\u0930\u0941\u0937 \u0906\u092a\u0915\u094b \u0928\u092e\u0938\u094d\u0915\u093e\u0930 \u0915\u0930\u0947\u0902, \u092f\u0939 \u0909\u091a\u093f\u0924 \u0939\u0940 \u0939\u0948\u0964"},{"text":"\u0924\u094d\u0935\u092e\u093e\u0926\u093f\u0926\u0947\u0935\u0903 \u092a\u0941\u0930\u0941\u0937\u0903 \u092a\u0941\u0930\u093e\u0923\\n\u0938\u094d\u0924\u094d\u0935\u092e\u0938\u094d\u092f \u0935\u093f\u0936\u094d\u0935\u0938\u094d\u092f \u092a\u0930\u0902 \u0928\u093f\u0927\u093e\u0928\u092e\u094d\u0964\\n\u0935\u0947\u0924\u094d\u0924\u093e\u0938\u093f \u0935\u0947\u0926\u094d\u092f\u0902 \u091a \u092a\u0930\u0902 \u091a \u0927\u093e\u092e\\n\u0924\u094d\u0935\u092f\u093e \u0924\u0924\u0902 \u0935\u093f\u0936\u094d\u0935\u092e\u0928\u0928\u094d\u0924\u0930\u0942\u092a\u0964\u096411.38\u0964\u0964","translation":"\u0964\u096411.38\u0964\u0964 \u0906\u092a \u0939\u0940 \u0906\u0926\u093f\u0926\u0947\u0935 \u0914\u0930 \u092a\u0941\u0930\u093e\u0923\u092a\u0941\u0930\u0941\u0937 \u0939\u0948\u0902 \u0924\u0925\u093e \u0906\u092a \u0939\u0940 \u0907\u0938 \u0938\u0902\u0938\u093e\u0930\u0915\u0947 \u092a\u0930\u092e \u0906\u0936\u094d\u0930\u092f \u0939\u0948\u0902\u0964 \u0906\u092a \u0939\u0940 \u0938\u092c\u0915\u094b \u091c\u093e\u0928\u0928\u0947\u0935\u093e\u0932\u0947, \u091c\u093e\u0928\u0928\u0947\u092f\u094b\u0917\u094d\u092f \u0914\u0930 \u092a\u0930\u092e\u0927\u093e\u092e \u0939\u0948\u0902\u0964 \u0939\u0947 \u0905\u0928\u0928\u094d\u0924\u0930\u0942\u092a ! \u0906\u092a\u0938\u0947 \u0939\u0940 \u0938\u092e\u094d\u092a\u0942\u0930\u094d\u0923 \u0938\u0902\u0938\u093e\u0930 \u0935\u094d\u092f\u093e\u092a\u094d\u0924 \u0939\u0948\u0964","commentary":"\u0964\u096411.38\u0964\u0964\xa0\u0935\u094d\u092f\u093e\u0916\u094d\u092f\u093e--\'\u0924\u094d\u0935\u092e\u093e\u0926\u093f\u0926\u0947\u0935\u0903 \u092a\u0941\u0930\u0941\u0937\u0903 \u092a\u0941\u0930\u093e\u0923\u0903\'--  \u0906\u092a \u0938\u092e\u094d\u092a\u0942\u0930\u094d\u0923 \u0926\u0947\u0935\u0924\u093e\u0913\u0902\u0915\u0947 \u0906\u0926\u093f\u0926\u0947\u0935 \u0939\u0948\u0902; \u0915\u094d\u092f\u094b\u0902\u0915\u093f \u0938\u092c\u0938\u0947 \u092a\u0939\u0932\u0947 \u0906\u092a \u0939\u0940 \u092a\u094d\u0930\u0915\u091f \u0939\u094b\u0924\u0947 \u0939\u0948\u0902\u0964 \u0906\u092a \u092a\u0941\u0930\u093e\u0923\u092a\u0941\u0930\u0941\u0937 \u0939\u0948\u0902; \u0915\u094d\u092f\u094b\u0902\u0915\u093f \u0906\u092a \u0938\u0926\u093e\u0938\u0947 \u0939\u0948\u0902 \u0914\u0930 \u0938\u0926\u093e \u0939\u0940 \u0930\u0939\u0928\u0947\u0935\u093e\u0932\u0947 \u0939\u0948\u0902\u0964"},{"text":"\u0935\u093e\u092f\u0941\u0930\u094d\u092f\u092e\u094b\u093d\u0917\u094d\u0928\u093f\u0930\u094d\u0935\u0930\u0941\u0923\u0903 \u0936\u0936\u093e\u0919\u094d\u0915\u0903\\n\u092a\u094d\u0930\u091c\u093e\u092a\u0924\u093f\u0938\u094d\u0924\u094d\u0935\u0902 \u092a\u094d\u0930\u092a\u093f\u0924\u093e\u092e\u0939\u0936\u094d\u091a\u0964\\n\u0928\u092e\u094b \u0928\u092e\u0938\u094d\u0924\u0947\u093d\u0938\u094d\u0924\u0941 \u0938\u0939\u0938\u094d\u0930\u0915\u0943\u0924\u094d\u0935\u0903\\n\u092a\u0941\u0928\u0936\u094d\u091a \u092d\u0942\u092f\u094b\u093d\u092a\u093f \u0928\u092e\u094b \u0928\u092e\u0938\u094d\u0924\u0947\u0964\u096411.39\u0964\u0964","translation":"\u0964\u096411.39\u0964\u0964 \u0906\u092a \u0939\u0940 \u0935\u093e\u092f\u0941, \u092f\u092e\u0930\u093e\u091c, \u0905\u0917\u094d\u0928\u093f, \u0935\u0930\u0941\u0923, \u091a\u0928\u094d\u0926\u094d\u0930\u092e\u093e, \u0926\u0915\u094d\u0937 \u0906\u0926\u093f \u092a\u094d\u0930\u091c\u093e\u092a\u0924\u093f \u0914\u0930 \u092a\u094d\u0930\u092a\u093f\u0924\u093e\u092e\u0939 (\u092c\u094d\u0930\u0939\u094d\u092e\u093e\u091c\u0940\u0915\u0947 \u092d\u0940 \u092a\u093f\u0924\u093e) \u0939\u0948\u0902\u0964 \u0906\u092a\u0915\u094b \u0939\u091c\u093e\u0930\u094b\u0902 \u092c\u093e\u0930 \u0928\u092e\u0938\u094d\u0915\u093e\u0930 \u0939\u094b! \u0928\u092e\u0938\u094d\u0915\u093e\u0930 \u0939\u094b ! ! \u0914\u0930 \u092b\u093f\u0930 \u092d\u0940 \u0906\u092a\u0915\u094b \u092c\u093e\u0930-\u092c\u093e\u0930 \u0928\u092e\u0938\u094d\u0915\u093e\u0930 \u0939\u094b ! \u0928\u092e\u0938\u094d\u0915\u093e\u0930 \u0939\u094b !","commentary":"\u0964\u096411.39\u0964\u0964\xa0\u0935\u094d\u092f\u093e\u0916\u094d\u092f\u093e--\u0935\u093e\u092f\u0941\u0903--\u091c\u093f\u0938\u0938\u0947 \u0938\u092c\u0915\u094b \u092a\u094d\u0930\u093e\u0923 \u092e\u093f\u0932 \u0930\u0939\u0947 \u0939\u0948\u0902, \u092e\u093e\u0924\u094d\u0930 \u092a\u094d\u0930\u093e\u0923\u0940 \u091c\u0940 \u0930\u0939\u0947 \u0939\u0948\u0902, \u0938\u092c\u0915\u094b \u0938\u093e\u092e\u0930\u094d\u0925\u094d\u092f \u092e\u093f\u0932 \u0930\u0939\u0940 \u0939\u0948, \u0935\u0939 \u0935\u093e\u092f\u0941 \u0906\u092a \u0939\u0940 \u0939\u0948\u0902\u0964"},{"text":"\u0928\u092e\u0903 \u092a\u0941\u0930\u0938\u094d\u0924\u093e\u0926\u0925 \u092a\u0943\u0937\u094d\u0920\u0924\u0938\u094d\u0924\u0947\\n\u0928\u092e\u094b\u093d\u0938\u094d\u0924\u0941 \u0924\u0947 \u0938\u0930\u094d\u0935\u0924 \u090f\u0935 \u0938\u0930\u094d\u0935\u0964\\n\u0905\u0928\u0928\u094d\u0924\u0935\u0940\u0930\u094d\u092f\u093e\u092e\u093f\u0924\u0935\u093f\u0915\u094d\u0930\u092e\u0938\u094d\u0924\u094d\u0935\u0902\\n\u0938\u0930\u094d\u0935\u0902 \u0938\u092e\u093e\u092a\u094d\u0928\u094b\u0937\u093f \u0924\u0924\u094b\u093d\u0938\u093f \u0938\u0930\u094d\u0935\u0903\u0964\u096411.40\u0964\u0964","translation":"\u0964\u096411.40\u0964\u0964 \u0939\u0947 \u0938\u0930\u094d\u0935 ! \u0906\u092a\u0915\u094b \u0906\u0917\u0947\u0938\u0947 \u092d\u0940 \u0928\u092e\u0938\u094d\u0915\u093e\u0930 \u0939\u094b !\xa0 \u092a\u0940\u091b\u0947\u0938\u0947 \u092d\u0940 \u0928\u092e\u0938\u094d\u0915\u093e\u0930 \u0939\u094b ! \u0938\u092c \u0913\u0930\u0938\u0947 \u0939\u0940 \u0928\u092e\u0938\u094d\u0915\u093e\u0930 \u0939\u094b ! \u0939\u0947 \u0905\u0928\u0928\u094d\u0924\u0935\u0940\u0930\u094d\u092f ! \u0905\u092e\u093f\u0924 \u0935\u093f\u0915\u094d\u0930\u092e\u0935\u093e\u0932\u0947 \u0906\u092a\u0928\u0947 \u0938\u092c\u0915\u094b \u0938\u092e\u093e\u0935\u0943\u0924 \u0915\u0930 \u0930\u0916\u093e \u0939\u0948; \u0905\u0924\u0903 \u0938\u092c \u0915\u0941\u091b \u0906\u092a \u0939\u0940 \u0939\u0948\u0902\u0964","commentary":"\u0964\u096411.40\u0964\u0964\xa0\u0935\u094d\u092f\u093e\u0916\u094d\u092f\u093e--\'\u0928\u092e\u0903 \u092a\u0941\u0930\u0938\u094d\u0924\u093e\u0926\u0925 \u092a\u0943\u0937\u094d\u0920\u0924\u0938\u094d\u0924\u0947 \u0928\u092e\u094b\u093d\u0938\u094d\u0924\u0941 \u0924\u0947 \u0938\u0930\u094d\u0935\u0924 \u090f\u0935 \u0938\u0930\u094d\u0935\'--\u0905\u0930\u094d\u091c\u0941\u0928 \u092d\u092f\u092d\u0940\u0924 \u0939\u0948\u0902\u0964 \u092e\u0948\u0902 \u0915\u094d\u092f\u093e \u092c\u094b\u0932\u0942\u0901-- \u092f\u0939 \u0909\u0928\u0915\u0940 \u0938\u092e\u091d\u092e\u0947\u0902 \u0928\u0939\u0940\u0902 \u0906 \u0930\u0939\u093e \u0939\u0948\u0964 \u0907\u0938\u0932\u093f\u092f\u0947 \u0935\u0947 \u0906\u0917\u0947\u0938\u0947, \u092a\u0940\u091b\u0947\u0938\u0947 \u0938\u092c \u0913\u0930\u0938\u0947 \u0905\u0930\u094d\u0925\u093e\u0924\u094d \u0926\u0938\u094b\u0902 \u0926\u093f\u0936\u093e\u0913\u0902\u0938\u0947 \u0915\u0947\u0935\u0932 \u0928\u092e\u0938\u094d\u0915\u093e\u0930\u0939\u0940\u0928\u092e\u0938\u094d\u0915\u093e\u0930 \u0915\u0930 \u0930\u0939\u0947 \u0939\u0948\u0902\u0964"},{"text":"\u0938\u0916\u0947\u0924\u093f \u092e\u0924\u094d\u0935\u093e \u092a\u094d\u0930\u0938\u092d\u0902 \u092f\u0926\u0941\u0915\u094d\u0924\u0902\\n\u0939\u0947 \u0915\u0943\u0937\u094d\u0923 \u0939\u0947 \u092f\u093e\u0926\u0935 \u0939\u0947 \u0938\u0916\u0947\u0924\u093f\u0964\\n\u0905\u091c\u093e\u0928\u0924\u093e \u092e\u0939\u093f\u092e\u093e\u0928\u0902 \u0924\u0935\u0947\u0926\u0902\\n\u092e\u092f\u093e \u092a\u094d\u0930\u092e\u093e\u0926\u093e\u0924\u094d\u092a\u094d\u0930\u0923\u092f\u0947\u0928 \u0935\u093e\u092a\u093f\u0964\u096411.41\u0964\u0964","translation":"\u0964\u096411.41 -- 11.42\u0964\u0964 \u0906\u092a\u0915\u0940 \u092e\u0939\u093f\u092e\u093e \u0914\u0930 \u0938\u094d\u0935\u0930\u0942\u092a\u0915\u094b \u0928 \u091c\u093e\u0928\u0924\u0947 \u0939\u0941\u090f \'\u092e\u0947\u0930\u0947 \u0938\u0916\u093e \u0939\u0948\u0902\' \u0910\u0938\u093e \u092e\u093e\u0928\u0915\u0930 \u092e\u0948\u0902\u0928\u0947 \u092a\u094d\u0930\u092e\u093e\u0926\u0938\u0947 \u0905\u0925\u0935\u093e \u092a\u094d\u0930\u0947\u092e\u0938\u0947 \u0939\u0920\u092a\u0942\u0930\u094d\u0935\u0915 (\u092c\u093f\u0928\u093e \u0938\u094b\u091a\u0947-\u0938\u092e\u091d\u0947) \'\u0939\u0947 \u0915\u0943\u0937\u094d\u0923 ! \u0939\u0947 \u092f\u093e\u0926\u0935 ! \u0939\u0947 \u0938\u0916\u0947 !\' \u0907\u0938 \u092a\u094d\u0930\u0915\u093e\u0930 \u091c\u094b \u0915\u0941\u091b \u0915\u0939\u093e \u0939\u0948; \u0914\u0930 \u0939\u0947 \u0905\u091a\u094d\u092f\u0941\u0924 ! \u0939\u0901\u0938\u0940-\u0926\u093f\u0932\u094d\u0932\u0917\u0940\u092e\u0947\u0902, \u091a\u0932\u0924\u0947-\u092b\u093f\u0930\u0924\u0947, \u0938\u094b\u0924\u0947-\u091c\u093e\u0917\u0924\u0947, \u0909\u0920\u0924\u0947-\u092c\u0948\u0920\u0924\u0947, \u0916\u093e\u0924\u0947-\u092a\u0940\u0924\u0947 \u0938\u092e\u092f\u092e\u0947\u0902 \u0905\u0915\u0947\u0932\u0947 \u0905\u0925\u0935\u093e \u0909\u0928 \u0938\u0916\u093e\u0913\u0902, \u0915\u0941\u091f\u0941\u092e\u094d\u092c\u093f\u092f\u094b\u0902 \u0906\u0926\u093f\u0915\u0947 \u0938\u093e\u092e\u0928\u0947 \u092e\u0947\u0930\u0947 \u0926\u094d\u0935\u093e\u0930\u093e \u0906\u092a\u0915\u093e \u091c\u094b \u0915\u0941\u091b \u0924\u093f\u0930\u0938\u094d\u0915\u093e\u0930 \u0915\u093f\u092f\u093e \u0917\u092f\u093e \u0939\u0948;\xa0 \u0935\u0939 \u0938\u092c \u0905\u092a\u094d\u0930\u092e\u0947\u092f\u0938\u094d\u0935\u0930\u0941\u092a \u0906\u092a\u0938\u0947 \u092e\u0948\u0902 \u0915\u094d\u0937\u092e\u093e \u092e\u093e\u0901\u0917\u0924\u093e \u0939\u0942\u0901\u0964","commentary":"\u0964\u096411.41\u0964\u0964\xa0\u0935\u094d\u092f\u093e\u0916\u094d\u092f\u093e--[\u091c\u092c \u0905\u0930\u094d\u091c\u0941\u0928 \u0935\u093f\u0930\u093e\u091f\u094d \u092d\u0917\u0935\u093e\u0928\u094d\u0915\u0947 \u0905\u0924\u094d\u092f\u0941\u0917\u094d\u0930 \u0930\u0942\u092a\u0915\u094b \u0926\u0947\u0916\u0915\u0930 \u092d\u092f\u092d\u0940\u0924 \u0939\u094b\u0924\u0947 \u0939\u0948\u0902, \u0924\u092c \u0935\u0947 \u092d\u0917\u0935\u093e\u0928\u094d\u0915\u0947 \u0915\u0943\u0937\u094d\u0923\u0930\u0942\u092a\u0915\u094b \u092d\u0942\u0932 \u091c\u093e\u0924\u0947 \u0939\u0948\u0902 \u0914\u0930 \u092a\u0942\u091b \u092c\u0948\u0920\u0924\u0947 \u0939\u0948\u0902 \u0915\u093f \u0909\u0917\u094d\u0930\u0930\u0942\u092a\u0935\u093e\u0932\u0947 \'\u0906\u092a\', \u0915\u094c\u0928 \u0939\u0948\u0902 \u092a\u0930\u0928\u094d\u0924\u0941 \u091c\u092c \u0909\u0928\u0915\u094b \u092d\u0917\u0935\u093e\u0928\u094d \u0936\u094d\u0930\u0940\u0915\u0943\u0937\u094d\u0923\u0915\u0940 \u0938\u094d\u092e\u0943\u0924\u093f \u0906\u0924\u0940 \u0939\u0948 \u0915\u093f \u0935\u0947 \u092f\u0947 \u0939\u0940 \u0939\u0948\u0902, \u0924\u092c \u092d\u0917\u0935\u093e\u0928\u094d\u0915\u0947 \u092a\u094d\u0930\u092d\u093e\u0935 \u0906\u0926\u093f\u0915\u094b \u0926\u0947\u0916\u0915\u0930 \u0909\u0928\u0915\u094b \u0938\u0916\u093e\u092d\u093e\u0935\u0938\u0947 \u0915\u093f\u092f\u0947 \u0939\u0941\u090f \u092a\u0941\u0930\u093e\u0928\u0947 \u0935\u094d\u092f\u0935\u0939\u093e\u0930\u0915\u0940 \u092f\u093e\u0926 \u0906 \u091c\u093e\u0924\u0940 \u0939\u0948 \u0914\u0930 \u0909\u0938\u0915\u0947 \u0932\u093f\u092f\u0947 \u0935\u0947 \u092d\u0917\u0935\u093e\u0928\u094d\u0938\u0947 \u0915\u094d\u0937\u092e\u093e \u092e\u093e\u0901\u0917\u0924\u0947 \u0939\u0948\u0902\u0964]\\n\'\u0938\u0916\u0947\u0924\u093f \u092e\u0924\u094d\u0935\u093e \u092a\u094d\u0930\u0938\u092d\u0902 \u092f\u0926\u0941\u0915\u094d\u0924\u0902 \u0939\u0947 \u0915\u0943\u0937\u094d\u0923 \u0939\u0947 \u092f\u093e\u0926\u0935 \u0939\u0947 \u0938\u0916\u0947\u0924\u093f\'--\u091c\u094b \u092c\u0921\u093c\u0947 \u0906\u0926\u092e\u0940 \u0939\u094b\u0924\u0947 \u0939\u0948\u0902, \u0936\u094d\u0930\u0947\u0937\u094d\u0920 \u092a\u0941\u0930\u0941\u0937 \u0939\u094b\u0924\u0947 \u0939\u0948\u0902, \u0909\u0928\u0915\u094b \u0938\u093e\u0915\u094d\u0937\u093e\u0924\u094d \u0928\u093e\u092e\u0938\u0947 \u0928\u0939\u0940\u0902 \u092a\u0941\u0915\u093e\u0930\u093e \u091c\u093e\u0924\u093e\u0964 \u0909\u0928\u0915\u0947 \u0932\u093f\u092f\u0947 \u0924\u094b \u0906\u092a, \u092e\u0939\u093e\u0930\u093e\u091c \u0906\u0926\u093f \u0936\u092c\u094d\u0926\u094b\u0902\u0915\u093e \u092a\u094d\u0930\u092f\u094b\u0917 \u0939\u094b\u0924\u093e \u0939\u0948\u0964 \u092a\u0930\u0928\u094d\u0924\u0941 \u092e\u0948\u0902\u0928\u0947 \u0906\u092a\u0915\u094b \u0915\u092d\u0940 \'\u0939\u0947 \u0915\u0943\u0937\u094d\u0923\' \u0915\u0939 \u0926\u093f\u092f\u093e, \u0915\u092d\u0940 \'\u0939\u0947 \u092f\u093e\u0926\u0935\' \u0915\u0939 \u0926\u093f\u092f\u093e \u0914\u0930 \u0915\u092d\u0940 \'\u0939\u0947 \u0938\u0916\u0947\' \u0915\u0939 \u0926\u093f\u092f\u093e\u0964 \u0907\u0938\u0915\u093e \u0915\u093e\u0930\u0923 \u0915\u094d\u092f\u093e \u0925\u093e?\xa0\'\u0905\u091c\u093e\u0928\u0924\u093e \u092e\u0939\u093f\u092e\u093e\u0928\u0902 \u0924\u0935\u0947\u0926\u092e\' (\u091f\u093f\u092a\u094d\u092a\u0923\u0940 \u092a0 603.1) \u0907\u0938\u0915\u093e \u0915\u093e\u0930\u0923 \u092f\u0939 \u0925\u093e \u0915\u093f \u092e\u0948\u0902\u0928\u0947 \u0906\u092a\u0915\u0940 \u0910\u0938\u0940 \u092e\u0939\u093f\u092e\u093e\u0915\u094b \u0914\u0930 \u0938\u094d\u0935\u0930\u0942\u092a\u0915\u094b \u091c\u093e\u0928\u093e \u0928\u0939\u0940\u0902 \u0915\u093f \u0906\u092a \u0910\u0938\u0947 \u0935\u093f\u0932\u0915\u094d\u0937\u0923 \u0939\u0948\u0902\u0964 \u0906\u092a\u0915\u0947 \u0915\u093f\u0938\u0940 \u090f\u0915 \u0905\u0902\u0936\u092e\u0947\u0902 \u0905\u0928\u0928\u094d\u0924\u0915\u094b\u091f\u093f \u092c\u094d\u0930\u0939\u094d\u092e\u093e\u0923\u094d\u0921 \u0935\u093f\u0930\u093e\u091c\u092e\u093e\u0928 \u0939\u0948\u0902 -- \u0910\u0938\u093e \u092e\u0948\u0902 \u092a\u0939\u0932\u0947 \u0928\u0939\u0940\u0902 \u091c\u093e\u0928\u0924\u093e \u0925\u093e\u0964 \u0906\u092a\u0915\u0947 \u092a\u094d\u0930\u092d\u093e\u0935\u0915\u0940 \u0924\u0930\u092b \u092e\u0947\u0930\u0940 \u0926\u0943\u0937\u094d\u091f\u093f \u0939\u0940 \u0928\u0939\u0940\u0902 \u0917\u092f\u0940\u0964 \u092e\u0948\u0902\u0928\u0947 \u0915\u092d\u0940 \u0938\u094b\u091a\u093e-\u0938\u092e\u091d\u093e \u0939\u0940 \u0928\u0939\u0940\u0902 \u0915\u093f \u0906\u092a \u0915\u094c\u0928 \u0939\u0948\u0902 \u0914\u0930 \u0915\u0948\u0938\u0947 \u0939\u0948\u0902\u0964"},{"text":"\u092f\u091a\u094d\u091a\u093e\u0935\u0939\u093e\u0938\u093e\u0930\u094d\u0925\u092e\u0938\u0924\u094d\u0915\u0943\u0924\u094b\u093d\u0938\u093f\\n\u0935\u093f\u0939\u093e\u0930\u0936\u092f\u094d\u092f\u093e\u0938\u0928\u092d\u094b\u091c\u0928\u0947\u0937\u0941\u0964\\n\u090f\u0915\u094b\u093d\u0925\u0935\u093e\u092a\u094d\u092f\u091a\u094d\u092f\u0941\u0924 \u0924\u0924\u094d\u0938\u092e\u0915\u094d\u0937\u0902\\n\u0924\u0924\u094d\u0915\u094d\u0937\u093e\u092e\u092f\u0947 \u0924\u094d\u0935\u093e\u092e\u0939\u092e\u092a\u094d\u0930\u092e\u0947\u092f\u092e\u094d\u0964\u096411.42\u0964\u0964","translation":"\u0964\u096411.41 -- 11.42\u0964\u0964 \u0906\u092a\u0915\u0940\xa0 \u092e\u0939\u093f\u092e\u093e \u0914\u0930 \u0938\u094d\u0935\u0930\u0942\u092a\u0915\u094b \u0928 \u091c\u093e\u0928\u0924\u0947 \u0939\u0941\u090f \'\u092e\u0947\u0930\u0947 \u0938\u0916\u093e \u0939\u0948\u0902\' \u0910\u0938\u093e \u092e\u093e\u0928\u0915\u0930 \u092e\u0948\u0902\u0928\u0947 \u092a\u094d\u0930\u092e\u093e\u0926\u0938\u0947 \u0905\u0925\u0935\u093e \u092a\u094d\u0930\u0947\u092e\u0938\u0947 \u092d\u0940 \u0939\u0920\u092a\u0942\u0930\u094d\u0935\u0915 (\u092c\u093f\u0928\u093e \u0938\u094b\u091a\u0947-\u0938\u092e\u091d\u0947) \'\u0939\u0947 \u0915\u0943\u0937\u094d\u0923 ! \u0939\u0947 \u092f\u093e\u0926\u0935 ! \u0939\u0947 \u0938\u0916\u0947 !\' \u0907\u0938 \u092a\u094d\u0930\u0915\u093e\u0930 \u091c\u094b \u0915\u0941\u091b \u0915\u0939\u093e \u0939\u0948; \u0914\u0930 \u0939\u0947 \u0905\u091a\u094d\u092f\u0941\u0924 ! \u0939\u0901\u0938\u0940-\u0926\u093f\u0932\u094d\u0932\u0917\u0940\u092e\u0947\u0902, \u091a\u0932\u0924\u0947-\u092b\u093f\u0930\u0924\u0947, \u0938\u094b\u0924\u0947-\u091c\u093e\u0917\u0924\u0947, \u0909\u0920\u0924\u0947-\u092c\u0948\u0920\u0924\u0947, \u0916\u093e\u0924\u0947-\u092a\u0940\u0924\u0947 \u0938\u092e\u092f\u092e\u0947\u0902 \u0905\u0915\u0947\u0932\u0947 \u0905\u0925\u0935\u093e \u0909\u0928 \u0938\u0916\u093e\u0913\u0902, \u0915\u0941\u091f\u0941\u092e\u094d\u092c\u093f\u092f\u094b\u0902 \u0906\u0926\u093f\u0915\u0947 \u0938\u093e\u092e\u0928\u0947 \u092e\u0947\u0930\u0947 \u0926\u094d\u0935\u093e\u0930\u093e \u0906\u092a\u0915\u093e \u091c\u094b \u0915\u0941\u091b \u0924\u093f\u0930\u0938\u094d\u0915\u093e\u0930 \u0915\u093f\u092f\u093e \u0917\u092f\u093e \u0939\u0948, \u0935\u0939 \u0938\u092c \u0905\u092a\u094d\u0930\u092e\u0947\u0938\u094d\u0935\u0930\u0942\u092a \u0906\u092a\u0938\u0947 \u092e\u0948\u0902 \u0915\u094d\u0937\u092e\u093e \u0915\u0930\u0935\u093e\u0924\u093e \u0939\u0942\u0901 \u0964","commentary":"\u0964\u096411.42\u0964\u0964\xa0\u0935\u094d\u092f\u093e\u0916\u094d\u092f\u093e--[\u091c\u092c \u0905\u0930\u094d\u091c\u0941\u0928 \u0935\u093f\u0930\u093e\u091f\u094d \u092d\u0917\u0935\u093e\u0928\u094d\u0915\u0947 \u0905\u0924\u094d\u092f\u0941\u0917\u094d\u0930 \u0930\u0942\u092a\u0915\u094b \u0926\u0947\u0916\u0915\u0930 \u092d\u092f\u092d\u0940\u0924 \u0939\u094b\u0924\u0947 \u0939\u0948\u0902, \u0924\u092c \u0935\u0947 \u092d\u0917\u0935\u093e\u0928\u094d\u0915\u0947 \u0915\u0943\u0937\u094d\u0923\u0930\u0942\u092a\u0915\u094b \u092d\u0942\u0932 \u091c\u093e\u0924\u0947 \u0939\u0948\u0902 \u0914\u0930 \u092a\u0942\u091b \u092c\u0948\u0920\u0924\u0947 \u0939\u0948\u0902 \u0915\u093f \u0909\u0917\u094d\u0930\u0930\u0942\u092a\u0935\u093e\u0932\u0947 \u0906\u092a \u0915\u094c\u0928 \u0939\u0948\u0902 \u092a\u0930\u0928\u094d\u0924\u0941 \u091c\u092c \u0909\u0928\u0915\u094b \u092d\u0917\u0935\u093e\u0928\u094d \u0936\u094d\u0930\u0940\u0915\u0943\u0937\u094d\u0923\u0915\u0940 \u0938\u094d\u092e\u0943\u0924\u093f \u0906\u0924\u0940 \u0939\u0948 \u0915\u093f \u0935\u0947 \u092f\u0947 \u0939\u0940 \u0939\u0948\u0902, \u0924\u092c \u092d\u0917\u0935\u093e\u0928\u094d\u0915\u0947 \u092a\u094d\u0930\u092d\u093e\u0935 \u0906\u0926\u093f\u0915\u094b \u0926\u0947\u0916\u0915\u0930 \u0909\u0928\u0915\u094b \u0938\u0916\u093e\u092d\u093e\u0935\u0938\u0947 \u0915\u093f\u092f\u0947 \u0939\u0941\u090f \u092a\u0941\u0930\u093e\u0928\u0947 \u0935\u094d\u092f\u0935\u0939\u093e\u0930\u0915\u0940 \u092f\u093e\u0926 \u0906 \u091c\u093e\u0924\u0940 \u0939\u0948 \u0914\u0930 \u0909\u0938\u0915\u0947 \u0932\u093f\u092f\u0947 \u0935\u0947 \u092d\u0917\u0935\u093e\u0928\u094d\u0938\u0947 \u0915\u094d\u0937\u092e\u093e \u092e\u093e\u0901\u0917\u0924\u0947 \u0939\u0948\u0902\u0964]\\n\xa0 \'\u0938\u0916\u0947\u0924\u093f \u092e\u0924\u094d\u0935\u093e \u092a\u094d\u0930\u0938\u092d\u0902 \u092f\u0926\u0941\u0915\u094d\u0924\u0902 \u0939\u0947 \u0915\u0943\u0937\u094d\u0923 \u0939\u0947 \u092f\u093e\u0926\u0935 \u0939\u0947 \u0938\u0916\u0947\u0924\u093f\'--\u091c\u094b \u092c\u0921\u093c\u0947 \u0906\u0926\u092e\u0940 \u0939\u094b\u0924\u0947 \u0939\u0948\u0902, \u0936\u094d\u0930\u0947\u0937\u094d\u0920 \u092a\u0941\u0930\u0941\u0937 \u0939\u094b\u0924\u0947 \u0939\u0948\u0902, \u0909\u0928\u0915\u094b \u0938\u093e\u0915\u094d\u0937\u093e\u0924\u094d \u0928\u093e\u092e\u0938\u0947 \u0928\u0939\u0940\u0902 \u092a\u0941\u0915\u093e\u0930\u093e \u091c\u093e\u0924\u093e\u0964 \u0909\u0928\u0915\u0947 \u0932\u093f\u092f\u0947 \u0924\u094b \'\u0906\u092a\', \u092e\u0939\u093e\u0930\u093e\u091c \u0906\u0926\u093f \u0936\u092c\u094d\u0926\u094b\u0902\u0915\u093e \u092a\u094d\u0930\u092f\u094b\u0917 \u0939\u094b\u0924\u093e \u0939\u0948\u0964 \u092a\u0930\u0928\u094d\u0924\u0941 \u092e\u0948\u0902\u0928\u0947 \u0906\u092a\u0915\u094b \u0915\u092d\u0940 \'\u0939\u0947 \u0915\u0943\u0937\u094d\u0923\' \u0915\u0939 \u0926\u093f\u092f\u093e, \u0915\u092d\u0940 \'\u0939\u0947 \u092f\u093e\u0926\u0935\' \u0915\u0939 \u0926\u093f\u092f\u093e \u0914\u0930 \u0915\u092d\u0940 \u0939\u0947 \u0938\u0916\u0947 \u0915\u0939 \u0926\u093f\u092f\u093e\u0964 \u0907\u0938\u0915\u093e \u0915\u093e\u0930\u0923 \u0915\u094d\u092f\u093e \u0925\u093e?\xa0\'\u0905\u091c\u093e\u0928\u0924\u093e \u092e\u0939\u093f\u092e\u093e\u0928\u0902 \u0924\u0935\u0947\u0926\u092e\u094d\' (\u091f\u093f\u092a\u094d\u092a\u0923\u0940 \u092a0 603.1) \u0907\u0938\u0915\u093e \u0915\u093e\u0930\u0923 \u092f\u0939 \u0925\u093e \u0915\u093f \u092e\u0948\u0902\u0928\u0947 \u0906\u092a\u0915\u0940 \u0910\u0938\u0940 \u092e\u0939\u093f\u092e\u093e\u0915\u094b \u0914\u0930 \u0938\u094d\u0935\u0930\u0942\u092a\u0915\u094b \u091c\u093e\u0928\u093e \u0928\u0939\u0940\u0902 \u0915\u093f \u0906\u092a \u0910\u0938\u0947 \u0935\u093f\u0932\u0915\u094d\u0937\u0923 \u0939\u0948\u0902\u0964 \u0906\u092a\u0915\u0947 \u0915\u093f\u0938\u0940 \u090f\u0915 \u0905\u0902\u0936\u092e\u0947\u0902 \u0905\u0928\u0928\u094d\u0924\u0915\u094b\u091f\u093f \u092c\u094d\u0930\u0939\u094d\u092e\u093e\u0923\u094d\u0921 \u0935\u093f\u0930\u093e\u091c\u092e\u093e\u0928 \u0939\u0948\u0902--\u0910\u0938\u093e \u092e\u0948\u0902 \u092a\u0939\u0932\u0947 \u0928\u0939\u0940\u0902 \u091c\u093e\u0928\u0924\u093e \u0925\u093e\u0964 \u0906\u092a\u0915\u0947 \u092a\u094d\u0930\u092d\u093e\u0935\u0915\u0940 \u0924\u0930\u092b \u092e\u0947\u0930\u0940 \u0926\u0943\u0937\u094d\u091f\u093f \u0939\u0940 \u0928\u0939\u0940\u0902 \u0917\u092f\u0940\u0964 \u092e\u0948\u0902\u0928\u0947 \u0915\u092d\u0940 \u0938\u094b\u091a\u093e-\u0938\u092e\u091d\u093e \u0939\u0940 \u0928\u0939\u0940\u0902 \u0915\u093f \u0906\u092a \u0915\u094c\u0928 \u0939\u0948\u0902 \u0914\u0930 \u0915\u0948\u0938\u0947 \u0939\u0948\u0902\u0964"},{"text":"\u092a\u093f\u0924\u093e\u0938\u093f \u0932\u094b\u0915\u0938\u094d\u092f \u091a\u0930\u093e\u091a\u0930\u0938\u094d\u092f\\n\u0924\u094d\u0935\u092e\u0938\u094d\u092f \u092a\u0942\u091c\u094d\u092f\u0936\u094d\u091a \u0917\u0941\u0930\u0941\u0930\u094d\u0917\u0930\u0940\u092f\u093e\u0928\u094d\u0964\\n\u0928 \u0924\u094d\u0935\u0924\u094d\u0938\u092e\u094b\u093d\u0938\u094d\u0924\u094d\u092f\u092d\u094d\u092f\u0927\u093f\u0915\u0903 \u0915\u0941\u0924\u094b\u093d\u0928\u094d\u092f\u094b\\n\u0932\u094b\u0915\u0924\u094d\u0930\u092f\u0947\u093d\u092a\u094d\u092f\u092a\u094d\u0930\u0924\u093f\u092e\u092a\u094d\u0930\u092d\u093e\u0935\u0964\u096411.43\u0964\u0964","translation":"\u0964\u096411.43\u0964\u0964 \u0906\u092a \u0939\u0940 \u0907\u0938 \u091a\u0930\u093e\u091a\u0930 \u0938\u0902\u0938\u093e\u0930\u0915\u0947 \u092a\u093f\u0924\u093e \u0939\u0948\u0902, \u0906\u092a \u0939\u0940 \u092a\u0942\u091c\u0928\u0940\u092f \u0939\u0948\u0902 \u0914\u0930 \u0906\u092a \u0939\u0940 \u0917\u0941\u0930\u0941\u0913\u0902\u0915\u0947 \u092e\u0939\u093e\u0928\u094d \u0917\u0941\u0930\u0941 \u0939\u0948\u0902\u0964 \u0939\u0947 \u0905\u0928\u0928\u094d\u0924 \u092a\u094d\u0930\u092d\u093e\u0935\u0936\u093e\u0932\u0940 \u092d\u0917\u0935\u0928\u094d ! \u0907\u0938 \u0924\u094d\u0930\u093f\u0932\u094b\u0915\u0940\u092e\u0947\u0902 \u0906\u092a\u0915\u0947 \u0938\u092e\u093e\u0928 \u092d\u0940 \u0926\u0942\u0938\u0930\u093e \u0915\u094b\u0908 \u0928\u0939\u0940\u0902 \u0939\u0948, \u092b\u093f\u0930 \u0905\u0927\u093f\u0915 \u0924\u094b \u0939\u094b \u0939\u0940 \u0915\u0948\u0938\u0947 \u0938\u0915\u0924\u093e \u0939\u0948 !","commentary":"\u0964\u096411.43\u0964\u0964\xa0\u0935\u094d\u092f\u093e\u0916\u094d\u092f\u093e--\'\u092a\u093f\u0924\u093e\u0938\u0940 \u0932\u094b\u0915\u0938\u094d\u092f \u091a\u0930\u093e\u091a\u0930\u0938\u094d\u092f\'--\u0905\u0928\u0928\u094d\u0924 \u092c\u094d\u0930\u0939\u094d\u092e\u093e\u0923\u094d\u0921\u094b\u0902\u092e\u0947\u0902 \u092e\u0928\u0941\u0937\u094d\u092f, \u0936\u0930\u0940\u0930, \u092a\u0936\u0941, \u092a\u0915\u094d\u0937\u0940 \u0906\u0926\u093f \u091c\u093f\u0924\u0928\u0947 \u091c\u0919\u094d\u0917\u092e \u092a\u094d\u0930\u093e\u0923\u0940 \u0939\u0948\u0902, \u0914\u0930 \u0935\u0943\u0915\u094d\u0937, \u0932\u0924\u093e \u0906\u0926\u093f \u091c\u093f\u0924\u0928\u0947 \u0938\u094d\u0925\u093e\u0935\u0930 \u092a\u094d\u0930\u093e\u0923\u0940 \u0939\u0948\u0902, \u0909\u0928 \u0938\u092c\u0915\u094b \u0909\u0924\u094d\u092a\u0928\u094d\u0928 \u0915\u0930\u0928\u0947\u0935\u093e\u0932\u0947 \u0914\u0930 \u0909\u0928\u0915\u093e \u092a\u093e\u0932\u0928 \u0915\u0930\u0928\u0947\u0935\u093e\u0932\u0947 \u092a\u093f\u0924\u093e \u092d\u0940 \u0906\u092a \u0939\u0948\u0902, \u0909\u0928\u0915\u0947 \u092a\u0942\u091c\u0928\u0940\u092f \u092d\u0940 \u0906\u092a \u0939\u0948\u0902 \u0924\u0925\u093e \u0909\u0928\u0915\u094b \u0936\u093f\u0915\u094d\u0937\u093e \u0926\u0947\u0928\u0947\u0935\u093e\u0932\u0947 \u092e\u0939\u093e\u0928\u094d \u0917\u0941\u0930\u0941 \u092d\u0940 \u0906\u092a \u0939\u0940 \u0939\u0948\u0902 -- \'\u0924\u094d\u0935\u092e\u0938\u094d\u092f \u092a\u0942\u091c\u094d\u092f\u0936\u094d\u091a \u0917\u0941\u0930\u0941\u0930\u094d\u0917\u0930\u0940\u092f\u093e\u0928\u094d\u0964\'\xa0"},{"text":"\u0924\u0938\u094d\u092e\u093e\u0924\u094d\u092a\u094d\u0930\u0923\u092e\u094d\u092f \u092a\u094d\u0930\u0923\u093f\u0927\u093e\u092f \u0915\u093e\u092f\u0902\\n\u092a\u094d\u0930\u0938\u093e\u0926\u092f\u0947 \u0924\u094d\u0935\u093e\u092e\u0939\u092e\u0940\u0936\u092e\u0940\u0921\u094d\u092f\u092e\u094d\u0964\\n\u092a\u093f\u0924\u0947\u0935 \u092a\u0941\u0924\u094d\u0930\u0938\u094d\u092f \u0938\u0916\u0947\u0935 \u0938\u0916\u094d\u092f\u0941\u0903\\n\u092a\u094d\u0930\u093f\u092f\u0903 \u092a\u094d\u0930\u093f\u092f\u093e\u092f\u093e\u0930\u094d\u0939\u0938\u093f \u0926\u0947\u0935 \u0938\u094b\u0922\u0941\u092e\u094d\u0964\u096411.44\u0964\u0964","translation":"\u0964\u096411.44\u0964\u0964 \u0907\u0938\u0932\u093f\u092f\u0947 \u0936\u0930\u0940\u0930\u0938\u0947 \u0932\u092e\u094d\u092c\u093e \u092a\u0921\u093c\u0915\u0930 \u0938\u094d\u0924\u0941\u0924\u093f \u0915\u0930\u0928\u0947\u092f\u094b\u0917\u094d\u092f \u0906\u092a \u0908\u0936\u094d\u0935\u0930\u0915\u094b \u092e\u0948\u0902 \u092a\u094d\u0930\u0923\u093e\u092e \u0915\u0930\u0915\u0947 \u092a\u094d\u0930\u0938\u0928\u094d\u0928 \u0915\u0930\u0928\u093e \u091a\u093e\u0939\u0924\u093e \u0939\u0942\u0901\u0964 \u091c\u0948\u0938\u0947 \u092a\u093f\u0924\u093e \u092a\u0941\u0924\u094d\u0930\u0915\u0947, \u092e\u093f\u0924\u094d\u0930 \u092e\u093f\u0924\u094d\u0930\u0915\u0947 \u0914\u0930 \u092a\u0924\u093f \u092a\u0924\u094d\u0928\u0940\u0915\u0947 \u0905\u092a\u092e\u093e\u0928\u0915\u094b \u0938\u0939 \u0932\u0947\u0924\u093e \u0939\u0948, \u0910\u0938\u0947 \u0939\u0940 \u0939\u0947 \u0926\u0947\u0935 ! \u0906\u092a \u092e\u0947\u0930\u0947 \u0926\u094d\u0935\u093e\u0930\u093e \u0915\u093f\u092f\u093e \u0917\u092f\u093e \u0905\u092a\u092e\u093e\u0928 \u0938\u0939\u0928\u0947\u092e\u0947\u0902 \u0938\u092e\u0930\u094d\u0925 \u0939\u0948\u0902\u0964","commentary":"\u0964\u096411.44\u0964\u0964\xa0\u0935\u094d\u092f\u093e\u0916\u094d\u092f\u093e--\'\u0924\u0938\u094d\u092e\u093e\u0924\u094d\u092a\u094d\u0930\u0923\u092e\u094d\u092f \u092a\u094d\u0930\u0923\u093f\u0927\u093e\u092f \u0915\u093e\u092f\u0902 \u092a\u094d\u0930\u0938\u093e\u0926\u092f\u0947 \u0924\u094d\u0935\u093e\u092e\u0939\u092e\u0940\u0937\u092e\u0940\u0921\u094d\u092f\u092e\u094d\'--\u0906\u092a \u0905\u0928\u0928\u094d\u0924 \u092c\u094d\u0930\u0939\u094d\u092e\u093e\u0923\u094d\u0921\u094b\u0902\u0915\u0947 \u0908\u0936\u094d\u0935\u0930 \u0939\u0948\u0902\u0964 \u0907\u0938\u0932\u093f\u092f\u0947 \u0938\u092c\u0915\u0947 \u0926\u094d\u0935\u093e\u0930\u093e \u0938\u094d\u0924\u0941\u0924\u093f \u0915\u0930\u0928\u0947\u092f\u094b\u0917\u094d\u092f \u0906\u092a \u0939\u0940 \u0939\u0948\u0902\u0964 \u0906\u092a\u0915\u0947 \u0917\u0941\u0923, \u092a\u094d\u0930\u092d\u093e\u0935, \u092e\u0939\u0924\u094d\u0924\u094d\u0935 \u0906\u0926\u093f \u0905\u0928\u0928\u094d\u0924 \u0939\u0948\u0902; \u0905\u0924\u0903 \u090b\u0937\u093f, \u092e\u0939\u0930\u094d\u0937\u093f, \u0926\u0947\u0935\u0924\u093e, \u092e\u0939\u093e\u092a\u0941\u0930\u0941\u0937 \u0906\u092a\u0915\u0940 \u0928\u093f\u0924\u094d\u092f-\u0928\u093f\u0930\u0928\u094d\u0924\u0930 \u0938\u094d\u0924\u0941\u0924\u093f \u0915\u0930\u0924\u0947 \u0930\u0939\u0947\u0902, \u0924\u094b \u092d\u0940 \u092a\u093e\u0930 \u0928\u0939\u0940\u0902 \u092a\u093e \u0938\u0915\u0924\u0947\u0964 \u0910\u0938\u0947 \u0938\u094d\u0924\u0941\u0924\u093f \u0915\u0930\u0928\u0947\u092f\u094b\u0917\u094d\u092f \u0906\u092a\u0915\u0940 \u092e\u0948\u0902 \u0915\u094d\u092f\u093e \u0938\u094d\u0924\u0941\u0924\u093f \u0915\u0930 \u0938\u0915\u0924\u093e \u0939\u0942\u0901? \u092e\u0947\u0930\u0947\u092e\u0947\u0902 \u0906\u092a\u0915\u0940 \u0938\u094d\u0924\u0941\u0924\u093f \u0915\u0930\u0928\u0947\u0915\u093e \u092c\u0932 \u0928\u0939\u0940\u0902 \u0939\u0948, \u0938\u093e\u092e\u0930\u094d\u0925\u094d\u092f \u0928\u0939\u0940\u0902 \u0939\u0948\u0964 \u0907\u0938\u0932\u093f\u092f\u0947 \u092e\u0948\u0902 \u0924\u094b \u0915\u0947\u0935\u0932 \u0906\u092a\u0915\u0947 \u091a\u0930\u0923\u094b\u0902\u092e\u0947\u0902 \u0932\u092e\u094d\u092c\u093e \u092a\u0921\u093c\u0915\u0930 \u0926\u0923\u094d\u0921\u0935\u0924\u094d \u092a\u094d\u0930\u0923\u093e\u092e \u0939\u0940 \u0915\u0930 \u0938\u0915\u0924\u093e \u0939\u0942\u0901 \u0914\u0930 \u0907\u0938\u0940\u0938\u0947 \u0906\u092a\u0915\u094b \u092a\u094d\u0930\u0938\u0928\u094d\u0928 \u0915\u0930\u0928\u093e \u091a\u093e\u0939\u0924\u093e \u0939\u0942\u0901\u0964\\n\'\u092a\u093f\u0924\u0947\u0935 \u092a\u0941\u0924\u094d\u0930\u0938\u094d\u092f \u0938\u0916\u0947\u0935 \u0938\u0916\u094d\u092f\u0941\u0903 \u092a\u094d\u0930\u093f\u092f\u0903 \u092a\u094d\u0930\u093f\u092f\u093e\u092f\u093e\u0930\u094d\u0939\u0938\u093f \u0926\u0947\u0935 \u0938\u094b\u0922\u0941\u092e\u094d\'--  \u0915\u093f\u0938\u0940\u0915\u093e \u0905\u092a\u092e\u093e\u0928 \u0939\u094b\u0924\u093e \u0939\u0948 \u0924\u094b \u0909\u0938\u092e\u0947\u0902 \u092e\u0941\u0916\u094d\u092f \u0924\u0940\u0928 \u0915\u093e\u0930\u0923 \u0939\u094b\u0924\u0947 \u0939\u0948\u0902 -- (1) \u092a\u094d\u0930\u092e\u093e\u0926-(\u0905\u0938\u093e\u0935\u0927\u093e\u0928\u0940-) \u0938\u0947, (2) \u0939\u0901\u0938\u0940, \u0926\u093f\u0932\u094d\u0932\u0917\u0940, \u0935\u093f\u0928\u094b\u0926\u092e\u0947\u0902 \u0916\u092f\u093e\u0932 \u0928 \u0930\u0939\u0928\u0947\u0938\u0947 \u0914\u0930 (3) \u0905\u092a\u0928\u0947\u092a\u0928\u0915\u0940 \u0918\u0928\u093f\u0937\u094d\u0920\u0924\u093e \u0939\u094b\u0928\u0947\u092a\u0930 \u0905\u092a\u0928\u0947 \u0938\u093e\u0925 \u0930\u0939\u0928\u0947\u0935\u093e\u0932\u0947\u0915\u093e \u092e\u0939\u0924\u094d\u0924\u094d\u0935 \u0928 \u091c\u093e\u0928\u0928\u0947\u0938\u0947\u0964 \u091c\u0948\u0938\u0947, \u0917\u094b\u0926\u0940\u092e\u0947\u0902 \u092c\u0948\u0920\u093e \u0939\u0941\u0906 \u091b\u094b\u091f\u093e \u092c\u091a\u094d\u091a\u093e \u0905\u091c\u094d\u091e\u093e\u0928\u0935\u0936 \u092a\u093f\u0924\u093e\u0915\u0940 \u0926\u093e\u0922\u093c\u0940-\u092e\u0942\u0901\u091b \u0916\u0940\u0902\u091a\u0924\u093e \u0939\u0948, \u092e\u0941\u0901\u0939\u092a\u0930 \u0925\u092a\u094d\u092a\u0921\u093c \u0932\u0917\u093e\u0924\u093e \u0939\u0948, \u0915\u092d\u0940 \u0915\u0939\u0940\u0902 \u0932\u093e\u0924 \u092e\u093e\u0930 \u0926\u0947\u0924\u093e \u0939\u0948 \u0924\u094b \u092c\u091a\u094d\u091a\u0947\u0915\u0940 \u0910\u0938\u0940 \u091a\u0947\u0937\u094d\u091f\u093e \u0926\u0947\u0916\u0915\u0930 \u092a\u093f\u0924\u093e \u0930\u093e\u091c\u0940 \u0939\u0940 \u0939\u094b\u0924\u0947 \u0939\u0948\u0902. \u092a\u094d\u0930\u0938\u0928\u094d\u0928 \u0939\u0940 \u0939\u094b\u0924\u0947 \u0939\u0948\u0902\u0964 \u0935\u0947 \u0905\u092a\u0928\u0947\u092e\u0947\u0902 \u092f\u0939 \u092d\u093e\u0935 \u0932\u093e\u0924\u0947 \u0939\u0940 \u0928\u0939\u0940\u0902 \u0915\u093f \u092a\u0941\u0924\u094d\u0930 \u092e\u0947\u0930\u093e \u0905\u092a\u092e\u093e\u0928 \u0915\u0930 \u0930\u0939\u093e \u0939\u0948\u0964 \u092e\u093f\u0924\u094d\u0930 \u092e\u093f\u0924\u094d\u0930\u0915\u0947 \u0938\u093e\u0925 \u091a\u0932\u0924\u0947-\u092b\u093f\u0930\u0924\u0947, \u0909\u0920\u0924\u0947-\u092c\u0948\u0920\u0924\u0947 \u0906\u0926\u093f \u0938\u092e\u092f \u091a\u093e\u0939\u0947 \u091c\u0948\u0938\u093e \u0935\u094d\u092f\u0935\u0939\u093e\u0930 \u0915\u0930\u0924\u093e \u0939\u0948, \u091a\u093e\u0939\u0947 \u091c\u0948\u0938\u093e \u092c\u094b\u0932 \u0926\u0947\u0924\u093e \u0939\u0948, \u091c\u0948\u0938\u0947 -- \u0924\u0941\u092e \u092c\u093c\u0921\u093c\u0947 \u0938\u0924\u094d\u092f \u092c\u094b\u0932\u0924\u0947 \u0939\u094b \u091c\u0940 \u0924\u0941\u092e \u0924\u094b \u092c\u0921\u093c\u0947 \u0938\u0924\u094d\u092f\u092a\u094d\u0930\u0924\u093f\u091c\u094d\u091e \u0939\u094b \u0905\u092c \u0924\u094b \u0924\u0941\u092e \u092c\u0921\u093c\u0947 \u0906\u0926\u092e\u0940 \u0939\u094b \u0917\u092f\u0947 \u0939\u094b \u0924\u0941\u092e \u0924\u094b \u0916\u0942\u092c \u0905\u092d\u093f\u092e\u093e\u0928 \u0915\u0930\u0928\u0947 \u0932\u0917 \u0917\u092f\u0947 \u0939\u094b \u0906\u091c \u092e\u093e\u0928\u094b \u0924\u0941\u092e \u0930\u093e\u091c\u093e \u0939\u0940 \u092c\u0928 \u0917\u092f\u0947 \u0939\u094b \u0906\u0926\u093f, \u092a\u0930 \u0909\u0938\u0915\u093e \u092e\u093f\u0924\u094d\u0930 \u0909\u0938\u0915\u0940 \u0907\u0928 \u092c\u093e\u0924\u094b\u0902\u0915\u093e \u0916\u092f\u093e\u0932 \u0928\u0939\u0940\u0902 \u0915\u0930\u0924\u093e\u0964 \u0935\u0939 \u0924\u094b \u092f\u0939\u0940 \u0938\u092e\u091d\u0924\u093e \u0939\u0948 \u0915\u093f \u0939\u092e \u092c\u0930\u093e\u092c\u0930\u0940\u0915\u0947 \u092e\u093f\u0924\u094d\u0930 \u0939\u0948\u0902, \u0910\u0938\u0940 \u0939\u0901\u0938\u0940-\u0926\u093f\u0932\u094d\u0932\u0917\u0940 \u0924\u094b \u0939\u094b\u0924\u0940 \u0939\u0940 \u0930\u0939\u0924\u0940 \u0939\u0948\u0964 \u092a\u0924\u094d\u0928\u0940\u0915\u0947 \u0926\u094d\u0935\u093e\u0930\u093e \u0906\u092a\u0938\u0915\u0947 \u092a\u094d\u0930\u0947\u092e\u0915\u0947 \u0915\u093e\u0930\u0923 \u0909\u0920\u0928\u0947-\u092c\u0948\u0920\u0928\u0947, \u092c\u093e\u0924\u091a\u0940\u0924 \u0915\u0930\u0928\u0947 \u0906\u0926\u093f\u092e\u0947\u0902 \u092a\u0924\u093f\u0915\u0940 \u091c\u094b \u0915\u0941\u091b \u0905\u0935\u0939\u0947\u0932\u0928\u093e \u0939\u094b\u0924\u0940 \u0939\u0948, \u0909\u0938\u0947 \u092a\u0924\u093f \u0938\u0939 \u0932\u0947\u0924\u093e \u0939\u0948\u0964 \u091c\u0948\u0938\u0947, \u092a\u0924\u093f \u0928\u0940\u091a\u0947 \u092c\u0948\u0920\u093e \u0939\u0948 \u0924\u094b,\u0935\u0939 \u090a\u0901\u091a\u0947 \u0906\u0938\u0928\u092a\u0930 \u092c\u0948\u0920 \u091c\u093e\u0924\u0940 \u0939\u0948, \u0915\u092d\u0940 \u0915\u093f\u0938\u0940 \u092c\u093e\u0924\u0915\u094b \u0932\u0947\u0915\u0930 \u0905\u0935\u0939\u0947\u0932\u0928\u093e \u092d\u0940 \u0915\u0930 \u0926\u0947\u0924\u0940 \u0939\u0948, \u092a\u0930 \u092a\u0924\u093f \u0909\u0938\u0947 \u0938\u094d\u0935\u093e\u092d\u093e\u0935\u093f\u0915 \u0939\u0940 \u0938\u0939 \u0932\u0947\u0924\u093e \u0939\u0948\u0964 \u0905\u0930\u094d\u091c\u0941\u0928 \u0915\u0939\u0924\u0947 \u0939\u0948\u0902 \u0915\u093f \u091c\u0948\u0938\u0947 \u092a\u093f\u0924\u093e \u092a\u0941\u0924\u094d\u0930\u0915\u0947, \u092e\u093f\u0924\u094d\u0930 \u092e\u093f\u0924\u094d\u0930\u0915\u0947 \u0914\u0930 \u092a\u0924\u093f \u092a\u0924\u094d\u0928\u0940\u0915\u0947 \u0905\u092a\u092e\u093e\u0928\u0915\u094b \u0938\u0939 \u0932\u0947\u0924\u093e \u0939\u0948 \u0905\u0930\u094d\u0925\u093e\u0924\u094d \u0915\u094d\u0937\u092e\u093e \u0915\u0930 \u0926\u0947\u0924\u093e \u0939\u0948, \u0910\u0938\u0947 \u0939\u0940 \u0939\u0947 \u092d\u0917\u0935\u0928\u094d \u0906\u092a \u092e\u0947\u0930\u0947 \u0905\u092a\u092e\u093e\u0928\u0915\u094b \u0938\u0939\u0928\u0947\u092e\u0947\u0902 \u0938\u092e\u0930\u094d\u0925 \u0939\u0948\u0902 \u0905\u0930\u094d\u0925\u093e\u0924\u094d \u0907\u0938\u0915\u0947 \u0932\u093f\u092f\u0947 \u092e\u0948\u0902 \u0906\u092a\u0938\u0947 \u0915\u094d\u0937\u092e\u093e \u092e\u093e\u0901\u0917\u0924\u093e \u0939\u0942\u0901\u0964"},{"text":"\u0905\u0926\u0943\u0937\u094d\u091f\u092a\u0942\u0930\u094d\u0935\u0902 \u0939\u0943\u0937\u093f\u0924\u094b\u093d\u0938\u094d\u092e\u093f \u0926\u0943\u0937\u094d\u091f\u094d\u0935\u093e\\n\u092d\u092f\u0947\u0928 \u091a \u092a\u094d\u0930\u0935\u094d\u092f\u0925\u093f\u0924\u0902 \u092e\u0928\u094b \u092e\u0947\u0964\\n\u0924\u0926\u0947\u0935 \u092e\u0947 \u0926\u0930\u094d\u0936\u092f \u0926\u0947\u0935 \u0930\u0942\u092a\u0902\\n\u092a\u094d\u0930\u0938\u0940\u0926 \u0926\u0947\u0935\u0947\u0936 \u091c\u0917\u0928\u094d\u0928\u093f\u0935\u093e\u0938\u0964\u096411.45\u0964\u0964","translation":"\u0964\u096411.45\u0964\u0964 \u092e\u0948\u0902\u0928\u0947 \u0910\u0938\u093e \u0930\u0941\u092a \u092a\u0939\u0932\u0947 \u0915\u092d\u0940 \u0928\u0939\u0940\u0902 \u0926\u0947\u0916\u093e\u0964 \u0907\u0938 \u0930\u0942\u092a\u0915\u094b \u0926\u0947\u0916\u0915\u0930 \u092e\u0948\u0902 \u0939\u0930\u094d\u0937\u093f\u0924 \u0939\u094b \u0930\u0939\u093e \u0939\u0942\u0901 \u0914\u0930 (\u0938\u093e\u0925-\u0939\u0940-\u0938\u093e\u0925) \u092d\u092f\u0938\u0947 \u092e\u0947\u0930\u093e \u092e\u0928 \u0905\u0924\u094d\u092f\u0928\u094d\u0924 \u0935\u094d\u092f\u0925\u093f\u0924 \u0939\u094b \u0930\u0939\u093e \u0939\u0948\u0964 \u0905\u0924\u0903 \u0906\u092a \u092e\u0941\u091d\u0947 \u0905\u092a\u0928\u0947 \u0909\u0938\u0940 \u0926\u0947\u0935\u0930\u0942\u092a\u0915\u094b (\u0938\u094c\u092e\u094d\u092f \u0935\u093f\u0937\u094d\u0923\u0941\u0930\u0942\u092a\u0915\u094b)\xa0 \u0926\u093f\u0916\u093e\u0907\u092f\u0947\u0964 \u0939\u0947 \u0926\u0947\u0935\u0947\u0936 ! \u0939\u0947 \u091c\u0917\u0928\u094d\u0928\u093f\u0935\u093e\u0938 ! \u0906\u092a \u092a\u094d\u0930\u0938\u0928\u094d\u0928 \u0939\u094b\u0907\u092f\u0947\u0964","commentary":"\u0964\u096411.45\u0964\u0964\xa0\u0935\u094d\u092f\u093e\u0916\u094d\u092f\u093e--[\u091c\u0948\u0938\u0947 \u0935\u093f\u0930\u093e\u091f\u094d\u0930\u0942\u092a \u0926\u093f\u0916\u093e\u0928\u0947\u0915\u0947 \u0932\u093f\u092f\u0947 \u092e\u0948\u0902\u0928\u0947 \u092d\u0917\u0935\u093e\u0928\u094d\u0938\u0947 \u092a\u094d\u0930\u093e\u0930\u094d\u0925\u0928\u093e \u0915\u0940 \u0924\u094b \u092d\u0917\u0935\u093e\u0928\u094d\u0928\u0947 \u092e\u0941\u091d\u0947 \u0935\u093f\u0930\u093e\u091f\u094d\u0930\u0942\u092a \u0926\u093f\u0916\u093e \u0926\u093f\u092f\u093e, \u0910\u0938\u0947 \u0939\u0940 \u0926\u0947\u0935\u0930\u0942\u092a \u0926\u093f\u0916\u093e\u0928\u0947\u0915\u0947 \u0932\u093f\u092f\u0947 \u092a\u094d\u0930\u093e\u0930\u094d\u0925\u0928\u093e \u0915\u0930\u0928\u0947\u092a\u0930 \u092d\u0917\u0935\u093e\u0928\u094d \u0926\u0947\u0935\u0930\u0942\u092a \u0926\u093f\u0916\u093e\u092f\u0947\u0902\u0917\u0947 \u0939\u0940 -- \u0910\u0938\u0940 \u0906\u0936\u093e \u0939\u094b\u0928\u0947\u0938\u0947 \u0905\u0930\u094d\u091c\u0941\u0928 \u092d\u0917\u0935\u093e\u0928\u094d\u0938\u0947 \u0926\u0947\u0935\u0930\u0942\u092a \u0926\u093f\u0916\u093e\u0928\u0947\u0915\u0947 \u0932\u093f\u092f\u0947 \u092a\u094d\u0930\u093e\u0930\u094d\u0925\u0928\u093e \u0915\u0930\u0924\u0947 \u0939\u0948\u0902\u0964]"},{"text":"\u0915\u093f\u0930\u0940\u091f\u093f\u0928\u0902 \u0917\u0926\u093f\u0928\u0902 \u091a\u0915\u094d\u0930\u0939\u0938\u094d\u0924\\n\u092e\u093f\u091a\u094d\u091b\u093e\u092e\u093f \u0924\u094d\u0935\u093e\u0902 \u0926\u094d\u0930\u0937\u094d\u091f\u0941\u092e\u0939\u0902 \u0924\u0925\u0948\u0935\u0964\\n\u0924\u0947\u0928\u0948\u0935 \u0930\u0942\u092a\u0947\u0923 \u091a\u0924\u0941\u0930\u094d\u092d\u0941\u091c\u0947\u0928\\n\u0938\u0939\u0938\u094d\u0930\u092c\u093e\u0939\u094b \u092d\u0935 \u0935\u093f\u0936\u094d\u0935\u092e\u0942\u0930\u094d\u0924\u0947\u0964\u096411.46\u0964\u0964","translation":"\u0964\u096411.46\u0964\u0964\xa0\xa0\u092e\u0948\u0902 \u0906\u092a\u0915\u094b \u0935\u0948\u0938\u0947 \u0939\u0940 \u0915\u093f\u0930\u0940\u091f\u0927\u093e\u0930\u0940, \u0917\u0926\u093e\u0927\u093e\u0930\u0940 \u0914\u0930 \u0939\u093e\u0925\u092e\u0947\u0902 \u091a\u0915\u094d\u0930 \u0932\u093f\u092f\u0947 \u0939\u0941\u090f \u0926\u0947\u0916\u0928\u093e \u091a\u093e\u0939\u0924\u093e \u0939\u0942\u0901\u0964 \u0907\u0938\u0932\u093f\u092f\u0947 \u0939\u0947 \u0938\u0939\u0938\u094d\u0930\u092c\u093e\u0939\u094b ! \u0939\u0947 \u0935\u093f\u0936\u094d\u0935\u092e\u0942\u0930\u094d\u0924\u0947 ! \u0906\u092a \u0909\u0938\u0940 \u091a\u0924\u0941\u0930\u094d\u092d\u0941\u091c\u0930\u0942\u092a\u0938\u0947 \u0939\u094b \u091c\u093e\u0907\u092f\u0947\u0964","commentary":"\u0964\u096411.46\u0964\u0964\xa0\u0935\u094d\u092f\u093e\u0916\u094d\u092f\u093e--\'\u0915\u093f\u0930\u0940\u091f\u0928\u0902 \u0917\u0926\u093f\u0928\u0902 \u091a\u0915\u094d\u0930\u0939\u0938\u094d\u0924\u092e\u093f\u091a\u094d\u091b\u093e\u092e\u093f \u0924\u094d\u0935\u093e\u0902 \u0926\u094d\u0930\u0937\u094d\u091f\u0941\u092e\u0939\u0902 \u0924\u0925\u0948\u0935--\u091c\u093f\u0938\u092e\u0947\u0902 \u0906\u092a\u0928\u0947 \u0938\u093f\u0930\u092a\u0930 \u0926\u093f\u0935\u094d\u092f \u092e\u0941\u0915\u0941\u091f \u0924\u0925\u093e \u0939\u093e\u0925\u094b\u0902\u092e\u0947\u0902 \u0917\u0926\u093e \u0914\u0930 \u091a\u0915\u094d\u0930 \u0927\u093e\u0930\u0923 \u0915\u0930 \u0930\u0916\u0947 \u0939\u0948\u0902, \u0909\u0938\u0940 \u0930\u0942\u092a\u0915\u094b \u092e\u0948\u0902 \u0926\u0947\u0916\u0928\u093e \u091a\u093e\u0939\u0924\u093e \u0939\u0942\u0901\u0964\\n\'\u0924\u0925\u0948\u0935\' \u0915\u0939\u0928\u0947\u0915\u093e \u0924\u093e\u0924\u094d\u092a\u0930\u094d\u092f \u0939\u0948 \u0915\u093f \u092e\u0947\u0930\u0947 \u0926\u094d\u0935\u093e\u0930\u093e \'\u0926\u094d\u0930\u0937\u094d\u091f\u0941\u092e\u093f\u091a\u094d\u091b\u093e\u092e\u093f \u0924\u0947 \u0930\u0942\u092a\u092e\u094d\' (11\u0964 3) \u0910\u0938\u0940 \u0907\u091a\u094d\u091b\u093e \u092a\u094d\u0930\u0915\u091f \u0915\u0930\u0928\u0947\u0938\u0947 \u0906\u092a\u0928\u0947 \u0935\u093f\u0930\u093e\u091f\u094d\u0930\u0942\u092a \u0926\u093f\u0916\u093e\u092f\u093e\u0964 \u0905\u092c \u092e\u0948\u0902 \u0905\u092a\u0928\u0940 \u0907\u091a\u094d\u091b\u093e \u092c\u093e\u0915\u0940 \u0915\u094d\u092f\u094b\u0902 \u0930\u0916\u0942\u0901? \u0905\u0924\u0903 \u092e\u0948\u0902\u0928\u0947 \u0906\u092a\u0915\u0947 \u0935\u093f\u0930\u093e\u091f\u094d\u0930\u0942\u092a\u092e\u0947\u0902 \u091c\u0948\u0938\u093e \u0938\u094c\u092e\u094d\u092f \u091a\u0924\u0941\u0930\u094d\u092d\u0941\u091c\u0930\u0942\u092a \u0926\u0947\u0916\u093e \u0939\u0948, \u0935\u0948\u0938\u093e-\u0915\u093e-\u0935\u0948\u0938\u093e \u0939\u0940 \u0930\u0942\u092a \u092e\u0948\u0902 \u0905\u092c \u0926\u0947\u0916\u0928\u093e \u091a\u093e\u0939\u0924\u093e \u0939\u0942\u0901 -- \'\u0907\u091a\u094d\u091b\u093e\u092e\u093f \u0924\u094d\u0935\u093e\u0902 \u0926\u094d\u0930\u0937\u094d\u091f\u0941\u092e\u0939\u0902 \u0924\u0925\u0948\u0935\u0964\xa0"},{"text":"\u0936\u094d\u0930\u0940 \u092d\u0917\u0935\u093e\u0928\u0941\u0935\u093e\u091a\\n\u092e\u092f\u093e \u092a\u094d\u0930\u0938\u0928\u094d\u0928\u0947\u0928 \u0924\u0935\u093e\u0930\u094d\u091c\u0941\u0928\u0947\u0926\u0902\\n\u0930\u0942\u092a\u0902 \u092a\u0930\u0902 \u0926\u0930\u094d\u0936\u093f\u0924\u092e\u093e\u0924\u094d\u092e\u092f\u094b\u0917\u093e\u0924\u094d\u0964\\n\u0924\u0947\u091c\u094b\u092e\u092f\u0902 \u0935\u093f\u0936\u094d\u0935\u092e\u0928\u0928\u094d\u0924\u092e\u093e\u0926\u094d\u092f\u0902\\n\u092f\u0928\u094d\u092e\u0947 \u0924\u094d\u0935\u0926\u0928\u094d\u092f\u0947\u0928 \u0928 \u0926\u0943\u0937\u094d\u091f\u092a\u0942\u0930\u094d\u0935\u092e\u094d\u0964\u096411.47\u0964\u0964","translation":"\u0964\u096411.47\u0964\u0964 \u0936\u094d\u0930\u0940\u092d\u0917\u0935\u093e\u0928\u094d \u092c\u094b\u0932\u0947 -- \u0939\u0947 \u0905\u0930\u094d\u091c\u0941\u0928 ! \u092e\u0948\u0902\u0928\u0947 \u092a\u094d\u0930\u0938\u0928\u094d\u0928 \u0939\u094b\u0915\u0930 \u0905\u092a\u0928\u0940 \u0938\u093e\u092e\u0930\u094d\u0925\u094d\u092f\u0938\u0947 \u092f\u0939 \u0905\u0924\u094d\u092f\u0928\u094d\u0924 \u0936\u094d\u0930\u0947\u0937\u094d\u0920, \u0924\u0947\u091c\u094b\u092e\u092f, \u0938\u092c\u0915\u093e \u0906\u0926\u093f \u0914\u0930 \u0905\u0928\u0928\u094d\u0924 \u0935\u093f\u0936\u094d\u0935\u0930\u0942\u092a \u0924\u0941\u091d\u0947 \u0926\u093f\u0916\u093e\u092f\u093e \u0939\u0948, \u091c\u093f\u0938\u0915\u094b \u0924\u0941\u092e\u094d\u0939\u093e\u0930\u0947 \u0938\u093f\u0935\u093e\u092f \u092a\u0939\u0932\u0947 \u0915\u093f\u0938\u0940\u0928\u0947 \u0928\u0939\u0940\u0902 \u0926\u0947\u0916\u093e \u0939\u0948\u0964","commentary":"\u0964\u096411.47\u0964\u0964\xa0\u0935\u094d\u092f\u093e\u0916\u094d\u092f\u093e --\'\u092e\u092f\u093e \u092a\u094d\u0930\u0938\u0928\u094d\u0928\u0947\u0928 \u0924\u0935\u093e\u0930\u094d\u091c\u0941\u0928\u0947\u0926\u0902 \u0930\u0942\u092a\u0902 \u0926\u0930\u094d\u0936\u093f\u0924\u092e\u094d\'--\u0939\u0947 \u0905\u0930\u094d\u091c\u0941\u0928 ! \u0924\u0942 \u092c\u093e\u0930-\u092c\u093e\u0930 \u092f\u0939 \u0915\u0939 \u0930\u0939\u093e \u0939\u0948 \u0915\u093f \u0906\u092a \u092a\u094d\u0930\u0938\u0928\u094d\u0928 \u0939\u094b \u091c\u093e\u0913 (11\u0964 25? 31? 45), \u0924\u094b \u092a\u094d\u092f\u093e\u0930\u0947 \u092d\u0948\u092f\u093e ! \u092e\u0948\u0902\u0928\u0947 \u091c\u094b \u092f\u0939 \u0935\u093f\u0930\u093e\u091f\u094d\u0930\u0942\u092a \u0924\u0941\u091d\u0947 \u0926\u093f\u0916\u093e\u092f\u093e \u0939\u0948, \u0909\u0938\u092e\u0947\u0902 \u0935\u093f\u0915\u0930\u093e\u0932\u0930\u0942\u092a\u0915\u094b \u0926\u0947\u0916\u0915\u0930 \u0924\u0942 \u092d\u092f\u092d\u0940\u0924 \u0939\u094b \u0917\u092f\u093e \u0939\u0948, \u092a\u0930 \u092f\u0939 \u0935\u093f\u0915\u0930\u093e\u0932\u0930\u0942\u092a \u092e\u0948\u0902\u0928\u0947 \u0915\u094d\u0930\u094b\u0927\u092e\u0947\u0902 \u0906\u0915\u0930 \u092f\u093e \u0924\u0941\u091d\u0947 \u092d\u092f\u092d\u0940\u0924 \u0915\u0930\u0928\u0947\u0915\u0947 \u0932\u093f\u092f\u0947 \u0928\u0939\u0940\u0902 \u0926\u093f\u0916\u093e\u092f\u093e \u0939\u0948\u0964 \u092e\u0948\u0902\u0928\u0947 \u0924\u094b \u0905\u092a\u0928\u0940 \u092a\u094d\u0930\u0938\u0928\u094d\u0928\u0924\u093e\u0938\u0947 \u0939\u0940 \u092f\u0939 \u0935\u093f\u0930\u093e\u091f\u094d\u0930\u0942\u092a \u0924\u0941\u091d\u0947 \u0926\u093f\u0916\u093e\u092f\u093e \u0939\u0948\u0964 \u0907\u0938\u092e\u0947\u0902 \u0924\u0947\u0930\u0940 \u0915\u094b\u0908 \u092f\u094b\u0917\u094d\u092f\u0924\u093e, \u092a\u093e\u0924\u094d\u0930\u0924\u093e \u0905\u0925\u0935\u093e \u092d\u0915\u094d\u0924\u093f \u0915\u093e\u0930\u0923 \u0928\u0939\u0940\u0902 \u0939\u0948\u0964 \u0924\u0941\u092e\u0928\u0947 \u0924\u094b \u092a\u0939\u0932\u0947 \u0915\u0947\u0935\u0932 \u0935\u093f\u092d\u0942\u0924\u093f \u0914\u0930 \u092f\u094b\u0917\u0915\u094b \u0939\u0940 \u092a\u0942\u091b\u093e \u0925\u093e\u0964 \u0935\u093f\u092d\u0942\u0924\u093f \u0914\u0930 \u092f\u094b\u0917\u0915\u093e \u0935\u0930\u094d\u0923\u0928 \u0915\u0930\u0915\u0947 \u092e\u0948\u0902\u0928\u0947 \u0905\u0928\u094d\u0924\u092e\u0947\u0902 \u0915\u0939\u093e \u0925\u093e \u0915\u093f \u0924\u0941\u091d\u0947 \u091c\u0939\u093e\u0901-\u0915\u0939\u0940\u0902 \u091c\u094b \u0915\u0941\u091b \u0935\u093f\u0932\u0915\u094d\u0937\u0923\u0924\u093e \u0926\u0940\u0916\u0947, \u0935\u0939\u093e\u0901-\u0935\u0939\u093e\u0901 \u092e\u0947\u0930\u0940 \u0939\u0940 \u0935\u093f\u092d\u0942\u0924\u093f \u0938\u092e\u091d\u0964 \u0907\u0938 \u092a\u094d\u0930\u0915\u093e\u0930 \u0924\u0941\u092e\u094d\u0939\u093e\u0930\u0947 \u092a\u094d\u0930\u0936\u094d\u0928\u0915\u093e \u0909\u0924\u094d\u0924\u0930 \u0938\u092e\u094d\u092f\u0915\u094d \u092a\u094d\u0930\u0915\u093e\u0930\u0938\u0947 \u092e\u0948\u0902\u0928\u0947 \u0926\u0947 \u0939\u0940 \u0926\u093f\u092f\u093e \u0925\u093e\u0964 \u092a\u0930\u0928\u094d\u0924\u0941 \u0935\u0939\u093e\u0901 \u092e\u0948\u0902\u0928\u0947,(\u0905\u0925\u0935\u093e \u092a\u0926\u0938\u0947) \u0905\u092a\u0928\u0940 \u0939\u0940 \u0924\u0930\u092b\u0938\u0947 \u092f\u0939 \u092c\u093e\u0924 \u0915\u0939\u0940 \u0915\u093f \u0924\u0941\u091d\u0947 \u092c\u0939\u0941\u0924 \u091c\u093e\u0928\u0928\u0947\u0938\u0947 \u0915\u094d\u092f\u093e \u092e\u0924\u0932\u092c? \u0926\u0947\u0916\u0928\u0947, \u0938\u0941\u0928\u0928\u0947, \u0938\u092e\u091d\u0928\u0947\u092e\u0947\u0902 \u091c\u094b \u0915\u0941\u091b \u0938\u0902\u0938\u093e\u0930 \u0906\u0924\u093e \u0939\u0948, \u0909\u0938 \u0938\u092e\u094d\u092a\u0942\u0930\u094d\u0923 \u0938\u0902\u0938\u093e\u0930\u0915\u094b \u092e\u0948\u0902 \u0905\u092a\u0928\u0947 \u0915\u093f\u0938\u0940 \u0905\u0902\u0936\u092e\u0947\u0902 \u0927\u093e\u0930\u0923 \u0915\u0930\u0915\u0947 \u0938\u094d\u0925\u093f\u0924 \u0939\u0942\u0901\u0964 \u0926\u0942\u0938\u0930\u093e \u092d\u093e\u0935 \u092f\u0939 \u0939\u0948 \u0915\u093f \u0924\u0941\u091d\u0947 \u092e\u0947\u0930\u0940 \u0935\u093f\u092d\u0942\u0924\u093f \u0914\u0930 \u092f\u094b\u0917\u0936\u0915\u094d\u0924\u093f\u0915\u094b \u091c\u093e\u0928\u0928\u0947\u0915\u0940 \u0915\u094d\u092f\u093e \u091c\u0930\u0942\u0930\u0924 \u0939\u0948? \u0915\u094d\u092f\u094b\u0902\u0915\u093f \u0938\u092c \u0935\u093f\u092d\u0942\u0924\u093f\u092f\u093e\u0901 \u092e\u0947\u0930\u0940 \u092f\u094b\u0917\u0936\u0915\u094d\u0924\u093f\u0915\u0947 \u0906\u0936\u094d\u0930\u093f\u0924 \u0939\u0948\u0902 \u0914\u0930 \u0909\u0938 \u092f\u094b\u0917\u0936\u0915\u094d\u0924\u093f\u0915\u093e \u0906\u0936\u094d\u0930\u092f \u092e\u0948\u0902 \u0938\u094d\u0935\u092f\u0902 \u0924\u0947\u0930\u0947 \u0938\u093e\u092e\u0928\u0947 \u092c\u0948\u0920\u093e \u0939\u0942\u0901\u0964 \u092f\u0939 \u092c\u093e\u0924 \u0924\u094b \u092e\u0948\u0902\u0928\u0947 \u0935\u093f\u0936\u0947\u0937 \u0915\u0943\u092a\u093e \u0915\u0930\u0915\u0947 \u0939\u0940 \u0915\u0939\u0940 \u0925\u0940\u0964 \u0907\u0938 \u092c\u093e\u0924\u0915\u094b \u0932\u0947\u0915\u0930 \u0939\u0940 \u0924\u0947\u0930\u0940 \u0935\u093f\u0936\u094d\u0935\u0930\u0942\u092a-\u0926\u0930\u094d\u0936\u0928\u0915\u0940 \u0907\u091a\u094d\u091b\u093e \u0939\u0941\u0908 \u0914\u0930 \u092e\u0948\u0902\u0928\u0947 \u0926\u093f\u0935\u094d\u092f\u091a\u0915\u094d\u0937\u0941 \u0926\u0947\u0915\u0930 \u0924\u0941\u091d\u0947 \u0935\u093f\u0936\u094d\u0935\u0930\u0942\u092a \u0926\u093f\u0916\u093e\u092f\u093e\u0964 \u092f\u0939 \u0924\u094b \u092e\u0947\u0930\u0940 \u0915\u094b\u0930\u0940 \u092a\u094d\u0930\u0938\u0928\u094d\u0928\u0924\u093e-\u0939\u0940-\u092a\u094d\u0930\u0938\u0928\u094d\u0928\u0924\u093e \u0939\u0948\u0964 \u0924\u093e\u0924\u094d\u092a\u0930\u094d\u092f \u0939\u0948 \u0915\u093f \u0907\u0938 \u0935\u093f\u0936\u094d\u0935\u0930\u0942\u092a\u0915\u094b \u0926\u093f\u0916\u093e\u0928\u0947\u092e\u0947\u0902 \u092e\u0947\u0930\u0940 \u0915\u0943\u092a\u093e\u0915\u0947 \u0938\u093f\u0935\u093e\u092f \u0926\u0942\u0938\u0930\u093e \u0915\u094b\u0908 \u0939\u0947\u0924\u0941 \u0928\u0939\u0940\u0902 \u0939\u0948\u0964 \u0924\u0947\u0930\u0940 \u0926\u0947\u0916\u0928\u0947\u0915\u0940 \u0907\u091a\u094d\u091b\u093e \u0924\u094b \u0928\u093f\u092e\u093f\u0924\u094d\u0924\u092e\u093e\u0924\u094d\u0930 \u0939\u0948\u0964"},{"text":"\u0928 \u0935\u0947\u0926\u092f\u091c\u094d\u091e\u093e\u0927\u094d\u092f\u092f\u0928\u0948\u0930\u094d\u0928 \u0926\u093e\u0928\u0948\\n\u0930\u094d\u0928 \u091a \u0915\u094d\u0930\u093f\u092f\u093e\u092d\u093f\u0930\u094d\u0928 \u0924\u092a\u094b\u092d\u093f\u0930\u0941\u0917\u094d\u0930\u0948\u0903\u0964\\n\u090f\u0935\u0902\u0930\u0942\u092a\u0903 \u0936\u0915\u094d\u092f \u0905\u0939\u0902 \u0928\u0943\u0932\u094b\u0915\u0947\\n\u0926\u094d\u0930\u0937\u094d\u091f\u0941\u0902 \u0924\u094d\u0935\u0926\u0928\u094d\u092f\u0947\u0928 \u0915\u0941\u0930\u0941\u092a\u094d\u0930\u0935\u0940\u0930\u0964\u096411.48\u0964\u0964","translation":"\u0964\u096411.48\u0964\u0964 \u0939\u0947 \u0915\u0941\u0930\u0941\u092a\u094d\u0930\u0935\u0940\u0930! \u092e\u0928\u0941\u0937\u094d\u092f\u0932\u094b\u0915\u092e\u0947\u0902 \u0907\u0938 \u092a\u094d\u0930\u0915\u093e\u0930\u0915\u0947 \u0935\u093f\u0936\u094d\u0935\u0930\u0942\u092a\u0935\u093e\u0932\u093e \u092e\u0948\u0902 \u0928 \u0935\u0947\u0926\u094b\u0902\u0915\u0947 \u092a\u0922\u093c\u0928\u0947\u0938\u0947, \u0928 \u092f\u091c\u094d\u091e\u094b\u0902\u0915\u0947 \u0905\u0928\u0941\u0937\u094d\u0920\u093e\u0928\u0938\u0947, \u0928 \u0926\u093e\u0928\u0938\u0947, \u0928 \u0909\u0917\u094d\u0930 \u0924\u092a\u094b\u0902\u0938\u0947 \u0914\u0930 \u0928 \u092e\u093e\u0924\u094d\u0930 \u0915\u094d\u0930\u093f\u092f\u093e\u0913\u0902\u0938\u0947 \u0924\u0947\u0930\u0947 (\u0915\u0943\u092a\u093e\u092a\u093e\u0924\u094d\u0930\u0915\u0947) \u0938\u093f\u0935\u093e\u092f \u0914\u0930 \u0915\u093f\u0938\u0940\u0915\u0947 \u0926\u094d\u0935\u093e\u0930\u093e \u0926\u0947\u0916\u093e \u091c\u093e\u0928\u093e \u0936\u0915\u094d\u092f \u0939\u0942\u0901\u0964","commentary":"\u0964\u096411.48\u0964\u0964\xa0\u0935\u094d\u092f\u093e\u0916\u094d\u092f\u093e--\'\u0915\u0941\u0930\u0941\u092a\u094d\u0930\u0935\u0940\u0930\'--\u092f\u0939\u093e\u0901 \u0905\u0930\u094d\u091c\u0941\u0928\u0915\u0947 \u0932\u093f\u092f\u0947 \'\u0915\u0941\u0930\u0941\u092a\u094d\u0930\u0935\u0940\u0930\' \u0938\u092e\u094d\u092c\u094b\u0927\u0928 \u0926\u0947\u0928\u0947\u0915\u093e \u0905\u092d\u093f\u092a\u094d\u0930\u093e\u092f \u0939\u0948 \u0915\u093f \u0938\u092e\u094d\u092a\u0942\u0930\u094d\u0923 \u0915\u0941\u0930\u0941\u0935\u0902\u0936\u093f\u092f\u094b\u0902\u092e\u0947\u0902 \u092e\u0947\u0930\u0947\u0938\u0947 \u0909\u092a\u0926\u0947\u0936 \u0938\u0941\u0928\u0928\u0947\u0915\u0940, \u092e\u0947\u0930\u0947 \u0930\u0942\u092a\u0915\u094b \u0926\u0947\u0916\u0928\u0947\u0915\u0940 \u0914\u0930 \u091c\u093e\u0928\u0928\u0947\u0915\u0940 \u0924\u0947\u0930\u0940 \u091c\u093f\u091c\u094d\u091e\u093e\u0938\u093e \u0939\u0941\u0908, \u0924\u094b \u092f\u0939,\u0915\u0941\u0930\u0941\u0935\u0902\u0936\u093f\u092f\u094b\u0902\u092e\u0947\u0902 \u0924\u0941\u092e\u094d\u0939\u093e\u0930\u0940 \u0936\u094d\u0930\u0947\u0937\u094d\u0920\u0924\u093e \u0939\u0948\u0964 \u0924\u093e\u0924\u094d\u092a\u0930\u094d\u092f \u092f\u0939 \u0939\u0941\u0906 \u0915\u093f \u092d\u0917\u0935\u093e\u0928\u094d\u0915\u094b \u0926\u0947\u0916\u0928\u0947\u0915\u0940, \u091c\u093e\u0928\u0928\u0947\u0915\u0940 \u0907\u091a\u094d\u091b\u093e \u0939\u094b\u0928\u093e \u0939\u0940 \u0935\u093e\u0938\u094d\u0924\u0935\u092e\u0947\u0902 \u092e\u0928\u0941\u0937\u094d\u092f\u0915\u0940 \u0936\u094d\u0930\u0947\u0937\u094d\u0920\u0924\u093e \u0939\u0948\u0964"},{"text":"\u092e\u093e \u0924\u0947 \u0935\u094d\u092f\u0925\u093e \u092e\u093e \u091a \u0935\u093f\u092e\u0942\u0922\u092d\u093e\u0935\u094b\\n\u0926\u0943\u0937\u094d\u091f\u094d\u0935\u093e \u0930\u0942\u092a\u0902 \u0918\u094b\u0930\u092e\u0940\u0926\u0943\u0919\u094d\u092e\u092e\u0947\u0926\u092e\u094d\u0964\\n\u0935\u094d\u092f\u092a\u0947\u0924\u092d\u0940\u0903 \u092a\u094d\u0930\u0940\u0924\u092e\u0928\u093e\u0903 \u092a\u0941\u0928\u0938\u094d\u0924\u094d\u0935\u0902\\n\u0924\u0926\u0947\u0935 \u092e\u0947 \u0930\u0942\u092a\u092e\u093f\u0926\u0902 \u092a\u094d\u0930\u092a\u0936\u094d\u092f\u0964\u096411.49\u0964\u0964","translation":"\u0964\u096411.49\u0964\u0964 \u092f\u0939 \u0907\u0938 \u092a\u094d\u0930\u0915\u093e\u0930\u0915\u093e \u092e\u0947\u0930\u093e \u0918\u094b\u0930\u0930\u0942\u092a \u0926\u0947\u0916\u0915\u0930 \u0924\u0947\u0930\u0947\u0915\u094b \u0935\u094d\u092f\u0925\u093e \u0928\u0939\u0940\u0902 \u0939\u094b\u0928\u0940 \u091a\u093e\u0939\u093f\u092f\u0947 \u0914\u0930 \u092e\u0942\u0922\u093c\u092d\u093e\u0935 \u092d\u0940 \u0928\u0939\u0940\u0902 \u0939\u094b\u0928\u093e \u091a\u093e\u0939\u093f\u092f\u0947\u0964 \u0905\u092c \u0928\u093f\u0930\u094d\u092d\u092f \u0914\u0930 \u092a\u094d\u0930\u0938\u0928\u094d\u0928 \u092e\u0928\u0935\u093e\u0932\u093e \u0939\u094b\u0915\u0930 \u0924\u0942 \u092b\u093f\u0930 \u0909\u0938\u0940 \u092e\u0947\u0930\u0947 \u0907\u0938 (\u091a\u0924\u0941\u0930\u094d\u092d\u0941\u091c) \u0930\u0942\u092a\u0915\u094b \u0905\u091a\u094d\u091b\u0940 \u0924\u0930\u0939 \u0926\u0947\u0916 \u0932\u0947\u0964","commentary":"\u0964\u096411.49\u0964\u0964\xa0\u0935\u094d\u092f\u093e\u0916\u094d\u092f\u093e--\'\u092e\u093e \u0924\u0947 \u0935\u094d\u092f\u0925\u093e \u092e\u093e \u091a \u0935\u093f\u092e\u0942\u0922\u092d\u093e\u0935\u094b \u0926\u0943\u0937\u094d\u091f\u094d\u0935\u093e \u0930\u0942\u092a\u0902 \u0918\u094b\u0930\u092e\u0940\u0926\u0943\u0919\u094d\u092e\u092e\u0947\u0926\u092e\u094d\'--\u0935\u093f\u0915\u0930\u093e\u0932 \u0926\u093e\u0922\u093c\u094b\u0902\u0915\u0947 \u0915\u093e\u0930\u0923 \u092d\u092f\u092d\u0940\u0924 \u0915\u0930\u0928\u0947\u0935\u093e\u0932\u0947 \u092e\u0947\u0930\u0947 \u092e\u0941\u0916\u094b\u0902\u092e\u0947\u0902 \u092f\u094b\u0926\u094d\u0927\u093e\u0932\u094b\u0917 \u092c\u0921\u093c\u0940 \u0924\u0947\u091c\u0940\u0938\u0947 \u091c\u093e \u0930\u0939\u0947 \u0939\u0948\u0902, \u0909\u0928\u092e\u0947\u0902\u0938\u0947 \u0915\u0908 \u091a\u0942\u0930\u094d\u0923 \u0939\u0941\u090f \u0938\u093f\u0930\u094b\u0902\u0938\u0939\u093f\u0924 \u0926\u093e\u0901\u0924\u094b\u0902\u0915\u0947 \u092c\u0940\u091a\u092e\u0947\u0902 \u092b\u0901\u0938\u0947 \u0939\u0941\u090f \u0926\u0940\u0916 \u0930\u0939\u0947 \u0939\u0948\u0902 \u0914\u0930 \u092e\u0948\u0902 \u092a\u094d\u0930\u0932\u092f\u0915\u093e\u0932\u0915\u0940 \u0905\u0917\u094d\u0928\u093f\u0915\u0947 \u0938\u092e\u093e\u0928 \u092a\u094d\u0930\u091c\u094d\u0935\u0932\u093f\u0924 \u092e\u0941\u0916\u094b\u0902\u0926\u094d\u0935\u093e\u0930\u093e \u0938\u092e\u094d\u092a\u0942\u0930\u094d\u0923 \u0932\u094b\u0917\u094b\u0902\u0915\u093e \u0917\u094d\u0930\u0938\u0928 \u0915\u0930\u0924\u0947 \u0939\u0941\u090f \u0909\u0928\u0915\u094b \u091a\u093e\u0930\u094b\u0902 \u0913\u0930\u0938\u0947 \u091a\u093e\u091f \u0930\u0939\u093e \u0939\u0942\u0901 -- \u0907\u0938 \u092a\u094d\u0930\u0915\u093e\u0930\u0915\u0947 \u092e\u0947\u0930\u0947 \u0918\u094b\u0930 \u0930\u0942\u092a\u0915\u094b \u0926\u0947\u0916\u0915\u0930 \u0924\u0947\u0930\u0947\u0915\u094b \u0935\u094d\u092f\u0925\u093e \u0928\u0939\u0940\u0902 \u0939\u094b\u0928\u0940 \u091a\u093e\u0939\u093f\u092f\u0947, \u092a\u094d\u0930\u0924\u094d\u092f\u0941\u0924 \u092a\u094d\u0930\u0938\u0928\u094d\u0928\u0924\u093e \u0939\u094b\u0928\u0940 \u091a\u093e\u0939\u093f\u092f\u0947\u0964 \u0924\u093e\u0924\u094d\u092a\u0930\u094d\u092f \u0939\u0948 \u0915\u093f \u092a\u0939\u0932\u0947 (11\u0964 45 \u092e\u0947\u0902) \u0924\u0942 \u091c\u094b \u092e\u0947\u0930\u0940 \u0915\u0943\u092a\u093e\u0915\u094b \u0926\u0947\u0916\u0915\u0930 \u0939\u0930\u094d\u0937\u093f\u0924 \u0939\u0941\u0906 \u0925\u093e, \u0924\u094b \u092e\u0947\u0930\u0940 \u0915\u0943\u092a\u093e\u0915\u0940 \u0924\u0930\u092b \u0926\u0943\u0937\u094d\u091f\u093f \u0939\u094b\u0928\u0947\u0938\u0947 \u0924\u0947\u0930\u093e \u0939\u0930\u094d\u0937\u093f\u0924 \u0939\u094b\u0928\u093e \u0920\u0940\u0915 \u0939\u0940 \u0925\u093e, \u092a\u0930 \u092f\u0939 \u0935\u094d\u092f\u0925\u093f\u0924 \u0939\u094b\u0928\u093e \u0920\u0940\u0915 \u0928\u0939\u0940\u0902 \u0939\u0948\u0964\\n\u0905\u0930\u094d\u091c\u0941\u0928\u0928\u0947 \u091c\u094b \u092a\u0939\u0932\u0947 \u0915\u0939\u093e \u0939\u0948 --\'\u092a\u094d\u0930\u0935\u094d\u092f\u0925\u093f\u0924\u093e\u0938\u094d\u0924\u0925\u093e\u0939\u092e\u094d\' (11\u0964 23) \u0914\u0930 \'\u092a\u094d\u0930\u0935\u094d\u092f\u0925\u093f\u0924\u093e\u0928\u094d\u0924\u0930\u093e\u0924\u094d\u092e\u093e\' (11\u0964 24)\u0964 \u0909\u0938\u0940\u0915\u0947 \u0909\u0924\u094d\u0924\u0930\u092e\u0947\u0902 \u092d\u0917\u0935\u093e\u0928\u094d \u092f\u0939\u093e\u0901 \u0915\u0939\u0924\u0947 \u0939\u0948\u0902 -- \'\u092e\u093e \u0924\u0947 \u0935\u094d\u092f\u0925\u093e\u0964\',\u092e\u0948\u0902 \u0915\u0943\u092a\u093e \u0915\u0930\u0915\u0947 \u0939\u0940 \u0910\u0938\u093e \u0930\u0942\u092a \u0926\u093f\u0916\u093e \u0930\u0939\u093e \u0939\u0942\u0901\u0964 \u0907\u0938\u0915\u094b \u0926\u0947\u0916\u0915\u0930 \u0924\u0947\u0930\u0947\u0915\u094b \u092e\u094b\u0939\u093f\u0924 \u0928\u0939\u0940\u0902 \u0939\u094b\u0928\u093e \u091a\u093e\u0939\u093f\u092f\u0947 -- \'\u092e\u093e \u091a \u0935\u093f\u092e\u0942\u0922\u092d\u093e\u0935\u0903\'\u0964 \u0926\u0942\u0938\u0930\u0940 \u092c\u093e\u0924? \u092e\u0948\u0902 \u0924\u094b \u092a\u094d\u0930\u0938\u0928\u094d\u0928 \u0939\u0940 \u0939\u0942\u0901 \u0914\u0930 \u0905\u092a\u0928\u0940 \u092a\u094d\u0930\u0938\u0928\u094d\u0928\u0924\u093e\u0938\u0947 \u0939\u0940 \u0924\u0947\u0930\u0947\u0915\u094b \u092f\u0939 \u0930\u0942\u092a \u0926\u093f\u0916\u093e \u0930\u0939\u093e \u0939\u0942\u0901; \u092a\u0930\u0928\u094d\u0924\u0941 \u0924\u0942 \u091c\u094b \u092c\u093e\u0930-\u092c\u093e\u0930 \u092f\u0939 \u0915\u0939 \u0930\u0939\u093e \u0939\u0948 \u0915\u093f \'\u092a\u094d\u0930\u0938\u0928\u094d\u0928 \u0939\u094b \u091c\u093e\u0913; \u092a\u094d\u0930\u0938\u0928\u094d\u0928 \u0939\u094b \u091c\u093e\u0913\', \u092f\u0939\u0940 \u0924\u0947\u0930\u093e \u0935\u093f\u092e\u0942\u0922\u093c\u092d\u093e\u0935 \u0939\u0948\u0964 \u0924\u0942 \u0907\u0938\u0915\u094b \u091b\u094b\u0921\u093c \u0926\u0947\u0964 \u0924\u0940\u0938\u0930\u0940 \u092c\u093e\u0924, \u092a\u0939\u0932\u0947 \u0924\u0942\u0928\u0947 \u0915\u0939\u093e \u0925\u093e \u0915\u093f \u092e\u0947\u0930\u093e \u092e\u094b\u0939 \u091a\u0932\u093e \u0917\u092f\u093e (11\u0964 1), \u092a\u0930 \u0935\u093e\u0938\u094d\u0924\u0935\u092e\u0947\u0902 \u0924\u0947\u0930\u093e \u092e\u094b\u0939 \u0905\u092d\u0940 \u0928\u0939\u0940\u0902 \u0917\u092f\u093e \u0939\u0948\u0964 \u0924\u0947\u0930\u0947\u0915\u094b \u0907\u0938 \u092e\u094b\u0939\u0915\u094b \u091b\u094b\u0921\u093c \u0926\u0947\u0928\u093e \u091a\u093e\u0939\u093f\u092f\u0947 \u0914\u0930 \u0928\u093f\u0930\u094d\u092d\u092f \u0924\u0925\u093e \u092a\u094d\u0930\u0938\u0928\u094d\u0928 \u092e\u0928\u0935\u093e\u0932\u093e \u0939\u094b\u0915\u0930 \u092e\u0947\u0930\u093e \u0935\u0939 \u0926\u0947\u0935\u0930\u0942\u092a \u0926\u0947\u0916\u0928\u093e \u091a\u093e\u0939\u093f\u092f\u0947\u0964\\n\u0924\u0947\u0930\u093e \u0914\u0930 \u092e\u0947\u0930\u093e \u091c\u094b \u0938\u0902\u0935\u093e\u0926 \u0939\u0948, \u092f\u0939 \u0924\u094b \u092a\u094d\u0930\u0938\u0928\u094d\u0928\u0924\u093e\u0938\u0947, \u0906\u0928\u0928\u094d\u0926\u0930\u0942\u092a\u0938\u0947, \u0932\u0940\u0932\u093e\u0930\u0942\u092a\u0938\u0947 \u0939\u094b\u0928\u093e \u091a\u093e\u0939\u093f\u092f\u0947\u0964 \u0907\u0938\u092e\u0947\u0902 \u092d\u092f \u0914\u0930 \u092e\u094b\u0939 \u092c\u093f\u0932\u0915\u0941\u0932 \u0928\u0939\u0940\u0902 \u0939\u094b\u0928\u0947 \u091a\u093e\u0939\u093f\u092f\u0947\u0964 \u092e\u0948\u0902 \u0924\u0947\u0930\u0947 \u0915\u0939\u0947 \u0905\u0928\u0941\u0938\u093e\u0930 \u0918\u094b\u0921\u093c\u0947 \u0939\u093e\u0901\u0915\u0924\u093e \u0939\u0942\u0901, \u092c\u093e\u0924\u0947\u0902 \u0915\u0930\u0924\u093e \u0939\u0942\u0901, \u0935\u093f\u0936\u094d\u0935\u0930\u0942\u092a \u0926\u093f\u0916\u093e\u0924\u093e \u0939\u0942\u0901 \u0906\u0926\u093f \u0938\u092c \u0915\u0941\u091b \u0915\u0930\u0928\u0947\u092a\u0930 \u092d\u0940 \u0924\u0942\u0928\u0947 \u092e\u0947\u0930\u0947\u092e\u0947\u0902 \u0915\u094b\u0908 \u0935\u093f\u0915\u0943\u0924\u093f \u0926\u0947\u0916\u0940 \u0939\u0948 \u0915\u094d\u092f\u093e (\u091f\u093f\u092a\u094d\u092a\u0923\u0940 \u092a0 611.1) \u092e\u0947\u0930\u0947\u092e\u0947\u0902 \u0915\u0941\u091b \u0905\u0928\u094d\u0924\u0930 \u0906\u092f\u093e \u0939\u0948 \u0915\u094d\u092f\u093e? \u0910\u0938\u0947 \u0939\u0940 \u092e\u0947\u0930\u0947 \u0935\u093f\u0936\u094d\u0935\u0930\u0942\u092a\u0915\u094b \u0926\u0947\u0916\u0915\u0930 \u0924\u0947\u0930\u0947\u092e\u0947\u0902 \u092d\u0940 \u0915\u094b\u0908 \u0935\u093f\u0915\u0943\u0924\u093f \u0928\u0939\u0940\u0902 \u0906\u0928\u0940 \u091a\u093e\u0939\u093f\u092f\u0947\u0964\xa0"},{"text":"\u0938\u091e\u094d\u091c\u092f \u0909\u0935\u093e\u091a\\n\u0907\u0924\u094d\u092f\u0930\u094d\u091c\u0941\u0928\u0902 \u0935\u093e\u0938\u0941\u0926\u0947\u0935\u0938\u094d\u0924\u0925\u094b\u0915\u094d\u0924\u094d\u0935\u093e\\n\u0938\u094d\u0935\u0915\u0902 \u0930\u0942\u092a\u0902 \u0926\u0930\u094d\u0936\u092f\u093e\u092e\u093e\u0938 \u092d\u0942\u092f\u0903\u0964\\n\u0906\u0936\u094d\u0935\u093e\u0938\u092f\u093e\u092e\u093e\u0938 \u091a \u092d\u0940\u0924\u092e\u0947\u0928\u0902\\n\u092d\u0942\u0924\u094d\u0935\u093e \u092a\u0941\u0928\u0903 \u0938\u094c\u092e\u094d\u092f\u0935\u092a\u0941\u0930\u094d\u092e\u0939\u093e\u0924\u094d\u092e\u093e\u0964\u096411.50\u0964\u0964","translation":"\u0964\u096411.50\u0964\u0964 \u0938\u091e\u094d\u091c\u092f \u092c\u094b\u0932\u0947 -- \u0935\u093e\u0938\u0941\u0926\u0947\u0935\u092d\u0917\u0935\u093e\u0928\u094d \u0928\u0947 \u0905\u0930\u094d\u091c\u0941\u0928\u0938\u0947 \u0910\u0938\u093e \u0915\u0939\u0915\u0930 \u092b\u093f\u0930 \u0909\u0938\u0940 \u092a\u094d\u0930\u0915\u093e\u0930\u0938\u0947 \u0905\u092a\u0928\u093e \u0930\u0942\u092a (\u0926\u0947\u0935\u0930\u0942\u092a) \u0926\u093f\u0916\u093e\u092f\u093e \u0914\u0930 \u092e\u0939\u093e\u0924\u094d\u092e\u093e \u0936\u094d\u0930\u0940\u0915\u0943\u0937\u094d\u0923\u0928\u0947 \u092a\u0941\u0928\u0903 \u0938\u094c\u092e\u094d\u092f\u0935\u092a\u0941 (\u0926\u094d\u0935\u093f\u092d\u0941\u091c\u0930\u0942\u092a) \u0939\u094b\u0915\u0930 \u0907\u0938 \u092d\u092f\u092d\u0940\u0924 \u0905\u0930\u094d\u091c\u0941\u0928\u0915\u094b \u0906\u0936\u094d\u0935\u093e\u0938\u0928 \u0926\u093f\u092f\u093e\u0964","commentary":"\u0964\u096411.50\u0964\u0964\xa0\u0935\u094d\u092f\u093e\u0916\u094d\u092f\u093e--\'\u0907\u0924\u094d\u092f\u0930\u094d\u091c\u0941\u0928\u0902 \u0935\u093e\u0938\u0941\u0926\u0947\u0935\u0938\u094d\u0924\u0925\u094b\u0915\u094d\u0924\u094d\u0935\u093e \u0938\u094d\u0935\u0915\u0902 \u0930\u0942\u092a\u0902 \u0926\u0930\u094d\u0936\u092f\u093e\u092e\u093e\u0938 \u092d\u0942\u092f\u0903\'--\u0905\u0930\u094d\u091c\u0941\u0928\u0928\u0947 \u091c\u092c \u092d\u0917\u0935\u093e\u0928\u094d\u0938\u0947 \u091a\u0924\u0941\u0930\u094d\u092d\u0941\u091c\u0930\u0942\u092a \u0939\u094b\u0928\u0947\u0915\u0947 \u0932\u093f\u092f\u0947 \u092a\u094d\u0930\u093e\u0930\u094d\u0925\u0928\u093e \u0915\u0940, \u0924\u092c \u092d\u0917\u0935\u093e\u0928\u094d\u0928\u0947 \u0915\u0939\u093e \u0915\u093f \u092e\u0947\u0930\u0947 \u0907\u0938 \u0935\u093f\u0936\u094d\u0935\u0930\u0942\u092a\u0915\u094b \u0926\u0947\u0916\u0915\u0930 \u0924\u0942 \u0935\u094d\u092f\u0925\u093f\u0924 \u0914\u0930 \u092d\u092f\u092d\u0940\u0924 \u092e\u0924 \u0939\u094b\u0964 \u0924\u0942 \u092a\u094d\u0930\u0938\u0928\u094d\u0928 \u092e\u0928\u0935\u093e\u0932\u093e \u0939\u094b\u0915\u0930 \u092e\u0947\u0930\u0947 \u0907\u0938 \u0930\u0942\u092a\u0915\u094b \u0926\u0947\u0916 (11\u0964 49)\u0964 \u092d\u0917\u0935\u093e\u0928\u094d\u0915\u0947 \u0907\u0938\u0940 \u0915\u0925\u0928\u0915\u094b \u0938\u091e\u094d\u091c\u092f\u0928\u0947 \u092f\u0939\u093e\u0901 \'\u0907\u0924\u094d\u092f\u0930\u094d\u091c\u0941\u0928\u0902 \u0935\u093e\u0938\u0941\u0926\u0947\u0935\u0938\u094d\u0924\u0925\u094b\u0915\u094d\u0924\u094d\u0935\u093e\' \u092a\u0926\u094b\u0902\u0938\u0947 \u0915\u0939\u093e \u0939\u0948\u0964"},{"text":"\u0905\u0930\u094d\u091c\u0941\u0928 \u0909\u0935\u093e\u091a\\n\u0926\u0943\u0937\u094d\u091f\u094d\u0935\u0947\u0926\u0902 \u092e\u093e\u0928\u0941\u0937\u0902 \u0930\u0942\u092a\u0902 \u0924\u0935\u0938\u094c\u092e\u094d\u092f\u0902 \u091c\u0928\u093e\u0930\u094d\u0926\u0928\u0964\\n\u0907\u0926\u093e\u0928\u0940\u092e\u0938\u094d\u092e\u093f \u0938\u0902\u0935\u0943\u0924\u094d\u0924\u0903 \u0938\u091a\u0947\u0924\u093e\u0903 \u092a\u094d\u0930\u0915\u0943\u0924\u093f\u0902 \u0917\u0924\u0903\u0964\u096411.51\u0964\u0964","translation":"\u0964\u096411.51\u0964\u0964 \u0905\u0930\u094d\u091c\u0941\u0928 \u092c\u094b\u0932\u0947 -- \u0939\u0947 \u091c\u0928\u093e\u0930\u094d\u0926\u0928 ! \u0906\u092a\u0915\u0947 \u0907\u0938 \u0938\u094c\u092e\u094d\u092f \u092e\u0928\u0941\u0937\u094d\u092f\u0930\u0942\u092a\u0915\u094b \u0926\u0947\u0916\u0915\u0930 \u092e\u0948\u0902 \u0907\u0938 \u0938\u092e\u092f \u0938\u094d\u0925\u093f\u0930\u091a\u093f\u0924\u094d\u0924 \u0939\u094b \u0917\u092f\u093e \u0939\u0942\u0901 \u0914\u0930 \u0905\u092a\u0928\u0940 \u0938\u094d\u0935\u093e\u092d\u093e\u0935\u093f\u0915 \u0938\u094d\u0925\u093f\u0924\u093f\u0915\u094b \u092a\u094d\u0930\u093e\u092a\u094d\u0924 \u0939\u094b \u0917\u092f\u093e \u0939\u0942\u0901\u0964","commentary":"\u0964\u096411.51\u0964\u0964\xa0\u0935\u094d\u092f\u093e\u0916\u094d\u092f\u093e--\'\u0926\u0943\u0937\u094d\u091f\u094d\u0935\u0947\u0926\u0902 \u092e\u093e\u0928\u0941\u0937\u0902 \u0930\u0942\u092a\u0902 \u0924\u0935 \u0938\u094c\u092e\u094d\u092f\u0902 \u091c\u0928\u093e\u0930\u094d\u0926\u0928\'--\u0906\u092a\u0915\u0947 \u092e\u0928\u0941\u0937\u094d\u092f\u0930\u0942\u092a\u092e\u0947\u0902 \u092a\u094d\u0930\u0915\u091f \u0939\u094b\u0915\u0930 \u0932\u0940\u0932\u093e \u0915\u0930\u0928\u0947\u0935\u093e\u0932\u0947 \u0930\u0942\u092a\u0915\u094b \u0926\u0947\u0916\u0915\u0930 \u0917\u093e\u092f\u0947\u0902, \u092a\u0936\u0941-\u092a\u0915\u094d\u0937\u0940, \u0935\u0943\u0915\u094d\u0937, \u0932\u0924\u093e\u090f\u0901 \u0906\u0926\u093f \u092d\u0940 \u092a\u0941\u0932\u0915\u093f\u0924 \u0939\u094b \u091c\u093e\u0924\u0940 \u0939\u0948\u0902 (\u091f\u093f\u092a\u094d\u092a\u0923\u0940 \u092a0 613),\xa0\u0910\u0938\u0947 \u0938\u094c\u092e\u094d\u092f \u0926\u094d\u0935\u093f\u092d\u0941\u091c\u0930\u0942\u092a\u0915\u094b \u0926\u0947\u0916\u0915\u0930 \u092e\u0948\u0902 \u0939\u094b\u0936\u092e\u0947\u0902 \u0906 \u0917\u092f\u093e \u0939\u0942\u0901, \u092e\u0947\u0930\u093e \u091a\u093f\u0924\u094d\u0924 \u0938\u094d\u0925\u093f\u0930 \u0939\u094b \u0917\u092f\u093e \u0939\u0948--\'\u0907\u0926\u093e\u0928\u0940\u092e\u0938\u094d\u092e\u093f \u0938\u0902\u0935\u0943\u0924\u094d\u0924\u0903\' \'\u0938\u091a\u0947\u0924\u093e\u0903\',\xa0\u0935\u093f\u0930\u093e\u091f\u094d\u0930\u0942\u092a\u0915\u094b \u0926\u0947\u0916\u0915\u0930 \u091c\u094b \u092e\u0948\u0902 \u092d\u092f\u092d\u0940\u0924 \u0939\u094b \u0917\u092f\u093e \u0925\u093e, \u0935\u0939 \u0938\u092c \u092d\u092f \u0905\u092c \u092e\u093f\u091f \u0917\u092f\u093e \u0939\u0948, \u0938\u092c \u0935\u094d\u092f\u0925\u093e \u091a\u0932\u0940 \u0917\u092f\u0940 \u0939\u0948 \u0914\u0930 \u092e\u0948\u0902 \u0905\u092a\u0928\u0940 \u0935\u093e\u0938\u094d\u0924\u0935\u093f\u0915 \u0938\u094d\u0925\u093f\u0924\u093f\u0915\u094b \u092a\u094d\u0930\u093e\u092a\u094d\u0924 \u0939\u094b \u0917\u092f\u093e \u0939\u0942\u0901 -- \'\u092a\u094d\u0930\u0915\u0943\u0924\u093f\u0902 \u0917\u0924\u0903\u0964\'\xa0\u092f\u0939\u093e\u0901 \u0938\u091a\u0947\u0924\u093e\u0903 \u0915\u0939\u0928\u0947\u0915\u093e \u0924\u093e\u0924\u094d\u092a\u0930\u094d\u092f \u0939\u0948 \u0915\u093f \u091c\u092c \u0905\u0930\u094d\u091c\u0941\u0928\u0915\u0940 \u0926\u0943\u0937\u094d\u091f\u093f \u092d\u0917\u0935\u093e\u0928\u094d\u0915\u0940 \u0915\u0943\u092a\u093e\u0915\u0940 \u0924\u0930\u092b \u0917\u092f\u0940, \u0924\u092c \u0905\u0930\u094d\u091c\u0941\u0928\u0915\u094b \u0939\u094b\u0936 \u0906\u092f\u093e \u0914\u0930 \u0935\u0947 \u0938\u094b\u091a\u0928\u0947 \u0932\u0917\u0947 \u0915\u093f \u0915\u0939\u093e\u0901 \u0924\u094b \u092e\u0948\u0902 \u0914\u0930 \u0915\u0939\u093e\u0901 \u092d\u0917\u0935\u093e\u0928\u094d\u0915\u093e \u0935\u093f\u0938\u094d\u092e\u092f\u0915\u093e\u0930\u0915 \u0935\u093f\u0932\u0915\u094d\u0937\u0923 \u0935\u093f\u0930\u093e\u091f\u094d\u0930\u0942\u092a ! \u0907\u0938\u092e\u0947\u0902 \u092e\u0947\u0930\u0940 \u0915\u094b\u0908 \u092f\u094b\u0917\u094d\u092f\u0924\u093e, \u0905\u0927\u093f\u0915\u093e\u0930\u093f\u0924\u093e \u0928\u0939\u0940\u0902 \u0939\u0948\u0964 \u0907\u0938\u092e\u0947\u0902 \u0924\u094b \u0915\u0947\u0935\u0932 \u092d\u0917\u0935\u093e\u0928\u094d\u0915\u0940 \u0915\u0943\u092a\u093e-\u0939\u0940-\u0915\u0943\u092a\u093e \u0939\u0948\u0964\\n\xa0\u0938\u092e\u094d\u092c\u0928\u094d\u0927--\u0905\u0930\u094d\u091c\u0941\u0928\u0915\u0940 \u0915\u0943\u0924\u091c\u094d\u091e\u0924\u093e\u0915\u093e \u0905\u0928\u0941\u092e\u094b\u0926\u0928 \u0915\u0930\u0924\u0947 \u0939\u0941\u090f \u092d\u0917\u0935\u093e\u0928\u094d \u0915\u0939\u0924\u0947 \u0939\u0948\u0902 -- "},{"text":"\u0936\u094d\u0930\u0940 \u092d\u0917\u0935\u093e\u0928\u0941\u0935\u093e\u091a\\n\u0938\u0941\u0926\u0941\u0930\u094d\u0926\u0930\u094d\u0936\u092e\u093f\u0926\u0902 \u0930\u0942\u092a\u0902 \u0926\u0943\u0937\u094d\u091f\u0935\u093e\u0928\u0938\u093f \u092f\u0928\u094d\u092e\u092e\u0964\\n\u0926\u0947\u0935\u093e \u0905\u092a\u094d\u092f\u0938\u094d\u092f \u0930\u0942\u092a\u0938\u094d\u092f \u0928\u093f\u0924\u094d\u092f\u0902 \u0926\u0930\u094d\u0936\u0928\u0915\u093e\u0919\u094d\u0915\u094d\u0937\u093f\u0923\u0903\u0964\u096411.52\u0964\u0964","translation":"\u0964\u096411.52\u0964\u0964 \u0936\u094d\u0930\u0940\u092d\u0917\u0935\u093e\u0928\u094d \u092c\u094b\u0932\u0947 -- \u092e\u0947\u0930\u093e \u092f\u0939 \u091c\u094b \u0930\u0942\u092a \u0924\u0941\u092e\u0928\u0947 \u0926\u0947\u0916\u093e \u0939\u0948, \u0907\u0938\u0915\u0947 \u0926\u0930\u094d\u0936\u0928 \u0905\u0924\u094d\u092f\u0928\u094d\u0924 \u0939\u0940 \u0926\u0941\u0930\u094d\u0932\u092d \u0939\u0948\u0902\u0964 \u0907\u0938 \u0930\u0942\u092a\u0915\u094b \u0926\u0947\u0916\u0928\u0947\u0915\u0947 \u0932\u093f\u092f\u0947 \u0926\u0947\u0935\u0924\u093e \u092d\u0940 \u0928\u093f\u0924\u094d\u092f \u0932\u093e\u0932\u093e\u092f\u093f\u0924 \u0930\u0939\u0924\u0947 \u0939\u0948\u0902\u0964","commentary":"\u0964\u096411.52\u0964\u0964\xa0\u0935\u094d\u092f\u093e\u0916\u094d\u092f\u093e--\'\u0938\u0941\u0926\u0941\u0930\u094d\u0926\u0930\u094d\u0936\u092e\u093f\u0926\u0902 \u0930\u0942\u092a\u0902 \u0926\u0943\u0937\u094d\u091f\u0935\u093e\u0928\u0938\u093f \u092f\u0928\u094d\u092e\u092e\'--\u092f\u0939\u093e\u0901 \'\u0938\u0941\u0926\u0941\u0930\u094d\u0926\u0930\u094d\u0936\u092e\u094d\' \u092a\u0926 \u091a\u0924\u0941\u0930\u094d\u092d\u0941\u091c\u0930\u0942\u092a\u0915\u0947 \u0932\u093f\u092f\u0947 \u0939\u0940 \u0906\u092f\u093e \u0939\u0948, \u0935\u093f\u0930\u093e\u091f\u094d\u0930\u0942\u092a \u092f\u093e \u0926\u094d\u0935\u093f\u092d\u0941\u091c\u0930\u0942\u092a\u0915\u0947 \u0932\u093f\u092f\u0947 \u0928\u0939\u0940\u0902\u0964 \u0915\u093e\u0930\u0923 \u0915\u093f \u0935\u093f\u0930\u093e\u091f\u094d\u0930\u0942\u092a\u0915\u0940 \u0924\u094b \u0926\u0947\u0935\u0924\u093e \u092d\u0940 \u0915\u0932\u094d\u092a\u0928\u093e \u0915\u094d\u092f\u094b\u0902 \u0915\u0930\u0928\u0947 \u0932\u0917\u0947 ! \u0914\u0930 \u092e\u0928\u0941\u0937\u094d\u092f\u0930\u0942\u092a \u091c\u092c \u092e\u0928\u0941\u0937\u094d\u092f\u094b\u0902\u0915\u0947 \u0932\u093f\u092f\u0947 \u0938\u0941\u0932\u092d \u0925\u093e, \u0924\u092c \u0926\u0947\u0935\u0924\u093e\u0913\u0902\u0915\u0947 \u0932,\u092f\u0947 \u0935\u0939 \u0926\u0941\u0930\u094d\u0932\u092d \u0915\u0948\u0938\u0947 \u0939\u094b\u0924\u093e ! \u0907\u0938\u0932\u093f\u092f\u0947 \'\u0938\u0941\u0926\u0941\u0930\u094d\u0926\u0930\u094d\u0936\u092e\u094d\' \u092a\u0926\u0938\u0947 \u092d\u0917\u0935\u093e\u0928\u094d \u0935\u093f\u0937\u094d\u0923\u0941\u0915\u093e \u091a\u0924\u0941\u0930\u094d\u092d\u0941\u091c\u0930\u0942\u092a \u0939\u0940 \u0932\u0947\u0928\u093e \u091a\u093e\u0939\u093f\u092f\u0947, \u091c\u093f\u0938\u0915\u0947 \u0932\u093f\u092f\u0947 \'\u0926\u0947\u0935\u0930\u0942\u092a\u092e\u094d\' (11\u0964 45) \u0914\u0930 \u0938\u094d\u0935\u0915\u0902 \u0930\u0942\u092a\u092e\u094d (11\u0964 50) \u092a\u0926 \u0906\u092f\u0947 \u0939\u0948\u0902\u0964"},{"text":"\u0928\u093e\u0939\u0902 \u0935\u0947\u0926\u0948\u0930\u094d\u0928 \u0924\u092a\u0938\u093e \u0928 \u0926\u093e\u0928\u0947\u0928 \u0928 \u091a\u0947\u091c\u094d\u092f\u092f\u093e\u0964\\n\u0936\u0915\u094d\u092f \u090f\u0935\u0902\u0935\u093f\u0927\u094b \u0926\u094d\u0930\u0937\u094d\u091f\u0941\u0902 \u0926\u0943\u0937\u094d\u091f\u0935\u093e\u0928\u0938\u093f \u092e\u093e\u0902 \u092f\u0925\u093e\u0964\u096411.53\u0964\u0964","translation":"\u0964\u096411.53\u0964\u0964 \u091c\u093f\u0938 \u092a\u094d\u0930\u0915\u093e\u0930 \u0924\u0941\u092e\u0928\u0947 \u092e\u0941\u091d\u0947 \u0926\u0947\u0916\u093e \u0939\u0948, \u0907\u0938 \u092a\u094d\u0930\u0915\u093e\u0930\u0915\u093e (\u091a\u0924\u0941\u0930\u094d\u092d\u0941\u091c\u0930\u0942\u092a\u0935\u093e\u0932\u093e) \u092e\u0948\u0902 \u0928 \u0924\u094b \u0935\u0947\u0926\u094b\u0902\u0938\u0947, \u0928 \u0924\u092a\u0938\u0947, \u0928 \u0926\u093e\u0928\u0938\u0947 \u0914\u0930 \u0928 \u092f\u091c\u094d\u091e\u0938\u0947 \u0939\u0940 \u0926\u0947\u0916\u093e \u091c\u093e \u0938\u0915\u0924\u093e \u0939\u0942\u0901\u0964","commentary":"\u0964\u096411.53\u0964\u0964 \u0935\u094d\u092f\u093e\u0916\u094d\u092f\u093e--\'\u0926\u0943\u0937\u094d\u091f\u0935\u093e\u0928\u0938\u093f \u092e\u093e\u0902 \u092f\u0925\u093e\'--\u0924\u0941\u092e\u0928\u0947 \u092e\u0947\u0930\u093e \u091a\u0924\u0941\u0930\u094d\u092d\u0941\u091c\u0930\u0942\u092a \u092e\u0947\u0930\u0940 \u0915\u0943\u092a\u093e\u0938\u0947 \u0939\u0940 \u0926\u0947\u0916\u093e \u0939\u0948\u0964 \u0924\u093e\u0924\u094d\u092a\u0930\u094d\u092f \u0939\u0948 \u0915\u093f \u092e\u0947\u0930\u0947 \u0926\u0930\u094d\u0936\u0928 \u092e\u0947\u0930\u0940 \u0915\u0943\u092a\u093e\u0938\u0947 \u0939\u0940 \u0939\u094b \u0938\u0915\u0924\u0947 \u0939\u0948\u0902, \u0915\u093f\u0938\u0940 \u092f\u094b\u0917\u094d\u092f\u0924\u093e\u0938\u0947 \u0928\u0939\u0940\u0902\u0964"},{"text":"\u092d\u0915\u094d\u0924\u094d\u092f\u093e \u0924\u094d\u0935\u0928\u0928\u094d\u092f\u092f\u093e \u0936\u0915\u094d\u092f\u092e\u0939\u092e\u0947\u0935\u0902\u0935\u093f\u0927\u094b\u093d\u0930\u094d\u091c\u0941\u0928\u0964\\n\u091c\u094d\u091e\u093e\u0924\u0941\u0902 \u0926\u0943\u0937\u094d\u091f\u0941\u0902 \u091a \u0924\u0924\u094d\u0924\u094d\u0935\u0947\u0928 \u092a\u094d\u0930\u0935\u0947\u0937\u094d\u091f\u0941\u0902 \u091a \u092a\u0930\u0902\u0924\u092a\u0964\u096411.54\u0964\u0964","translation":"\u0964\u096411.54\u0964\u0964 \u092a\u0930\u0928\u094d\u0924\u0941 \u0939\u0947 \u0936\u0924\u094d\u0930\u0941\u0924\u093e\u092a\u0928 \u0905\u0930\u094d\u091c\u0941\u0928 ! \u0907\u0938 \u092a\u094d\u0930\u0915\u093e\u0930 (\u091a\u0924\u0941\u0930\u094d\u092d\u0941\u091c\u0930\u0942\u092a\u0935\u093e\u0932\u093e) \u092e\u0948\u0902 \u0905\u0928\u0928\u094d\u092f\u092d\u0915\u094d\u0924\u093f\u0938\u0947 \u0939\u0940 \u0924\u0924\u094d\u0924\u094d\u0935\u0938\u0947 \u091c\u093e\u0928\u0928\u0947\u092e\u0947\u0902, \u0938\u0917\u0941\u0923\u0930\u0942\u092a\u0938\u0947 \u0926\u0947\u0916\u0928\u0947\u092e\u0947\u0902 \u0914\u0930 \u092a\u094d\u0930\u093e\u092a\u094d\u0924 \u0915\u0930\u0928\u0947\u092e\u0947\u0902 \u0936\u0915\u094d\u092f \u0939\u0942\u0901\u0964","commentary":"\u0964\u096411.54\u0964\u0964\xa0\u0935\u094d\u092f\u093e\u0916\u094d\u092f\u093e--\'\u092d\u0915\u094d\u0924\u094d\u092f\u093e \u0924\u094d\u0935\u0928\u0928\u094d\u092f\u092f\u093e \u0936\u0915\u094d\u092f \u0905\u0939\u092e\u0947\u0935\u0902\u0935\u093f\u0927\u094b\u093d\u0930\u094d\u091c\u0941\u0928\'--\u092f\u0939\u093e\u0901 \'\u0924\u0941\' \u092a\u0926 \u092a\u0939\u0932\u0947 \u092c\u0924\u093e\u092f\u0947 \u0939\u0941\u090f \u0938\u093e\u0927\u0928\u094b\u0902\u0938\u0947 \u0935\u093f\u0932\u0915\u094d\u0937\u0923 \u0938\u093e\u0927\u0928 \u092c\u0924\u093e\u0928\u0947\u0915\u0947 \u0932\u093f\u092f\u0947 \u0906\u092f\u093e \u0939\u0948\u0964 \u092d\u0917\u0935\u093e\u0928\u094d \u0915\u0939\u0924\u0947 \u0939\u0948\u0902 \u0915\u093f \u0939\u0947 \u0905\u0930\u094d\u091c\u0941\u0928 ! \u0924\u0941\u092e\u0928\u0947 \u092e\u0947\u0930\u093e \u091c\u0948\u0938\u093e \u0936\u0919\u094d\u0916-\u091a\u0915\u094d\u0930-\u0917\u0926\u093e-\u092a\u0926\u094d\u092e\u0927\u093e\u0930\u0940 \u091a\u0924\u0941\u0930\u094d\u092d\u0941\u091c\u0930\u0942\u092a \u0926\u0947\u0916\u093e \u0939\u0948, \u0935\u0948\u0938\u093e \u0930\u0942\u092a\u0935\u093e\u0932\u093e \u092e\u0948\u0902 \u092f\u091c\u094d\u091e, \u0926\u093e\u0928, \u0924\u092a \u0906\u0926\u093f\u0915\u0947 \u0926\u094d\u0935\u093e\u0930\u093e \u0928\u0939\u0940\u0902 \u0926\u0947\u0916\u093e \u091c\u093e \u0938\u0915\u0924\u093e, \u092a\u094d\u0930\u0924\u094d\u092f\u0941\u0924 \u0905\u0928\u0928\u094d\u092f\u092d\u0915\u094d\u0924\u093f\u0915\u0947 \u0926\u094d\u0935\u093e\u0930\u093e \u0939\u0940 \u0926\u0947\u0916\u093e \u091c\u093e \u0938\u0915\u0924\u093e \u0939\u0942\u0901\u0964\\n\u0905\u0928\u0928\u094d\u092f\u092d\u0915\u094d\u0924\u093f\u0915\u093e \u0905\u0930\u094d\u0925 \u0939\u0948 -- \u0915\u0947\u0935\u0932 \u092d\u0917\u0935\u093e\u0928\u094d\u0915\u093e \u0939\u0940 \u0906\u0936\u094d\u0930\u092f \u0939\u094b, \u0938\u0939\u093e\u0930\u093e \u0939\u094b, \u0906\u0936\u093e \u0939\u094b, \u0935\u093f\u0936\u094d\u0935\u093e\u0938 \u0939\u094b (\u091f\u093f\u092a\u094d\u092a\u0923\u0940 \u092a0 616)\u0964 \u092d\u0917\u0935\u093e\u0928\u094d\u0915\u0947 \u0938\u093f\u0935\u093e\u092f \u0915\u093f\u0938\u0940 \u092f\u094b\u0917\u094d\u092f\u0924\u093e, \u092c\u0932, \u092c\u0941\u0926\u094d\u0927\u093f \u0906\u0926\u093f\u0915\u093e \u0915\u093f\u091e\u094d\u091a\u093f\u0928\u094d\u092e\u093e\u0924\u094d\u0930 \u092d\u0940 \u0938\u0939\u093e\u0930\u093e \u0928 \u0939\u094b\u0964 \u0907\u0928\u0915\u093e \u0905\u0928\u094d\u0924\u0903\u0915\u0930\u0923\u092e\u0947\u0902 \u0915\u093f\u091e\u094d\u091a\u093f\u0928\u094d\u092e\u093e\u0924\u094d\u0930 \u092d\u0940 \u092e\u0939\u0924\u094d\u0924\u094d\u0935 \u0928 \u0939\u094b\u0964 \u092f\u0939 \u0905\u0928\u0928\u094d\u092f\u092d\u0915\u094d\u0924\u093f \u0938\u094d\u0935\u092f\u0902\u0938\u0947 \u0939\u0940 \u0939\u094b\u0924\u0940 \u0939\u0948, \u092e\u0928\u092c\u0941\u0926\u094d\u0927\u093f\u0907\u0928\u094d\u0926\u094d\u0930\u093f\u092f\u094b\u0902 \u0906\u0926\u093f\u0915\u0947 \u0926\u094d\u0935\u093e\u0930\u093e \u0928\u0939\u0940\u0902\u0964 \u0924\u093e\u0924\u094d\u092a\u0930\u094d\u092f \u0939\u0948 \u0915\u093f \u0915\u0947\u0935\u0932 \u0938\u094d\u0935\u092f\u0902\u0915\u0940 \u0935\u094d\u092f\u093e\u0915\u0941\u0932\u0924\u093e \u092a\u0942\u0930\u094d\u0935\u0915 \u0909\u0924\u094d\u0915\u0923\u094d\u0920\u093e \u0939\u094b, \u092d\u0917\u0935\u093e\u0928\u094d\u0915\u0947 \u0926\u0930\u094d\u0936\u0928 \u092c\u093f\u0928\u093e \u090f\u0915 \u0915\u094d\u0937\u0923 \u092d\u0940 \u091a\u0948\u0928 \u0928 \u092a\u0921\u093c\u0947\u0964 \u0910\u0938\u0940 \u091c\u094b \u092d\u0940\u0924\u0930\u092e\u0947\u0902 \u0938\u094d\u0935\u092f\u0902\u0915\u0940 \u092c\u0948\u091a\u0947\u0928\u0940 \u0939\u0948, \u0935\u0939\u0940 \u092d\u0917\u0935\u0924\u094d\u092a\u094d\u0930\u093e\u092a\u094d\u0924\u093f\u092e\u0947\u0902 \u0916\u093e\u0938 \u0915\u093e\u0930\u0923 \u0939\u0948\u0964 \u0907\u0938 \u092c\u0947\u091a\u0948\u0928\u0940 \u092e\u0947\u0902, \u0935\u094d\u092f\u093e\u0915\u0941\u0932\u0924\u093e\u092e\u0947\u0902 \u0905\u0928\u0928\u094d\u0924 \u091c\u0928\u094d\u092e\u094b\u0902\u0915\u0947 \u0905\u0928\u0928\u094d\u0924 \u092a\u093e\u092a \u092d\u0938\u094d\u092e \u0939\u094b \u091c\u093e\u0924\u0947 \u0939\u0948\u0902\u0964 \u0910\u0938\u0940 \u0905\u0928\u0928\u094d\u092f\u092d\u0915\u094d\u0924\u093f\u0935\u093e\u0932\u094b\u0902\u0915\u0947 \u0932\u093f\u092f\u0947 \u0939\u0940 \u092d\u0917\u0935\u093e\u0928\u094d\u0928\u0947 \u0915\u0939\u093e \u0939\u0948 -- \u091c\u094b \u0905\u0928\u0928\u094d\u092f\u091a\u093f\u0924\u094d\u0924\u0935\u093e\u0932\u093e \u092d\u0915\u094d\u0924 \u0928\u093f\u0924\u094d\u092f\u0928\u093f\u0930\u0928\u094d\u0924\u0930 \u092e\u0947\u0930\u093e \u091a\u093f\u0928\u094d\u0924\u0928 \u0915\u0930\u0924\u093e \u0939\u0948, \u0909\u0938\u0915\u0947 \u0932\u093f\u092f\u0947 \u092e\u0948\u0902 \u0938\u0941\u0932\u092d \u0939\u0942\u0901 (\u0917\u0940\u0924\u093e 8\u0964 14) \u0914\u0930 \u091c\u094b \u0905\u0928\u0928\u094d\u092f\u092d\u0915\u094d\u0924 \u092e\u0947\u0930\u093e \u091a\u093f\u0928\u094d\u0924\u0928 \u0915\u0930\u0924\u0947 \u0939\u0941\u090f \u0909\u092a\u093e\u0938\u0928\u093e \u0915\u0930\u0924\u0947 \u0939\u0948\u0902, \u0909\u0928\u0915\u093e \u092f\u094b\u0917\u0915\u094d\u0937\u0947\u092e \u092e\u0948\u0902 \u0935\u0939\u0928 \u0915\u0930\u0924\u093e \u0939\u0942\u0901 (\u0917\u0940\u0924\u093e 9\u0964 22)\u0964\u0905\u0928\u0928\u094d\u092f\u092d\u0915\u094d\u0924\u093f\u0915\u093e \u0926\u0942\u0938\u0930\u093e \u0924\u093e\u0924\u094d\u092a\u0930\u094d\u092f \u092f\u0939 \u0939\u0948 \u0915\u093f \u0905\u092a\u0928\u0947\u092e\u0947\u0902 \u092d\u091c\u0928\u0938\u094d\u092e\u0930\u0923 \u0915\u0930\u0928\u0947\u0915\u093e, \u0938\u093e\u0927\u0928 \u0915\u0930\u0928\u0947\u0915\u093e, \u0909\u0924\u094d\u0915\u0923\u094d\u0920\u093e\u092a\u0942\u0930\u094d\u0935\u0915 \u092a\u0941\u0915\u093e\u0930\u0928\u0947\u0915\u093e \u091c\u094b \u0915\u0941\u091b \u0938\u0939\u093e\u0930\u093e \u0939\u0948, \u0935\u0939 \u0938\u0939\u093e\u0930\u093e \u0915\u093f\u091e\u094d\u091a\u093f\u0928\u094d\u092e\u093e\u0924\u094d\u0930 \u092d\u0940 \u0928 \u0939\u094b\u0964 \u092b\u093f\u0930 \u0938\u093e\u0927\u0928 \u0915\u093f\u0938\u0932\u093f\u092f\u0947 \u0915\u0930\u0928\u093e \u0939\u0948 \u0915\u0947\u0935\u0932 \u0905\u092a\u0928\u093e \u0905\u092d\u093f\u092e\u093e\u0928 \u092e\u093f\u091f\u093e\u0928\u0947\u0915\u0947 \u0932\u093f\u092f\u0947 \u0905\u0930\u094d\u0925\u093e\u0924\u094d \u0905\u092a\u0928\u0947\u092e\u0947\u0902 \u091c\u094b \u0938\u093e\u0927\u0928 \u0915\u0930\u0928\u0947\u0915\u0947 \u092c\u0932\u0915\u093e \u092d\u093e\u0928 \u0939\u094b\u0924\u093e \u0939\u0948, \u0909\u0938\u0915\u094b \u092e\u093f\u091f\u093e\u0928\u0947\u0915\u0947 \u0932\u093f\u092f\u0947 \u0939\u0940 \u0938\u093e\u0927\u0928 \u0915\u0930\u0928\u093e \u0939\u0948\u0964 \u0924\u093e\u0924\u094d\u092a\u0930\u094d\u092f \u0939\u0948 \u0915\u093f \u092d\u0917\u0935\u093e\u0928\u094d\u0915\u0940 \u092a\u094d\u0930\u093e\u092a\u094d\u0924\u093f \u0938\u093e\u0927\u0928 \u0915\u0930\u0928\u0947\u0938\u0947 \u0928\u0939\u0940\u0902 \u0939\u094b\u0924\u0940, \u092a\u094d\u0930\u0924\u094d\u092f\u0941\u0924 \u0938\u093e\u0927\u0928\u0915\u093e \u0905\u092d\u093f\u092e\u093e\u0928 \u0917\u0932\u0928\u0947\u0938\u0947 \u0939\u094b\u0924\u0940 \u0939\u0948\u0964 \u0938\u093e\u0927\u0928\u0915\u093e \u0905\u092d\u093f\u092e\u093e\u0928 \u0917\u0932 \u091c\u093e\u0928\u0947\u0938\u0947 \u0938\u093e\u0927\u0915\u092a\u0930 \u092d\u0917\u0935\u093e\u0928\u094d\u0915\u0940 \u0936\u0941\u0926\u094d\u0927 \u0915\u0943\u092a\u093e \u0905\u0938\u0930 \u0915\u0930\u0924\u0940 \u0939\u0948 \u0905\u0930\u094d\u0925\u093e\u0924\u094d \u0909\u0938 \u0915\u0943\u092a\u093e\u0915\u0947 \u0906\u0928\u0947\u092e\u0947\u0902 \u0915\u094b\u0908 \u0906\u0921\u093c \u0928\u0939\u0940\u0902 \u0930\u0939\u0924\u0940 \u0914\u0930 (\u0909\u0938 \u0915\u0943\u092a\u093e\u0938\u0947) \u092d\u0917\u0935\u093e\u0928\u094d\u0915\u0940 \u092a\u094d\u0930\u093e\u092a\u094d\u0924\u093f \u0939\u094b \u091c\u093e\u0924\u0940 \u0939\u0948\u0964"},{"text":"\u092e\u0924\u094d\u0915\u0930\u094d\u092e\u0915\u0943\u0928\u094d\u092e\u0924\u094d\u092a\u0930\u092e\u094b \u092e\u0926\u094d\u092d\u0915\u094d\u0924\u0903 \u0938\u0919\u094d\u0917\u0935\u0930\u094d\u091c\u093f\u0924\u0903\u0964\\n\u0928\u093f\u0930\u094d\u0935\u0948\u0930\u0903 \u0938\u0930\u094d\u0935\u092d\u0942\u0924\u0947\u0937\u0941 \u092f\u0903 \u0938 \u092e\u093e\u092e\u0947\u0924\u093f \u092a\u093e\u0923\u094d\u0921\u0935\u0964\u096411.55\u0964\u0964","translation":"\u0964\u096411.55\u0964\u0964 \u0939\u0947 \u092a\u093e\u0923\u094d\u0921\u0935\u0928 ! \u091c\u094b \u092e\u0947\u0930\u0947 \u0932\u093f\u092f\u0947 \u0939\u0940 \u0915\u0930\u094d\u092e \u0915\u0930\u0928\u0947\u0935\u093e\u0932\u093e, \u092e\u0947\u0930\u0947 \u0939\u0940 \u092a\u0930\u093e\u092f\u0923 \u0914\u0930 \u092e\u0947\u0930\u093e \u0939\u0940 \u092d\u0915\u094d\u0924 \u0939\u0948 \u0924\u0925\u093e \u0938\u0930\u094d\u0935\u0925\u093e \u0906\u0938\u0915\u094d\u0924\u093f\u0930\u0939\u093f\u0924 \u0914\u0930 \u092a\u094d\u0930\u093e\u0923\u093f\u092e\u093e\u0924\u094d\u0930\u0915\u0947 \u0938\u093e\u0925 \u0928\u093f\u0930\u094d\u0935\u0948\u0930 \u0939\u0948, \u0935\u0939 \u092d\u0915\u094d\u0924 \u092e\u0947\u0930\u0947\u0915\u094b \u092a\u094d\u0930\u093e\u092a\u094d\u0924 \u0939\u094b\u0924\u093e \u0939\u0948\u0964","commentary":"\u0964\u096411.55\u0964\u0964\xa0\u0935\u094d\u092f\u093e\u0916\u094d\u092f\u093e--[\u0907\u0938 \u0936\u094d\u0932\u094b\u0915\u092e\u0947\u0902 \u092a\u093e\u0901\u091a \u092c\u093e\u0924\u0947\u0902 \u0906\u092f\u0940 \u0939\u0948\u0902\u0964 \u0907\u0928 \u092a\u093e\u0901\u091a\u094b\u0902\u0915\u094b \'\u0938\u093e\u0927\u0928\u092a\u091e\u094d\u091a\u0915\' \u092d\u0940 \u0915\u0939\u0924\u0947 \u0939\u0948\u0902\u0964 \u0907\u0928 \u092a\u093e\u0901\u091a\u094b\u0902 \u092c\u093e\u0924\u094b\u0902\u0915\u0947 \u0926\u094b \u0935\u093f\u092d\u093e\u0917 \u0939\u0948\u0902\u0964 (1) \u092d\u0917\u0935\u093e\u0928\u094d\u0915\u0947 \u0938\u093e\u0925 \u0918\u0928\u093f\u0937\u094d\u0920\u0924\u093e \u0914\u0930 (2) \u0938\u0902\u0938\u093e\u0930\u0915\u0947 \u0938\u093e\u0925 \u0938\u092e\u094d\u092c\u0928\u094d\u0927-\u0935\u093f\u091a\u094d\u091b\u0947\u0926\u0964 \u092a\u0939\u0932\u0947 \u0935\u093f\u092d\u093e\u0917\u092e\u0947\u0902 \'\u092e\u0924\u094d\u0915\u0930\u094d\u092e\u0915\u0943\u0924\u094d\',\xa0\'\u092e\u0924\u094d\u092a\u0930\u092e\u0903\' \u0914\u0930 \'\u092e\u0926\u094d\u092d\u0915\u094d\u0924\u0903\' -- \u092f\u0947 \u0924\u0940\u0928 \u092c\u093e\u0924\u0947\u0902 \u0939\u0948\u0902; \u0914\u0930 \u0926\u0942\u0938\u0930\u0947 \u0935\u093f\u092d\u093e\u0917\u092e\u0947\u0902 \'\u0938\u0919\u094d\u0917\u0935\u0930\u094d\u091c\u093f\u0924\u0903\' \u0914\u0930\'\u0928\u093f\u0930\u094d\u0935\u0948\u0930\u0903 \u0938\u0930\u094d\u0935\u092d\u0942\u0924\u0947\u0937\u0942\'--\u092f\u0947 \u0926\u094b \u092c\u093e\u0924\u0947\u0902 \u0939\u0948\u0902\u0964"}]')}}]);
